INSERT INTO `motelrooms` VALUES (1, 'Cho thuê phòng trong nhà riêng 4 tầng ô tô đỗ cửa', 'cho-thue-phong-trong-nha-rieng-4-tang-o-to-do-cua', 1500000, 15.0000, 1, 2, 3, '886 Kim Giang, Kim Giang, Thanh Xuân, Hà Nội', '0982667815', 2, 'Chung', '{\"0\":\"cho-thue-phong-trong-nha-rieng-4-tang-o-to-do-cua-resized-qojj4.jpeg\",\"1\":\"cho-thue-phong-trong-nha-rieng-4-tang-o-to-do-cua-resized-uj5yy.jpeg\",\"2\":\"cho-thue-phong-trong-nha-rieng-4-tang-o-to-do-cua-resized-vbzjf.jpeg\",\"3\":\"cho-thue-phong-trong-nha-rieng-4-tang-o-to-do-cua-resized-r6mj7.jpeg\"}', '<div class=\"dis-content\">Cho thuê nhà chính chủ ‼️‼️‼️Đây là nhà của mình do còn thừa nhiều phòng nên mình muốn cho thuê 2p trong nhà 4 tầng như hình:☘️ Nhà đầy đủ bình nóng lạnh, tủ lạnh, máy giặt☘️ Có chỗ nấu ăn và để xe dưới tầng 1☘️ Điện, nước, mạng giá nhà nước chia đầu người☘️ Nhà mặt đường bờ sông oto đỗ cửa☘️ Nhà cách bến xe bus 100m trong khu dân cư văn minh. ☘️ 886 Kim GiangĐịa chỉ: Cuối đường Kim Giang, Thanh Liệt, Thanh Trì(Cuối đường Kim Giang cắt đường mới Thanh Liệt)</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCIsIjMiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCIsIjQiOiJNXHUwMGUxeSBnaVx1MWViN3QifQ==', 1, 0, '{\"0\":\"20.95931967864031\",\"1\":\"105.81385105240383\"}', 1, 0, '2019-05-14 18:43:48', '2019-05-14 18:43:48');
INSERT INTO `motelrooms` VALUES (2, 'Phòng trọ,chung cư giá rẻ khu công nghiệp Bắc Thăng Long', 'phong-trochung-cu-gia-re-khu-cong-nghiep-bac-thang-long', 2000000, 30.0000, 1, 4, 5, 'ngõ 19 thôn Hậu Dưỡng, Kim Chung , Đông Anh, 23, Đông Anh, Hà Nội', '0971369515', 4, 'Khép kín', '{\"0\":\"phong-trochung-cu-gia-re-khu-cong-nghiep-bac-thang-long-resized-d4xxs.jpg\",\"1\":\"phong-trochung-cu-gia-re-khu-cong-nghiep-bac-thang-long-jogo7.jpg\",\"2\":\"phong-trochung-cu-gia-re-khu-cong-nghiep-bac-thang-long-resized-v2bqr.jpg\",\"3\":\"phong-trochung-cu-gia-re-khu-cong-nghiep-bac-thang-long-resized-pq7lp.jpg\"}', '<div class=\"dis-content\">Cho thuê phòng chưng cư giá rẻ, tiện nghi gần CầuThăng Long cho ae sống và làm việc tại Đông Anh.<br> Dịch vụtốt mà giá rẻ, điện chỉ 2k3/số, nước 70k/người, internet tốc độ cao. Phòng rộng rãi thoáng mát từ 30-45m2 mà giá chỉ từ 1.300.000 –2.500.000 , có thể ở  4-5người/phòng<br>-       Giờ giấcthoải mái, có thang máy lên xuống tự do, bảo vệ trông xe 24/24<br>-       Gần chợHậu Dưỡng, chợ Mun, thoải mái mua sắm ngày nghỉ cuối tuần<br>-       Khu vựcgần phòng tập gym, nhà trẻ, bệnh viện Nhiệt Đới…<br>Địa CHỉ: nhà 8 tầng ngõ 19 HậuDưỡng, Kim Chung, Đông Anh. <br>LH Nga: 0971.369.515</div>', '', 1, 0, '{\"0\":\"21.121654595657915\",\"1\":\"105.76937198030998\"}', 1, 0, '2019-05-14 18:43:50', '2019-05-14 18:43:50');
