INSERT INTO `motelrooms` VALUES (5, 'Phòng Trọ giá rẻ Mỹ Đình. Nam Từ Liêm', 'phong-tro-gia-re-my-dinh-nam-tu-liem', 1000000, 12.0000, 1, 10, 12, 'Số 1 đường Mỹ Đình, Nam Từ Liêm, Hà Nội, Mỹ Đình, Từ Liêm, Hà Nội', '0966663256', 2, 'Chung', '{\"0\":\"phong-tro-gia-re-my-dinh-nam-tu-liem-17pco.jpg\"}', '<div class=\"dis-content\">Cư Xá Mỹ Đình<br>Tổng hợp phòng trọ giá rẻ tại Cư Xá<br>- Phòng không khép kín 1.000k tầng 5 rộng 10m2<br>- Phòng khép kín 1tr5 tầng 3 rộng 15m2<br>- Phòng khép kín 1tr3 tầng 4 rộng 13m2<br>- Phòng không khép kín 1tr tầng 3 rộng 10m2<br>* Mô tả chung<br>+ Camera an ninh các hành lang<br>+ Giờ giấc thoải mái<br>+ Bảo vệ trực 24/24<br>+ Tạp vụ dọn vệ sinh hàng ngày<br>+ Đóng tiền tháng 1 cọc 1.000k /phòng<br>Địa chỉ: Số 1 đường Mĩ Đình( Đối diện cổng bốc vác bến xe mĩ đình<br>Giá: <strong>1.000.000 đ / tháng</strong><br>Đ/c: <strong>Số 1 Đường Mỹ Đình, Mỹ Đình, Từ Liêm, Hà Nội</strong><br></div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCJ9', 1, 0, '{\"0\":\"21.0029317912212212\",\"1\":\"105.820226663232323\"}', 1, 0, '2019-05-14 18:43:56', '2019-05-14 18:43:56');
INSERT INTO `motelrooms` VALUES (6, 'Cho Thua CCMN KCN Bắc Thăng Long - KCN Quang Minh', 'cho-thua-ccmn-kcn-bac-thang-long-kcn-quang-minh', 1800000, 30.0000, 1, 4, 5, 'ngõ 19 thôn Hậu Dưỡng, Kim Chung , Đông Anh, 23, Đông Anh, Hà Nội', '0971369515', 4, 'Khép kín', '{\"0\":\"cho-thua-ccmn-kcn-bac-thang-long-kcn-quang-minh-resized-3mqc8.jpg\",\"1\":\"cho-thua-ccmn-kcn-bac-thang-long-kcn-quang-minh-resized-2xkxo.jpg\",\"2\":\"cho-thua-ccmn-kcn-bac-thang-long-kcn-quang-minh-resized-gahad.jpg\",\"3\":\"cho-thua-ccmn-kcn-bac-thang-long-kcn-quang-minh-resized-drlaa.jpg\",\"4\":\"cho-thua-ccmn-kcn-bac-thang-long-kcn-quang-minh-resized-5b7l4.jpg\"}', '<div class=\"dis-content\">Bên mình còn 1 số phòng Chung Cư Mini cho thuê. Với thiết kế hiện đại, thoáng mát rất phù hợp với hộ gia đình, nhóm bạn thuê trọ gần Khu Công Nghiệp Bắc Thăng Long<br>- Phòng kép kín, Không chung chủ  với thiết kế 1 khách và 1 ngủ rộng 30 - 35m2<br>- Từ 1.800.000 - 2.000.000 bạn  đã có thể sở hữu cho mình 1 căn hộ CCMN cao cấp<br>- Dịch vụ tốt và giá lại rẻ. Điện 2k3/số , nước 70k/người<br>- Tòa nhà nằm ở vị trí giao thông thuận lợi, khu dân trí cao, dễ dàng đi chợ, mua sắm chỉ cách 50m là đến chợ<br>Địa chỉ: nhà 8 tầng ngõ 19 Hậu Dưỡng, Kim Chung, Đông Anh<br>LH Quản Lý: 0971.369.515 ---Gọi cho tôi nếu như bạn đang có thắc mắc <br></div>', '', 1, 0, '{\"0\":\"21.121634579566432\",\"1\":\"105.76941489565422\"}', 1, 0, '2019-05-14 18:43:58', '2019-05-14 18:43:58');
