hoai-mai-xach-vali-den-o-luon-resized-ji0fx.jpg\",\"12\":\"qlong-bien-can-ho-ccmn-45m2-1-phong-khach-1-phong-ngu-full-do-rieng-tu-sang-sach-thoai-mai-xach-vali-den-o-luon-lyiax.jpg\"}', '<div class=\"dis-content\">Q.Long Biên - Căn hộ CCMN 45m2 1 phòng khách 1 phòng ngủ full đồ riêng tư sáng sạch thoải mái - Xách vali đến ở luôn.<br>5.000.000 ₫<br>Bệnh viện Đa khoa Tâm Anh - 310 Nguyễn Văn Cừ<br>Mình đang trống 1 phòng tầng 5 xây kiểu cho Tây thuê, cụ thể như sau: chia 1 phòng khách/ bếp + 1 phòng ngủ + nhà tắm + ban công riêng.<br>Địa chỉ : Chung cư mini 7 tầng, số 29 ngõ 90 phố Hoàng Như Tiếp, Q. Long Biên (chính là ngõ 310 Nguyễn Văn Cừ cũ)<br>Đã có sẵn : Điều hòa hai chiều, Bình nóng lạnh, Tủ lạnh 90l, Tủ quần áo 2 buồng, Quạt, đồ bếp cơ bản, Bàn bếp chạn kệ tủ bếp, Ban công, Giường 1m6x2m + chăn ga gối đệm lò xo (các bạn xem ảnh nhé). Wifi full 7 tầng mỗi tầng 1 modem riêng, máy giặt free tầng 1.<br>Vị trí cách phố cổ 2.5km, cách Big C/Aeon Long Biên 3km, gần rất nhiều chợ lớn/ nhỏ, Vinmart, tạp hóa... gần trường học, gần nhiều mẫu giáo, gần bệnh viện, tiện sinh hoạt, tiện giao thông. Nhà mình nằm trong khu vực trung tâm phát triển nhất quận Long Biên.<br>Diện tích đất nền nhà mình là 60m2, diện tích sử dụng thực 45m2, 15m2 còn lại là cầu thang + 2 giếng trời (nên nhà rất thoáng và ánh sáng tốt). Các bạn ở đây không ai quản giờ giấc sinh hoạt của các bạn, không giới hạn giờ đi lại, nhưng xin phiền nếu buổi đêm về muộn thì nhẹ nhàng tránh ảnh hưởng đến các tầng khác.<br>Điện 2.700đ/số, nước 28.000đ/khối. Không phát sinh chi phí nào khác ngoài điện nước.<br>Giá 5 triệu/ tháng Vui lòng ko mặc cả. (hợp đồng ít nhất 6 tháng, đóng tiền tháng 1, cọc 1 tháng ) Cầu thang bộ, tầng 5 nhưng thấp chỉ = tầng 3-4 nhà khác thôi, mình còn ở tầng 7 nè. Vì là thang bộ nên mình cho thuê rẻ hơn tầng thấp rồi nhé ạ.<br>Có thể cho người nước ngoài thuê, giá 250 usd/ tháng.<br>Liên hệ chủ nhà 0904040387 Hằng zalo imes facebook đều ok nhé.<br><br><br></div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCIsIjMiOiJcdTAxMTBpXHUxZWMxdSBoXHUwMGYyYSIsIjQiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCIsIjUiOiJNXHUwMGUxeSBnaVx1MWViN3QifQ==', 1, 0, '{\"0\":\"21.042369720428795\",\"1\":\"105.87544798243096\"}', 1, 0, '2019-05-14 18:44:38', '2019-05-14 18:44:38');
