ÒNG NỮ 2 giường tầng giá 1,5 triệu/ng/tháng (1 slot)-không có tivi<br>- PHÒNGNAM 4 Giường tầng giá 1,6 triệu/ng/tháng (1 slot)<br>-PHÒNG NỮ 3 giường tầng giá 1,7 triệu/ng/tháng (còn 1 slot)<br>(hợpđồng từ 6 tháng trở lên giảm ngay 100k/tháng)<br> <br>=&gt;MIỄN PHÍ: điện, nước sạch, mạng internet, gas, có người dọn tổng vệ sinh hàng<br>tuần<br> <br>Cănhộ nằm tại khu dân cư cao cấp đảm bảo an ninh, sạch sẽ, thuận tiện giao thông,<br>đầy đủ tiện nghi chỉ việc xách quần áo đến ở<br>✨ Mỗi người có 2 tủ quần áo có khóa riêng<br>✨ Chăn ga gối đệm đầy đủ cho từng người<br>✨ Bếp, tủ bếp , nồi niêu bát đĩa, dao, thớt,bàn ăn<br>✨ TIVI TRUYỀN HÌNH CÁP RIÊNG TỪNG PHÒNG, 2 Tủlạnh, 2 máy giặt, bình nóng lạnh, điều hòa.<br><br><br>Cácbạn quan tâm vui lòng liên hệ chính chủ để đi xem nhà<br>NÓIKHÔNG VỚI THU PHÍ ĐI XEM HAY THUÊ<br>LH:0901498666 (fb, zalo, viber, imessage)</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCIsIjMiOiJcdTAxMTBpXHUxZWMxdSBoXHUwMGYyYSIsIjQiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCIsIjUiOiJNXHUwMGUxeSBnaVx1MWViN3QiLCI2IjoiVHJ1eVx1MWVjMW4gaFx1MDBlY25oIGNcdTAwZTFwIiwiNyI6IlRpdmkifQ==', 1, 0, '{\"0\":\"21.0029317912212212\",\"1\":\"105.820226663232323\"}', 1, 0, '2019-05-14 18:45:30', '2019-05-14 18:45:30');
