 uống tại vòi (khỏi mất công đi đổi nước và tốn chi phí)<br> <br>Cácbạn quan tâm vui lòng liên hệ chính chủ để đi xem nhà<br>NÓIKHÔNG VỚI THU PHÍ ĐI XEM HOẶC THUÊ<br>LH:0901498666 (fb, zalo, viber, imessage)</div>', '', 1, 0, '{\"0\":\"21.0029317912212212\",\"1\":\"105.820226663232323\"}', 1, 0, '2019-05-14 18:45:34', '2019-05-14 18:45:34');
