INSERT INTO `motelrooms` VALUES (64, 'Cho thuê nhà khu xuân phương - cầu diễn', 'cho-thue-nha-khu-xuan-phuong-cau-dien', 1600000, 15.0000, 1, 10, 61, 'Số 32 , ngách 123/22 , ngõ 123 , xuân phương, Cầu Diễn, Từ Liêm, Hà Nội', '0365856947', 1, 'Khép kín', '{\"0\":\"cho-thue-nha-khu-xuan-phuong-cau-dien-resized-eeqfk.jpeg\",\"1\":\"cho-thue-nha-khu-xuan-phuong-cau-dien-resized-u0jz7.jpeg\",\"2\":\"cho-thue-nha-khu-xuan-phuong-cau-dien-resized-wx8fb.jpeg\"}', '<div class=\"dis-content\">Cho thuê phòng khu  Xuân Phương - cầu diễn<br><br>-Nhà mình còn 1 phòng cho thuê giá 1.6 triệu<br>1 phòng 15 m2 tầng 3 ( diện tích chưa bao gồm vệ sinh , vệ sinh cạnh phòng rộng thoải mái)<br><br>- Nhà mình 4 tầng , nhà đẹp, thoáng mát , phòng đã có 1 giường , nhà vệ sinh sạch đẹp , có bình nóng lạnh , máy giặt , nước sạch nhà nước <br><br>- Nhà mình có nhà ở quận hai bà trưng nữa nên mẹ mình ở ngoài hai bà trưng ko ở cầu diễn , các con đều đi lấy ck rồi nên nhà mình cũng ko ai ở , có bố mình đi làm từ sáng tới tối mới về ngủ tầng 1 trông nhà thôi và thi thoảng cũng ko có nhà . Nên muốn cho thuê vài phòng cho nhà đỡ trống trải <br> <br>- Có sân rộng để xe, an ninh tốt, có sân thượng rộng để phơi đồ, có chìa khóa cổng riêng mỗi phòng, Tầng 1 có sân rộng và đã có mái hiên bằng tôn để để xe<br><br>Bạn nào muốn tới xem nhà và thuê nhà thì liên hệ sớm với mẹ mình nhé, vì nhà mình cho thuê cũng nhanh ^^- Cô Hà 0365856947<br><br>Địa chỉ nhà mình : số nhà 32 ,  ngách 123/22 , ngõ 123 đường Xuân Phương- Phương Canh - Cầu Diễn - Nam Từ Liêm - Hà Nội ( đi từ cầu diễn vào nhà mình mất 3km )<br>--&gt; thường mọi người đi từ cầu diễn rẽ trái vào đường Phúc diễn đi đến ngã ba rẽ phải vào đường Phương canh đi thẳng đến Ủy ban nhân dân phường Phương Canh (hoặc tới số nhà 386 phương canh - hiệu thuốc Châu Anh ) thì alo mẹ mình chỉ vào cho nhanh .</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCIsIjMiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCIsIjQiOiJN