an riêng tưcho bản thân do thiết kế thông minh của phòng ngủ<br>Có phòng sinh hoạt chung được thiết kế đẹp và tiệnnghi như quán café trong phòng, có được trang bị camera an ninh và dàn đèn vô<br>cùng đẹp mắt<br>Với chỉ 1tr… bạn đã được tận hưởng dịch vụ tốt nhất,được chăm sóc đặc biệt <br>Trở thành cư dân của tòa nhà bạn sẽ được ưu ái và tặngquà tri ân mỗi dịp sinh nhật, hay dịp lễ tết <br> <br> </div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCIsIjMiOiJcdTAxMTBpXHUxZWMxdSBoXHUwMGYyYSIsIjQiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCIsIjUiOiJNXHUwMGUxeSBnaVx1MWViN3QiLCI2IjoiVHJ1eVx1MWVjMW4gaFx1MDBlY25oIGNcdTAwZTFwIiwiNyI6IlRpdmkifQ==', 1, 0, '{\"0\":\"21.0029317912212212\",\"1\":\"105.820226663232323\"}', 1, 0, '2019-05-14 18:46:12', '2019-05-14 18:46:12');
INSERT INTO `motelrooms` VALUES (66, 'Phòng CCMN có điều hòa nóng lạnh wifi 35m2 - ngõ 39 Đại Đồng, Q. Hoàng Mai - 0902163344', 'phong-ccmn-co-dieu-hoa-nong-lanh-wifi-35m2-ngo-39-dai-dong-q-hoang-mai-0902163344', 3000000, 35.0000, 1, 57, 62, 'Ngách 38 Ngõ 39 Đại Đồng – P. Thanh Trì – Hoàng Mai, Đại Đồng, Hoàng Mai, Hà Nội', '0902163344', 3, 'Khép kín', '{\"0\":\"phong-ccmn-co-dieu-hoa-nong-lanh-wifi-35m2-ngo-39-dai-dong-q-hoang-mai-0902163344-5176q.jpg\",\"1\":\"phong-ccmn-co-dieu-hoa-nong-lanh-wifi-35m2-ngo-39-dai-dong-q-hoang-mai-0902163344-kjgmn.jpg\",\"2\":\"phong-ccmn-co-dieu-hoa-nong-lanh-wifi-35m2-ngo-39-dai-dong-q-hoang-mai-0902163344-4j3dj.jpg\",\"3\":\"phong-ccmn-co-dieu-hoa-nong-lanh-wifi-35m2-ngo-39-dai-dong-q-hoang-mai-0902163344-j9s2r.jpg\",\"4\":\"phong-ccmn-co-dieu-hoa-nong-lanh-wifi-35m2-ngo-39-dai-dong-q-hoang-mai-0902163344-uxl6w.jpg\"}', '<div class=\"dis-content\">Tiền nhà : 3 triệu/ tháng + Điện 2.300/số + Nước 30k/ khối.<br>Xin chào, gia đình tôi sắp trống phòng ở tầng 4 với giá 3 tr/tháng.<br>Gồm 1 phòng ngủ, 1 phòng bếp, 1 toilet ban công.<br>Tất cả đều riêng biệt, chỉ chung cửa vào nhà chính ở tầng 1 và cầu thang bộ đi lên, không quản giờ giấc đi về, xe máy để tầng 1.<br>Diện tích sử dụng trên 35m2, nhà cửa mới xây còn rất mới.<br>Trong phòng có: Điều hòa, bình nước nóng, giường 1m6x2m. Ngoài ra có sẵn rèm, dây truyền hình cáp và internet.<br>Địa chỉ: Ngách 38 Ngõ 39 Đại Đồng – P. Thanh Trì – Hoàng Mai. <br>Cô Lan 0902163344.<br>Gần Time City, gần trường Kinh Doanh Công Nghệ, gần chợ gần bệnh viện, công viên… thích hợp cho gia đình nhỏ 2-3 người hoặc 2-3 bạn đi học đi làm ở chung với nhau. Nhà xây kiểu Chung cư mini nên sẽ thoáng và tiện nghi hơn so với nhà cấp 4 mái tôn, bạn có thể yên tâm về an ninh cũng như sinh hoạt.<br>Điện giá rẻ : 2.300đ/ số, nước 30.0000/khối. Internet 100 nghìn/tháng nếu dùng. Chỉ cho để 1-2 xe máy hơn không nhận khách.<br>RIÊNG TƯ 100% - KO QUẢN GIỜ GIẤC ĐI VỀ <br>Tiền nhà đóng tiền hàng tháng một, cọc 1 tháng. Hợp đồng yêu cầu ở ít nhất 6 tháng.<br>Mọi chi tiết xin trực tiếp liên hệ chủ nhà: Cô Lan 0902163344.<br>* Ngoài ra. Hết tháng này bên mình trống phòng tầng 2 gioong giá 3.2 triệu/ tháng.<br></div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCIsIjMiOiJcdTAxMTBpXHUxZWMxdSBoXHUwMGYyYSIsIjQiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCJ9', 1, 0, '{\"0\":\"20.997643231260952\",\"1\":\"105.8844065605407\"}', 1, 0, '2019-05-14 18:46:15', '2019-05-14 18:46:15');
INSERT INTO `motelrooms` VALUES (68, 'Tìm nữ ở ghép ngõ 199 Hồ Tùng Mậu thông với ngõ 126 nguyễn đổng chi', 'tim-nu-o-ghep-ngo-199-ho-tung-mau-thong-voi-ngo-126-nguyen-dong-chi', 750000, 17.0000, 1, 10, 39, 'Nhà số 1 ngách 199/59 hồ tùng mậu. cầu diễn, hà nội, Hồ Tùng Mậu, Từ Liêm, Hà Nội', '0985106559', 1, 'Khép kín', '{\"0\":\"tim-nu-o-ghep-ngo-199-ho-tung-mau-thong-voi-ngo-126-nguyen-dong-chi-b9rxi.jpg\",\"1\":\"tim-nu-o-ghep-ngo-199-ho-tung-mau-thong-voi-ngo-126-nguyen-dong-chi-bx3sr.jpg\"}', '<div class=\"dis-content\">Mình tìm nữ ở ghép tầm 92 ,93 càng tốt. Yêu cầu : Ngoan, sống vui vẻ và sạch (bẩn thì không ở được đâu ạ hihi), phòng tầng 3 thoáng vô cùng, gần chợ, khu vực ở giữa siêu thị Thành Đô và vinhomes mới xây. Đi lại tự do không chung chủ nên rất thoải mái, phòng mình có gác xép nên ai ở được gác xép càng tốt mỗi người 1 không gian riêng thoải mái lắm :))) . Điện 4k, nước 10k/khối. Vào cọc 300k. Tính mình thoải mái lắm nên tìm ai không tính toán nhé. Cảm ơn mọi người đã đọc tin ạ.  </div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCJ9', 1, 0, '{\"0\":\"21.0029317912212212\",\"1\":\"105.820226663232323\"}', 1, 0, '2019-05-14 18:46:20', '2019-05-14 18:46:20');
