INSERT INTO `motelrooms` VALUES (73, 'Tìm người ở ghép gần các trường đại học quốc gia, thủy lợi...', 'tim-nguoi-o-ghep-gan-cac-truong-dai-hoc-quoc-gia-thuy-loi', 1350000, 83.0000, 1, 57, 60, 'CT1b chung cư thông tấn xã, Nguyễn Xiển, Hoàng Mai, Hà Nội', '0942074462', 3, 'Khép kín', '{\"0\":\"tim-nguoi-o-ghep-gan-cac-truong-dai-hoc-quoc-gia-thuy-loi-mifdz.jpg\"}', '<div class=\"dis-content\">Phòng mình cần tìm thêm 1 bạn nữ nữa để giảm bớt tiền phòng. nhà cung cư rộng,sạch, đã đủ đồ cơ bản, và điều hòa, nóng lạnh, ko chung chủ, an ninh tốt. <br>Trọn gói cả tiền nhà + điện nước+ phí dịch vụ+ gửi xe:1.350k/thang<br>Yêu cầu: thật thà, sạch sẽ<br>sđt: 0942074462 Đ/c: P1606 tòa B chung cư thông tấn xã, đằng sau kđt kim văn kim lũ. Rất tiện khu khu định công, nga tư sở, ngã tư khuất duy tiến và linh đàm</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJUaGFuZyBtXHUwMGUxeSIsIjMiOiJJbnRlcm5ldCIsIjQiOiJcdTAxMTBpXHUxZWMxdSBoXHUwMGYyYSIsIjUiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCIsIjYiOiJNXHUwMGUxeSBnaVx1MWViN3QifQ==', 1, 0, '{\"0\":\"21.0029317912212212\",\"1\":\"105.820226663232323\"}', 1, 0, '2019-05-14 18:46:28', '2019-05-14 18:46:28');
INSERT INTO `motelrooms` VALUES (74, 'CÓ PHÒNG CHO THUÊ PHÙ HỢP HỘ GIA ĐÌNH VÀ SINH VIÊN Ở GHÉP', 'co-phong-cho-thue-phu-hop-ho-gia-dinh-va-sinh-vien-o-ghep', 3500000, 30.0000, 1, 6, 66, 'SỐ 29B NGÕ 886 NGÁCH 185/91 ĐƯỜNG LÁNG, Láng, Đống Đa, Hà Nội', '0822194425', 4, 'Khép kín', '{\"0\":\"co-phong-cho-thue-phu-hop-ho-gia-dinh-va-sinh-vien-o-ghep-resized-anorm.jpg\",\"1\":\"co-phong-cho-thue-phu-hop-ho-gia-dinh-va-sinh-vien-o-ghep-resized-5zmas.jpg\",\"2\":\"co-phong-cho-thue-phu-hop-ho-gia-dinh-va-sinh-vien-o-ghep-resized-nztpt.jpg\",\"3\":\"co-phong-cho-thue-phu-hop-ho-gia-dinh-va-sinh-vien-o-ghep-resized-cqddj.jpg\"}', '<div class=\"dis-content\">Có phòng cho thuê, giá 3tr500 / tháng. Diện tích 30m vuông phù hợp với hộ gia đình và sinh viên ở ghep 3-4 người. Phòng to, thoáng mát, là khu vực an toàn không có trộm cắp. Ngoài ra phòng còn nằm cạnh phố Chùa Láng với gần trường Đại học Ngoại Thương, Ngoại Giao, GTVT, gần bệnh viện nhi, bệnh viện đường sắt, gần TTTM Vincom và có rất nhiều list ăn vặt cực ngon...<br>Địa chỉ: số 29B ngõ 886 ngách 185/91 Đường Láng<br>Liên hệ : Chú Tuấn.</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCIsIjMiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCJ9', 1, 0, '{\"0\":\"21.0029317912212212\",\"1\":\"105.820226663232323\"}', 1, 0, '2019-05-14 18:46:33', '2019-05-14 18:46:33');
INSERT INTO `motelrooms` VALUES (75, 'Chính chủ cho hộ gia đình thuê nhà tại nguyễn chính - hoàng mai - HN', 'chinh-chu-cho-ho-gia-dinh-thue-nha-tai-nguyen-chinh-hoang-mai-hn', 2500000, 20.0000, 1, 57, 67, 'Ngách 79, ngõ 143 Nguyễn Chính, Nguyễn Chính, Hoàng Mai, Hà Nội', '0988943333', 4, 'Khép kín', '{\"0\":\"chinh-chu-cho-ho-gia-dinh-thue-nha-tai-nguyen-chinh-hoang-mai-hn-resized-opbax.jpg\"}', '<div class=\"dis-content\">Nhà mình mới xây xong, 3 tầng, mỗi tầng 1 phòng 20m2, công trình phụ khép kín, bệ bếp, nóng lạnh, chậu rửa, sen vòi đầy đủ, cầu thang ngoài, lối đi riêng, trước mặt là cổng trường cấp II đường rộng 8m, gần chợ, thuận tiện đi lại, sinh hoạt<br><br>Ưu tiên hộ gia đình và người đi làm thuê ở lâu dài<br><br>Giá 2,5 triệu/tháng<br>Địa chỉ: ngách 79, ngõ 143 Nguyễn chính, Hoàng Mai, Hà Nội<br><br>LH chính chủ: anh Hà 098.894.3333</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IkJcdTAwZWNuaCBuXHUwMGYzbmcgbFx1MWVhMW5oIn0=', 1, 0, '{\"0\":\"21.0029317912212212\",\"1\":\"105.820226663232323\"}', 1, 0, '2019-05-14 18:46:34', '2019-05-14 18:46:34');
INSERT INTO `motelrooms` VALUES (76, 'Cho thuê phòng riêng khép kín khu vực An Trạch, Cát Linh, Hào Nam', 'cho-thue-phong-rieng-khep-kin-khu-vuc-an-trach-cat-linh-hao-nam', 3000000, 35.0000, 1, 6, 68, 'Số nhà 24, ngõ An Trạch 1, phố An Trạch, Đống Đa, Hà Nội, An Trạch, Đống Đa, Hà Nội', '0972658614', 4, 'Khép kín', '{\"0\":\"cho-thue-phong-rieng-khep-kin-khu-vuc-an-trach-cat-linh-hao-nam-resized-nj6sa.jpg\",\"1\":\"cho-thue-phong-rieng-khep-kin-khu-vuc-an-trach-cat-linh-hao-nam-resized-vwpeo.jpg\"}', '<div class=\"dis-content\">Gia đình tôi có một số phòng khép kín cho thuê tại nhà 4 tầng ngõ An Trạch 1, phố An Trạch.<br>Mỗi phòng rộng 25-30m2, công trình phụ khép kín, sạch sẽ, yên tĩnh, không chung chủ. Vệ sinh sạch sẽ, an ninh tốt.<br>Phòng thoáng mát có cửa sổ, điều hòa 2 chiều, bình nóng lạnh, giường, tủ. <br>Sân phơi tầng 4, chỗ để xe ở tầng 1, bếp bếp riêng biệt gồm kệ bếp, chậu rửa, tủ bếp, máy hút mùi ở tầng 1<br>Khu dân trí cao, giao thông thuận tiện (cách mặt phố An Trạch 50m, gần đường sắt trên không Cát Linh - Hà Đông)<br>Điện, nước, internet tính theo giá nhà nước.<br>Giá thuê: 3-3.5 triệu/tháng. <br>Địa chỉ: Số nhà 24, ngõ An Trạch 1, phố An Trạch, Đống Đa, Hà Nội<br>Liên hệ: Cô Ngân (SĐT: 0972 658 614)</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCIsIjMiOiJcdTAxMTBpXHUxZWMxdSBoXHUwMGYyYSIsIjQiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCIsIjUiOiJNXHUwMGUxeSBnaVx1MWViN3QiLCI2IjoiVHJ1eVx1MWVjMW4gaFx1MDBlY25oIGNcdTAwZTFwIiwiNyI6IlRpdmkifQ==', 1, 0, '{\"0\":\"21.0029317912212212\",\"1\":\"105.820226663232323\"}', 1, 0, '2019-05-14 18:46:36', '2019-05-14 18:46:36');
INSERT INTO `motelrooms` VALUES (77, 'Cho thuê phòng trọ khép kín 500k/th ở Hà Đông 12m2', 'cho-thue-phong-tro-khep-kin-500kth-o-ha-dong-12m2', 500000, 12.0000, 1, 21, 69, '89 Đường Huyền Kỳ, Phú Lãm Hà Đông, Huyền Kỳ, Hà Đông, Hà Nội', '0965899449', 4, 'Khép kín', '{\"0\":\"cho-thue-phong-tro-khep-kin-500kth-o-ha-dong-12m2-1546078894cldbh-ld7kp.jpg\"}', '<div class=\"dis-content\">Hiện mình có dãy phòng trọ cấp 4 sạch sẽthoáng mát muốn cho thuê. Phòng có nhà vệ sinh khép kín 500k/tháng diện tích<br>khoảng 10-15m2 tùy phòng. Nước 50/người/ tháng và internet 50k/người/tháng. Điện<br>3.5k/số. An ninh đảm bảo, không khí trong lành, yên tĩnh, sân vườn mát mẻ. Chỗ<br>để xe, sân phơi thoải mái, Giờ giấc không quy định, bạn bè người thân đến chơi<br>thoải mái. Mình ở gần cao đẳng kinh tế Kỹ Thuật Thương Mại: 89-Huyền Kỳ-Tổ 7-<br>Phú Lãm-Hà Đông-Hà Nội. Liên hệ chính chủ: Tùng Anh: 0965899449 hoặc cô Yến : 0968560406</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IkludGVybmV0In0=', 1, 0, '{\"0\":\"21.0029317912212212\",\"1\":\"105.820226663232323\"}', 1, 0, '2019-05-14 18:46:38', '2019-05-14 18:46:38');
INSERT INTO `motelrooms` VALUES (78, 'P. Bồ Đề - Q. Long Biên : Căn hộ đủ đồ 1 phòng khách + 1 phòng ngủ 45m2 rất đẹp kiểu cho Tây thuê', 'p-bo-de-q-long-bien-can-ho-du-do-1-phong-khach-1-phong-ngu-45m2-rat-dep-kieu-cho-tay-thue', 5000000, 45.0000, 1, 8, 30, '29, ngõ 90 Hoàng Như Tiếp, Q.Long Biên, Hà Nội, Hoàng Như Tiếp, Long Biên, Hà Nội', '0904040387', 3, 'Khép kín', '{\"0\":\"p-bo-de-q-long-bien-can-ho-du-do-1-phong-khach-1-phong-ngu-45m2-rat-dep-kieu-cho-tay-thue-biblq.jpg\",\"1\":\"p-bo-de-q-long-bien-can-ho-du-do-1-phong-khach-1-phong-ngu-45m2-rat-dep-kieu-cho-tay-thue-oik7k.jpg\",\"2\":\"p-bo-de-q-long-bien-can-ho-du-do-1-phong-khach-1-phong-ngu-45m2-rat-dep-kieu-cho-tay-thue-wgien.jpg\",\"3\":\"p-bo-de-q-long-bien-can-ho-du-do-1-phong-khach-1-phong-ngu-45m2-rat-dep-kieu-cho-tay-thue-nv9e5.jpg\",\"4\":\"p-bo-de-q-long-bien-can-ho-du-do-1-phong-khach-1-phong-ngu-45m2-rat-dep-kieu-cho-tay-thue-8udew.jpg\",\"5\":\"p-bo-de-q-long-bien-can-ho-du-do-1-phong-khach-1-phong-ngu-45m2-rat-dep-kieu-cho-tay-thue-tynes.jpg\",\"6\":\"p-bo-de-q-long-bien-can-ho-du-do-1-phong-khach-1-phong-ngu-45m2-rat-dep-kieu-cho-tay-thue-896yx.jpg\",\"7\":\"p-bo-de-q-long-bien-can-ho-du-do-1-phong-khach-1-phong-ngu-45m2-rat-dep-kieu-cho-tay-thue-oxzxu.jpg\",\"8\":\"p-bo-de-q-long-bien-can-ho-du-do-1-phong-khach-1-phong-ngu-45m2-rat-dep-kieu-cho-tay-thue-resized-ocgnk.jpg\",\"9\":\"p-bo-de-q-long-bien-can-ho-du-do-1-phong-khach-1-phong-ngu-45m2-rat-dep-kieu-cho-tay-thue-jli6o.jpg\",\"10\":\"p-bo-de-q-long-bien-can-ho-du-do-1-phong-khach-1-phong-ngu-45m2-rat-dep-kieu-cho-tay-thue-pwgxz.jpg\"}', '<div class=\"dis-content\">Hiện mình còn trống 1 phòng xây kiểu cho Tây thuê, phòng rất sáng, thoáng sạch sẽ. Có ban công riêng.<br>Địa chỉ : Chung cư mini 7 tầng, số 29 ngõ 90 phố Hoàng Như Tiếp, Q. Long Biên<br>Đã có sẵn : điều hòa hai chiều, bình nóng lạnh, tủ lạnh 150l, tủ quần áo, đồ bếp cơ bản, khu vực bếp, ban công, giường 1m6x2m + chăn ga gối đệm lò xo (các bạn xem ảnh nhé). Wifi full 7 tầng mỗi tầng 1 modem riêng, máy giặt free tầng 1.<br>Vị trí cách phố cổ 2.5km, cách Big C/Aeon Long Biên 3km, gần rất nhiều chợ lớn/ nhỏ, Vinmart, tạp hóa... gần trường học, gần nhiều mẫu giáo, gần bệnh viện, tiện sinh hoạt, tiện giao thông. Nhà mình nằm trong khu vực trung tâm phát triển nhất quận Long Biên.<br>Diện tích đất nền nhà mình là 60m2, diện tích sử dụng thực 45m2, 15m2 còn lại là cầu thang + 2 giếng trời (nên nhà rất thoáng và ánh sáng tốt). Các bạn ở đây không ai quản giờ giấc sinh hoạt của các bạn, không giới hạn giờ đi lại, nhưng xin phiền nếu buổi đêm về muộn thì nhẹ nhàng tránh ảnh hưởng đến các tầng khác.<br>Mỗi tầng gồm 1 phòng bếp (phòng khách) + 1 phòng ngủ + phòng tắm + ban công. Phòng tầng cao nên mình báo giá rẻ nhất rồi nếu tầng thấp thì giá cao hơn :) Cầu thang rất rộng và thấp đi ko mệt đâu ạ, tầng 5 chỉ bằng tầng 3 nhà khác thôi. Bạn nếu lăn tăn tầng cao nên thử qua đi 1 lần cho biết mình ko nói sai nha~<br>Điện 3.400đ/số, nước 28.000đ/khối. (đang xin điện giá rẻ hi vọng sẽ được thông qua sớm luôn trong tháng sau)<br>Giá đúng 5 triệu/ tháng, Sát tết nên mình chấp nhận hợp đồng ngắn 3 tháng là ok. Cọc 1 tháng đóng tiền tháng một.<br>Có thể cho người nước ngoài thuê, giá 250 usd/ tháng HĐ 6 tháng hoặc 270 usd HĐ 3 tháng<br>Liên hệ chủ nhà 0904040387 Hằng (zalo imes facebook đều đc nhé)</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCIsIjMiOiJNXHUwMGUxeSBnaVx1MWViN3QifQ==', 1, 0, '{\"0\":\"21.042410848757953\",\"1\":\"105.87563452495976\"}', 1, 0, '2019-05-14 18:46:41', '2019-05-14 18:46:41');
INSERT INTO `motelrooms` VALUES (79, 'Cho thuê chung cư mini ở Tân Mai', 'cho-thue-chung-cu-mini-o-tan-mai', 3200000, 25.0000, 1, 57, 58, 'Số 14B, ngõ 139 phố Tân Mai, Tân Mai, Hoàng Mai, Hà Nội', '0916122234', 3, 'Khép kín', '{\"0\":\"cho-thue-chung-cu-mini-o-tan-mai-resized-hckm5.jpg\",\"1\":\"cho-thue-chung-cu-mini-o-tan-mai-resized-ipzmv.jpg\"}', '<div class=\"dis-content\">Đầu tháng 1 nhà mình có phòng trong chung cư mini<br>Diện tích 25m. Chung cư gần các trường Đại học Kinh tế, Bách khoa, Xây dựng, gần bến xe buýt, giao thông thuận tiện. Phòng có đầy đủ đồ, chỉ việc xách va li đến ở. Điện 3500đ/1 số, nước 20000đ/1 khối. Giá 3tr2. Địa chỉ số 14B, ngõ 139, phố Tân Mai, quận Hoàng Mai, Hà Nội. Liên hệ sđt: 0916122234</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJUaGFuZyBtXHUwMGUxeSIsIjMiOiJJbnRlcm5ldCIsIjQiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCJ9', 1, 0, '{\"0\":\"21.0029317912212212\",\"1\":\"105.820226663232323\"}', 1, 0, '2019-05-14 18:46:43', '2019-05-14 18:46:43');
INSERT INTO `motelrooms` VALUES (80, 'Chính chủ cho thuê phòng 2.7tr-3.2tr phố YÊN HÒA,TRUNG KÍNH, cầu giấy', 'chinh-chu-cho-thue-phong-27tr-32tr-pho-yen-hoatrung-kinh-cau-giay', 2700000, 26.0000, 1, 2, 71, 'số 12 ngõ 271 yên hòa, Vương Thừa Vũ, Thanh Xuân, Hà Nội', '0337021163', 1, 'Khép kín', '{\"0\":\"chinh-chu-cho-thue-phong-27tr-32tr-pho-yen-hoatrung-kinh-cau-giay-resized-uvnfv.jpg\",\"1\":\"chinh-chu-cho-thue-phong-27tr-32tr-pho-yen-hoatrung-kinh-cau-giay-68y7g.jpg\",\"2\":\"chinh-chu-cho-thue-phong-27tr-32tr-pho-yen-hoatrung-kinh-cau-giay-resized-vpvu4.jpg\",\"3\":\"chinh-chu-cho-thue-phong-27tr-32tr-pho-yen-hoatrung-kinh-cau-giay-rflfq.jpg\",\"4\":\"chinh-chu-cho-thue-phong-27tr-32tr-pho-yen-hoatrung-kinh-cau-giay-s0azf.jpg\"}', '<div class=\"dis-content\">Chính chủ cho thuê phòng 2.7tr-3.2tr phố YÊN HÒA, TRUNG KÍNH<br>CĂN HỘ CÓ THÁI DƯƠNG NĂNG( khách thuê dùng nước nóng thoải máiko mất tiền điện)<br>CHĂN ẤM, ĐỆM ÊM ấm áp theo phong cách HÀN QUỐC.<br>+ chỉ khoảng 20m là ra tới phố YÊN HÒA, TRUNG KÍNH( vị trí trungtâm, đi lại, ăn uống không thiếu thứ gì). SIÊU THỊ ĐẦU NGÕ. <br>+OTO đỗ cửa.NGÕ CỰC SẠCH và AN NINH.<br>+Giường trang bị cả đệm, ga ,gối…<br>+Tủ mới trang bị móc treo.<br>+Điều hòa 12000 BTU hai chiều tiết kiệm điện.<br>+ Rèm cửa trang trí sang trọng.<br>+ Tủ để giày, dép sạch sẽ<br>+Nền gỗ thịt mát mùa hè, ấm mùa đông.<br>+ Có tiểu cảnh ĐẸP trong nhà.<br>+Vệ sinh khép kín .BÌnh nóng lạnh 30l. Tòa nhà trang bị Nănglượng Thái Dương Năng để tiết kiệm tiền điện cho khách thuê. khu phơi đồ riêng<br>biệt sạch sẽ.<br>+Camera an ninh 24/24<br>+Đặc biệt có người lau dọn vệ sinh hằng tuần.<br>+Ưu tiên nữ , không chung chủ.<br>+ Giá chỉ từ 2.7tr-3.2tr( có fix cho người ở sạch sẽ)<br>Liên hệ 0337021163( ko gọi được vui lòng để lại tin nhắn)</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCIsIjMiOiJcdTAxMTBpXHUxZWMxdSBoXHUwMGYyYSIsIjQiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCIsIjUiOiJUcnV5XHUxZWMxbiBoXHUwMG