INSERT INTO `motelrooms` VALUES (81, 'Phòng trọ trong căn hộ 90m2. Ngõ 319 Tam Trinh', 'phong-tro-trong-can-ho-90m2-ngo-319-tam-trinh', 2400000, 30.0000, 1, 57, 72, '319 Tam Trinh, Tam Trinh, Hoàng Mai, Hà Nội', '0966987383', 3, 'Chưa xác định', '{\"0\":\"phong-tro-trong-can-ho-90m2-ngo-319-tam-trinh-resized-gnen3.jpg\",\"1\":\"phong-tro-trong-can-ho-90m2-ngo-319-tam-trinh-resized-r7kdf.jpg\",\"2\":\"phong-tro-trong-can-ho-90m2-ngo-319-tam-trinh-b2gna.jpg\",\"3\":\"phong-tro-trong-can-ho-90m2-ngo-319-tam-trinh-mezzl.jpg\"}', '<div class=\"dis-content\">Dư một phòng trong căn hộ 90m2 Ngõ 319 Tam Trinh<br>Nhà đầy đủ tiện nghi. <br>Phòng khách, Giường, Tủ quần áo, <br>Điều Hoà, Nóng Lạnh,Bếp nấu, Máy Giặt... <br>Chỉ việc đến ở ưu tiên SV, Người đi làm ở lâu dài<br>(Người Bắc Giang, Bắc Ninh càng tốt)<br>Điện nước giá dân dùng bnhieu tính bấy nhiêu</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCIsIjMiOiJcdTAxMTBpXHUxZWMxdSBoXHUwMGYyYSIsIjQiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCIsIjUiOiJNXHUwMGUxeSBnaVx1MWViN3QifQ==', 1, 0, '{\"0\":\"21.0029317912212212\",\"1\":\"105.820226663232323\"}', 1, 0, '2019-05-14 18:46:50', '2019-05-14 18:46:50');
