INSERT INTO `motelrooms` VALUES (83, 'CHÍNH CHỦ CHO THUÊ CĂN HỘ CHUNG CƯ MINI PHÒNG NGỦ VÀ KHÁCH DT28-45M2 NGÕ 322 MỸ ĐÌNH', 'chinh-chu-cho-thue-can-ho-chung-cu-mini-phong-ngu-va-khach-dt28-45m2-ngo-322-my-dinh', 5000000, 45.0000, 1, 10, 12, 'ngõ 322 ngách 76 đường Mỹ Đình (cạnh đình Nhân Mỹ), Mỹ Đình, Từ Liêm, Hà Nội', '0981056756', 5, 'Khép kín', '{\"0\":\"chinh-chu-cho-thue-can-ho-chung-cu-mini-phong-ngu-va-khach-dt28-45m2-ngo-322-my-dinh-resized-des2j.jpg\",\"1\":\"chinh-chu-cho-thue-can-ho-chung-cu-mini-phong-ngu-va-khach-dt28-45m2-ngo-322-my-dinh-resized-cmwko.jpg\",\"2\":\"chinh-chu-cho-thue-can-ho-chung-cu-mini-phong-ngu-va-khach-dt28-45m2-ngo-322-my-dinh-resized-gwmdg.jpg\",\"3\":\"chinh-chu-cho-thue-can-ho-chung-cu-mini-phong-ngu-va-khach-dt28-45m2-ngo-322-my-dinh-resized-cnay9.jpg\",\"4\":\"chinh-chu-cho-thue-can-ho-chung-cu-mini-phong-ngu-va-khach-dt28-45m2-ngo-322-my-dinh-resized-raw9c.jpg\",\"5\":\"chinh-chu-cho-thue-can-ho-chung-cu-mini-phong-ngu-va-khach-dt28-45m2-ngo-322-my-dinh-kvwyy.jpg\",\"6\":\"chinh-chu-cho-thue-can-ho-chung-cu-mini-phong-ngu-va-khach-dt28-45m2-ngo-322-my-dinh-resized-dzk8d.jpg\",\"7\":\"chinh-chu-cho-thue-can-ho-chung-cu-mini-phong-ngu-va-khach-dt28-45m2-ngo-322-my-dinh-resized-pi19b.jpg\",\"8\":\"chinh-chu-cho-thue-can-ho-chung-cu-mini-phong-ngu-va-khach-dt28-45m2-ngo-322-my-dinh-resized-bfl54.jpg\",\"9\":\"chinh-chu-cho-thue-can-ho-chung-cu-mini-phong-ngu-va-khach-dt28-45m2-ngo-322-my-dinh-resized-igiyx.jpg\",\"10\":\"chinh-chu-cho-thue-can-ho-chung-cu-mini-phong-ngu-va-khach-dt28-45m2-ngo-322-my-dinh-resized-i0054.jpg\",\"11\":\"chinh-chu-cho-thue-can-ho-chung-cu-mini-phong-ngu-va-khach-dt28-45m2-ngo-322-my-dinh-resized-wn8gd.jpg\"}', '<div class=\"dis-content\">Tòa nhà 7 tầng mới hoàn thiện, nội thất đầy đủ,gần chợ nhân mỹ, đi lại thuận tiện, cách chợ 30m. 1.Vị trí tiện ích: Tòa nhà mới hoàn thiện, cách cổng làng nhân mỹ 300m, gần đường phạm Hùng, bến xe mỹ đình, gần sân vận động mỹ đình. <br>2. Thiết kế 03 loại diện tích: 27m2, 40m2, 45m2 với phong cách hiện đại, tiện dụng. <br>+ Loại 1 phòng ngủ và 1 phòng khách: DT40m2 - 45M2, gồm 2 Điều hòa 02 chiều, giường, tủ quần áo, kệ bếp... <br>- Phòng khách được thiết kế đẹp có thể làm phòng ngủ nếu nhà đông người. <br>+ Loại 1 phòng đơn khép kín DT 27M2 Điều hòa 02 chiều, giường, tủ quần áo, kệ bếp... <br>- Khu bếp riêng biệt, có tủ bếp trên và dưới, hút mùi, chậu rửa bát hiện đại nấu nướng không sợ mùi vào phòng ngủ và khách. <br>- WC khép kín hiện đại, bình nóng lạnh, thiết bị vệ sinh Inax. <br>- Tòa nhà được lắp camera an ninh, đảm bảo, bảo vệ 24/24h. <br>- Gửi xe miễn phí, tối đa mỗi phòng 2 xe máy, internet cáp quang, camera các tầng, có thang máy tốc độ cao... <br>- Căn hộ có cửa sổ thoáng mát, chỉ việc xách va li đến ở. <br>3. Giá cả: <br>- Giá phòng từ : 4.000.000 đ - 4.500.000 -5.000.000 đ /tháng. <br>- Rất Phù hợp với người đi làm, hộ gia đình trẻ, công tác, du lịch, học tập,... <br>Hãy tiết kiệm thời gian quý báu của chính các bạn bằng cách nhấc máy lên và gọi ngay tôi. <br>Địa chỉ: Số 4 nghách 322/76 đường Mỹ Đình, phường Mỹ Đình 2- Quận nam từ liêm.. <br>Liên hệ chính chủ: 0902109798 - 0981056756</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJUaGFuZyBtXHUwMGUxeSIsIjMiOiJJbnRlcm5ldCIsIjQiOiJcdTAxMTBpXHUxZWMxdSBoXHUwMGYyYSIsIjUiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCIsIjYiOiJNXHUwMGUxeSBnaVx1MWViN3QifQ==', 1, 0, '{\"0\":\"21.0229644\",\"1\":\"105.77238620000003\"}', 1, 0, '2019-05-14 18:46:55', '2019-05-14 18:46:55');
INSERT INTO `motelrooms` VALUES (84, 'Cho thuê phòng khép kín ở đường Quang Trung-Hà Đông-Hà Nội, diện tích 23m2', 'cho-thue-phong-khep-kin-o-duong-quang-trung-ha-dong-ha-noi-dien-tich-23m2', 2200000, 23.0000, 1, 21, 73, 'quang trung, hà đông hà nội, Quang Trung, Hà Đông, Hà Nội', '0902166024', 2, 'Khép kín', '{\"0\":\"cho-thue-phong-khep-kin-o-duong-quang-trung-ha-dong-ha-noi-dien-tich-23m2-resized-ij4pt.jpg\"}', '<div class=\"dis-content\">Nhà mới hoàn thiện sạch đẹp, gần bưu điện Hà Đông, tàu điện trên cao, bến xe bus, cách mặt đường Quang Trung 10m rất thuận tiện đi lại. Có 6 phòng cho thuê, nay còn 1 phòng tại tầng 2. Phòng có trang bị tiện nghi đầy đủ: công trình phụ khép kín,có điều hòa, cửa sổ rộng có rèm, chỗ phơi, nấu ăn, wifi cáp quang, truyền hình cáp, sân rộng để xe, nằm trong khu vực dân trí cao, yên tĩnh và an ninh tốt. Ai có nhu cầu liên hệ: Chị Hà 0902166024.<br><br><br></div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCIsIjMiOiJcdTAxMTBpXHUxZWMxdSBoXHUwMGYyYSIsIjQiOiJUcnV5XHUxZWMxbiBoXHUwMGVjbmggY1x1MDBlMXAifQ==', 1, 0, '{\"0\":\"20.9652675\",\"1\":\"105.7681278\"}', 1, 0, '2019-05-14 18:46:57', '2019-05-14 18:46:57');
INSERT INTO `motelrooms` VALUES (85, 'Cho thuê phòng trọ khép kín 500k/th', 'cho-thue-phong-tro-khep-kin-500kth', 500000, 12.0000, 1, 21, 69, '89 Huyền Kỳ, Tổ 8, Phú Lãm - Hà Đông , Hà Nội, Huyền Kỳ, Hà Đông, Hà Nội', '0965899449', 3, 'Khép kín', '{\"0\":\"cho-thue-phong-tro-khep-kin-500kth-o9iqw.jpg\"}', '<div class=\"dis-content\">Hiện mình có dãy phòng trọ cấp4 sạch sẽ thoáng mát muốn cho thuê .Phòng có nhà vệ sinh khép kín 500k/tháng diện<br>tích khoảng 10-15m2 tùy phòng.Nước 50/người/ tháng và internet 50k/người/tháng.Điện<br>3.5k/số.An ninh đảm bảo,không khí trong lành, yên tĩnh, sân vườn mát mẻ.Chỗ để<br>xe, sân phơi thoải mái,Giờ giấc không quy định, bạn bè người thân đến chơi thoải<br>mái. Mình ở gần cao đẳng kinh tế kỹ thuật thương mại : 89-Huyền kỳ-tổ 7- phú<br>lãm-hà đông-hà nội Liên hệ chính chủ : Tùng Anh:0965899449 Cô Yến :0363416034/0968560406</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCJ9', 1, 0, '{\"0\":\"20.9406454\",\"1\":\"105.75548149999997\"}', 1, 0, '2019-05-14 18:46:59', '2019-05-14 18:46:59');
