INSERT INTO `motelrooms` VALUES (96, 'Căn hộ CCMN 1 khách + 1 ngủ 45m2 full đồ sáng thoáng cực đẹp Xách vali đến ở luôn 90 Hoàng Như Tiếp', 'can-ho-ccmn-1-khach-1-ngu-45m2-full-do-sang-thoang-cuc-dep-xach-vali-den-o-luon-90-hoang-nhu-tiep', 5300000, 45.0000, 1, 8, 30, ' số 29 ngõ 90 phố Hoàng Như Tiếp, Q. Long Biên, Hoàng Như Tiếp, Long Biên, Hà Nội', '0904040387', 3, 'Khép kín', '{\"0\":\"can-ho-ccmn-1-khach-1-ngu-45m2-full-do-sang-thoang-cuc-dep-xach-vali-den-o-luon-90-hoang-nhu-tiep-cbg5h.jpg\",\"1\":\"can-ho-ccmn-1-khach-1-ngu-45m2-full-do-sang-thoang-cuc-dep-xach-vali-den-o-luon-90-hoang-nhu-tiep-tz87s.jpg\",\"2\":\"can-ho-ccmn-1-khach-1-ngu-45m2-full-do-sang-thoang-cuc-dep-xach-vali-den-o-luon-90-hoang-nhu-tiep-rjm5y.jpg\",\"3\":\"can-ho-ccmn-1-khach-1-ngu-45m2-full-do-sang-thoang-cuc-dep-xach-vali-den-o-luon-90-hoang-nhu-tiep-gjzvq.jpg\",\"4\":\"can-ho-ccmn-1-khach-1-ngu-45m2-full-do-sang-thoang-cuc-dep-xach-vali-den-o-luon-90-hoang-nhu-tiep-resized-bg4tg.jpg\",\"5\":\"can-ho-ccmn-1-khach-1-ngu-45m2-full-do-sang-thoang-cuc-dep-xach-vali-den-o-luon-90-hoang-nhu-tiep-resized-jbxhy.jpg\",\"6\":\"can-ho-ccmn-1-khach-1-ngu-45m2-full-do-sang-thoang-cuc-dep-xach-vali-den-o-luon-90-hoang-nhu-tiep-jiyzm.jpg\",\"7\":\"can-ho-ccmn-1-khach-1-ngu-45m2-full-do-sang-thoang-cuc-dep-xach-vali-den-o-luon-90-hoang-nhu-tiep-resized-j2nzv.jpg\",\"8\":\"can-ho-ccmn-1-khach-1-ngu-45m2-full-do-sang-thoang-cuc-dep-xach-vali-den-o-luon-90-hoang-nhu-tiep-resized-1lwiv.jpg\",\"9\":\"can-ho-ccmn-1-khach-1-ngu-45m2-full-do-sang-thoang-cuc-dep-xach-vali-den-o-luon-90-hoang-nhu-tiep-resized-7kfra.jpg\",\"10\":\"can-ho-ccmn-1-khach-1-ngu-45m2-full-do-sang-thoang-cuc-dep-xach-vali-den-o-luon-90-hoang-nhu-tiep-ifnv6.jpg\"}', '<div class=\"dis-content\">Hiện mình đang trống 1 phòng tầng 3 xây kiểu cho Tây thuê, cụ thể như sau:<br>Địa chỉ : Chung cư mini 7 tầng, số 29 ngõ 90 phố Hoàng Như Tiếp, Q. Long Biên<br>Đã có sẵn : Điều hòa hai chiều, Bình nóng lạnh, Tủ lạnh 90l, Tủ quần áo 2 buồng, Quạt, đồ bếp cơ bản, Bàn bếp chạn kệ tủ bếp, Ban công, Giường 1m6x2m + chăn ga gối đệm. Wifi full 7 tầng mỗi tầng 1 modem riêng, máy giặt free tầng 1.<br>Cách phố cổ 2,5km, cách Big C, Aeon 3km, thuộc khu vực phát triển nhất quận Long Biên, gần bệnh viện trường học bến xe trạm xe bus, chợ dân sinh ... (đi qua cầu Chương Dương 1km rẽ phải là đến), cách Bệnh viện Tâm Anh 3 phút đi bộ, là khu vực trung tâm phát triển nhất quận Long Biên.<br>Diện tích đất nền nhà mình là 60m2, diện tích sử dụng thực 45m2, 15m2 còn lại là cầu thang + 2 giếng trời (nên nhà rất thoáng và ánh sáng tốt). Các bạn ở đây không ai quản giờ giấc sinh hoạt của các bạn, không giới hạn giờ đi lại, nhưng xin phiền nếu buổi đêm về muộn thì nhẹ nhàng tránh ảnh hưởng đến các tầng khác.<br>Phòng trống là phòng tầng 3. Tầng 1 để xe máy. Tầng 3 thấp nên chỉ hơn tầng 2 nhà khác một chút thôi,<br>Điện 3.400đ/số, nước 28.000đ/khối. Không phát sinh chi phí nào khác ngoài điện nước.<br>Giá đúng 5.3 triệu/ tháng (hợp đồng 6 tháng, đóng tiền tháng 1, cọc 1 tháng ) <br>Có thể cho người nước ngoài thuê, giá 260 usd/ tháng.<br>Không nhận khách ồn ào hoặc nuôi chó nhé ạ.<br>Liên hệ chủ nhà 0904040387 Hằng zalo imes facebook đều được nhé.</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCIsIjMiOiJcdTAxMTBpXHUxZWMxdSBoXHUwMGYyYSIsIjQiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCIsIjUiOiJNXHUwMGUxeSBnaVx1MWViN3QifQ==', 1, 0, '{\"0\":\"21.042289834796225\",\"1\":\"105.87543173226322\"}', 1, 0, '2019-05-14 18:47:30', '2019-05-14 18:47:30');
INSERT INTO `motelrooms` VALUES (97, 'Cho thuê phòng trọ tại số 3 ngõ An Sơn, Đại La, Hai Bà Trưng, HN (phòng 25m2, giá 2 triệu) ', 'cho-thue-phong-tro-tai-so-3-ngo-an-son-dai-la-hai-ba-trung-hn-phong-25m2-gia-2-trieu', 2000000, 25.0000, 1, 45, 82, 'Số 3 ngõ An Sơn, Đại La, Hai Bà Trưng, Hà Nội', '0969726100', 4, 'Chung', '{\"0\":\"cho-thue-phong-tro-tai-so-3-ngo-an-son-dai-la-hai-ba-trung-hn-phong-25m2-gia-2-trieu-1539507165yzd6l-resized-0gcrt.jpg\",\"1\":\"cho-thue-phong-tro-tai-so-3-ngo-an-son-dai-la-hai-ba-trung-hn-phong-25m2-gia-2-trieu-1539507165yzd6l-resized-opyoc.jpg\"}', '<div class=\"dis-content\">Tôicó phòng trọ diện tích 25m2 nằm trong nhà 3 tầng tại số 03 ngõ An Sơn, Đại La,<br>Hai Bà Trưng, Hà Nội. Vệ sinh khép kín, điện và nước dùng theo giá sinh hoạt<br>bình thường. Nhà ở khu an ninh tốt, dân trí cao, gần các trường ĐH Bách khoa,<br>Xây dựng, Kinh tế, Y; gần các trường mẫu giáo, mầm non, cấp 1,2,3; gần Bệnh viện<br>Bạch Mai, ĐH Y, Bưu Điện; gần chợ Mơ, chợ Đồng Tâm, chợ Bách Khoa.<br>Nhàthoáng mát sạch sẽ. Đầy đủ tiện nghi, khách thuê chỉ việc đến ở. Hợp đồng dài hạn.<br>Giá:2 triệu/tháng <br>Liênhệ: O969.726.100 (Thế Anh)<br>(Tag:Cho thuê phòng trọ, thuê nhà Đại La, thuê nhà Hai Bà Trưng, thuê nhà Đại học<br>Xây Dựng, thuê nhà Đại học Bách Khoa, thuê nhà Đại học Kinh tế, thuê nhà Trường<br>Chinh, thuê nhà Bách Khoa, thuê nhà Lê Thanh Nghị, thuê nhà Trần Đại Nghĩa,<br>thuê nhà Giải Phóng, thuê nhà Trương Định, thuê nhà Minh Khai, thuê nhà Bạch<br>Mai, thuê nhà chợ Mơ, thuê nhà Thanh Nhàn, thuê nhà Mai Động)</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIn0=', 1, 0, '{\"0\":\"20.9945767\",\"1\":\"105.84334009999998\"}', 1, 0, '2019-05-14 18:47:36', '2019-05-14 18:47:36');
INSERT INTO `motelrooms` VALUES (98, 'Tìm nữ ở ghép ngõ 199 Hồ Tùng Mậu đi ra được ngõ 126 nguyễn đổng chi', 'tim-nu-o-ghep-ngo-199-ho-tung-mau-di-ra-duoc-ngo-126-nguyen-dong-chi', 750000, 16.0000, 1, 10, 61, 'Nhà số 1 ngách 199/59 hồ tùng mậu. cầu diễn, hà nội, Cầu Diễn, Từ Liêm, Hà Nội', '0985106559', 1, 'Khép kín', '{\"0\":\"tim-nu-o-ghep-ngo-199-ho-tung-mau-di-ra-duoc-ngo-126-nguyen-dong-chi-resized-o5zmb.jpg\"}', '<div class=\"dis-content\">Mình tìm nữ ở ghép tầm 92 ,93 càng tốt. Yêu cầu : Ngoan, sống vui vẻ và sạch (bẩn thì không ở được đâu ạ hihi), phòng tầng 3 thoáng vô cùng, gần chợ, khu vực ở giữa siêu thị Thành Đô và vinhomes mới xây. Đi lại tự do không chung chủ nên rất thoải mái, phòng mình có gác xép nên ai ở được gác xép càng tốt mua 2 cái chiếu dải ra thì bơi luôn :))) vì là nền bê tông . Điện 4k, nước 10k/khối. Tính mình thoải mái lắm nên tìm ai không tính toán nhé. Cảm ơn mọi người đã đọc tin ạ.  </div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IkludGVybmV0In0=', 1, 0, '{\"0\":\"21.036582\",\"1\":\"105.77850590000003\"}', 1, 0, '2019-05-14 18:47:38', '2019-05-14 18:47:38');
INSERT INTO `motelrooms` VALUES (99, 'Cho thuê phòng trọ giá cực rẻ giá 800k/tháng', 'cho-thue-phong-tro-gia-cuc-re-gia-800kthang', 800000, 15.0000, 1, 10, 85, 'SN 11 ngõ 64 đường Cầu Diễn – Phúc Diễn - Bắc Từ Liêm – Hà Nội, Quốc lộ 32, Từ Liêm, Hà Nội', '0386542006', 2, 'Chung', '{\"0\":\"cho-thue-phong-tro-gia-cuc-re-gia-800kthang-quv9m.jpg\"}', '<div class=\"dis-content\">Cho thuê phòng trọ không khép kínsạch sẽ, gió cực mát, an ninh tốt, có bếp nấu ăn riêng, phòng đẹp, sàn lát gạch<br>hoa, có giường, có chỗ để xe, phơi đồ.<br>- Gần bến xe bus 20, 29, 32, 57.<br>- Gần chợ <br>- Gần uỷ ban phường Phúc Diễn<br>- Gần hầm đi bộ<br>Diện tích: 15m2 (không khép kín)<br>Giá thuê:  800k/tháng (không khép kín)<br>Điện: 4000/số , Nước:70000/người.<br>Địa chỉ: SN 11 ngõ 64 đường CầuDiễn – Phúc Diễn - Bắc Từ Liêm – Hà Nội<br><em>Sơ đồ đường đi: Đi qua cầu Diễn, qua đường tàu, đi tiếp qua trường Caođẳng in, qua 1 bến xe bus đi tiếp thấy hầm đi bộ (ngõ 64 ngay cạnh hầm đi bộ),<br>vào ngõ tìm số nhà 11</em><br>Liên hệ: Chị Thủy   038.654.2006      -    038.999.2002  </div>', 'eyIwIjoiSW50ZXJuZXQifQ==', 1, 0, '{\"0\":\"21.0460842\",\"1\":\"105.75043660000006\"}', 1, 0, '2019-05-14 18:47:41', '2019-05-14 18:47:41');
