INSERT INTO `motelrooms` VALUES (106, 'Cho thuê Phòng ở Đại La, gần Bách-Kinh-Xây', 'cho-thue-phong-o-dai-la-gan-bach-kinh-xay', 2000000, 25.0000, 1, 45, 82, 'Số 112, ngõ Thống Nhất, Phố Đại La, Phường Trương Định, Hai Bà Trưng, Hà Nội, Đại La, Hai Bà Trưng, Hà Nội', '0975069980', 5, 'Chung', '{\"0\":\"cho-thue-phong-o-dai-la-gan-bach-kinh-xay-vkkct.jpg\",\"1\":\"cho-thue-phong-o-dai-la-gan-bach-kinh-xay-ymceq.jpg\",\"2\":\"cho-thue-phong-o-dai-la-gan-bach-kinh-xay-wh4mh.jpg\",\"3\":\"cho-thue-phong-o-dai-la-gan-bach-kinh-xay-6dy4s.jpg\",\"4\":\"cho-thue-phong-o-dai-la-gan-bach-kinh-xay-cnjtm.jpg\"}', '<div class=\"dis-content\">Cho thuê Phòng ở Đại La<br>Do tớ đã học xong nên muốn nhượng lại phòng vào giữa tháng 6 này, có thể chuyển đến trước mấy ngày. <br>- Phòng rộng khoảng 25m2, có thể ở 3-4 người hoặc hơn tùy thích<br>- Giá phòng 2 triệu/tháng, đóng 1 tháng 1, không cần đặt cọc, điện 3,5k/số, nước 90k/người/tháng<br>- Có ban công sạch sẽ, view đẹp, buổi sáng và buổi tối rất mát<br>- Có chỗ nấu ăn riêng bên ngoài<br>- Có sẵn tấm phản rộng , chỉ cần trải chiếu hoặc kê đệm nằm<br>- Có tủ để quần áo như hình<br>- Có 2 bàn học và 1 ghế<br>- Phòng ở tầng 4 trong nhà 5 tầng<br>- Phơi quần áo ở tầng 5 thoáng mát thoải mái<br>- Chung chủ nhưng chủ chỉ ở tầng 1 và tầng 2 rất ít liên quan<br>- Để đc xe đạp ở tầng 1, xe máy gửi tại trường Xây Dựng hoặc Kinh Tế ngay gần ngõ<br>Địa chỉ: số 112, ngõ Thống Nhất, Đại La. Gần ngã tư Trần Đại Nghĩa-Đại La (gần quán phở Mẹ Việt). Đi bộ đến Kinh tế chưa đến 10p, phù hợp cho những bạn học Bách-Kinh-Xây, hàng xóm phòng bên cạnh và tầng dưới đều thân thiện, vui tính và đều học 3 trường này. <br>Liên hệ: Hoa: 0975069980 hoặc em gái Hoa: 0983118367</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCJ9', 1, 0, '{\"0\":\"20.9961042\",\"1\":\"105.84608550000007\"}', 1, 0, '2019-05-14 18:47:59', '2019-05-14 18:47:59');
INSERT INTO `motelrooms` VALUES (107, 'Cho thuê phòng trọ Ngõ 197, Hoàng Mai.', 'cho-thue-phong-tro-ngo-197-hoang-mai', 1500000, 15.0000, 1, 57, 90, 'ngÕ 197 hoàng mai, Cầu Thanh Trì, Hoàng Mai, Hà Nội', '0977953129', 3, 'Khép kín', '{\"0\":\"cho-thue-phong-tro-ngo-197-hoang-mai-097z5.jpg\"}', '<div class=\"dis-content\">CÒN 2 PHÒNG CHO THUÊ HOÀNG MAI<br>ĐỊA CHỈ :  Ngõ 197 Hoàng Mai.<br>Gần các trường đại học : ĐH Kinh Tế - Kỹ thuật Công nghiệp, Cầu MAI ĐỘNG ,ĐH Kinh Doanh Công Nghệ, Bách Khoa Hà Nội, ĐH Xây Dựng, Kinh Tế Quốc Dân, Đh Mở Hà Nội, ...<br>Phòng<br>Diện Tích : 15m2 - 20m2,khép kín 1 nhà vệ sinh<br>Nội Thất : Gác xép, giường, kệ bếp bếp , <br>Giá Thuê phòng: 1,5 - 1,8 tr/tháng ( tùy só người ở)<br>Phòng phù hợp cho 1,2 người, sạch sẽ, thoáng mát<br>LH :CHỊ THỦY:0977953129</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IkludGVybmV0IiwiMiI6Ilx1MDExMGlcdTFlYzF1IGhcdTAwZjJhIiwiMyI6IkJcdTAwZWNuaCBuXHUwMGYzbmcgbFx1MWVhMW5oIiwiNCI6IlRydXlcdTFlYzFuIGhcdTAwZWNuaCBjXHUwMGUxcCJ9', 1, 0, '{\"0\":\"20.9934418\",\"1\":\"105.90157640000007\"}', 1, 0, '2019-05-14 18:48:02', '2019-05-14 18:48:02');
