INSERT INTO `motelrooms` VALUES (109, 'Cho thuê phòng trọ ngõ 124 Minh Khai ', 'cho-thue-phong-tro-ngo-124-minh-khai', 2200000, 24.0000, 1, 45, 46, 'Số nhà 45 Ngõ 124 Minh Khai, Minh Khai, Hai Bà Trưng, Hà Nội', '01692833151', 3, 'Chưa xác định', '{\"0\":\"no_img_room.png\"}', '<div class=\"dis-content\">Hiện tại do nhu cầu công việc, mình cần chuyển nhượng lại phòng trọ tại tầng 1 số nhà 45 ngõ 124 Minh Khai (ngõ Lilama), quận Hai Bà Trưng. <br>Nhà trước xây là để ở nên tầng 1 nguyên bản gồm 1 phòng khách (giờ thành chỗ để xe rộng rãi miễn phí) +1  phòng bếp với đầy đủ tủ bếp, chậu rửa bát + nóng lạnh cho chậu rửa + 1 nhà vệ sinh nhỏ . Mình hiện tại ở tầng 1 tức nhà bếp cũ, diện tích rộng rãi, ở được 3 người, có tủ bếp, hút mùi, rất rộng và để được nhiều đồ, 1 giường ngủ, bàn kính, và nhiều đồ dùng khác (y như gia đình ở). Nhà  4 tầng hiện tại đều cho sinh viên thuê, tầng 4 là nơi phơi đồ, giờ giấc thoải mái, ko chung chủ. Gần các trường đại học ( kinh tế quốc dân, kinh tế kỹ thuật công ngh, kinh doanh công nghệ, xây dựng, bách khoa), gần các chợ (chợ Mơ, chợ gốc đề..), không gian yên tính do khu này toàn các bác hưu trí ở, bên ngoài là chung cư và công ty lylama có 2 chốt bảo vệ 24/24 nên an ninh cực tốt), ATM ngày ở đầu ngõ.<br>Giá :2,200,000 đ/ tháng, đóng 3 tháng 1 lần<br>đặt cọc 1 tháng,<br>Bạn nào quan tâm xin liên lạc mình theo số đt 01692,833,151. Mình tên Hiếu. Xin cảm ơn!<br></div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCIsIjMiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCJ9', 1, 0, '{\"0\":\"20.993098\",\"1\":\"105.86105299999997\"}', 1, 0, '2019-05-14 18:48:06', '2019-05-14 18:48:06');
INSERT INTO `motelrooms` VALUES (110, 'Chính chủ cho thuê phòng 20m2, có đủ máy điều hòa, nóng lạnh.', 'chinh-chu-cho-thue-phong-20m2-co-du-may-dieu-hoa-nong-lanh', 2000000, 20.0000, 1, 57, 3, 'nhà 30B, ngõ 192 Kim Giang, Phường Đại Kim, Quận Hoàng Mai, Hà Nội., Kim Giang, Hoàng Mai, Hà Nội', '0986903600', 2, 'Chung', '{\"0\":\"no_img_room.png\"}', '<div class=\"dis-content\">Chính chủ cho thuê phòng 20m2, có đủ máy điều hòa, nóng lạnh.<br>Địa chỉ: nhà 30B, ngõ 192 Kim Giang, Phường Đại Kim, Quận Hoàng Mai, Hà Nội.<br>Đi đường Kim Giang, Định Công hoặc Vành đai III Khuất Duy Tiến đều tiện, cách trường Đại học Thăng Long 200m.<br><br>Vị trí thuận lợi:<br>+ Gần trường học: Khoa học TN, Nhân Văn, Thăng Long, cách trường Kinh Tế, Bách Khoa 2 km.<br>+ Mua sắm dễ dàng: Chỉ mất vài phút đi bộ là đến chợ, cửa hàng tiện dụng Vinmart, gần Tmart...<br><br>Các vật dụng đã trang bị:<br>✓ Điều hòa nhiệt độ vừa mới vệ sinh, bảo trì<br>✓ Máy nóng lạnh: mỗi tầng 2 phòng chung toilet &amp; có máy nóng lạnh<br>✓ Phòng có 2 cửa: 1 thông ra hành lang chung, 1 ra ban công<br>✓ 1 tủ quần áo gỗ cỡ lớn<br>✓ Nơi để xe chung ở tầng 1, có cổng khóa. Mỗi phòng được để miễn phí tối đa tới 2 xe máy<br>✓ Vừa tiến hành sửa chữa, bảo trì nên diện mạo căn phòng đẹp đẽ, sạch sẽ<br><br>Điện nước tự trả theo giá nhà nước.<br><br>Giá phòng: 2 triệu/tháng<br><br>Liên hệ chính chủ để xem phòng<br>Anh Sơn: 0986 903 600 </div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJcdTAxMTBpXHUxZWMxdSBoXHUwMGYyYSIsIjMiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCJ9', 1, 0, '{\"0\":\"20.97773234765747\",\"1\":\"105.81611024050596\"}', 1, 0, '2019-05-14 18:48:07', '2019-05-14 18:48:07');
INSERT INTO `motelrooms` VALUES (111, 'Chính chủ cho thuê CCMN mới hoàn thiện ở Trung Văn', 'chinh-chu-cho-thue-ccmn-moi-hoan-thien-o-trung-van', 4000000, 45.0000, 1, 10, 92, '277 Ngõ 275 Trung Văn, Nam Từ Liêm, Hà Nội, Trung Văn, Từ Liêm, Hà Nội', '0981056756', 4, 'Khép kín', '{\"0\":\"no_img_room.png\"}', '<div class=\"dis-content\">CHÍNH CHỦ CHO THUÊ CHUNG CƯ MINI MỚI HOÀN THIỆN VÀO Ở LUÔN, ĐƯỜNG TRUNG VĂN Giá chỉ còn: 4 triệu / tháng - 40M2.* Vị trí tiện ích: Tòa chung cư mini 8 tầng nằm trên đường TRUNG VĂN, cuối đường Lương Thế Vinh, gần nhà thờ Phùng Khoang, gần trường cao đẳng Xây Dựng.<br>- Nằm Cách mặt đường ( ĐƯỜNG TỐ HỮU) 100m, 3 phút ra bigc thăng long, ngã tư trần duy hưng, đường phạm hùng, ngã tư khuất duy tiến...<br>- Chỉ 3 phút để tiếp cận hệ thống ngân hàng, siêu thị, trung tâm thương mại, trường học Quốc tế từ mầm non đến trung học, đại học ...<br>-Các căn hộ được thiết kế thông minh, tiện lợi, đầy đủ tiện ích đi kèm, gồm tầng 1 với DT250M2 để xe rộng rãi. giao thông đi lại thuận tiện và 7 tầng trên với các căn hộ chung cư mini cho thuê.<br>* Thiết kế 02 loại diện tích: 35m2, 45m2 với phong cách hiện đại, tiện dụng.<br>- 1 Phòng ngủ riêng biệt : điều hòa 02 chiều, giường, tủ quần áo... <br>- Phòng khách được thiết kế đẹp có thể làm phòng ngủ nếu nhà đông người. <br>- Khu bếp riêng biệt,có tủ bếp trên và dưới, chậu rửa bát hiện đại nấu nướng không sợ mùi vào phòng ngủ và khách. <br>- WC khép kín hiện đại, bình nóng lạnh,thiết bị vệ sinh Inax.<br> - Tòa nhà được lắp camera an ninh, đảm bảo, giờ giấc 24/24h, thoải mái đi lại. - Gửi xe miễn phí, tối đa mỗi phòng 2 xe máy,truyền hình cáp, internet cáp quang, camera các tầng, có thang máy tốc độ cao... <br>- Căn hộ có cửa sổ thoáng mát , chỉ việc xách va li đến ở.3. <br>* Giá cả: - Giá phòng: 4.000.000 đ - 4.500.000 đ /tháng. <br>-DT TỪ 35- 45M2. -Rất Phù hợp với người đi làm,hộ gia đình trẻ,công tác, du lịch, học tập...v.v.. Hãy tiết kiệm thời gian quý báu của chính các bạn bằng cách nhấc máy lên và gọi ngay cho chúng tôi để được tư vấn. <br>Địa chỉ: số nhà 277 ngõ 275 đường Trung Văn- phường Trung văn- nam từ liêm<br></div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJUaGFuZyBtXHUwMGUxeSIsIjMiOiJJbnRlcm5ldCIsIjQiOiJcdTAxMTBpXHUxZWMxdSBoXHUwMGYyYSIsIjUiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCJ9', 1, 0, '{\"0\":\"20.989116\",\"1\":\"105.78626320000001\"}', 1, 0, '2019-05-14 18:48:09', '2019-05-14 18:48:09');
INSERT INTO `motelrooms` VALUES (112, 'Cho thuê chung cư mini mới 100% tại Linh Đàm', 'cho-thue-chung-cu-mini-moi-100-tai-linh-dam', 2500000, 23.0000, 1, 57, 93, 'Số 15, ngõ 123/81, Bằng A, Hoàng Mai, Hà Nội', '0961519964', 4, 'Khép kín', '{\"0\":\"no_img_room.png\"}', '<div class=\"dis-content\">Cho thuê chung cư mini, phòng trọ khu vực Linh Đàm, Hoàng Liệt Phòng cho thuê mới tinh khép kín có gác xép giá 3tr ở Linh Đàm gần khu HH, Rice city-  Phòng đẹp tiện nghi 25 - 30 m2 có ban công của sổ thoáng mát.- Giá 2.5 -  3 triệu | cọc 1 tháng tiền| chi tiết liên hệ 0961519964 - cô Thủy- Vị trí nằm ven khu đô thị Linh Đàm, gần siêu thị, rạp chiếu phim khu vui chơi ăn uống. Cách trường tiểu học Chu Văn An 200m, cách chợ 50m, bãi gửi xe oto cách 30m. Khu an ninh dân trí cao, yên tĩnh thoáng mát, thích cho các bạn đi lại làm việc. - Điện nước tính theo giá nhà nước. - Wifi tốc độ cao trọn gói trong giá dịch vụ- Không chung chủ, có bảo vệ bảo đảm an ninh tuyệt đối-  Nhà để xe 2 tầng trong nhà, an toàn có camera an ninh giám sát 24/7- Địa chỉ ngõ 123/81 Bằng Liệt ( gần chợ Bằng A)- Xem phòng cả ngày luôn khi đi các bác gọi trước không phải đợi nhé.- Nhanh chân đến xem để đặt phòng đẹp, chìa khóa trao tay luôn. Cảm ơn các bạn đọc tin! Hẹn gặp lại các bạn.Nội thất:- Quạt trần- Bàn bếp- Nóng lạnh- Điều hòa ( Nếu khách có nhu cầu ). Số điện thoại liên hệ: Cô Thủy 0961519964</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJUaGFuZyBtXHUwMGUxeSIsIjMiOiJJbnRlcm5ldCIsIjQiOiJcdTAxMTBpXHUxZWMxdSBoXHUwMGYyYSIsIjUiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCIsIjYiOiJUcnV5XHUxZWMxbiBoXHUwMGVjbmggY1x1MDBlMXAiLCI3IjoiVGl2aSJ9', 1, 0, '{\"0\":\"20.960703213266726\",\"1\":\"105.82163364491385\"}', 1, 0, '2019-05-14 18:48:12', '2019-05-14 18:48:12');
