INSERT INTO `motelrooms` VALUES (120, 'cho thuê nhà tại bạch mai - hà nội', 'cho-thue-nha-tai-bach-mai-ha-noi', 2500000, 25.0000, 1, 45, 97, '14/45 giếng mứt, bạch mai, hà nội, Bạch Mai, Hai Bà Trưng, Hà Nội', '0933599991', 3, 'Khép kín', '{\"0\":\"no_img_room.png\"}', '<div class=\"dis-content\">Cho thuê nhà trong ngõ Giếng Mứt – phố Bạch Mai.<br>Diện tích 25m2. nhà sạch đẹp, an ninh tốt, cho thuê lâu dài, điện nước thanh toán theo hóa đơn, khu dân trí cao, ưu tiên hộ gia đình, hoặc nhóm sinh viên nữ, có kệ bếp nấu<br>ăn,vòi tắm hoa sen, vệ sinh khép kín, chỗ phơi đồ đầy đủ.Gần TTTM Chợ Mơ, trường ĐH Bách Khoa, Xây Dựng, Kinh Tế ... <br>Hàng xóm vui vẻ hòa đồng - chủ nhà dễ tính thân thiện<br> Giá từ 2.300.000 đến 2.500.000/ tháng.<br> LH: Cô Trường, 14/45 ngõ Giếng Mứt - Bạch Mai - Hai Bà Trưng - Hà Nội<br> Tel. 0945110330, 0945110320.</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCJ9', 1, 0, '{\"0\":\"20.9978197\",\"1\":\"105.85015720000001\"}', 1, 0, '2019-05-14 18:48:30', '2019-05-14 18:48:30');
INSERT INTO `motelrooms` VALUES (121, 'CHÍNH CHỦ CHO THUÊ PHÒNG KHÉP KÍN CÓ ĐIỀU HÒA GIÁ 2.8TR MẶT PHỐ DOÃN KẾ THIỆN.', 'chinh-chu-cho-thue-phong-khep-kin-co-dieu-hoa-gia-28tr-mat-pho-doan-ke-thien', 2800000, 22.0000, 1, 16, 23, 'Nhà 32/C1 đường Doãn Kế Thiện kéo dài - Mai Dịch - Cầu Giấy., Mai Dịch, Cầu Giấy, Hà Nội', '0976173640', 3, 'Khép kín', '{\"0\":\"no_img_room.png\"}', '<div class=\"dis-content\">Cho thuê phòng DT20 m2 ngay mặt đường Doãn Kế Thiện kéo dài, gần khu quân đội mai dịch, gần trường sân khấu điện ảnh, đối diện cổng chợ đồng xa.Hai cửa sổ thoáng mát, có truyền hình cáp, internet.<br>Vệ sinh khép kín, phòng riêng biệt, có điều hòa, nóng lạnh, sàn nhà ốp lát sạch sẽ,<br>Trang thiết bị vệ sinh cao cấp, sạch sẽ, khép kín ở trong phòng, giờ giấc đi về tự do, vì không ở cùng chủ.<br>Giao thông đi lại thuận lợi cho người đi làm hoặc sinh viên thuê.<br>Giá thuê 2.800.000 - 3.000.000 Đ/ tháng.<br>ĐC: Nhà 32/C1 đường Doãn Kế Thiện kéo dài - Mai Dịch - Cầu Giấy.<br>LH:Liên hệ chị Hương 0976 173 640 / 0902 212 798 / 0981 056 756<br>gọi trước khi qua.</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCIsIjMiOiJcdTAxMTBpXHUxZWMxdSBoXHUwMGYyYSIsIjQiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCJ9', 1, 0, '{\"0\":\"21.042452265091235\",\"1\":\"105.77422012908323\"}', 1, 0, '2019-05-14 18:48:31', '2019-05-14 18:48:31');
INSERT INTO `motelrooms` VALUES (122, 'Cho thuê nhà ở khép kín', 'cho-thue-nha-o-khep-kin', 3000000, 45.0000, 1, 10, 92, 'số 55 ngõ 30 đường Phùng Khoang Quận Nam Từ Liêm, Trung Văn, Từ Liêm, Hà Nội', '0967781573', 3, 'Khép kín', '{\"0\":\"no_img_room.png\"}', '<div class=\"dis-content\">Cho thuê nhà ở tại số 55 ngõ 30 đường Phùng Khoang, Quận Nam Từ Liêm, Hà nội<br>✽ 40m2 giá 3 triệu đồng/tháng<br>► Điện, nước đầy đủ, giá cả nhà nước.<br>► Có bình tắm nóng lạnh.<br>► Nhà có chỗ để xe rộng rãi (cả tầng 1) an toàn.<br>► Bảo vệ, Camera an ninh 24/24 <br>► Wifi, Internet ADSL, Truyền hình cáp đầy đủ.<br>► Không ở chung với chủ nhà<br>► Nhà nằm gần trường học, bệnh viện và chợ Phùng Khoang <br>► Rất thuận tiện đi lại. <br>► Điện thoại liên hệ: 0967781573 ( Chú Sâm)<br>► Địa chỉ : Số 55 Ngõ 30 Đuờng Phùng Khoang <br>(cách nhà hàng Chiến béo 2 nhà, cổng màu xanh lá cây đậm).<br>► Cam kết tôi là chính chủ, không qua môi giới </div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCIsIjMiOiJcdTAxMTBpXHUxZWMxdSBoXHUwMGYyYSIsIjQiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCIsIjUiOiJUcnV5XHUxZWMxbiBoXHUwMGVjbmggY1x1MDBlMXAifQ==', 1, 0, '{\"0\":\"20.989171\",\"1\":\"105.78353479999998\"}', 1, 0, '2019-05-14 18:48:35', '2019-05-14 18:48:35');
INSERT INTO `motelrooms` VALUES (124, 'CHO THUÊ CHUNG CƯ MINI 2 PHÒNG NGỦ DT45M2 CÓ GIƯỜNG TỦ MẶT PHỐ NGUYỄN ĐỔNG CHI– GIÁ 4,5TR', 'cho-thue-chung-cu-mini-2-phong-ngu-dt45m2-co-giuong-tu-mat-pho-nguyen-dong-chi-gia-45tr', 4500000, 45.0000, 1, 10, 12, '118 Nguyễn Đổng Chi, Mỹ Đình, Hà Nội, Mỹ Đình, Từ Liêm, Hà Nội', '0981056756', 3, 'Khép kín', '{\"0\":\"no_img_room.png\"}', '<div class=\"dis-content\">1-Chung cư mini 7 tầng có nhiều loại phòng cho thuê tại số 118 Đường Nguyễn Đổng Chi- Phường Mỹ Đình 2+Có 1 phòng ngủ + 1 phòng khách+bếp. DT 30m2,giá 3.500.000 đ/tháng.<br>+ Có 2 phòng ngủ + 1 phòng khách +bếp DT 50M2 GIÁ 4.500.000 đ/ tháng.<br>- Nội thất: Có nóng lạnh,giường, tủ, kệ bếp, chậu rửa, thiết bị vệ sinh hiện đại, các phòng đều thiết kế có cửa sổ thông thoáng.<br>Tòa nhà có thang máy, bảo vệ 24/24, an ninh đảm bảo, điện nước ổn định.<br>- Vị trí: Nhà mặt đường NGUYỄN ĐỔNG CHI nằm ở khu vực đông dân cư, dân trí cao, gần chợ, trường FPT, dân lập Lê Quý Đôn, mầm non Hoa Anh Đào, sát đô thị Mỹ Đình …cách đường Hàm Nghi 300m.<br>Mặt đường trước cửa 5m, hai ô tô tránh nhau, phù hợp người đi làm, hộ gia đình trẻ có thêm ông bà hoặc giúp việc ở cùng.<br>- Giá cả linh hoạt, thanh toán tối thiểu 3 tháng + cọc 1 tháng.<br>- Địa chỉ: Số nhà 118 đường Nguyễn Đổng Chi - Quận Nam Từ Liêm (siêu thị thành đô rẽ vào hoặc đường Hàm Nghi đi vào). Hoặc gần khu đô thị Mỹ Đình 1 đi vào.<br><br>Liên hệ: chị Hương 0902 212 798 /0981 056 756/ 0976 173 640<br><br>2- Tòa nhà 8 tầng tại phố Doãn Kế Thiện mới hoàn thiện.<br>- Diện tích các phòng từ 38m2 - 40m2.<br>Giá cho thuê 5.000.000đ/tháng, các phòng bao gồm:<br>Phòng ngủ + phòng khách và khu bếp riêng biệt.<br>- Phòng ngủ được trang bị điều hòa 2 chiều, giường, tủ quần áo...<br>- Phòng khách cũng có thể làm phòng ngủ nếu nhà Đông người.<br>- Phòng bếp được trang bị bàn ăn, bàn bếp, tủ bếp, chậu rửa bát, hút mùi,...<br>- Khu vực nhà vệ sinh được lắp đầy đủ thiết bị hiện đại như chậu rửa mặt, bệt Inax, vòi sen, bình nóng lạnh,...<br>- Tòa nhà có bảo vệ 24/24, đảm bảo an ninh tuyệt đối, giờ giấc ra vào thoải mái.<br>- Khu vực ban công phơi đồ riêng biệt của từng phòng.<br>* Tòa nhà nằm ở vị trí trung tâm, giao thông thuận tiện, cách mặt đường Doãn Kế Thiện 20m, đối diện chợ Đồng Xa nên rất thuận tiện cho việc mua sắm, đi chợ, nằm trong khuôn viên tập quân đội nên an ninh rất tốt, gần các trung tâm thương mại, gần các trường ĐH như quốc gia, ngoại ngữ, gần bến xe Mỹ Đình,...<br><br>Địa chỉ: Số 32/C1 – Đường Doãn Kế Thiện - P Mai Dịch - Cầu Giấy.<br>LH C Hương 0981.056.756 / 0976 173 640 / 0902 212 798 <br><br>3/ Tòa nhà 9 tầng tại số nhà D2 ngõ 93 phố Cầu Giấy - P. Quan Hoa - Cầu Giấy, mới hoàn thiện vào ở luôn được.<br>- Nhà ngay phố Cầu Giấy, đường vào rộng, 2 ô tô con tránh nhau, rất thuận tiện cho việc đi lại, sinh hoạt, vui chơi, giải trí.<br>- Các phòng được thiết kế hết sức hợp lý:<br>+ Gồm 1 phòng ngủ hoặc 2 phòng ngủ + 1 phòng khách, đầy đủ ánh sáng, gió và không khí vào phòng. DT: 45m2-50m2.<br>- Mỗi phòng được trang bị 1 điều hòa 2 chiều, giường, tủ quần áo, cửa sổ có rèm cản nắng cực đẹp, trần thạch cao, bàn bếp, bồn rửa bát xịn.<br>- Nhà vệ sinh được lắp thiết bị vệ sinh Inax cao cấp, bình nóng lạnh Ariston, ốp lát gạch Prime sang trọng hiện đại.<br><br>Giá cho thuê: 6.000.000-6.500.000đ căn/tháng (thanh toán tối thiểu 03 tháng và đặt cọc 1 tháng). DT Các phòng từ 45-50m2.<br>- Tòa nhà trang bị thang máy cao cấp, máy giặt miễn phí, truyền hình cáp, internet tốc độ cao miễn phí, mỗi căn hộ được cấp thẻ từ thang máy riêng.<br>- Tòa nhà có bảo vệ 24/7 nên an ninh cực ổn, ra vào thoải mái, nhà để xe rộng rãi gần 200m2, có thể chứa được đến 100 chiếc xe máy.<br>- Vệ sinh dọn phòng hàng ngày nếu khách có nhu cầu.<br>* Thích hợp cho người nước ngoài, hộ gia đình và người đi làm thuê ở.<br>+ Địa chỉ: Tòa nhà D2 ngõ 93 phố Cầu Giấy, P. Quan Hoa, Q. Cầu Giấy (Cách Cầu Giấy 150m).<br>Liên hệ chủ nhà chị Huế  0981.056.756 / 0902 212 798 / 0976 173 640<br>Giá: 5 triệu / thángDiện tích: 50 m2</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJUaGFuZyBtXHUwMGUxeSIsIjMiOiJJbnRlcm5ldCIsIjQiOiJcdTAxMTBpXHUxZWMxdSBoXHUwMGYyYSIsIjUiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCIsIjYiOiJNXHUwMGUxeSBnaVx1MWViN3QifQ==', 1, 0, '{\"0\":\"21.036326\",\"1\":\"105.76398629999994\"}', 1, 0, '2019-05-14 18:48:37', '2019-05-14 18:48:37');
