INSERT INTO `motelrooms` VALUES (127, 'CHỖ Ở TIỆN NGHI CHỈ 1.2TR/ THÁNG KHÔNG MẤT GÌ HƠN', 'cho-o-tien-nghi-chi-12tr-thang-khong-mat-gi-hon', 1200000, 34.0000, 1, 6, 81, '123  ngõ 88 trần quý cáp, Trần Quý Cáp, Đống Đa, Hà Nội', '01677090266', 8, 'Khép kín', '{\"0\":\"no_img_room.png\"}', '<div class=\"dis-content\">CHỖ Ở TIỆN NGHI CHỈ 1.2TR/ THÁNG KHÔNG MẤT GÌ HƠN<br>Lekima House tại ngõ 98 Khâm Thiên, nhà mang phong cách dormstay, ở giường tầng, đầy đủ ga đệm, có phòng riêng cho nam và nữ.<br>Khuyến mãi nhân dịp khai trương, chỉ còn 1200k/tháng (giá gốc 1400k) cho một cuộc sống đầy đủ tiện nghi:<br>- Vị trí trung tâm tp di chuyển các nơi đều thuận tiện‎<br>- Phong cách sống tối giản đồ đạc của người Nhật và lối sống sử dụng các sản phẩm hữu cơ thân thiện với môi trường, hạn chế sử dụng túi nilon<br>- Có dịp nâng cao trình độ tiếng anh vì sinh hoạt cùng bạn bè quốc tế<br>- Không gian sống đầy đủ nội thất, phòng khách, bếp, phòng làm việc riêng, nóng lạnh, điều hòa, bồn tắm, giường, tủ, locker cá nhân, máy giặt, smart TV<br>- ‎Sân thượng thoáng mát view khắp tp, có thể cắm trại, trồng cây ngắm trăng sao..<br>- ‎Có nguyên tầng 5 chuyên dành để học tập và làm việc<br>- ‎Giá đã bao gồm tiền điện, nước, internet, nước uống.. Bạn chỉ việc xách vali vào ở mà không phải trả thêm bất cứ chi phí gì nữa<br>- Nhà quá đẹp, đồ đạc quá xịn, giá quá rẻ, đảm bảo đến xem nhà xong không muốn về =))<br>KHUYẾN MÃI SỐ LƯỢNG CÓ HẠN, CHỈ DÀNH CHO 10 KHÁCH ĐẦU TIÊN<br>Địa chỉ: LEKIMA HOUSE số 123 ngõ 88 Trần Quý Cáp, Phường Văn Chương, Đống Đa, Hà Nội (đi từ ngõ 98 Khâm Thiên thẳng vào không rẽ 200m bên tay phải, lối vào ngay số 82b tiệm làm tóc Nguyên Salon)<br>Liên hệ: <br>01688257253 (Ms. Trâm Anh)<br>01677090266 (Mr. Hoàn)<br>Fanpage: https://facebook.com/LekimaHouse/</div>', 'eyIwIjoiU1x1MDBlMm4gcGhcdTAxYTFpIiwiMSI6IkludGVybmV0IiwiMiI6Ilx1MDExMGlcdTFlYzF1IGhcdTAwZjJhIiwiMyI6IkJcdTAwZWNuaCBuXHUwMGYzbmcgbFx1MWVhMW5oIiwiNCI6Ik1cdTAwZTF5IGdpXHUxZWI3dCIsIjUiOiJUcnV5XHUxZWMxbiBoXHUwMGVjbmgg