INSERT INTO `motelrooms` VALUES (136, 'Tìm nữ ở ghép', 'tim-nu-o-ghep', 2200000, 18.0000, 1, 19, 98, 'Số 46, ngõ 376 Bưởi, Bưởi, Tây Hồ, Hà Nội', '0968852674', 2, 'Khép kín', '{\"0\":\"no_img_room.png\"}', '<div class=\"dis-content\">Mình cần tìm 1 bạn nữ ở ghép!<br>Hiện tại mình đã đi làm nhưng ở 1 mình nên cũng hơi buồn và tìm bạn ở cùng để chia sẻ chi phí!<br>Địa chỉ số 46, ngõ 376 Bưởi, Tây Hồ Hà nội. nhà ở mặt đường, có thể đi ô tô.<br>Nhà thoáng rộng, an ninh tốt, là nhà riêng nguyên căn nên điện nước giá dân, có nóng lạnh và điều hòa đầy đủ, sân phơi quần áo rộng thoáng<br>Giá 2,2tr/ 1 phòng<br>Liên hệ: 0968 8526 74</div>', 'eyIwIjoiU1x1MDBlMm4gcGhcdTAxYTFpIiwiMSI6IkludGVybmV0IiwiMiI6Ilx1MDExMGlcdTFlYzF1IGhcdTAwZjJhIiwiMyI6IkJcdTAwZWNuaCBuXHUwMGYzbmcgbFx1MWVhMW5oIiwiNCI6Ik1cdTAwZTF5IGdpXHUxZWI3dCJ9', 1, 0, '{\"0\":\"21.0556612\",\"1\":\"105.8099598\"}', 1, 0, '2019-05-14 18:49:18', '2019-05-14 18:49:18');
