INSERT INTO `motelrooms` VALUES (138, 'CHO THUÊ PHONG TRỌ MĂT ĐƯỜNG TRUNG VĂM', 'cho-thue-phong-tro-mat-duong-trung-vam', 4500000, 30.0000, 1, 10, 106, 'SỐ 277 NGÕ 275 ĐƯỜNG TRUNG VĂN ,NAM TỪ LIÊM ,HN, Vân Trì, Từ Liêm, Hà Nội', '0981056756', 5, 'Khép kín', '{\"0\":\"no_img_room.png\"}', '<div class=\"dis-content\">CHÍNH CHỦ CHO THUÊ CHUNG CƯ MINI MỚI HOÀN THIỆN ĐẦU THÁNG 4 VÀO Ở ĐƯỜNG TRUNG VĂNGiá chỉ còn: 4 triệu / tháng - 35m2 <br>             4,5 triệu / tháng - 45m2<br>1. Vị trí tiện ích: <br>Tòa chung cư mini 8 tầng nằm trên đường TRUNG VĂN CẮT ĐƯỜNG TỐ HỮU, được thiết kế thông minh, tiện lợi, đầy đủ tiện ích đi kèm, gồm tầng 1 với DT250M2 để xe rộng rãi. giao thông đi lại thuận tiện và 7 tầng trên với các căn hộ chung cư mini cho thuê. <br>- Nằm Cách mặt đường LÊ VĂN LƯƠNG KÉO DÀI( ĐƯỜNG TỐ HỮU) 100m, 3 phút ra bigc thăng long, ngã tư trần duy hưng, đường phạm hùng, ngã tư khuất duy tiến... <br>- Chỉ 3 phút để tiếp cận hệ thống ngân hàng, siêu thị, trung tâm thương mại, trường học Quốc tế từ mầm non đến trung học, đại học ... <br><br>2. Thiết kế 02 loại diện tích: 35m2, 45m2 với phong cách hiện đại, tiện dụng. <br>- 1 Phòng ngủ riêng biệt : điều hòa 02 chiều, giường, tủ quần áo... <br>- Phòng khách được thiết kế đẹp có thể làm phòng ngủ nếu nhà đông người.<br>- Khu bếp riêng biệt,có tủ bếp trên và dưới, chậu rửa bát hiện đại nấu nướng không sợ mùi vào phòng ngủ và khách.<br>- WC khép kín hiện đại, bình nóng lạnh,thiết bị vệ sinh Inax.<br>- Tòa nhà được lắp camera an ninh, đảm bảo, giờ giấc 24/24h, thoải mái đi lại.<br>- Gửi xe miễn phí, tối đa mỗi phòng 2 xe máy,truyền hình cáp, internet cáp quang, camera các tầng, có thang máy tốc độ cao... <br>- Căn hộ có cửa sổ thoáng mát , chỉ việc xách va li đến ở.<br>3. Giá cả: <br>- Giá phòng: 4.000.000 đ - 4.500.000 đ /tháng. <br>-DT TỪ 35- 45M2.<br>-Rất Phù hợp với người đi làm,hộ gia đình trẻ,công tác, du lịch, học tập...v.v.. <br>Hãy tiết kiệm thời gian quý báu của chính các bạn bằng cách nhấc máy lên và gọi ngay cho mình để được tư vấn. <br>Địa chỉ: số nhà 277 ngõ 275 đường Trung Văn- phường Trung văn- nam từ liêm<br>LH CHỊ NA :0981 056 756 /0902 212 798.(miễn trung gian)</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IkludGVybmV0IiwiMiI6Ik1cdTAwZTF5IGdpXHUxZWI3dCJ9', 1, 0, '{\"0\":\"21.0565405\",\"1\":\"105.74538640000003\"}', 1, 0, '2019-05-14 18:49:21', '2019-05-14 18:49:21');
