INSERT INTO `motelrooms` VALUES (140, 'Cho thuê phòng khép kín mới xây ngõ 924 đường Nguyễn Khoái, Thanh Trì, Hoàng Mai, Hà Nội.', 'cho-thue-phong-khep-kin-moi-xay-ngo-924-duong-nguyen-khoai-thanh-tri-hoang-mai-ha-noi', 2000000, 23.0000, 1, 57, 94, 'Số 18 ngõ 924 Nguyễn Khoái, Thanh Trì, Hoàng Mai, Hà Nội, Nguyễn Khoái, Hoàng Mai, Hà Nội', '0966908338', 3, 'Khép kín', '{\"0\":\"no_img_room.png\"}', '<div class=\"dis-content\">Cho thuê phòng thuộc CCMN 4 tầng (11 phòng) ngõ 924 đường Nguyễn Khoái, Thanh Trì, Hoàng Mai, Hà Nội.<br>- Diện tích sử dụng từ 17 - 23m2/ phòng. (Giá 1,7 - 2,2 triệu/tháng) <br>- Phòng xây mới hoàn thành, sạch đẹp,cửa sổ thoáng mát, có gác xép để đồ. Đầy đủ trang thiết bị giường ngủ, kệ nấu ăn, chậu rửa bát... <br>- Công trình phụ khép kín, riêng biệt, đầy đủ thiết bị: vòi sen,chậu rửa, quạt thông gió, đầu chờ điều hòa, bình nóng lạnh,... <br>- Để xe tại tầng 1 trong nhà để xe, có khóa an ninh. <br>- Ban công phơi đồ rộng rãi, thoáng đãng. <br>- Tiền nhà thanh toán tháng 1, không cần đặt cọc. <br>- Công tơ điện, nước riêng, đầy đủ truyền hình cáp, internet, wifi... giá hợp lý tính theo số sử dụng. Miễn các loại phí gửi xe, dịch vụ, bảo trì, rác thải... <br>- Khu vực dân trí cao, yên tĩnh,giao thông thuận tiện, an ninh tốt, camera 24/24h. <br>- Giờ giấc thoải mái, đi lại tự do, có chìa khóa cổng riêng. <br>- Cách chợ dân sinh, bến xe bus 100m, cách Times City, các trường Đại học như : Kinh Doanh Công Nghệ, Kinh Tế Kỹ Thuật CN, Y Dược Tuệ Tĩnh 2km. <br>Vào ở ngay, phù hợp cho cán bộ công nhân viên, sinh viên cần không gian thoáng mát yên tĩnh nghỉ ngơi, làm việc, học tập. <br>Liên hệ chính chủ: Cô Huệ - 096.690.8338 - (Miễn trung gian). <br>Địa chỉ: Số nhà 18 ngõ 924 đường Nguyễn Khoái - Thanh Trì - Hoàng Mai - Hà Nội.</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCIsIjMiOiJcdTAxMTBpXHUxZWMxdSBoXHUwMGYyYSIsIjQiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCIsIjUiOiJUcnV5XHUxZWMxbiBoXHUwMGVjbmggY