INSERT INTO `motelrooms` VALUES (157, 'Chính chủ cho thuê phòng căn hộ đầy đủ tiện nghi', 'chinh-chu-cho-thue-phong-can-ho-day-du-tien-nghi', 3500000, 45.0000, 1, 10, 32, 'Greenstars, 234 Phạm Văn Đồng, Phạm Văn Đồng, Từ Liêm, Hà Nội', '0942094720', 2, 'Khép kín', '{\"0\":\"chinh-chu-cho-thue-phong-can-ho-day-du-tien-nghi-dsche.jpg\",\"1\":\"chinh-chu-cho-thue-phong-can-ho-day-du-tien-nghi-7ryq7.jpg\",\"2\":\"chinh-chu-cho-thue-phong-can-ho-day-du-tien-nghi-opobk.jpg\",\"3\":\"chinh-chu-cho-thue-phong-can-ho-day-du-tien-nghi-yhmzr.jpg\",\"4\":\"chinh-chu-cho-thue-phong-can-ho-day-du-tien-nghi-lgfgj.jpg\",\"5\":\"chinh-chu-cho-thue-phong-can-ho-day-du-tien-nghi-aeicq.jpg\",\"6\":\"chinh-chu-cho-thue-phong-can-ho-day-du-tien-nghi-gmlul.jpg\"}', '<div class=\"dis-content\">Chính chủ cho thuê phòng căn hộ đầy đủ tiện nghi - ngay gần các trường đại học lớn và trung tâm mua sắm<br>1 phòng ngủ,làm việc và không gian chung  - đầy đủ tiện nghi - chỉ xách vali vào ở.<br>Giá thuê là 3.5 triệu/tháng + điện nước giá dân - Phòng và không gian chung thoải mái đầy đủ tiện nghi - không gian xung quanh thoải mái, an toàn.<br>Nằm trong tòa nhà Greenstars - tiện lợi sinh hoạt, dân trí cao<br>1/ Có khu ban công, phòng riêng, vệ sinh khép kín, phòng khách và nhà bếp chung với chủ nhà<br>2/ Nhà ngay gần các trường đại học lớn Học viện kỹ thuật quân sự, Đại học điện lực, gần Trung tâm Vincom Plaza - thuận tiện cho việc đi học, đi làm, đi chơi.<br>3/ Vì trong khuôn viên có hồ Greenstars (rất nhiều cây xanh) - nên bạn có thể chạy bộ, tập thể dục thể thao, hoặc đi dạo vào buổi tối.<br>4/ Có máy giặt + ban công phơi đồ.<br>5/ Toilet (phòng vệ sinh) riêng với nóng lạnh - để bạn thoải mái thư giãn.<br>6/ Khu vực chung được dọn vệ sinh hàng tuần sạch sẽ.<br>7/ Nằm trong khu vực an ninh cao.<br>8/ Giờ giấc tự do.<br>9/ Chủ nhà vui tính, dễ thương.<br>10/ Dưới tầng hầm có khu để xe và khu thương mại Vincom Plaza, tầng 1 và 2 có đủ các tiện ích: hiệu thuốc, spa, salon, phòng gym, cafe, quán ăn,ATM...<br>11/ Buổi sáng và chiều có chợ ngay gần kề, quán ăn bình dân,tiện lợi cho việc sinh hoạt<br>12/ Đặc biệt tuy không gian tiện nghi nhưng lại rất yên tĩnh.<br>Ngoài ra phòng riêng và không gian chung ( phòng khách, nhà bếp, ban công) đầy đủ tiện nghi như sau:<br>1/ Tủ lạnh.<br>2/ Internet tốc độ cao.<br>3/ Máy nước nóng lạnh.<br>4/ Giường.<br>5/ Tủ.<br>6/ Nệm, ga trải giường có sẵn.<br>7/ Điều hòa<br>8/ Bàn làm việc + giá sách<br>9/ Tivi<br>10/ Bếp điện + đồ dùng nhà bếp (nồi cơm điện, lò vi sóng,nồi lẩu,bát đĩa...)<br>Lưu ý: Chỉ cho các bạn nữ thuê<br>Địa chỉ: Greenstars, 234 Phạm  Văn Đồng, Hà Nội<br>Vui lòng liên hệ xem nhà chị Hà 0942094720</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJUaGFuZyBtXHUwMGUxeSIsIjMiOiJJbnRlcm5ldCIsIjQiOiJcdTAxMTBpXHUxZWMxdSBoXHUwMGYyYSIsIjUiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCIsIjYiOiJNXHUwMGUxeSBnaVx1MWViN3QiLCI3IjoiVGl2aSJ9', 1, 0, '{\"0\":\"21.049066401628153\",\"1\":\"105.78070459688956\"}', 1, 0, '2019-05-14 18:51:23', '2019-05-14 18:51:23');
