ch 32/45/9, phố Viên (nhà màuxanh ngay sau nhà văn hoá phố Viên)<br>* Diện tích: 25m2 khép kín<br>* Giao thông đi lại nhanh chóng, chợ búa thuận tiện. Gầnbến xe buýt, gần các trường Học Viện Tài Chính (đi bộ 5 phút), ĐH Mỏ Địa Chất<br>(đi bộ 5 phút), CĐ Tài Nguyên Môi Trường, … &amp; cách đường Phạm Văn Đồng<br>1.5km, cách thành phố giao lưu 1km …<br>* Tòa nhà 4 tầng mới tinh vừa khánh thành tháng1/2018, thiết kế hiện đại hợp lý, phòng rộng rãi, có cửa sổ thoáng, tầm nhìn rộng<br>thằng sang trường Tài Chính, gần chợ.<br>* Nội thất đầy đủ, mới tinh: Điều hòa, Nóng lạnh, Senvòi, Giường, Tủ quần áo, Internet.<br>* Giờ giấc tự do, không ở chung với chủ nhà.<br>* Chỗ để xe trong nhà, ngay tầng 1.<br>* Có chỗ nấu ăn, sân phơi rộng rãi thoáng mát. <br>* Có camera an ninh, khu vực yên tĩnh an ninh tốt, cựckì an toàn.<br>* Công trình vệ sinh khép, đã lắp đặt nóng lạnh.<br>* Đặc biệt thích hợp với các bạn sinh viên có yêu cầucao và các cặp gia đình trẻ thích không gian riêng biệt, yên tĩnh và văn minh.<br>Ưu tiên các bạn/gia đình có nhu cầu ở ổn định lâu dài.<br>* Điện: 4.000đ/số; Nước theo công tơ riêng<br>* Giá phòng: 2,3 đến 2,5 triệu/tháng<br>* Liên hệ: 0983-537-084</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCIsIjMiOiJcdTAxMTBpXHUxZWMxdSBoXHUwMGYyYSIsIjQiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCJ9', 1, 0, '{\"0\":\"21.0576943\",\"1\":\"105.77913269999999\"}', 1, 0, '2019-05-14 18:51:27', '2019-05-14 18:51:27');
