dt-40m2-tai-so-118-duong-nguyen-dong-chi-wvk0g.jpg\",\"34\":\"chinh-chu-cho-thue-chung-cu-mini-p-ngu-p-khach-dt-40m2-tai-so-118-duong-nguyen-dong-chi-opfwb.jpg\"}', '<div class=\"dis-content\">CHÍNH CHỦ CHO THUÊ CHUNG CƯ MINI P. NGỦ, P. KHÁCH DT 40M2 TẠI SỐ 118 ĐƯỜNG NGUYỄN ĐỔNG CHI.<br><br>1-Chung cư mini 7 tầng mới hoàn thiện TẠI SỐ 118 ĐƯỜNG NGUYỄN ĐỔNG CHI có nhiều loại phòng cho thuê.+Loại 1 phòng ngủ + 1 phòng khách và bếp.DT 40m2.<br>  Giá 4.000.000 đ/tháng.<br>-Thanh toán tối thiểu 3 tháng + cọc 1 tháng.<br>- Nội thất: Có nóng lạnh, giường, tủ, kệ bếp, chậu rửa, thiết bị vệ sinh hiện đại, các phòng đều thiết kế có cửa sổ thông thoáng.<br>Tòa nhà có thang máy, bảo vệ 24/24, an ninh đảm bảo, điện nước ổn định.<br>- Vị trí: Nhà nằm ở khu vực đông dân cư, dân trí cao, gần chợ, trường FPT, dân lập Lê Qúy Đôn, Đoàn Thị Điểm, mầm non hoa anh đào, sát đô thị Mỹ Đình …, cách đường Hàm Nghi 300m.<br>Mặt đường trước cửa 5m, hai ô tô tránh nhau, phù hợp người đi làm, hộ gia đình trẻ có thêm ông bà hoặc giúp việc ở cùng.<br>- Địa chỉ: Số nhà 118 Đường nguyễn Đổng Chi - Quận Nam Từ Liêm. (siêu thị thành đô rẽ vào hoặc đường Hàm Nghi đi vào). Hoặc gần khu đô thị Mỹ Đình 1 đi vào.<br><br>LH C Hương 0978 335 871./ 0902 212 798 /0981 056 756<br><br>2-Hiện nay tôi đang có tòa nhà chung cư mini 5 tầng. Nhà mới xây 100% với các căn hộ khép kín, đầy đủ tiện nghi, được trang bị như sau:<br>- Phòng ngủ : giường ngủ, tủ quần áo + Điều hòa 2 chiều.<br>- Phòng tắm: Có trang bị đồ dùng cao cấp: Bình nóng lạnh, vòi hoa sen, gương, chậu rửa mặt, bệt. <br>- Diện tích các căn hộ: 20m2.<br>- Giá cho thuê: 2,8 triệu – 3triệu/tháng. Tùy từng loại phòng.<br>- Tầng 1 để xe rộng rãi. <br>- Phương thức thanh toán: Đặt cọc 1 tháng+ 2-3 tháng tiền nhà. <br>- An ninh tuyệt đối: Giờ giấc đi lại thoải mái có camera theo dõi 24/24, khóa vân tay. <br>- Phí dịch vụ khác: Điện: 3.800 vnđ/số - Nước: 30.000/m3 – Internet: 100.000vnđ/phòng <br>- Vị trí : Ngôi nhà nằm ở khu vực trung tâm, đi lại thuận tiện, đ