ợc trang bị bàn ăn, bàn bếp, tủ bếp, chậu rửa bát, hút mùi...<br>- Khu vực nhà vệ sinh được lắp đầy đủ thiết bị hiện đại như chậu rửa mặt, bệt Inax, vòi sen, bình nóng lạnh...<br>- Tòa nhà có bảo vệ 24/24, đảm bảo an ninh tuyệt đối, giờ giấc ra vào thoải mái.<br>* Gửi xe miễn phí, thang máy cao cấp, internet cáp quang, miễn phí tuyền hình cáp, miễn phí máy giặt.<br>* Tòa nhà nằm ở vị trí trung tâm, giao thông thuận tiện, cách mặt đường La Thành 10m, gần hồ Hoàng Cầu, không khí thoáng mát trong lành, gần các trung tâm thương mại, đi lại vào phố cổ rất thuận tiện....<br><br>Địa chỉ: Số nhà 67 ngõ 39 phố Hào Nam, P. Ô Chợ Dừa - Q. Đống Đa. Hoặc ngõ 318 Đê La Thành.<br>LH  - C Hương 0978 335 871- 0902 212 798 - 0976 173 640 <br>(Chú ý tòa nhà trên đều là chính chủ không qua môi giới).<br>Giá: 7,5 triệu / thángDiện tích: 55 m2<br>Địa chỉ tài sản: 96 Đường La Thành, Phường Ô Chợ Dừa, Quận Đống Đa, Hà Nội</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJUaGFuZyBtXHUwMGUxeSIsIjMiOiJJbnRlcm5ldCIsIjQiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCIsIjUiOiJNXHUwMGUxeSBnaVx1MWViN3QiLCI2IjoiVHJ1eVx1MWVjMW4gaFx1MDBlY25oIGNcdTAwZTFwIn0=', 1, 0, '{\"0\":\"21.0229074\",\"1\":\"105.82166699999993\"}', 1, 0, '2019-05-14 18:51:56', '2019-05-14 18:51:56');
