Y ĐỦ TIỆN NGHI PHỐ LA THÀNH TO.<br><br>1- Tòa nhà chung cư mini 8 tầng mới, có nhiều căn hộ gồm phòng ngủ, phòng khách, bếp cho thuê.Diện tích các căn hộ từ  55m2. Giá cho thuê 7.000.000đ - 7.500.000 đ/căn.<br>- Thanh toán tối thiểu 03 tháng + đặt cọc 01 tháng.<br>Các căn hộ bao gồm:<br>+ 1 phòng ngủ riêng biệt có cửa sổ thông thoáng được trang bị điều hòa 2 chiều, giường, tủ quần áo.<br>+ 1 phòng khách cũng có thể bố trí làm phòng ngủ nếu nhà có đông người.<br>+ Phòng bếp được trang bị bàn ăn, bàn bếp, tủ bếp, chậu rửa bát, hút mùi….<br>+ Khu vực nhà vệ sinh được lắp đầy đủ thiết bị hiện đại như chậu rửa mặt, bệt Inax, vòi sen, bình nóng lạnh...<br>+ Có ban công riêng biệt từng căn hộ và khu vực phơi đồ và để máy giặt.<br>- Tiện ích: Tòa nhà có bảo vệ 24/24, đảm bảo an ninh tuyệt đối, giờ giấc ra vào thoải mái.<br>Thang máy cao cấp, mỗi hộ gia đình có thẻ từ sử dụng riêng, internet cáp quang, miễn phí tuyền hình cáp, miễn phí máy giặt.<br>- Tòa nhà nằm ở vị trí trung tâm, giao thông thuận tiện, cách mặt đường La Thành 10m, gần hồ Hoàng Cầu, không khí thoáng mát trong lành, gần các trung tâm thương mại, đi lại vào phố cổ rất thuận tiện...<br>- Ưu tiên cho hộ gia đình, người đi làm thuê ở lâu dài.<br>Địa chỉ: Số 96 ĐƯỜNG LA THÀNH- Ô CHỢ DỪA  - ĐỐNG ĐA- HN.<br><br>LH: CHỊ HƯƠNG 0978 335 871./ 0902 212 798 - 0982 9696 69 <br><br>2- Tòa chung cư mini tại số 67 ngõ 39 phố Hào Nam.<br>- Diện tích các căn hộ từ 35m2 - 45m2.<br>Giá cho thuê từ 5.000.000đ- 5.500.000 đ - 6.500.000 đ. Các căn hộ bao gồm:<br>+ Loại: 1 phòng ngủ riêng biệt có cửa sổ thông thoáng được trang bị điều hòa 2 chiều, giường, tủ quần áo. DT 35 - 45m2..<br>+ Loại 2 phòng ngủ + 1 phòng khách + phòng bếp, được trang bị 2 điều hòa, giường, tủ quần...<br>+ Phòng bếp được trang bị bàn ăn, bàn bếp, tủ bếp, chậu rửa bát, hút mùi….<br>+ Khu vực nhà vệ sinh được lắp đầy đủ thiết bị hiện đại như chậu rửa mặt, bệt Inax, vòi sen, bình nóng lạnh....<br>- Tòa nhà có bảo vệ 24/24, đảm bảo an ninh tuyệt đối, giờ giấc ra vào thoải mái, miễn phí để xe.<br>Thang máy cao cấp, internet cáp quang, miễn phí tuyền hình cáp, miễn phí máy giặt.<br>- Tòa nhà nằm ở vị trí trung tâm, giao thông thuận tiện, cách mặt đường La Thành 10m, gần hồ Hoàng Cầu, không khí thoáng mát trong lành, gần các trung tâm thương mại, đi lại vào phố cổ rất thuận tiện....<br>Địa chỉ: Số nhà 67 ngõ 39 phố Hào Nam, P. Ô Chợ Dừa - Q. Đống Đa. Hoặc ngõ 318 Đê La Thành.<br>LH C Hương 0978 335 871./ 0982 9696 69/ 0981 056 756<br>Giá: 5 triệu / thángDiện tích: 40 m2<br>Địa chỉ tài sản: 96 Đường La Thành, Phường Ô Chợ Dừa, Quận Đống Đa, Hà Nội</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJUaGFuZyBtXHUwMGUxeSIsIjMiOiJJbnRlcm5ldCIsIjQiOiJcdTAxMTBpXHUxZWMxdSBoXHUwMGYyYSIsIjUiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCIsIjYiOiJNXHUwMGUxeSBnaVx1MWViN3QiLCI3IjoiVHJ1eVx1MWVjMW4gaFx1MDBlY25oIGNcdTAwZTFwIn0=', 1, 0, '{\"0\":\"21.0205946\",\"1\":\"105.82665029999998\"}', 1, 0, '2019-05-14 18:52:24', '2019-05-14 18:52:24');
