 phòng khách, khu bếp có bàn bếp, tủ bếp, hút mùi, đầy đủ ánh sáng, gió và không khí vào phòng. <br>  - DT: 45m2. GIÁ 7,5 TRIỆU/THÁNG.<br>+ Loại 2: Gồm 2 phòng ngủ + 1 phòng khách và phòng bếp riêng biệt DT: 65-70m2. <br>  - GIÁ 10-12 TRIỆU/THÁNG.<br>- Mỗi phòng được trang bị điều hòa 2 chiều, giường, tủ quần áo, bộ bàn ăn, cửa sổ có rèm cản nắng cực đẹp, trần thạch cao, đèn ngủ đủ cả, bàn bếp, hút mùi, bồn rửa bát xịn. <br>- Nhà vệ sinh được lắp thiết bị vệ sinh Inax cao cấp, bình nóng lạnh Ariston, ốp lát gạch Prime sang trọng hiện đại.  <br>- Tòa nhà trang bị thang máy cao cấp, máy giặt miễn phí, truyền hình cáp, internet tốc độ cao mỗi căn hộ được cấp thẻ từ thang máy riêng. <br>- Tòa nhà có 2 bảo vệ 24/7 nên an ninh cực ổn, ra vào thoải mái, nhà để xe rộng rãi gần 300m2, có thể chứa được đến 200 chiếc xe máy. <br>- Vệ sinh dọn phòng hàng ngày nếu khách có nhu cầu. <br>* Thích hợp cho làm văn phòng giao dịch,người nước ngoài, hộ gia đình và người đi làm thuê ở. <br>+ Địa chỉ: Tòa nhà 23 Phố Đông Các- P.Ô Chợ Dừa -Đống Đa- hn. <br><br>LH :CHÍNH CHỦ CHỊ HƯƠNG 0978 335 871/ 0982 9696 69 / 0981 056 756 <br><br></div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJUaGFuZyBtXHUwMGUxeSIsIjMiOiJJbnRlcm5ldCIsIjQiOiJcdTAxMTBpXHUxZWMxdSBoXHUwMGYyYSIsIjUiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCIsIjYiOiJNXHUwMGUxeSBnaVx1MWViN3QiLCI3IjoiVHJ1eVx1MWVjMW4gaFx1MDBlY25oIGNcdTAwZTFwIn0=', 1, 0, '{\"0\":\"21.0180725\",\"1\":\"105.8299495\"}', 1, 0, '2019-05-14 18:52:28', '2019-05-14 18:52:28');
