ách mặt đường Xã Đàn 20m, nằm trong khuôn viên Tập Thể Học Viện Kỹ Thuật Quân Sự nên an ninh rất tốt, gần các trung tâm thương mại, lên phố cổ cũng gần, cách ngã tư Xã Đàn 300m... <br>Địa chỉ: Số 213 Xã Đàn- P.Kim Liên- Q.Đống Đa. <br>     LH C Hương 0902 212 798/ 0978 335 871 - A Lượng 0982 9696 69. <br><br><br>2-CHO THUÊ CHUNG CƯ MINI CAO CẤP 45- 50M2,PHÒNG KHÁCH PHÒNG NGỦ ĐẦY ĐỦ TIỆN NGHI PHỐ TRƯỜNG CHINH<br>Căn hộ chung cư mới xây, nội thất cao cấp tọa lạc trong tòa nhà 09 tầng, nằm ven hồ rùa cách đường Trường Chinh 300m, ĐƯỜNG rộng, 2 tô con tránh nhau, rất thuận tiện cho việc đi lại, sinh hoạt, vui chơi, giải trí. Lên phố cổ cũng gần, trung tâm thương mại ngay sát, GẦN trường học, như trường ĐH như Kinh Tế Quốc Dân...<br>- Căn hộ rộng 45- 50m2 được lát sàn gỗ, căn nào cũng cửa sổ rộng, ban công phơi đồ riêng biệt nhìn sang hồ, tha hồ ngắm cá, ngỗng vịt bơi quanh hồ, hít khí trời trong lành nên không độc hại. Căn hộ được thiết kế hết sức hợp lý, 1phòng ngủ, 1 phòng khách, khu bếp có đầy đủ ánh sáng, gió và không khí vào phòng.<br>- Mỗi căn hộ được trang bị giường, cửa sổ có rèm Thái Tuấn cực đẹp, trần thạch cao, đèn ngủ đủ cả, bàn bếp xịn, hút mùi, bồn rửa bát xịn.<br>- Nhà vệ sinh có thiết bị vệ sinh inax cao cấp, ốp lát gạch Prime sang trọng, mỗi nhà vệ sinh đều được trang bị bình Nóng Lạnh Ariston loại xin mới tinh..<br>Giá cho thuê: 5.000 000- 5500 000 đ/căn/tháng (thanh toán tối thiểu 03 tháng và đặt cọc 01 tháng). Hộ nào thanh toán 6 tháng trở lên sẽ được ưu đãi giảm giá.<br>Phí dịch vụ:<br>- Điện: 3.500 đồng/số.Nước: 30.000 đồng/khối.<br>- Bảo vệ 24/24 Gửi xe miễn phí.<br>- Tòa nhà trang bị thang máy cao cấp, máy giặt, truyền hình cáp miễn phí, mỗi căn hộ được cấp thẻ từ thang máy riêng.<br>- Tòa nhà có bảo vệ 24/24 nên an ninh cực ổn, ra vào thoải mái, nhà để xe rộng rãi gần 200m2, có thể chứa được đến 50 chiếc xe máy.<br>- Thích hợp hộ gia đình kèm theo người giúp việc hoặc ông bà ở cùng, người đi làm, sinh viên ngoan... <br>+ Địa chỉ:Số nhà 78 mặt đường hồ rùa, ngõ 155 Đường Trường Chinh– Đống Đa- HN.<br>Liên hệ chủ nhà: LH C Hương 0902 212 798/ 0976 173 640 Chị Hương 0978 335 871.<br><br><br>(TẤT CẢ CÁC TÒA NHÀ TRÊN ĐỀU LÀ CHÍNH CHỦ CHO THUÊ)<br>Giá: 6 triệu / thángDiện tích: 45 m2<br>Địa chỉ tài sản: 78 Đường Trường Chinh, Phường Ngã Tư Sở, Quận Đống Đa, Hà Nội</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJUaGFuZyBtXHUwMGUxeSIsIjMiOiJJbnRlcm5ldCIsIjQiOiJcdTAxMTBpXHUxZWMxdSBoXHUwMGYyYSIsIjUiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCIsIjYiOiJNXHUwMGUxeSBnaVx1MWViN3QiLCI3IjoiVHJ1eVx1MWVjMW4gaFx1MDBlY25oIGNcdTAwZTFwIn0=', 1, 0, '{\"0\":\"21.0088109\",\"1\":\"105.83467760000008\"}', 1, 0, '2019-05-14 18:53:07', '2019-05-14 18:53:07');
