ong-tro-cao-cap-dt35-40m2-day-du-dieu-hoa-1pngu1pkhach-pho-doan-ke-thien-rru6r.jpg\",\"54\":\"chinh-chu-phong-tro-cao-cap-dt35-40m2-day-du-dieu-hoa-1pngu1pkhach-pho-doan-ke-thien-s6aeo.jpg\",\"55\":\"chinh-chu-phong-tro-cao-cap-dt35-40m2-day-du-dieu-hoa-1pngu1pkhach-pho-doan-ke-thien-kdr5o.jpg\",\"56\":\"chinh-chu-phong-tro-cao-cap-dt35-40m2-day-du-dieu-hoa-1pngu1pkhach-pho-doan-ke-thien-a43jt.jpg\",\"57\":\"chinh-chu-phong-tro-cao-cap-dt35-40m2-day-du-dieu-hoa-1pngu1pkhach-pho-doan-ke-thien-xg3pb.jpg\",\"58\":\"chinh-chu-phong-tro-cao-cap-dt35-40m2-day-du-dieu-hoa-1pngu1pkhach-pho-doan-ke-thien-f6nee.jpg\",\"59\":\"chinh-chu-phong-tro-cao-cap-dt35-40m2-day-du-dieu-hoa-1pngu1pkhach-pho-doan-ke-thien-r9mrj.jpg\",\"60\":\"chinh-chu-phong-tro-cao-cap-dt35-40m2-day-du-dieu-hoa-1pngu1pkhach-pho-doan-ke-thien-b2twp.jpg\"}', '<div class=\"dis-content\">CHÍNH CHỦ PHÒNG TRỌ CAO CẤP DT35-40M2 ĐẦY ĐỦ ĐIỀU HÒA 1P.NGỦ+1P.KHÁCH PHỐ DOÃN KẾ THIỆN.<br><br>1 / Tòa chung cư mini 8 tầng tại số 32/C1 Phố Doãn Kế Thiện mới hoàn thiện  vào ở được luôn.- Diện tích các phòng từ 35m2 - 40m2.<br>Giá cho thuê  5.000.000đ- 5.500.000 đ/tháng, các căn hộ bao gồm:<br>1 phòng ngủ + phòng khách và khu bếp riêng biệt.<br>- Phòng ngủ được trang bị điều hòa 2 chiều, giường, tủ quần áo...<br>- Phòng khách cũng có thể làm phòng ngủ nếu nhà Đông người.<br>- Phòng bếp được trang bị bộ bàn ăn,bàn bếp, tủ bếp, chậu rửa bát, hút mùi...<br>- Khu vực nhà vệ sinh được lắp đầy đủ thiết bị hiện đại như chậu rửa mặt, bệt Inax, vòi sen, hút mùi, bình nóng lạnh...<br>- Tòa nhà có bảo vệ 24/24, đảm bảo an ninh tuyệt đối, giờ giấc ra vào thoải mái.<br>- Khu vực ban công phơi đồ riêng biệt của từng phòng.<br><br>* Tòa nhà nằm ở vị trí trung tâm, giao thông thuận tiện, cách mặt đường Doãn Kế Thiện 20m, đối diện chợ Đồng Xa nên rất thuận tiện cho việc mua sắm, đi chợ, nằm trong khuôn viên tập quân đội nên an ninh rất tốt, gần các trung tâm thương mại, gần các trường ĐH như quốc gia, Đại học Thương Mại, gần bến xe Mỹ Đình, gần đường Lê Đức Thọ...<br>Địa chỉ: Số 32/C1 – Đường Doãn Kế Thiện - P Mai Dịch - Cầu Giấy.<br>LH chị Hương 0978 335 871. / 0981.056.756 / 0982 9696 69<br><br><br>2-Tòa nhà 9 tầng tại số nhà D2 ngõ 93 phố Cầu Giấy - P. Quan Hoa - Cầu Giấy, vào ở luôn.<br>- Nhà ngay phố Cầu Giấy, đường vào rộng, 2 ô tô con tránh nhau, rất thuận tiện cho việc đi lại, sinh hoạt, vui chơi, giải trí. Lên phố cổ cũng gần, trung tâm thương mại ngay sát, gần trường Đại học Sư Phạm, Học Viện Báo Chí Và Tuyên Truyền...<br>- Các căn hộ rộng được lát sàn gạch cao cấp, căn nào cũng có cửa sổ rộng, ban công phơi đồ riêng biệt. Các căn hộ được thiết kế hết sức hợp lý:<br>+ Loại 1: Gồm 1 phòng ngủ + 1 phòng khách, khu bếp có bàn bếp, tủ bếp, đầy đủ ánh sáng, gió và không khí vào phòng. DT 45m2.<br>+ Loại 2: Gồm 2 phòng ngủ + 1 phòng khách và phòng bếp riêng biệt DT 50m2.<br><br>- Mỗi phòng được trang bị điều hòa 2 chiều, giường, tủ quần áo, cửa sổ có rèm cản nắng cực đẹp, trần thạch cao, đèn ngủ đủ cả, bàn bếp xịn, hút mùi, bồn rửa bát xịn, sàn gỗ cao cấp.<br>- Nhà vệ sinh được lắp thiết bị vệ sinh Inax cao cấp, bình nóng lạnh Ariston, ốp lát gạch Prime sang trọng, có bồn tắm đứng hiện đại.<br><br>Giá cho thuê: 6.000.000 - 6.500.000đ- 7.500.000đ/căn/tháng (thanh toán tối thiểu 03 tháng và đặt cọc 1 tháng). DT Các phòng từ 45 - 50m2.<br><br>- Tòa nhà trang bị thang máy cao cấp, máy giặt, truyền hình cáp, internet tốc độ cao miễn phí, mỗi căn hộ được cấp thẻ từ thang máy riêng.<br>- Tòa nhà có 2 bảo vệ 24/24 nên an ninh cực ổn, ra vào thoải mái, nhà để xe rộng rãi gần 200m2, có thể chứa được đến 80 chiếc xe máy.<br><br>+ Địa chỉ: Tòa nhà D2 ngõ 93 phố Cầu Giấy, P. Quan Hoa, Q. Cầu Giấy. (Cách Cầu Giấy 300m).<br>Liên hệ chị Hương 0978 335 871. / 0902 212 798 / 0982 9696 69<br>Giá: 5 triệu / thángDiện tích: 40 m2<br>Địa chỉ tài sản: 32C1 Phố Doãn Kế Thiện, Phường Mai Dịch, Quận Cầu Giấy, Hà Nội<br>Các thông tin khác</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJUaGFuZyBtXHUwMGUxeSIsIjMiOiJJbnRlcm5ldCIsIjQiOiJcdTAxMTBpXHUxZWMxdSBoXHUwMGYyYSIsIjUiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCIsIjYiOiJNXHUwMGUxeSBnaVx1MWViN3QiLCI3IjoiVHJ1eVx1MWVjMW4gaFx1MDBlY25oIGNcdTAwZTFwIn0=', 1, 0, '{\"0\":\"21.0362368\",\"1\":\"105.79058250000003\"}', 1, 0, '2019-05-14 18:53:31', '2019-05-14 18:53:31');
