tien-nghi-2-phong-ngu-dt50m2-tai-nha-d2-ngo-93-cau-giay-q3iuu.jpg\"}', '<div class=\"dis-content\">CHO THUÊ CHÍNH CHỦ PHÒNG TRỌ CAO CẤP, ĐẦY ĐỦ TIỆN NGHI 2 PHÒNG NGỦ DT50M2 TẠI NHÀ D2 NGÕ 93 CẦU GIẤY.<br><br>1- Tòa nhà 9 tầng tại số nhà D2 ngõ 93 phố Cầu Giấy- P.Quan Hoa-Cầu Giấy, mới hoàn thiên vào ở luôn. - Nhà ngay phố Cầu Giấy, đường vào rộng, 2 ô tô con tránh nhau, rất thuận tiện cho việc đi lại, sinh hoạt, vui chơi, giải trí. Lên phố cổ cũng gần, trung tâm thương mại ngay sát, cách cầu giấy 150m.<br>- Các căn hộ rộng được lát sàn gạch cao cấp, căn nào cũng có cửa sổ rộng, ban công phơi đồ riêng biệt.<br> Gồm 2 phòng ngủ +1 phòng khách và phòng bếp riêng biệt DT 50m2. <br>- Mỗi phòng được trang bị điều hòa 2 chiều, giường, tủ quần áo, cửa sổ có rèm cản nắng cực đẹp, trần thạch cao, đèn ngủ đủ cả, bàn bếp xịn, bồn rửa bát xịn, sàn gạch ốp lát cao cấp. <br>- Nhà vệ sinh được lắp thiết bị vệ sinh Inax cao cấp, bình nóng lạnh Ariston, ốp lát gạch Prime sang trọng, có bồn tắm đứng hiện đại. <br>   Giá cho thuê 6.500.000 đ - 7.000.000 đ /căn/tháng.<br>- DT Các phòng từ 45-50m2. <br>- Tòa nhà trang bị thang máy cao cấp, máy giặt miễn phí, truyền hình cáp, internet tốc độ cao, mỗi căn hộ được cấp thẻ từ thang máy riêng. <br>- Tòa nhà có 2 bảo vệ 24/24 nên an ninh cực ổn, ra vào thoải mái, để xe miễn phí, có thể chứa được đến 80 chiếc xe máy. <br>+ Địa chỉ: Số nhà D2 Ngõ 93 Phố Cầu Giấy, P.Quan Hoa, Q.Cầu Giấy.( Cách Cầu Giay 300m) <br>Liên hệ chủ nhà Chị Hương 0978 335 871/ 0902.212.798/ 0976 173 640<br><br>2- Tòa nhà 8 tầng tại phố Doãn Kế Thiện mới hoàn thiện vào ở luôn.<br>- Diện tích các phòng từ 38m2 - 40m2.<br>Giá cho thuê 4.500.000đ - 5.000.000đ/tháng, các phòng bao gồm:<br>Phòng ngủ + phòng khách và khu bếp riêng biệt.<br>- Phòng ngủ được trang bị điều hòa 2 chiều, giường, tủ quần áo.<br>- Phòng bếp được trang bị bàn bếp, tủ bếp, chậu rửa bát, hút mùi...<br>- Khu vực nhà vệ sinh được lắp đầy đủ thiết bị hiện đại như chậu rửa mặt, bệt Inax, vòi sen, bình nóng lạnh...<br>- Tòa nhà có bảo vệ 24/24, đảm bảo an ninh tuyệt đối, giờ giấc ra vào thoải mái.<br>- Nhà thiết kế đẹp, hiện đại với 1 tầng hầm rộng hơn 200m để xe, thang bộ, thang máy tốc độ cao, hệ thống cứu hỏa, mạng internet, camera, dọn dẹp.<br>- Khu vực ban công phơi đồ riêng biệt của từng phòng.<br>* Tòa nhà nằm ở vị trí trung tâm, giao thông thuận tiện, cách mặt đường Doãn Kế Thiện 20m, đối diện chợ Đồng Xa nên rất thuận tiện cho việc mua sắm, đi chợ, nằm trong khuôn viên tập thể quân đội nên an ninh rất tốt, gần các trung tâm thương mại, gần các trường ĐH như quốc gia, ngoại ngữ, gần bến xe Mỹ Đình...<br>Địa chỉ: Số 32C1 – Đường Doãn Kế Thiện - P Mai Dịch - Cầu Giấy.<br>  LH C Hương 0978 335 871./0902.212.798 / 0976.173.640<br>Giá: 6,5 triệu / thángDiện tích: 50 m2<br>Địa chỉ tài sản: Đường Cầu Giấy, Phường Quan Hoa, Quận Cầu Giấy, Hà Nội<br>Các thông tin khác</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJUaGFuZyBtXHUwMGUxeSIsIjMiOiJJbnRlcm5ldCIsIjQiOiJcdTAxMTBpXHUxZWMxdSBoXHUwMGYyYSIsIjUiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCIsIjYiOiJNXHUwMGUxeSBnaVx1MWViN3QiLCI3IjoiVHJ1eVx1MWVjMW4gaFx1MDBlY25oIGNcdTAwZTFwIn0=', 1, 0, '{\"0\":\"21.0323856\",\"1\":\"105.80052410000008\"}', 1, 0, '2019-05-14 18:53:42', '2019-05-14 18:53:42');
