át, hút mùi,...<br>- Khu vực nhà vệ sinh được lắp đầy đủ thiết bị hiện đại như chậu rửa mặt, bệt Inax, vòi sen, bình nóng lạnh,...<br>- Tòa nhà có bảo vệ 24/24, đảm bảo an ninh tuyệt đối, giờ giấc ra vào thoải mái.<br>- Khu vực ban công phơi đồ riêng biệt của từng phòng.<br>* Tòa nhà nằm ở vị trí trung tâm, giao thông thuận tiện, cách mặt đường Doãn Kế Thiện 20m, đối diện chợ Đồng Xa nên rất thuận tiện cho việc mua sắm, đi chợ, nằm trong khuôn viên tập quân đội nên an ninh rất tốt, gần các trung tâm thương mại, gần các trường ĐH như quốc gia, ngoại ngữ, gần bến xe Mỹ Đình,...<br><br>Địa chỉ: Số 32C1 – Đường Doãn Kế Thiện - P Mai Dịch - Cầu Giấy.<br>LH C Hương 0981 056 756 /0978 335 871. /0976 173 640<br><br>2 -Tòa nhà 9 tầng tại số nhà D2 ngõ 93 phố Cầu Giấy - P. Quan Hoa - Cầu Giấy, mới hoàn thiện vào ở luôn được.<br>- Nhà ngay phố Cầu Giấy, đường vào rộng, 2 ô tô con tránh nhau, rất thuận tiện cho việc đi lại, sinh hoạt, vui chơi, giải trí.<br>- Các phòng được thiết kế hết sức hợp lý:<br>+ Gồm 1 phòng ngủ hoặc 2 phòng ngủ + 1 phòng khách, đầy đủ ánh sáng, gió và không khí vào phòng. DT: 45m2 - 50m2.<br>- Mỗi phòng được trang bị 1 điều hòa 2 chiều, giường, tủ quần áo, cửa sổ có rèm cản nắng cực đẹp, trần thạch cao, bàn bếp, bồn rửa bát xịn.<br>- Nhà vệ sinh được lắp thiết bị vệ sinh Inax cao cấp, bình nóng lạnh Ariston, ốp lát gạch Prime sang trọng hiện đại.<br><br>Giá cho thuê: 6.500.000đ- 7.000.000 đ/ căn/tháng (thanh toán tối thiểu 03 tháng và đặt cọc 1 tháng).<br>- Tòa nhà trang bị thang máy cao cấp, máy giặt miễn phí, truyền hình cáp, internet tốc độ cao.<br>- Tòa nhà có bảo vệ 24/7 nên an ninh cực ổn, ra vào thoải mái, nhà để xe rộng rãi gần 200m2, có thể chứa được đến 100 chiếc xe máy.<br>- Vệ sinh dọn phòng hàng ngày nếu khách có nhu cầu.<br>+ Địa chỉ: Tòa nhà D2 ngõ 93 phố Cầu Giấy, P. Quan Hoa, Q. Cầu Giấy. (Cách Cầu Giấy 150m).<br><br>Liên hệ chủ nhà chị Hương 0902 212 798 /0978 335 871/0976 173 640<br>Giá: 5 triệu / thángDiện tích: 38 m2<br>Địa chỉ tài 