INSERT INTO `motelrooms` VALUES (193, 'Nhà trọ phố chợ Khâm Thiên không chung chủ, có điều hòa, nóng lạnh, nhà vệ sinh khép kín', 'nha-tro-pho-cho-kham-thien-khong-chung-chu-co-dieu-hoa-nong-lanh-nha-ve-sinh-khep-kin', 3200000, 25.0000, 1, 6, 122, 'số 22 ngõ 249 phố chợ khâm thiên, Chợ Khâm Thiên, Đống Đa, Hà Nội', '0973612652', 5, 'Khép kín', '{\"0\":\"nha-tro-pho-cho-kham-thien-khong-chung-chu-co-dieu-hoa-nong-lanh-nha-ve-sinh-khep-kin-j5uzl.jpg\",\"1\":\"nha-tro-pho-cho-kham-thien-khong-chung-chu-co-dieu-hoa-nong-lanh-nha-ve-sinh-khep-kin-wpttz.jpg\"}', '<div class=\"dis-content\">Phòng trọ tại nhà số 22 ngõ 249 phố chợ Khâm Thiênthoáng mát, giờ giấc tự do, điện nước giá dân ngay đầu Ngã ba Lê Duẩn – Khâm<br>Thiên<br>Nhà còn 1 phòng rộng cụ thể như  sau:<br>*Tầng 2 có 2 phòng: 1 phòng to có ban công, diệntích 25m2, có điều hòa, nóng lạnh, vệ sinh khép kín:giá 3tr2<br>   Mô tả thêm:                        <br>- Nhà có 2 chỗ để xe rộng rãi, an ninh cực đảm bảohoàn toàn free, gần chợ, các trường đại học Bách Khoa, Xây Dựng, Kinh Tế… <br>- Nhà liên kề không bị nắng chiếu nên các phòng rấtthoáng.<br>- Máy giặt miễn phí cả nhà dùng chung, dây phơi quầnáo thoáng ở sân thượng <br>- Nhà vệ sinh đẹp, rộng rãi, lịch sự, vòi hoa sen,nóng lạnh, bệt, gương… đầy đủ<br>- Internet cáp quang <br>- Điện nước giá nhà nước hoàn toàn. Các phòng đều cócông tơ riêng tự chia. <br>- Phòng ở nhiều người thoải mái.  <br>- Tháng có người qua dọn vệ sinh chung cả nhà thườngxuyên <br>- Không ở chung chủ. Giờ giấc đi lại thoải mái, tiếpbạn bè vô tư miễn là lịch sự và không làm ảnh hưởng đến người khác và hàng xóm<br>xung quanh. <br>- Yêu cầu là ngăn nắp, sạch sẽ, không làm hư hạiphòng và các vật dụng trong nhà. Ngoài ra không thu thêm tiền gì. <br>-Hợp đồng lâu dài không tăng giá, chu kỳ đóng tiềnnhà 1 tháng 1 lần, đặt cọc 1 tháng tiền nhà ( liên hệ 0973.612.652) </div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCIsIjMiOiJcdTAxMTBpXHUxZWMxdSB