INSERT INTO `motelrooms` VALUES (194, 'Nhà trọ 108 Pháo Đài Láng không chung chủ, có điều hòa, nóng lạnh, máy giặt', 'nha-tro-108-phao-dai-lang-khong-chung-chu-co-dieu-hoa-nong-lanh-may-giat', 2600000, 22.0000, 1, 6, 123, 'số 108 Pháo Đài Láng, Pháo Đài Láng, Đống Đa, Hà Nội', '0973612652', 6, 'Chưa xác định', '{\"0\":\"nha-tro-108-phao-dai-lang-khong-chung-chu-co-dieu-hoa-nong-lanh-may-giat-ydfne.jpg\",\"1\":\"nha-tro-108-phao-dai-lang-khong-chung-chu-co-dieu-hoa-nong-lanh-may-giat-resized-rr0xm.jpg\",\"2\":\"nha-tro-108-phao-dai-lang-khong-chung-chu-co-dieu-hoa-nong-lanh-may-giat-resized-tzz24.jpg\"}', '<div class=\"dis-content\">Phòng trọ tại nhà số Nhà trọ 108 Pháo Đài Láng cáchđường láng 50m (số 780 Đường Láng), có chỗ để xe thoải mái, giờ giấc tự do, điện<br>nước giá dân, <br>1 phòng rộng 22m2 giá 2tr8 có điều hòa<br> Mô tả thêm: <br>- Nhà có chỗ để xe rộng rãi, an ninh cực đảm bảohoàn toàn free, gần chợ, các trường đại học Ngoại Thương, Giao Thông Vận Tải, Học<br>Viện Phụ Nữ, Học Viện Ngoại Giao… <br>- Có quạt trần<br>- Có view cây xanh và hồ cá.<br>- Máy giặt miễn phí cả nhà dùng chung, dây phơi quầnáo thoáng ở sân thượng <br>- Nhà vệ sinh đẹp, rộng rãi, lịch sự, vòi hoa sen,nóng lạnh, bệt, gương… đầy đủ<br>- Internet cáp quang <br>- Có chỗ nấu ăn ở tầng 3<br>- Điện nước giá nhà nước hoàn toàn. Các phòng đều cócông tơ riêng tự chia. <br>- Phòng ở nhiều người thoải mái.  <br>- Tháng có người qua dọn vệ sinh chung cả nhà thườngxuyên <br>- Không ở chung chủ. Giờ giấc đi lại thoải mái, tiếpbạn bè vô tư miễn là lịch sự và không làm ảnh hưởng đến người khác và hàng xóm<br>xung quanh. <br>- Yêu cầu là ngăn nắp, sạch sẽ, không làm hư hạiphòng và các vật dụng trong nhà. Ngoài ra không thu thêm tiền gì. <br>-Hợp đồng lâu dài không tăng giá, chu kỳ đóng tiềnnhà 1 tháng 1 lần, đặt cọc 1 tháng tiền nhà, ưu tiên người ở lâu dài<br>( liên hệ 0973612652) </div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCIsIjMiOiJcdTAxMTBpXHUxZWMxdSBoXHUwMGYyYSIsIjQiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCIsIjUiOiJNXHUwMGUxeSBnaVx1MWViN3QifQ==', 1, 0, '{\"0\":\"21.0194123\",\"1\":\"105.80549599999995\"}', 1, 0, '2019-05-14 18:54:27', '2019-05-14 18:54:27');
INSERT INTO `motelrooms` VALUES (195, 'Nhà trọ số 12 Đại Từ không chung chủ, có điều hòa, nóng lạnh, vệ sinh khép kín', 'nha-tro-so-12-dai-tu-khong-chung-chu-co-dieu-hoa-nong-lanh-ve-sinh-khep-kin', 2600000, 20.0000, 1, 57, 124, 'số 12 Đại Từ, Đại Từ, Hoàng Mai, Hà Nội', '0973612652', 4, 'Khép kín', '{\"0\":\"nha-tro-so-12-dai-tu-khong-chung-chu-co-dieu-hoa-nong-lanh-ve-sinh-khep-kin-qmo88.jpg\",\"1\":\"nha-tro-so-12-dai-tu-khong-chung-chu-co-dieu-hoa-nong-lanh-ve-sinh-khep-kin-wpqnk.jpg\",\"2\":\"nha-tro-so-12-dai-tu-khong-chung-chu-co-dieu-hoa-nong-lanh-ve-sinh-khep-kin-tc6n2.jpg\"}', '<div class=\"dis-content\">Phòng tầng 2 trong nhà 5 tầng: rộng 20m2 giá 2tr6<br>Mô tả thêm: <br>- Nhà mặt đường có chỗ để xe rộng rãi,  có camera hoạt động 24/24 an ninh cực đảm bảohoàn toàn free, gần chợ, các trường đại học Bách Khoa, Xây Dựng, Kinh Tế, Thăng<br>Long… Gần bến xe bus, cách đường giải phóng 10m, gần bến xe Giáp Bát, bến xe Nước<br>Ngầm thuận tiện cho việc đi lại….<br>- Nhà vệ sinh khép kín bên trong phòng, rộng rãi, lịchsự, vòi hoa sen, nóng lạnh, bệt, gương… đầy đủ<br>- Phòng có cửa sổ thoáng và đều trang bị điều hòa,nóng lạnh,giường, tủ… <br>- Máy giặt ở tầng 1 miễn phí cả nhà dùng chung, dâyphơi quần áo thoáng ở tầng 3<br>- Internet cáp quang băng thông lớn.<br>- Điện giá nhà nước hoàn toàn. Các phòng đều có côngtơ riêng tự chia. Nước 80k/người<br>- Phòng ở nhiều người thoải mái.  <br>- Tháng có người qua dọn vệ sinh chung cả nhà thườngxuyên <br>- Không ở chung chủ. Giờ giấc đi lại thoải mái, tiếpbạn bè vô tư miễn là lịch sự và không làm ảnh hưởng đến người khác và hàng xóm<br>xung quanh. <br>- Yêu cầu là ngăn nắp, sạch sẽ, không làm hư hạiphòng và các vật dụng trong nhà. Ngoài ra không thu thêm tiền gì. <br>Hợp đồng lâu dài không tăng giá, chu kỳ đóng tiềnnhà 1 tháng 1 lần, đặt cọc 1 tháng tiền nhà . Liên hệ : 0973612652</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCIsIjMiOiJcdTAxMTBpXHUxZWMxdSBoXHUwMGYyYSIsIjQiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCIsIjUiOiJNXHUwMGUxeSBnaVx1MWViN3QifQ==', 1, 0, '{\"0\":\"20.9720932\",\"1\":\"105.83919450000008\"}', 1, 0, '2019-05-14 18:54:29', '2019-05-14 18:54:29');
INSERT INTO `motelrooms` VALUES (197, 'CHO THUÊ PHÒNG TRỌ TỐT GỒM: 1 PHÒNG NGỦ, PHÒNG KHÁCH ĐẦY ĐỦ ĐỒ DT 45M2 NGÕ 155 PHỐ TRƯỜNG CHINH.', 'cho-thue-phong-tro-tot-gom-1-phong-ngu-phong-khach-day-du-do-dt-45m2-ngo-155-pho-truong-chinh', 5000000, 45.0000, 1, 6, 120, 'SỐ 78 NGÕ 155 Đường Trường Chinh, Phường Ngã Tư Sở, Quận Đống Đa, Hà Nội, Trường Chinh, Đống Đa, Hà Nội', '0986205100', 3, 'Khép kín', '{\"0\":\"cho-thue-phong-tro-tot-gom-1-phong-ngu-phong-khach-day-du-do-dt-45m2-ngo-155-pho-truong-chinh-l9uhu.jpg\",\"1\":\"cho-thue-phong-tro-tot-gom-1-phong-ngu-phong-khach-day-du-do-dt-45m2-ngo-155-pho-truong-chinh-ujbua.jpg\",\"2\":\"cho-thue-phong-tro-tot-gom-1-phong-ngu-phong-khach-day-du-do-dt-45m2-ngo-155-pho-truong-chinh-lh5vq.jpg\",\"3\":\"cho-thue-phong-tro-tot-gom-1-phong-ngu-phong-khach-day-du-do-dt-45m2-ngo-155-pho-truong-chinh-8bhww.jpg\"}', '<div class=\"dis-content\">CHO THUÊ PHÒNG TRỌ TỐT GỒM: 1 PHÒNG NGỦ, PHÒNG KHÁCH ĐẦY ĐỦ ĐỒ DT 45M2 NGÕ 155 PHỐ TRƯỜNG CHINH.<br><br>1-Tòa nhà 9 tầng tại số 78 ngõ 155 Trường Chinh:- Nằm ven hồ Rùa cách đường Trường Chinh 300m đường vào rộng, 2 tô con tránh nhau, rất thuận tiện cho việc đi lại, sinh hoạt, vui chơi, giải trí. Lên phố cổ cũng gần, trung tâm thương mại ngay sát, gần Trường Đại Học Y, trường ĐH Kinh Tế Quốc Dân...<br>- Căn hộ rộng 45m2 - 50m2 được lát sàn gỗ, căn nào cũng cửa sổ rộng, ban công phơi đồ riêng biệt nhìn sang hồ điều hòa, hít khí trời trong lành nên không độc hại. Căn hộ được thiết kế hết sức hợp lý, 1 phòng ngủ, 1 phòng khách, khu bếp có đầy đủ ánh sáng, gió và không khí vào phòng.<br><br>- Mỗi căn hộ được trang bị giường, cửa sổ có rèm Thái Tuấn cực đẹp, trần thạch cao, đèn ngủ đủ cả, bàn bếp xịn, hút mùi, bồn rửa bát xịn.<br>- Nhà vệ sinh có thiết bị vệ sinh Inax cao cấp, ốp lát gạch Prime sang trọng.<br>Giá cho thuê: 5.000.000 - 5.500.000 đ/căn/tháng (thanh toán tối thiểu 03 tháng và đặt cọc 01 tháng).<br>- Bảo vệ 24/24, gửi xe miễn phí.<br>- Tòa nhà trang bị thang máy cao cấp, máy giặt, truyền hình cáp miễn phí, mỗi căn hộ được cấp thẻ từ thang máy riêng.<br>- Tòa nhà có bảo vệ 24/24 nên an ninh cực ổn, ra vào thoải mái, nhà để xe rộng rãi gần 200m2, có thể chứa được đến 50 chiếc xe máy.<br>+ Địa chỉ: Số nhà 78 mặt đường Hồ Rùa, ngõ 155 đường Trường Chinh – Đống Đa - HN.<br>LH CHỊ HƯƠNG 0978 335 871 / 0981 056 756 / 0982 9696 69<br><br>2- Tòa chung cư mini tại số 67 ngõ 39 phố Hào Nam.<br>- Diện tích các căn hộ từ 25m2 - 35m2.<br>Giá cho thuê từ 5.000.000đ- 5.500.000 đ - 6.500.000 đ. Các căn hộ bao gồm:<br>+ Loại: 1 phòng ngủ riêng biệt có cửa sổ thông thoáng được trang bị điều hòa 2 chiều, giường, tủ quần áo. DT 25 - 30m2..<br>+ Loại 2 phòng ngủ + 1 phòng khách + phòng bếp, được trang bị 2 điều hòa, giường, tủ quần...<br>+ Phòng bếp được trang bị bàn ăn, bàn bếp, tủ bếp, chậu rửa bát, hút mùi….<br>+ Khu vực nhà vệ sinh được lắp đầy đủ thiết bị hiện đại như chậu rửa mặt, bệt Inax, vòi sen, bình nóng lạnh....<br>- Tòa nhà có bảo vệ 24/24, đảm bảo an ninh tuyệt đối, giờ giấc ra vào thoải mái, miễn phí để xe.<br>Thang máy cao cấp, internet cáp quang, miễn phí tuyền hình cáp, miễn phí máy giặt.<br>- Tòa nhà nằm ở vị trí trung tâm, giao thông thuận tiện, cách mặt đường La Thành 10m, gần hồ Hoàng Cầu, không khí thoáng mát trong lành, gần các trung tâm thương mại, đi lại vào phố cổ rất thuận tiện....<br>Địa chỉ: Số nhà 67 ngõ 39 phố Hào Nam, P. Ô Chợ Dừa - Q. Đống Đa. Hoặc ngõ 318 Đê La Thành.<br>LH C Hương 0978 335 871./ 0902 212 798 / 0982 9696 692<br> LƯU Ý: CHÍNH CHỦ CHO THUÊ KHÔNG QUA MÔI GIỚI<br>Giá: 5 triệu / thángDiện tích: 45 m2<br>Địa chỉ tài sản: SỐ 78 NGÕ 155 Đường Trường Chinh, Phường Ngã Tư Sở, Quận Đống Đa, Hà Nội</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJUaGFuZyBtXHUwMGUxeSIsIjMiOiJJbnRlcm5ldCIsIjQiOiJcdTAxMTBpXHUxZWMxdSBoXHUwMGYyYSIsIjUiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCIsIjYiOiJNXHUwMGUxeSBnaVx1MWViN3QiLCI3IjoiVHJ1eVx1MWVjMW4gaFx1MDBlY25oIGNcdTAwZTFwIn0=', 1, 0, '{\"0\":\"21.0180725\",\"1\":\"105.8299495\"}', 1, 0, '2019-05-14 18:54:32', '2019-05-14 18:54:32');
