ệc đi lại, sinh hoạt, vui chơi, giải trí. Lên phố cổ cũng gần, trung tâm thương mại ngay sát<br>- Các căn hộ rộng được lát sàn gỗ cao cấp, phòng nào cũng có cửa sổ rộng, ban công phơi đồ riêng biệt. Các căn hộ được thiết kế hết sức hợp lý:<br> Gồm 2 phòng ngủ + 1 phòng khách và phòng bếp riêng biệt DT: 60-70m2.<br>- Mỗi phòng được trang bị điều hòa 2 chiều, giường, tủ quần áo, bộ bàn ăn, cửa sổ có rèm cản nắng cực đẹp, trần thạch cao, đèn ngủ đủ cả, bàn bếp, hút mùi, bồn rửa bát xịn.<br>- Nhà vệ sinh được lắp thiết bị vệ sinh Inax cao cấp, bình nóng lạnh Ariston, ốp lát gạch Prime sang trọng hiện đại.<br>Giá cho thuê: 10.000.000 đ- 12.000.000 đ/căn/tháng <br>     DT Các căn hộ từ 60-70 m2<br>- Tòa nhà trang bị thang máy cao cấp, máy giặt miễn phí, truyền hình cáp, internet tốc độ cao mỗi căn hộ được cấp thẻ từ thang máy riêng.<br>- Tòa nhà có 2 bảo vệ 24/7 nên an ninh cực ổn, ra vào thoải mái, nhà để xe rộng rãi gần 300m2, có thể chứa được đến 200chiếc xe máy.<br>- Vệ sinh dọn phòng hàng ngày nếu khách có nhu cầu.<br>* Thích hợp cho người nước ngoài, hộ gia đình và người đi làm thuê ở.<br>+ Địa chỉ: Tòa nhà 23 Phố Đông Các- P.Ô Chợ Dừa -Đống Đa- hn.<br>LH :CHÍNH CHỦ CHỊ HƯƠNG 0978 335 871/0982 9696 69 /0902.212.798<br><br>2- TÒA NHÀ 8 TẦNG SỐ 93+95 MẶT PHỐ ĐÔNG CÁC-Ô CHỢ DỪA-ĐỐNG ĐA.<br>-Nhà mặt đường phố Đông Các, đường rộng, 2 tô con tránh nhau, rất thuận tiện cho việc đi lại, sinh hoạt, vui chơi, giải trí. <br>- Căn hộ rộng 45 -60m2, được lát sàn gỗ, căn nào cũng cửa sổ rộng, ban công phơi đồ riêng biệt. Căn hộ được thiết kế hết sức hợp lý.<br>-Gồm 1 phòng ngủ, 1 phòng khách và phòng bếp.<br>+ Phòng ngủ được trang bị điều hòa 2 chiều,giường,tủ quần áo, cửa sổ có rèm cản nắng cực đẹp, trần thạch cao, đèn ngủ đủ cả.<br>+ Phòng bếp và khách có bàn bếp, tủ bếp,tủ lạnh, bàn ăn, hút mùi, bồn rửa bát xịn.<br>+ Nhà vệ sinh có thiết bị vệ sinh Inax cao cấp, ốp lát gạch Prime sang trọng.<br>có bình nóng lạnh, bồn tắm đứng thiết kế hiện đại.<br>+ Giá cho thuê:7.000.000đ- 7.500.000 đ/căn/tháng (thanh toán tối thiểu 03 tháng và đặt cọc 1 tháng).<br>- Tòa nhà trang bị thang máy cao cấp, máy giặt, truyền hình cáp, internet tốc độ cao, mỗi căn hộ được cấp thẻ từ thang máy riêng.<br>- Tòa nhà có bảo vệ 24/24 nên an ninh cực ổn, ra vào thoải mái, nhà để xe rộng rãi DT200m2, có thể chứa được đến 100 chiếc xe máy.<br>+ Địa chỉ: Số nhà 93-95 mặt phố Đông Các-P.Ô Chợ Dừa – Đống Đa - HN.<br>Liên hệ chủ nhà chị Hương 0978 335 871/ 0902 212 798 /Anh Lượng 0982 9696 69<br>Giá: 12 triệu / thángDiện tích: 60 m2<br>Địa chỉ tài sản: 23 Phố Đông Các, Phường Ô Chợ Dừa, Quận Đống Đa, Hà Nội</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJUaGFuZyBtXHUwMGUxeSIsIjMiOiJJbnRlcm5ldCIsIjQiOiJcdTAxMTBpXHUxZWMxdSBoXHUwMGYyYSIsIjUiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCIsIjYiOiJNXHUwMGUxeSBnaVx1MWViN3QiLCI3IjoiVHJ1eVx1MWVjMW4gaFx1MDBlY25oIGNcdTAwZTFwIn0=', 1, 0, '{\"0\":\"21.0180725\",\"1\":\"105.8299495\"}', 1, 0, '2019-05-14 18:54:47', '2019-05-14 18:54:47');
