La Thành.- Diện tích các căn hộ từ 40m2- 55m2. Giá cho thuê từ 5.000.000đ - 5.500.000đ - 7.500.000đ /căn.<br>- Thanh toán tối thiểu 3 tháng + đặt cọc 1 tháng.<br>Các căn hộ bao gồm:<br>-Loại 1 phòng ngủ và 1 phòng khách riêng biệt có cửa sổ thông thoáng được trang bị điều hòa 2 chiều, giường, tủ quần áo.DT 40M2 giá 5,5 tr.<br>-Loại 2 phòng ngủ và 1 phòng khách DT 55m2 giá 7,5 triệu.<br>+ Phòng khách cũng có thể bố trí làm phòng ngủ nếu nhà có đông người.<br>+ Phòng bếp được trang bị bàn ăn, bàn bếp, tủ bếp, chậu rửa bát, hút mùi….<br>+ Khu vực nhà vệ sinh được lắp đầy đủ thiết bị hiện đại như chậu rửa mặt, bệt Inax, vòi sen, bình nóng lạnh...<br>+ Có ban công riêng biệt từng căn hộ và khu vực phơi đồ và để máy giặt.<br>- Tiện ích: Tòa nhà có bảo vệ 24/24, đảm bảo an ninh tuyệt đối, giờ giấc ra vào thoải mái.<br>Thang máy cao cấp, mỗi hộ gia đình có thẻ từ sử dụng riêng, internet cáp quang, miễn phí tuyền hình cáp, miễn phí máy giặt.<br>- Tòa nhà nằm ở vị trí trung tâm, giao thông thuận tiện, cách mặt đường La Thành 10m, gần hồ Hoàng Cầu, không khí thoáng mát trong lành, gần các trung tâm thương mại, đi lại vào phố cổ rất thuận tiện...<br>- Ưu tiên cho hộ gia đình, người đi làm thuê ở.<br>Địa chỉ: Số 96 Đê La Thành - Ô Chợ Dừa - Đống Đa - HN.<br>Liên hệ:  chị Hương  0978 335 871./0981 056 756 /0976 173 640.<br><br>2-Tòa chung cư mini 8 tầng tại số 67 ngõ 39 phố Hào Nam mới hoàn thiện vào ở luôn.<br>- Diện tích các phòng từ 35m2 - 45m2 - 50m2.<br>Giá cho thuê từ 5.000.000đ - 5.500.000 đ/th, các căn hộ bao gồm:<br>+ Loại: 1 phòng ngủ + 1 phòng khách + phòng bếp, DT:35- 40m2.<br>- Phòng ngủ được trang bị điều hòa 2 chiều, giường, tủ quần áo...<br>- Phòng bếp được trang bị bàn ăn, bàn bếp, tủ bếp, chậu rửa bát, hút mùi...<br>- Khu vực nhà vệ sinh được lắp đầy đủ thiết bị hiện đại như chậu rửa mặt, bệt Inax, vòi sen, bình nóng lạnh...<br>- Tòa nhà có bảo vệ 24/24, đảm bảo an ninh tuyệt đối, giờ giấc ra vào thoải mái.<br>* Gửi xe miễn phí, thang máy cao cấp, internet cáp quang, miễn phí tuyền hình cáp, miễn phí máy giặt.<br>* Tòa nhà nằm ở vị trí trung tâm, giao thông thuận tiện, cách mặt đường La Thành 10m, gần hồ Hoàng Cầu, không khí thoáng mát trong lành, gần các trung tâm thương mại, đi lại vào phố cổ rất thuận tiện....<br><br>Địa chỉ: Số nhà 67 ngõ 39 phố Hào Nam, P. Ô Chợ Dừa - Q. Đống Đa. Hoặc ngõ 318 Đê La Thành.<br>LH  - C Hương 0978 335 871- 0902 212 798 - 0976 173 640 <br>(Chú ý tòa nhà trên đều là chính chủ không qua môi giới).<br>Giá: 7,5 triệu / thángDiện tích: 55 m2<br>Địa chỉ tài sản: 96 Đường La Thành, Phường Ô Chợ Dừa, Quận Đống Đa, Hà Nội</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJUaGFuZyBtXHUwMGUxeSIsIjMiOiJJbnRlcm5ldCIsIjQiOiJcdTAxMTBpXHUxZWMxdSBoXHUwMGYyYSIsIjUiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCIsIjYiOiJNXHUwMGUxeSBnaVx1MWViN3QiLCI3IjoiVHJ1eVx1MWVjMW4gaFx1MDBlY25oIGNcdTAwZTFwIn0=', 1, 0, '{\"0\":\"21.0150419\",\"1\":\"105.83395150000001\"}', 1, 0, '2019-05-14 18:54:51', '2019-05-14 18:54:51');
