ke-thien-mai-dich-eftvw.jpg\"}', '<div class=\"dis-content\">CHO THUÊ CHÍNH CHỦ PHÒNG TRỌ TẠI TÒA 8 TẦNG -GIÁ 5TR CÓ 1 PHÒNG NGỦ VÀ P.KHÁCH PHỐ DOÃN KẾ THIỆN-MAI DỊCH<br>1-Tòa nhà 8 tầng tại phố Doãn Kế Thiện mới hoàn thiện vào ở luôn.- Diện tích các phòng từ 38m2 - 40m2.<br><br>Giá cho thuê 5.000.000đ/tháng, các phòng bao gồm:<br><br>Phòng ngủ + phòng khách và khu bếp riêng biệt.<br><br>- Phòng ngủ được trang bị điều hòa 2 chiều, giường, tủ quần áo...<br><br>- Phòng khách cũng có thể làm phòng ngủ nếu nhà Đông người.<br><br>- Phòng bếp được trang bị bàn ăn, bàn bếp, tủ bếp, chậu rửa bát, hút mùi,...<br><br>- Khu vực nhà vệ sinh được lắp đầy đủ thiết bị hiện đại như chậu rửa mặt, bệt Inax, vòi sen, bình nóng lạnh,...<br><br>- Tòa nhà có bảo vệ 24/24, đảm bảo an ninh tuyệt đối, giờ giấc ra vào thoải mái.<br><br>- Khu vực ban công phơi đồ riêng biệt của từng phòng.<br><br>* Tòa nhà nằm ở vị trí trung tâm, giao thông thuận tiện, cách mặt đường Doãn Kế Thiện 20m, đối diện chợ Đồng Xa nên rất thuận tiện cho việc mua sắm, đi chợ, nằm trong khuôn viên tập quân đội nên an ninh rất tốt, gần các trung tâm thương mại, gần các trường ĐH như quốc gia, ngoại ngữ, gần bến xe Mỹ Đình,...<br><br>Địa chỉ: Số 32CT1 – Đường Doãn Kế Thiện( Đối diện cổng chợ đồng Xa)-P.Mai Dịch - Cầu Giấy.<br>LH C Hương 0978 335 871. / 0902.212.798/ 0981 056 756<br>2- Tòa nhà 9 tầng tại số nhà D2 ngõ 93 phố Cầu Giấy - P. Quan Hoa <br>- Cầu Giấy, mới hoàn thiện vào ở luôn được.<br>- Nhà ngay phố Cầu Giấy, đường vào rộng, 2 ô tô con tránh nhau, rất thuận tiện cho việc đi lại, sinh hoạt, vui chơi, giải trí.<br>- Các phòng được thiết kế hết sức hợp lý:<br>+ Gồm 1 phòng ngủ hoặc 2 phòng ngủ + 1 phòng khách, đầy đủ ánh sáng, gió và không khí vào phòng. DT: 45m2-50m2.<br>- Mỗi phòng được trang bị 1 điều hòa 2 chiều, giường, tủ quần áo, cửa sổ có rèm cản nắng cực đẹp, trần thạch cao, bàn bếp, bồn rửa bát xịn.<br>- Nhà vệ sinh được lắp thiết bị vệ sinh Inax cao cấp, bình nóng lạnh Ariston, ốp lát gạch Prime sang trọng hiện đại.<br><br>Giá cho thuê: 6.000.000-6.500.000đ căn/tháng (thanh toán tối thiểu 03 tháng và đặt cọc 1 tháng). DT Các phòng từ 45-50m2.<br>- Tòa nhà trang bị thang máy cao cấp, máy giặt miễn phí, truyền hình cáp, internet tốc độ cao miễn phí, mỗi căn hộ được cấp thẻ từ thang máy riêng.<br>- Tòa nhà có bảo vệ 24/7 nên an ninh cực ổn, ra vào thoải mái, nhà để xe rộng rãi gần 200m2, có thể chứa được đến 100 chiếc xe máy.<br>- Vệ sinh dọn phòng hàng ngày nếu khách có nhu cầu.<br>* Thích hợp cho người nước ngoài, hộ gia đình và người đi làm thuê ở.<br>+ Địa chỉ: Tòa nhà D2 ngõ 93 phố Cầu Giấy, P. Quan Hoa, Q. Cầu Giấy (Cách Cầu Giấy 150m).<br>Liên hệ chủ nhà chị Hương <br>  0978 335 871. / 0902.212.798 / 0902 212 798<br>Giá: 5 triệu / thángDiện tích: 40 m2<br>Địa chỉ tài sản: 32C1 Phố Doãn Kế Thiện, Phường Mai Dịch, Quận Cầu Giấy, Hà Nội</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJUaGFuZyBtXHUwMGUxeSIsIjMiOiJJbnRlcm5ldCIsIjQiOiJcdTAxMTBpXHUxZWMxdSBoXHUwMGYyYSIsIjUiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCIsIjYiOiJNXHUwMGUxeSBnaVx1MWViN3QiLCI3IjoiVHJ1eVx1MWVjMW4gaFx1MDBlY25oIGNcdTAwZTFwIn0=', 1, 0, '{\"0\":\"21.0414805\",\"1\":\"105.77725750000002\"}', 1, 0, '2019-05-14 18:55:20', '2019-05-14 18:55:20');
