cọc 1 tháng. Thanh toán 3 tháng tiền nhà.<br>---------------------<br>+ Liên hệ chủ nhà: 0979.566.409 trước khi hết phòng (không qua môi giới). Miễn phí xem phòng.<br>Ưu tiên người đi làm, hộ gia đình ở sạch sẽ, tử tế.<br><br></div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCIsIjMiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCJ9', 1, 0, '{\"0\":\"21.0055267\",\"1\":\"105.77913269999999\"}', 1, 0, '2019-05-14 18:55:48', '2019-05-14 18:55:48');
