------<br>+ Nội thất: Nóng lạnh, bàn bếp chậu rửa, tủ bếp, giường bằng gỗ cực đẹp (như ảnh), hệ thống nhà vệ sinh hiện đại có thông gió.<br>+ Có đầu chờ máy giặt, internet cực mạnh.<br>+ Các phòng đều được thiết kế hiện đại, có 2 cửa sổ+ ban công cực thoáng mát.<br>+ Khách có thể phơi đồ trực tiếp tại ban công các phòng hoặc đi thang máy lên phơi trên tầng thượng.<br>---------------------<br>+ Tầng 1 để xe rộng rãi. Miễn phí.<br>+ An ninh tuyệt đối: Giờ giấc đi lại thoải mái có camera theo dõi 24/24, cửa ra vào lắp khóa vân tay cực kỳ an toàn.<br>+ Có hệ thống thoát hiểm, phòng cháy chữa cháy<br>--------------------<br>+ Giá dịch vụ: Điện 3,800đ. Nước 30.000đ/khối. Mạng 100.000đ/phòng.<br>+ Diện tích các căn hộ: Từ 30-35m2 khép kín.<br>+ Giá cho thuê: Từ 3.1tr đến 3.5tr/tháng. Tùy từng loại phòng.<br>+ Phương thức thanh toán: Đặt cọc 1 tháng. Thanh toán 3 tháng tiền nhà.<br>---------------------<br>+ Liên hệ chủ nhà: 0979.566.409 trước khi hết phòng (không qua môi giới). Miễn phí xem phòng.<br>Ưu tiên người đi làm, hộ gia đình ở sạch sẽ, tử tế.<br></div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJUaGFuZyBtXHUwMGUxeSIsIjMiOiJJbnRlcm5ldCIsIjQiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCJ9', 1, 0, '{\"0\":\"20.9937692\",\"1\":\"105.7770137\"}', 1, 0, '2019-05-14 18:55:52', '2019-05-14 18:55:52');
INSERT INTO `motelrooms` VALUES (215, 'Cho thuê phòng trọ tại Khương Trung', 'cho-thue-phong-tro-tai-khuong-trung', 4000000, 50.0000, 1, 2, 63, 'ngõ 211Khương Trung, Khương Trung, Thanh Xuân, Hà Nội', '01668501585', 5, 'Khép kín', '{\"0\":\"cho-thue-phong-tro-tai-khuong-trung-1516357785fxchm-resized-zovdx.jpg\",\"1\":\"cho-thue-phong-tro-tai-khuong-trung-1516357785fxchm-lphns.jpg\"}', '<div class=\"dis-content\">Gia đình hiện nay có một phòng trọ cho thuê. Không gian đẹp, rộng rãi, thoáng mát. Có truyền hình cáp và internet, điều hòa, bình nóng lạnh, chỗ để xe miễn phí, lối đi riêng, thích hợp gia đình nhỏ . Diện tích 50m2. <br>Liên hệ cô Hà. Đt: 01668.501.585.</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCIsIjMiOiJcdTAxMTBpXHUxZWMxdSBoXHUwMGYyYSIsIjQiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCIsIjUiOiJUaXZpIn0=', 1, 0, '{\"0\":\"20.994476\",\"1\":\"105.82144800000003\"}', 1, 0, '2019-05-14 18:55:54', '2019-05-14 18:55:54');
INSERT INTO `motelrooms` VALUES (219, 'Nhà trọ số 12 Đại Từ vệ sinh khép kín , có nóng lạnh, máy giặt , điều hòa, không chung chủ', 'nha-tro-so-12-dai-tu-ve-sinh-khep-kin-co-nong-lanh-may-giat-dieu-hoa-khong-chung-chu', 3000000, 40.0000, 1, 57, 124, 'số 12 Đại Từ, Đại Từ, Hoàng Mai, Hà Nội', '0973612652', 6, 'Khép kín', '{\"0\":\"nha-tro-so-12-dai-tu-ve-sinh-khep-kin-co-nong-lanh-may-giat-dieu-hoa-khong-chung-chu-rqrwm.jpg\",\"1\":\"nha-tro-so-12-dai-tu-ve-sinh-khep-kin-co-nong-lanh-may-giat-dieu-hoa-khong-chung-chu-xrjex.jpg\",\"2\":\"nha-tro-so-12-dai-tu-ve-sinh-khep-kin-co-nong-lanh-may-giat-dieu-hoa-khong-chung-chu-r8hsj.jpg\"}', '<div class=\"dis-content\">Nhà còn 1 phòng rộng cụthể như sau:<br>Phòng ở tầng 2 trong nhà 5 tầng rộng 40m2 có bancông rộng có thể nấu nương, phơi quần áo bên ngoài:  giá 3tr<br>Mô tả thêm: <br>- Nhà mặt đường có chỗ để xe rộng rãi, có camerahoạt động 24/24 an ninh cực đảm bảo hoàn toàn free, gần chợ, các trường đại học<br>Bách Khoa, Xây Dựng, Kinh Tế, Thăng Long… Gần bến xe bus, cách đường giải phóng<br>10m, gần bến xe Giáp Bát, bến xe Nước Ngầm thuận tiện cho việc đi lại….<br>- Nhà vệ sinh khép kín bên trong phòng, rộngrãi, lịch sự, vòi hoa sen, nóng lạnh, bệt, gương… đầy đủ<br>- Phòng nào cũng có cửa sổ thoáng và đều trang bịđiều hòa, nóng lạnh,giường, tủ… <br>- Máy giặt ở tầng 1 miễn phí cả nhà dùng chung,dây phơi quần áo thoáng ở tầng 3<br>- Internet cáp quang băng thông lớn.<br>- Điện giá nhà nước hoàn toàn. Các phòng đều cócông tơ riêng tự chia. Nước 80k/người<br>- Phòng ở nhiều người thoải mái. <br>- Tháng có người qua dọn vệ sinh chung cả nhàthường xuyên <br>- Không ở chung chủ. Giờ giấc đi lại thoải mái,tiếp bạn bè vô tư miễn là lịch sự và không làm ảnh hưởng đến người khác và hàng<br>xóm xung quanh. <br>- Yêu cầu là ngăn nắp, sạch sẽ, không làm hư hạiphòng và các vật dụng trong nhà. Ngoài ra không thu thêm tiền gì. <br>Hợp đồng lâu dài không tăng giá, chu kỳ đóng tiềnnhà 1 tháng 1 lần, đặt cọc 1 tháng tiền nhà . Liên hệ : 0973612652</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCIsIjMiOiJcdTAxMTBpXHUxZWMxdSBoXHUwMGYyYSIsIjQiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCIsIjUiOiJNXHUwMGUxeSBnaVx1MWViN3QiLCI2IjoiVHJ1eVx1MWVjMW4gaFx1MDBlY25oIGNcdTAwZTFwIn0=', 1, 0, '{\"0\":\"20.9720932\",\"1\":\"105.83919450000008\"}', 1, 0, '2019-05-14 18:56:00', '2019-05-14 18:56:00');
