. (siêu thị thành đô rẽ vào hoặc đường Hàm Nghi đi vào). Hoặc gần khu đô thị Mỹ Đình 1 đi vào.<br><br><strong>LH C Hương 0978 335 871./ 0902 212 798 /0981 056 756</strong><br><br>2-Hiện nay tôi đang có tòa nhà chung cư mini 5 tầng. Nhà mới xây 100% với các căn hộ khép kín, đầy đủ tiện nghi, được trang bị như sau:<br>- Phòng ngủ : giường ngủ, tủ quần áo + Điều hòa 2 chiều.<br>- Phòng tắm: Có trang bị đồ dùng cao cấp: Bình nóng lạnh, vòi hoa sen, gương, chậu rửa mặt, bệt. <br>- Diện tích các căn hộ: 20m2.<br>- Giá cho thuê: 2,8 triệu – 3triệu/tháng. Tùy từng loại phòng.<br>- Tầng 1 để xe rộng rãi. <br>- Phương thức thanh toán: Đặt cọc 1 tháng+ 2-3 tháng tiền nhà. <br>- An ninh tuyệt đối: Giờ giấc đi lại thoải mái có camera theo dõi 24/24, khóa vân tay. <br>- Phí dịch vụ khác: Điện: 3.800 vnđ/số - Nước: 30.000/m3 – Internet: 100.000vnđ/phòng <br>- Vị trí : Ngôi nhà nằm ở khu vực trung tâm, đi lại thuận tiện, đối diện chợ Đồng Xa,nên mua bán đi chợ rất tiện lợi,nhà cách đường DOÃN KẾ THIỆN chỉ 20m, gần nhà có bãi đỗ xe ô tô và gửi ô tô. Gần các trường ĐH như sư phạm, ngoại ngữ, quốc gia, gần bến xe Mỹ Đình...<br><strong>Liên hệ chủ nhà 0981 056 756 / 0978 335 871 / 0976 173 640 </strong><br>ĐC:  số 32C1 – Đường Doãn Kế Thiện - P.Mai Dịch -Cầu Giấy<br>Giá: 3 triệu / thángDiện tích: 28 m2<br>Địa chỉ tài sản: số 32Ct1 Đường Nguyễn Đổng Chi, Quận Nam Từ Liêm, Hà Nội</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJUaGFuZyBtXHUwMGUxeSIsIjMiOiJJbnRlcm5ldCIsIjQiOiJcdTAxMTBpXHUxZWMxdSBoXHUwMGYyYSIsIjUiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCIsIjYiOiJNXHUwMGUxeSBnaVx1MWViN3QiLCI3IjoiVHJ1eVx1MWVjMW4gaFx1MDBlY25oIGNcdTAwZTFwIn0=', 1, 0, '{\"0\":\"21.046723\",\"1\":\"105.74843120000003\"}', 1, 0, '2019-05-14 18:56:06', '2019-05-14 18:56:06');
INSERT INTO `motelrooms` VALUES (222, 'CHO THUÊ CHUNG CƯ MINI GIÁ 5TR CÓ 1 PHÒNG NGỦ VÀ P.KHÁCH PHỐ DOÃN KẾ THIỆN-MAI DỊCH', 'cho-thue-chung-cu-mini-gia-5tr-co-1-phong-ngu-va-pkhach-pho-doan-ke-thien-mai-dich', 5000000, 40.0000, 1, 16, 100, 'Số 32CT1 – Đường Doãn Kế Thiện( Đối diện cổng chợ đồng Xa)-P.Mai Dịch - Cầu Giấy., Doãn Kế Thiện, Cầu Giấy, Hà Nội', '0978335871', 3, 'Khép kín', '{\"0\":\"cho-thue-chung-cu-mini-gia-5tr-co-1-phong-ngu-va-pkhach-pho-doan-ke-thien-mai-dich-1515577709lrnfq-ehupz.jpg\",\"1\":\"cho-thue-chung-cu-mini-gia-5tr-co-1-phong-ngu-va-pkhach-pho-doan-ke-thien-mai-dich-1515577709lrnfq-z2ohs.jpg\",\"2\":\"cho-thue-chung-cu-mini-gia-5tr-co-1-phong-ngu-va-pkhach-pho-doan-ke-thien-mai-dich-1515577709lrnfq-bmg8o.jpg\",\"3\":\"cho-thue-chung-cu-mini-gia-5tr-co-1-phong-ngu-va-pkhach-pho-doan-ke-thien-mai-dich-1515577709lrnfq-uusno.jpg\",\"4\":\"cho-thue-chung-cu-mini-gia-5tr-co-1-phong-ngu-va-pkhach-pho-doan-ke-thien-mai-dich-1515577709lrnfq-h2lmr.jpg\",\"5\":\"cho-thue-chung-cu-mini-gia-5tr-co-1-phong-ngu-va-pkhach-pho-doan-ke-thien-mai-dich-1515577709lrnfq-b1mfr.jpg\",\"6\":\"cho-thue-chung-cu-mini-gia-5tr-co-1-phong-ngu-va-pkhach-pho-doan-ke-thien-mai-dich-1515577709lrnfq-2x0no.jpg\",\"7\":\"cho-thue-chung-cu-mini-gia-5tr-co-1-phong-ngu-va-pkhach-pho-doan-ke-thien-mai-dich-1515577709lrnfq-6nwrt.jpg\",\"8\":\"cho-thue-chung-cu-mini-gia-5tr-co-1-phong-ngu-va-pkhach-pho-doan-ke-thien-mai-dich-1515577709lrnfq-3ssas.jpg\",\"9\":\"cho-thue-chung-cu-mini-gia-5tr-co-1-phong-ngu-va-pkhach-pho-doan-ke-thien-mai-dich-1515577709lrnfq-tdlup.jpg\",\"10\":\"cho-thue-chung-cu-mini-gia-5tr-co-1-phong-ngu-va-pkhach-pho-doan-ke-thien-mai-dich-1515577709lrnfq-nvsjp.jpg\",\"11\":\"cho-thue-chung-cu-mini-gia-5tr-co-1-phong-ngu-va-pkhach-pho-doan-ke-thien-mai-dich-1515577709lrnfq-mhgvp.jpg\",\"12\":\"cho-thue-chung-cu-mini-gia-5tr-co-1-phong-ngu-va-pkhach-pho-doan-ke-thien-mai-dich-1515577709lrnfq-ycahe.jpg\",\"13\":\"cho-thue-chung-cu-mini-gia-5tr-co-1-phong-ngu-va-pkhach-pho-doan-ke-thien-mai-dich-1515577709lrnfq-zquln.jpg\",\"14\":\"cho-thue-chung-cu-mini-gia-5tr-co-1-phong-ngu-va-pkhach-pho-doan-ke-thien-mai-dich-1515577709lrnfq-vhlni.jpg\"}', '<div class=\"dis-content\"><br><strong>1-Tòa nhà 8 tầng tại phố Doãn Kế Thiện mới hoàn thiện vào ở luôn.- Diện tích các phòng từ 38m2 - 40m2.<br></strong><br>Giá cho thuê 5.000.000đ/tháng, các phòng bao gồm:<br><br>Phòng ngủ + phòng khách và khu bếp riêng biệt.<br><br>- Phòng ngủ được trang bị điều hòa 2 chiều, giường, tủ quần áo...<br><br>- Phòng khách cũng có thể làm phòng ngủ nếu nhà Đông người.<br><br>- Phòng bếp được trang bị bàn ăn, bàn bếp, tủ bếp, chậu rửa bát, hút mùi,...<br><br>- Khu vực nhà vệ sinh được lắp đầy đủ thiết bị hiện đại như chậu rửa mặt, bệt Inax, vòi sen, bình nóng lạnh,...<br><br>- Tòa nhà có bảo vệ 24/24, đảm bảo an ninh tuyệt đối, giờ giấc ra vào thoải mái.<br><br>- Khu vực ban công phơi đồ riêng biệt của từng phòng.<br><br>* Tòa nhà nằm ở vị trí trung tâm, giao thông thuận tiện, cách mặt đường Doãn Kế Thiện 20m, đối diện chợ Đồng Xa nên rất thuận tiện cho việc mua sắm, đi chợ, nằm trong khuôn viên tập quân đội nên an ninh rất tốt, gần các trung tâm thương mại, gần các trường ĐH như quốc gia, ngoại ngữ, gần bến xe Mỹ Đình,...<br><br>Địa chỉ: Số 32CT1 – Đường Doãn Kế Thiện( Đối diện cổng chợ đồng Xa)-P.Mai Dịch - Cầu Giấy.<br><strong>LH C Hương 0978 335 871. / 0902.212.798/ 0981 056 756<br></strong><br><strong>2- Tòa nhà 9 tầng tại số nhà D2 ngõ 93 phố Cầu Giấy - P. Quan Hoa <br>- Cầu Giấy, mới hoàn thiện vào ở luôn được.</strong><br>- Nhà ngay phố Cầu Giấy, đường vào rộng, 2 ô tô con tránh nhau, rất thuận tiện cho việc đi lại, sinh hoạt, vui chơi, giải trí.<br>- Các phòng được thiết kế hết sức hợp lý:<br>+ Gồm 1 phòng ngủ hoặc 2 phòng ngủ + 1 phòng khách, đầy đủ ánh sáng, gió và không khí vào phòng. DT: 45m2-50m2.<br>- Mỗi phòng được trang bị 1 điều hòa 2 chiều, giường, tủ quần áo, cửa sổ có rèm cản nắng cực đẹp, trần thạch cao, bàn bếp, bồn rửa bát xịn.<br>- Nhà vệ sinh được lắp thiết bị vệ sinh Inax cao cấp, bình nóng lạnh Ariston, ốp lát gạch Prime sang trọng hiện đại.<br><br>Giá cho thuê: 6.000.000-6.500.000đ căn/tháng (thanh toán tối thiểu 03 tháng và đặt cọc 1 tháng). DT Các phòng từ 45-50m2.<br>- Tòa nhà trang bị thang máy cao cấp, máy giặt miễn phí, truyền hình cáp, internet tốc độ cao miễn phí, mỗi căn hộ được cấp thẻ từ thang máy riêng.<br>- Tòa nhà có bảo vệ 24/7 nên an ninh cực ổn, ra vào thoải mái, nhà để xe rộng rãi gần 200m2, có thể chứa được đến 100 chiếc xe máy.<br>- Vệ sinh dọn phòng hàng ngày nếu khách có nhu cầu.<br>* Thích hợp cho người nước ngoài, hộ gia đình và người đi làm thuê ở.<br>+ Địa chỉ: Tòa nhà D2 ngõ 93 phố Cầu Giấy, P. Quan Hoa, Q. Cầu Giấy (Cách Cầu Giấy 150m).<br><strong>Liên hệ chủ nhà chị Hương <br>            0978 335 871. / 0902.212.798 / 0902 212 798</strong><br>Giá: 5 triệu / thángDiện tích: 40 m2<br>Địa chỉ tài sản: 32C1 Phố Doãn Kế Thiện, Phường Mai Dịch, Quận Cầu Giấy, Hà Nội</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJUaGFuZyBtXHUwMGUxeSIsIjMiOiJJbnRlcm5ldCIsIjQiOiJcdTAxMTBpXHUxZWMxdSBoXHUwMGYyYSIsIjUiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCIsIjYiOiJNXHUwMGUxeSBnaVx1MWViN3QiLCI3IjoiVHJ1eVx1MWVjMW4gaFx1MDBlY25oIGNcdTAwZTFwIn0=', 1, 0, '{\"0\":\"21.0425725\",\"1\":\"105.77466400000003\"}', 1, 0, '2019-05-14 18:56:17', '2019-05-14 18:56:17');
