ng-ngu-1-phong-khach-day-du-do-dt35-45m2-pho-hao-nam-lvwpn.jpg\",\"33\":\"chinh-chu-cho-thue-chung-cu-mini-1phong-ngu-1-phong-khach-day-du-do-dt35-45m2-pho-hao-nam-2pvwd.jpg\",\"34\":\"chinh-chu-cho-thue-chung-cu-mini-1phong-ngu-1-phong-khach-day-du-do-dt35-45m2-pho-hao-nam-3vo7y.jpg\",\"35\":\"chinh-chu-cho-thue-chung-cu-mini-1phong-ngu-1-phong-khach-day-du-do-dt35-45m2-pho-hao-nam-rkdrp.jpg\",\"36\":\"chinh-chu-cho-thue-chung-cu-mini-1phong-ngu-1-phong-khach-day-du-do-dt35-45m2-pho-hao-nam-myamc.jpg\"}', '<div class=\"dis-content\"><br><strong>1-Tòa chung cư mini tại số 67 ngõ 39 phố Hào Nam mới đi vòa hoạt động</strong>.<br>- Diện tích các căn hộ từ 35m2-45m2-50m2<br>  Giá cho thuê từ:<br>                 4.500.000 đ -5.000.000đ -5.500.0000đ- 6.500.000đ/th.<br>- Thanh toán tối thiểu 3 tháng + đặt cọc 1 tháng.<br>Các căn hộ bao gồm:<br>+ 1 phòng ngủ riêng biệt có cửa sổ thông thoáng được trang bị điều hòa 2 chiều, giường, tủ quần áo.<br>+ Phòng khách cũng có thể bố trí làm phòng ngủ nếu nhà có đông người.<br>+ Phòng bếp được trang bị bàn ăn, bàn bếp, tủ bếp, chậu rửa bát, hút mùi….<br>+ Khu vực nhà vệ sinh được lắp đầy đủ thiết bị hiện đại như chậu rửa mặt, bệt Inax, vòi sen, bình nóng lạnh...<br>* Tiện ích: <br>+Tòa nhà có bảo vệ 24/24, đảm bảo an ninh tuyệt đối, giờ giấc ra vào thoải mái.<br>+Thang máy cao cấp miễn phí, mỗi hộ gia đình có thẻ từ sử dụng riêng, internet cáp quang , miễn phí tuyền hình cáp, miễn phí máy giặt, xe để thoải mái...<br>+Tòa nhà nằm ở vị trí trung tâm, giao thông thuận tiện, cách mặt đường La Thành 10m, gần hồ Hoàng Cầu, không khí thoáng mát trong lành, gần các trung tâm thương mại, đi lại vào phố cổ rất thuận tiện,...<br>= Ưu tiên cho hộ gia đình, người đi làm.<br> Địa chỉ: Số nhà 67 ngõ 39 phố Hào Nam, P. Ô Chợ Dừa-Q. Đống Đa.<br>Hoặc ngõ 318 Đê La Thành đi vào số nhà 67.<br>(Cách trường ĐH Mỹ Thuật Công Nghiệp 300m, gần học viện Âm Nhạc)<br><strong>Liên hệ: CHÍNH CHỦ Anh Lượng 0982 9696 69-0981 056 756 chị Hương 0978 335 871.</strong><br><strong><br>2- Tòa chung cư mini 8 tầng tại số 213 XÃ ĐÀN mới hoàn thiện vào ở luôn.</strong><br>- Diện tích các phòng từ 35m2-40m2.<br>Giá cho thuê 6.000.000đ- 7.000.000 đ/tháng, các căn hộ bao gồm:<br>1 phòng ngủ + phòng khách và bếp <br>- Phòng ngủ được trang bị điều hòa 2 chiều, giường, tủ quần áo...<br>- Phòng bếp được trang bị bàn ăn, bàn bếp, tủ bếp, chậu rửa bát, hút mùi...<br>- Khu vực nhà vệ sinh được lắp đầy đủ thiết bị hiện đại như chậu rửa mặt, bệt Inax, vòi sen, bình nóng lạnh...<br>- Tòa nhà có bảo vệ 24/24, đảm bảo an ninh tuyệt đối, giờ giấc ra vào thoải mái.<br><br>* Tòa nhà nằm ở vị trí trung tâm, giao thông thuận tiện, cách mặt đường XÃ ĐÀN 30m, gần ngã tư XÃ ĐÀN,nằm trong khuôn viên tập thể kỹ thuật quân sự, gần các trung tâm thương mại, đi lại vào phố cổ rất thuận tiện....<br><br>Địa chỉ: Số 213 phố XÃ ĐÀN, P.Phương Liên - Q. Đống Đa.<br><strong>LHC Hương 0978 335 871./ 0902 212 798 A Lượng 0982 9696 69 - </strong><br><strong><br>3/ Tòa nhà 9 tầng tại số nhà 78 ngõ 155 Trường Chinh:</strong><br>- Nằm ven hồ Rùa cách đường Trường Chinh 300m đường vào rộng, 2 tô con tránh nhau, rất thuận tiện cho việc đi lại, sinh hoạt, vui chơi, giải trí. Lên phố cổ cũng gần, trung tâm thương mại ngay sát, gần Trường Đại Học Y, trường ĐH Kinh Tế Quốc Dân...<br>- Căn hộ rộng 45m2 - 50m2 được lát sàn gỗ, căn nào cũng cửa sổ rộng, ban công phơi đồ riêng biệt nhìn sang hồ điều hòa, hít khí trời trong lành nên không độc hại. Căn hộ được thiết kế hết sức hợp lý, 1 phòng ngủ, 1 phòng khách, khu bếp có đầy đủ ánh sáng, gió và không khí vào phòng.<br><br>- Mỗi căn hộ được trang bị giường, cửa sổ có rèm Thái Tuấn cực đẹp, trần thạch cao, đèn ngủ đủ cả, bàn bếp xịn, hút mùi, bồn rửa bát xịn.<br>- Nhà vệ sinh có thiết bị vệ sinh Inax cao cấp, ốp lát gạch Prime sang trọng.<br>Giá cho thuê: 4.500.000đ - 5.000.000 đ/căn/tháng (thanh toán tối thiểu 03 tháng và đặt cọc 01 tháng).<br>- Bảo vệ 24/24, gửi xe miễn phí.<br>- Tòa nhà trang bị thang máy cao cấp, máy giặt, truyền h