rần thạch cao, đèn ngủ đủ cả.<br>+ Phòng bếp và khách có bàn bếp, tủ bếp,tủ lạnh, bàn ăn, hút mùi, bồn rửa bát xịn.<br>+ Nhà vệ sinh có thiết bị vệ sinh Inax cao cấp, ốp lát gạch Prime sang trọng.<br>có bình nóng lạnh, bồn tắm đứng thiết kế hiện đại.<br>+ Giá cho thuê:7.000.000đ- 7.500.000 đ/căn/tháng (thanh toán tối thiểu 03 tháng và đặt cọc 1 tháng).<br>- Tòa nhà trang bị thang máy cao cấp, máy giặt, truyền hình cáp, internet tốc độ cao, mỗi căn hộ được cấp thẻ từ thang máy riêng.<br>- Tòa nhà có bảo vệ 24/24 nên an ninh cực ổn, ra vào thoải mái, nhà để xe rộng rãi DT200m2, có thể chứa được đến 100 chiếc xe máy.<br>+ Địa chỉ: Số nhà 93-95 mặt phố Đông Các-P.Ô Chợ Dừa – Đống Đa - HN.<br><strong>Liên hệ chủ nhà chị Hương 0978 335 871/ 0902 212 798 /Anh Lượng 0982 9696 69</strong><br>Giá: 12 triệu / thángDiện tích: 60 m2<br>Địa chỉ tài sản: 23 Phố Đông Các, Phường Ô Chợ Dừa, Quận Đống Đa, Hà Nội</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJUaGFuZyBtXHUwMGUxeSIsIjMiOiJJbnRlcm5ldCIsIjQiOiJcdTAxMTBpXHUxZWMxdSBoXHUwMGYyYSIsIjUiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCIsIjYiOiJNXHUwMGUxeSBnaVx1MWViN3QiLCI3IjoiVHJ1eVx1MWVjMW4gaFx1MDBlY25oIGNcdTAwZTFwIn0=', 1, 0, '{\"0\":\"21.0180725\",\"1\":\"105.8299495\"}', 1, 0, '2019-05-14 18:56:30', '2019-05-14 18:56:30');
