.<br> - Nhà ngay mặt phố Đông Các, đường rộng, 2 ô tô con tránh nhau, nằm ngay ngã tư Ô chợ dừa và Xã Đàn rất thuận tiện cho việc đi lại, sinh hoạt, vui chơi, giải trí. Lên phố cổ cũng gần, trung tâm thương mại ngay sát <br>- Các căn hộ rộng được lát sàn gỗ cao cấp, phòng nào cũng có cửa sổ rộng, ban công phơi đồ riêng biệt. Các căn hộ được thiết kế hết sức hợp lý: <br>+ Loại 1: Gồm 1 phòng ngủ + 1 phòng khách, khu bếp có bàn bếp, tủ bếp, hút mùi, đầy đủ ánh sáng, gió và không khí vào phòng. <br>  - DT: 45m2. GIÁ 7,5 TRIỆU/THÁNG.<br>+ Loại 2: Gồm 2 phòng ngủ + 1 phòng khách và phòng bếp riêng biệt DT: 60-70m2. <br>  - GIÁ 10-12 TRIỆU/THÁNG.<br>- Mỗi phòng được trang bị điều hòa 2 chiều, giường, tủ quần áo, bộ bàn ăn, cửa sổ có rèm cản nắng cực đẹp, trần thạch cao, đèn ngủ đủ cả, bàn bếp, hút mùi, bồn rửa bát xịn. <br>- Nhà vệ sinh được lắp thiết bị vệ sinh Inax cao cấp, bình nóng lạnh Ariston, ốp lát gạch Prime sang trọng hiện đại.  <br>- Tòa nhà trang bị thang máy cao cấp, máy giặt miễn phí, truyền hình cáp, internet tốc độ cao mỗi căn hộ được cấp thẻ từ thang máy riêng. <br>- Tòa nhà có 2 bảo vệ 24/7 nên an ninh cực ổn, ra vào thoải mái, nhà để xe rộng rãi gần 300m2, có thể chứa được đến 200 chiếc xe máy. <br>- Vệ sinh dọn phòng hàng ngày nếu khách có nhu cầu. <br>* Thích hợp cho người nước ngoài, hộ gia đình và người đi làm thuê ở. <br>+ Địa chỉ: Tòa nhà 23 Phố Đông Các- P.Ô Chợ Dừa -Đống Đa- hn. <br><br><strong>LH :CHÍNH CHỦ CHỊ HƯƠNG 0978 335 871/ 0982 9696 69 / 0981 056 756</strong> <br><br><strong>2-Tòa chung cư mini 8 tầng tại số 213 phố Xã Đàn mới hoàn thiện vào ở được</strong>.<br>- Diện tích các phòng từ 35m2 - 40m2.<br>Giá cho thuê 6.000.000đ - 7.000.000đ /tháng, các căn hộ bao gồm:<br>1 phòng ngủ + phòng khách và khu bếp riêng biệt.<br>- Phòng ngủ được trang bị điều hòa 2 chiều, giường, tủ quần áo...<br>- Phòng bếp được trang bị bàn bếp, tủ bếp, chậu rửa bát...<br>- Khu vực nhà vệ sinh được lắp đầy đủ thiết bị hiện đại như chậu rửa mặt, bệt Inax, vòi sen, bình nóng lạnh...<br>- Tòa nhà có bảo vệ 24/24, đảm bảo an ninh tuyệt đối, giờ giấc ra vào thoải mái.<br>- Khu vực ban công phơi đồ riêng biệt của từng phòng.<br><br>* Tòa nhà nằm ở vị trí trung tâm, giao thông thuận tiện, cách mặt đường LA THÀNH 10m,gần các trung tâm thương mại, lên phố cổ cũng gần, cách ngã tư Ô CHỢ DỪA 300m...<br><br>Địa chỉ: SỐ 213 XÃ ĐÀN- P .NAM ĐỒNG- Q. Đống Đa.<br><strong>LH C Hương 0978 335 871 -0981 056 756 - 0976 173 640</strong><br>Giá: 10 triệu / thángDiện tích: 65 m2<br>Địa chỉ tài sản: 23 Phố Đông Các, Phường Ô Chợ Dừa, Quận Đống Đa, Hà Nội</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJUaGFuZyBtXHUwMGUxeSIsIjMiOiJJbnRlcm5ldCIsIjQiOiJcdTAxMTBpXHUxZWMxdSBoXHUwMGYyYSIsIjUiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCIsIjYiOiJNXHUwMGUxeSBnaVx1MWViN3QiLCI3IjoiVHJ1eVx1MWVjMW4gaFx1MDBlY25oIGNcdTAwZTFwIn0=', 1, 0, '{\"0\":\"21.0192795\",\"1\":\"105.8275979\"}', 1, 0, '2019-05-14 18:56:37', '2019-05-14 18:56:37');
