br><strong>2- Tòa chung cư mini 8 tầng tại số 213 phố Xã Đàn mới hoàn thiện vào ở luôn.</strong><br>- Diện tích các phòng từ 35m2 - 40m2. <br>Giá cho thuê 6.000.000đ - 7.000.000đ /tháng, các căn hộ bao gồm: <br>1 phòng ngủ + phòng khách và khu bếp riêng biệt. <br>- Phòng ngủ được trang bị điều hòa 2 chiều, giường, tủ quần áo... <br>- Phòng bếp được trang bị bàn ăn, bàn bếp, tủ bếp, chậu rửa bát... <br>- Khu vực nhà vệ sinh được lắp đầy đủ thiết bị hiện đại như chậu rửa mặt, bệt Inax, vòi sen, bình nóng lạnh... <br>- Tòa nhà có bảo vệ 24/24, đảm bảo an ninh tuyệt đối, giờ giấc ra vào thoải mái. <br>- Khu vực ban công phơi đồ riêng biệt của từng phòng. <br>* Tòa nhà nằm ở vị trí trung tâm, giao thông thuận tiện, cách mặt đường Xã Đàn 20m, nằm trong khuôn viên Tập Thể Học Viện Kỹ Thuật Quân Sự nên an ninh rất tốt, gần các trung tâm thương mại, lên phố cổ cũng gần, cách ngã tư Xã Đàn 300m... <br>Địa chỉ: Số 213 Xã Đàn- P.Kim Liên- Q.Đống Đa. <br>   <div style=\"text-align:left;\"><strong>LH C Hương 0902 212 798/ 0978 335 871 - A Lượng 0982 9696 69.</strong> </div><br><br><strong>3-Tòa nhà 9 tầng tại số nhà 23 mặt phố đông các đang hoàn thiện vào ở luôn được.</strong><br>- Nhà ngay mặt phố Đông Các, đường rộng, 2 ô tô con tránh nhau, nằm ngay ngã tư Ô chợ dừa và Xã Đàn rất thuận tiện cho việc đi lại, sinh hoạt, vui chơi, giải trí. Lên phố cổ cũng gần, trung tâm thương mại ngay sát<br>- Các căn hộ rộng được lát sàn gỗ cao cấp, phòng nào cũng có cửa sổ rộng, ban công phơi đồ riêng biệt. Các căn hộ được thiết kế hết sức hợp lý:<br> Gồm 2 phòng ngủ + 1 phòng khách và phòng bếp riêng biệt DT: 60-70m2.<br>- Mỗi phòng được trang bị điều hòa 2 chiều, giường, tủ quần áo, bộ bàn ăn, cửa sổ có rèm cản nắng cực đẹp, trần thạch cao, đèn ngủ đủ cả, bàn bếp, hút mùi, bồn rửa bát xịn.<br>- Nhà vệ sinh được lắp thiết bị vệ sinh Inax cao cấp, bình nóng lạnh Ariston, ốp lát gạch Prime sang trọng hiện đại.<br>Giá cho thuê:12.000.000 đ/căn/tháng <br>     DT Các căn hộ từ 60-70 m2<br>- Tòa nhà trang bị thang máy cao cấp, máy giặt miễn phí, truyền hình cáp, internet tốc độ cao mỗi căn hộ được cấp thẻ từ thang máy riêng.<br>- Tòa nhà có 2 bảo vệ 24/7 nên an ninh cực ổn, ra vào thoải mái, nhà để xe rộng rãi gần 300m2, có thể chứa được đến 200chiếc xe máy.<br>- Vệ sinh dọn phòng hàng ngày nếu khách có nhu cầu.<br>* Thích hợp cho người nước ngoài, hộ gia đình và người đi làm thuê ở.+ Địa chỉ: Tòa nhà 23 Phố Đông Các- P.Ô Chợ Dừa -Đống Đa- hn.<br><strong>LH :CHÍNH CHỦ CHỊ HƯƠNG 0978 335 871/0982 9696 69 /0902.212.798</strong><br>  (Tất cả các tòa nhà trên đều là chính chủ cho thuê)<br>Giá: 7 triệu / thángDiện tích: 45 m2<br>Địa chỉ tài sản: số 18 Đường Đê La Thành, Phường Phương Liên, Quận Đống Đa, Hà Nội</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJUaGFuZyBtXHUwMGUxeSIsIjMiOiJJbnRlcm5ldCIsIjQiOiJcdTAxMTBpXHUxZWMxdSBoXHUwMGYyYSIsIjUiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCIsIjYiOiJNXHUwMGUxeSBnaVx1MWViN3QiLCI3IjoiVHJ1eVx1MWVjMW4gaFx1MDBlY25oIGNcdTAwZTFwIn0=', 1, 0, '{\"0\":\"21.0150419\",\"1\":\"105.83395150000001\"}', 1, 0, '2019-05-14 18:56:45', '2019-05-14 18:56:45');
