br><br>* Tòa nhà nằm ở vị trí trung tâm, giao thông thuận tiện, cách mặt đường Doãn Kế Thiện 20m, đối diện chợ Đồng Xa nên rất thuận tiện cho việc mua sắm, đi chợ, nằm trong khuôn viên tập quân đội nên an ninh rất tốt, gần các trung tâm thương mại, gần các trường ĐH như quốc gia, Đại học Thương Mại, gần bến xe Mỹ Đình, gần đường Lê Đức Thọ...<br><strong>Địa chỉ: Số 32/C1 – Đường Doãn Kế Thiện - P Mai Dịch - Cầu Giấy.<br>LH C Hương 0978 335 871./ 0902 212 798 / 0982 9696 69</strong><br><br><strong>2-Tòa nhà 9 tầng tại số nhà D2 ngõ 93 phố Cầu Giấy - P. Quan Hoa - Cầu Giấy, vào ở luôn.</strong><br>- Nhà ngay phố Cầu Giấy, đường vào rộng, 2 ô tô con tránh nhau, rất thuận tiện cho việc đi lại, sinh hoạt, vui chơi, giải trí. Lên phố cổ cũng gần, trung tâm thương mại ngay sát, gần trường Đại học Sư Phạm, Học Viện Báo Chí Và Tuyên Truyền...<br>- Các căn hộ rộng được lát sàn gạch cao cấp, căn nào cũng có cửa sổ rộng, ban công phơi đồ riêng biệt. Các căn hộ được thiết kế hết sức hợp lý:<br>+ Loại 1: Gồm 1 phòng ngủ + 1 phòng khách, khu bếp có bàn bếp, tủ bếp, đầy đủ ánh sáng, gió và không khí vào phòng. DT 45m2.<br>+ Loại 2: Gồm 2 phòng ngủ + 1 phòng khách và phòng bếp riêng biệt DT 50m2.<br><br>- Mỗi phòng được trang bị điều hòa 2 chiều, giường, tủ quần áo, cửa sổ có rèm cản nắng cực đẹp, trần thạch cao, đèn ngủ đủ cả, bàn bếp xịn, hút mùi, bồn rửa bát xịn, sàn gỗ cao cấp.<br>- Nhà vệ sinh được lắp thiết bị vệ sinh Inax cao cấp, bình nóng lạnh Ariston, ốp lát gạch Prime sang trọng, có bồn tắm đứng hiện đại.<br><br>Giá cho thuê: 6.000.000 - 6.500.000đ- 7.500.000đ/căn/tháng (thanh toán tối thiểu 03 tháng và đặt cọc 1 tháng). DT Các phòng từ 45 - 50m2.<br><br>- Tòa nhà trang bị thang máy cao cấp, máy giặt, truyền hình cáp, internet tốc độ cao miễn phí, mỗi căn hộ được cấp thẻ từ thang máy riêng.<br>- Tòa nhà có 2 bảo vệ 24/24 nên an ninh cực ổn, ra vào thoải mái, nhà để xe rộng rãi gần 200m2, có thể chứa được đến 80 chiếc xe máy.<br><br>+ Địa chỉ: Tòa nhà D2 ngõ 93 phố Cầu Giấy, P. Quan Hoa, Q. Cầu Giấy. (Cách Cầu Giấy 300m).<br><strong>LH C Hương 0978 335 871./ 0902 212 798 / 0982 9696 69<br>Giá: 5 triệu / thángDiện tích: 35 m2<br>Địa chỉ tài sản: 32c1 Phố Doãn Kế Thiện, Phường Mai Dịch, Quận Cầu Giấy, Hà Nội</strong></div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJUaGFuZyBtXHUwMGUxeSIsIjMiOiJJbnRlcm5ldCIsIjQiOiJcdTAxMTBpXHUxZWMxdSBoXHUwMGYyYSIsIjUiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCIsIjYiOiJNXHUwMGUxeSBnaVx1MWViN3QiLCI3IjoiVHJ1eVx1MWVjMW4gaFx1MDBlY25oIGNcdTAwZTFwIn0=', 1, 0, '{\"0\":\"21.0414805\",\"1\":\"105.77725750000002\"}', 1, 0, '2019-05-14 18:56:51', '2019-05-14 18:56:51');
