từ 5.000.000đ - 5.500.000đ - 6.500.000đ - 7.500.000 đ/căn.</strong><br>- Thanh toán tối thiểu 3 tháng + đặt cọc 1 tháng.<br>Các căn hộ bao gồm:<br>+ 1 phòng ngủ riêng biệt có cửa sổ thông thoáng được trang bị điều hòa 2 chiều, giường, tủ quần áo.<br>+ 1 phòng khách cũng có thể bố trí làm phòng ngủ nếu nhà có đông người.<br>+ Phòng bếp được trang bị bàn ăn, bàn bếp, tủ bếp, chậu rửa bát, hút mùi….<br>+ Khu vực nhà vệ sinh được lắp đầy đủ thiết bị hiện đại như chậu rửa mặt, bệt Inax, vòi sen, bình nóng lạnh...<br>+ Có ban công riêng biệt từng căn hộ và khu vực phơi đồ và để máy giặt.<br>- Tiện ích: Tòa nhà có bảo vệ 24/24, đảm bảo an ninh tuyệt đối, giờ giấc ra vào thoải mái.<br>Thang máy cao cấp, mỗi hộ gia đình có thẻ từ sử dụng riêng, internet cáp quang, miễn phí tuyền hình cáp, miễn phí máy giặt.<br>- Tòa nhà nằm ở vị trí trung tâm, giao thông thuận tiện, cách mặt đường La Thành 10m, gần hồ Hoàng Cầu, không khí thoáng mát trong lành, gần các trung tâm thương mại, đi lại vào phố cổ rất thuận tiện...<br>- Ưu tiên cho hộ gia đình, người đi làm thuê ở.<br>Địa chỉ: Số 96 Đê La Thành - Ô Chợ Dừa - Đống Đa - HN.<br>LH C Hương 0978 335 871./ 0902 212 798 / 0981 056 756<br>(Chú ý tòa nhà trên đều là chính chủ không qua môi giới).<br>Giá: 5 triệu / thángDiện tích: 40 m2<br><strong>Địa chỉ tài sản: 67 ngõ 39 Phố Hào Nam, Phường Ô Chợ Dừa, Quận Đống Đa, Hà Nội</strong></div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJUaGFuZyBtXHUwMGUxeSIsIjMiOiJJbnRlcm5ldCIsIjQiOiJcdTAxMTBpXHUxZWMxdSBoXHUwMGYyYSIsIjUiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCIsIjYiOiJNXHUwMGUxeSBnaVx1MWViN3QiLCI3IjoiVHJ1eVx1MWVjMW4gaFx1MDBlY25oIGNcdTAwZTFwIn0=', 1, 0, '{\"0\":\"21.0200535\",\"1\":\"105.82462659999999\"}', 1, 0, '2019-05-14 18:56:57', '2019-05-14 18:56:57');
INSERT INTO `motelrooms` VALUES (229, 'Phòng CCMN có điều hòa nóng lạnh wifi 35m2 - ngõ 39 Đại Đồng, Q. Hoàng Mai - 0902163344 - 0902136044', 'phong-ccmn-co-dieu-hoa-nong-lanh-wifi-35m2-ngo-39-dai-dong-q-hoang-mai-0902163344-0902136044', 3000000, 35.0000, 1, 57, 62, '39 Đại Đồng, Đại Đồng, Hoàng Mai, Hà Nội', '0902163344', 4, 'Khép kín', '{\"0\":\"phong-ccmn-co-dieu-hoa-nong-lanh-wifi-35m2-ngo-39-dai-dong-q-hoang-mai-0902163344-0902136044-54tak.jpg\",\"1\":\"phong-ccmn-co-dieu-hoa-nong-lanh-wifi-35m2-ngo-39-dai-dong-q-hoang-mai-0902163344-0902136044-nwaoq.jpg\",\"2\":\"phong-ccmn-co-dieu-hoa-nong-lanh-wifi-35m2-ngo-39-dai-dong-q-hoang-mai-0902163344-0902136044-etcuf.jpg\",\"3\":\"phong-ccmn-co-dieu-hoa-nong-lanh-wifi-35m2-ngo-39-dai-dong-q-hoang-mai-0902163344-0902136044-2vg8k.jpg\",\"4\":\"phong-ccmn-co-dieu-hoa-nong-lanh-wifi-35m2-ngo-39-dai-dong-q-hoang-mai-0902163344-0902136044-76lnr.jpg\"}', '<div class=\"dis-content\">[Update 7/1] CÒN PHÒNG TẦNG 3<br>Xin chào, gia đình tôi hiện còn trống phòng ở tầng 3 với giá 3tr/tháng.<br>Gồm 1 phòng ngủ, 1 phòng bếp, 1 toilet ban công.<br>Tất cả đều riêng biệt, chỉ chung cửa vào nhà chính ở tầng 1 và cầu thang bộ đi lên, không quản giờ giấc đi về, xe máy để tầng 1.<br>Diện tích sử dụng trên 35m2, nhà cửa mới xây còn rất mới.<br>Trong phòng có: Điều hòa, bình nước nóng, giường 1m6x2m. Ngoài ra có sẵn rèm, dây truyền hình cáp và internet.<br>Địa chỉ: Ngõ 39 Đại Đồng – P. Thanh Trì – Hoàng Mai.<br>Gần Time City, gần trường Kinh Doanh Công Nghệ, gần chợ gần bệnh viện, công viên… thích hợp cho gia đình nhỏ 2-3 người hoặc 2-3 bạn đi học đi làm ở chung với nhau. Nhà xây kiểu Chung cư mini nên sẽ thoáng và tiện nghi hơn so với nhà cấp 4 mái tôn, bạn có thể yên tâm về an ninh cũng như sinh hoạt.<br>Điện 3.3 nghìn/số, nước 20 nghìn/khối. Internet 100 nghìn/tháng nếu dùng.<br>RIÊNG TƯ 100% - KO QUẢN GIỜ GIẤC ĐI VỀ <br>Tiền nhà đóng tiền hàng tháng một, cọc 1 tháng<br>Mọi chi tiết xin trực tiếp liên hệ chủ nhà: Cô Lan 0902163344 hoặc 0902136044</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCIsIjMiOiJcdTAxMTBpXHUxZWMxdSBoXHUwMGYyYSIsIjQiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCJ9', 1, 0, '{\"0\":\"20.9974298\",\"1\":\"105.88401099999999\"}', 1, 0, '2019-05-14 18:57:00', '2019-05-14 18:57:00');
