g, Quận Long Biên Hà Nội.<br>Khu vực tiện sinh hoạt, cách Big C và Aeon 5 phút xe máy, cách cầu Vĩnh Tuy 200m, cạnh nhà là tạp hóa, cách 500m là chợ dân sinh, đi bộ 200m là điểm dừng xe bus, đường ngõ lớn ô tô đỗ cửa nhé<br>Trong phòng đã có sẵn điều hòa, bình nóng lạnh, giường.<br>Camera an ninh 24/24.<br>Chỉ nhận 1 xe máy/ phòng để ở tầng 1<br>Điện 3.400đ/ số ; nước 30.000đ/ khối<br>Wifi 100.000đ/ phòng/ tháng<br>Giá phòng : 2.600.000đ/ tháng, cọc 1 tháng đóng tiền tháng một.<br>Mọi chi tiết xin liên hệ Hưng chủ nhà 0904748688<br></div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJUaGFuZyBtXHUwMGUxeSIsIjMiOiJJbnRlcm5ldCIsIjQiOiJcdTAxMTBpXHUxZWMxdSBoXHUwMGYyYSIsIjUiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCJ9', 1, 0, '{\"0\":\"21.04074817629137\",\"1\":\"105.89851135131221\"}', 1, 0, '2019-05-14 18:57:03', '2019-05-14 18:57:03');
INSERT INTO `motelrooms` VALUES (231, 'Phòng trọ nhà 5 tầng, có nóng lạnh điều hòa giá 1tr8', 'phong-tro-nha-5-tang-co-nong-lanh-dieu-hoa-gia-1tr8', 1800000, 20.0000, 1, 10, 47, 'Ngõ 347/57 Cổ nhuế 2 - Bắc từ Liêm - Hà nội, Cổ Nhuế, Từ Liêm, Hà Nội', '0965818978', 5, 'Khép kín', '{\"0\":\"phong-tro-nha-5-tang-co-nong-lanh-dieu-hoa-gia-1tr8-resized-yrbfe.JPG\",\"1\":\"phong-tro-nha-5-tang-co-nong-lanh-dieu-hoa-gia-1tr8-resized-j21fg.JPG\",\"2\":\"phong-tro-nha-5-tang-co-nong-lanh-dieu-hoa-gia-1tr8-resized-8frva.JPG\",\"3\":\"phong-tro-nha-5-tang-co-nong-lanh-dieu-hoa-gia-1tr8-resized-cgtdz.JPG\",\"4\":\"phong-tro-nha-5-tang-co-nong-lanh-dieu-hoa-gia-1tr8-resized-of5de.JPG\",\"5\":\"phong-tro-nha-5-tang-co-nong-lanh-dieu-hoa-gia-1tr8-resized-lscji.JPG\",\"6\":\"phong-tro-nha-5-tang-co-nong-lanh-dieu-hoa-gia-1tr8-resized-isjry.JPG\",\"7\":\"phong-tro-nha-5-tang-co-nong-lanh-dieu-hoa-gia-1tr8-resized-eiuta.JPG\"}', '<div class=\"dis-content\">Mình có một căn nhà 5 tầng mới xây xong năm nay. Nhà nằm ở địa chỉ số nhà 24 ngõ 347 ngách 57 cổ nhuế 2 - bắc từ liêm - hà nội. Gần các trường đại học MỎ, Tài Chính, Học viện Cảnh sát và Có lối tắt để ra công viên hòa bình, tới trạm bus khoảng 5-8 phút.Nhà có tổng cộng 14 phòng tất cả, mỗi phòng đều có lắp nóng lạnh, điều hòa và có giường sẵn, chỉ việc đến ở và thư giãn. Giá cho thuê từ 1tr8 - 2tr2. Rất thích hợp với sinh viên và hộ gia đình. Ngoài ra, còn có gác xép rộng rãi đủ cho 3 người nằm. Mọi thứ ổn định và hoàn chỉnh, của kính rất hiện đại và chắc chắn. Sau đây sẽ là một số thông tin cụ thể về mỗi phòng:<br>+ Diện tích: 16 - 25 mét vuông.<br>+ Tình trạng: Mới 100%<br>+ Giường: Có sẵn<br>+ Nóng lạnh: Có sẵn<br>+ Điều hòa: Có sẵn<br>+ Bếp nấu: Trong nhà hoặc ngoài trời (tùy phòng)<br>+ Số người ở: Thoải mái người ở<br>+ Điện: Tính theo số (4k/1KW.h) có công tơ riêng<br>+ Nước: Cực kì rẻ (8K/1 Khối) có công tơ riêng<br>+ An ninh: An toàn tuyệt đối, có Camera<br>+ Nhà để xe: Có riêng nhà xe, thoải mái chỗ để<br>+ Vệ sinh chung: Có người giúp việc (10K/phòng)<br>+ Rác đổ: Ngay cạnh cổng và có người giúp việc đổ rác<br>+  Giờ giấc: THOẢI MÁI ĐI LẠI<br>+ Chung chủ: KHÔNG CHUNG CHỦ<br>Nhà mới xây nên các bạn hoàn toàn yên tâm là mọi thứ OK, nếu bạn quan tâm hãy gọi cho mình: 0965.818.978 - Mình tên Quân. Mình không phải trung gian nên các bạn cứ yên tâm nhé. Mình có đăng cho thuê ở nhiều trang khác nữa với nội dung copy y hệt nên các bạn sẽ dễ dàng tìm thấy thông tin này. Khi nào hết phòng mình sẽ tự động xóa bài, vì thế khi thấy còn bài Post này tức là vẫn còn phòng cho thuê nhé.</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCIsIjMiOiJcdTAxMTBpXHUxZWMxdSBoXHUwMGYyYSIsIjQiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCIsIjUiOiJUcnV5XHUxZWMxbiBoXHUwMGVjbmggY1x1MDBlMXAifQ==', 1, 0, '{\"0\":\"21.0672509\",\"1\":\"105.77872750000006\"}', 1, 0, '2019-05-14 18:57:07', '2019-05-14 18:57:07');
INSERT INTO `motelrooms` VALUES (233, 'CC Cho thuê phòng trọ nhà 4 tầng Ngô Quyền Hà Đông', 'cc-cho-thue-phong-tro-nha-4-tang-ngo-quyen-ha-dong', 2000000, 20.0000, 1, 21, 127, 'Nhà số 4D, ngách 1, cụm 2, ngõ 32 Ngô Quyền , Quang Trung Hà Đông Hà Nội, Ngô Quyền, Hà Đông, Hà Nội', '0932352266', 2, 'Khép kín', '{\"0\":\"cc-cho-thue-phong-tro-nha-4-tang-ngo-quyen-ha-dong-lh6xw.jpg\",\"1\":\"cc-cho-thue-phong-tro-nha-4-tang-ngo-quyen-ha-dong-me3bo.jpg\",\"2\":\"cc-cho-thue-phong-tro-nha-4-tang-ngo-quyen-ha-dong-xjdvu.jpg\",\"3\":\"cc-cho-thue-phong-tro-nha-4-tang-ngo-quyen-ha-dong-u2gcp.jpg\",\"4\":\"cc-cho-thue-phong-tro-nha-4-tang-ngo-quyen-ha-dong-ckju3.jpg\"}', '<div class=\"dis-content\">Chính chủ cho thuê phòng trọ trong nhà 4 tầng có 3 phòng (không chung chủ, giờ giấc thoải mái)Địa chỉ: Nhà 4D, ngách 1, cụm 2 ngõ 32 Ngô Quyền- Hà Đông ( Cách Metro Hà Đông hơn 1km)<br>Gần bệnh viện Hà Đông, CĐ y Hà Đông, Có đường thông ra Tố Hữu, khu đô thị Dương Nội...<br>Khu dân cư văn minh, yên tĩnh.<br>- Phòng tầng 3 : 20m2- sàn gỗ sạch sẽ thoáng mát : 2.000.000/ tháng<br>- phòng tầng 4: 20m2- sàn lát đá hoa cương: 1.600.000/ tháng<br>Tiện ích: Điều hòa, nóng lạnh, máy giặt,wifi... có khu phơi đồ riêng<br>Nấu ăn, để xe tầng 1 rộng rãi.<br>Điện nước giá nhà nước.<br>Yêu cầu:<br>-Phòng ở tối đa 2 người<br>-không cho hộ gia đình thuê <br>-Ở sạch sẽ, giữ gìn đồ đạc.<br>Liên hệ xem nhà: A Sang : 0932 35 2266Giá: 2 triệu / thángĐ/c: Nhà số 4D, ngách 1, cụm 2, ngõ 32 Ngô Quyền, Hà Đông</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCIsIjMiOiJcdTAxMTBpXHUxZWMxdSBoXHUwMGYyYSIsIjQiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCIsIjUiOiJNXHUwMGUxeSBnaVx1MWViN3QifQ==', 1, 0, '{\"0\":\"20.9718403\",\"1\":\"105.76884180000002\"}', 1, 0, '2019-05-14 18:57:10', '2019-05-14 18:57:10');
INSERT INTO `motelrooms` VALUES (236, 'Cho NỮ thuê nhà – HOMESTAY Nghi Tàm- Nhà trọ tiện nghi giá cả hợp lý', 'cho-nu-thue-nha-homestay-nghi-tam-nha-tro-tien-nghi-gia-ca-hop-ly', 1300000, 30.0000, 1, 19, 129, 'Số 18 ngách 62 ngõ 108 Nghi Tàm, đường Nghi Tàm, Tây Hồ, Hà Nội', '01688257253', 6, 'Khép kín', '{\"0\":\"cho-nu-thue-nha-homestay-nghi-tam-nha-tro-tien-nghi-gia-ca-hop-ly-9kqw1.png\",\"1\":\"cho-nu-thue-nha-homestay-nghi-tam-nha-tro-tien-nghi-gia-ca-hop-ly-xuxjs.jpg\",\"2\":\"cho-nu-thue-nha-homestay-nghi-tam-nha-tro-tien-nghi-gia-ca-hop-ly-ihxrg.jpg\",\"3\":\"cho-nu-thue-nha-homestay-nghi-tam-nha-tro-tien-nghi-gia-ca-hop-ly-mlvfg.jpg\"}', '<div class=\"dis-content\">KHUYẾN MÃI CỰC HOT CHÀO MỪNG NĂM MỚI<br>Khuyến mãi chỉ còn 1,1tr/tháng dành cho những người đăng ký trong tháng 12 và tháng 1, SỐ LƯỢNG CÓ HẠN<br><br>Chỉ với 1,1 triệu, bạn sẽ được:<br>Cover toàn bộ chi phí bao gồm điện, nước, internet tốc độ cao <br>Miễn phí sử dụng các tiện nghi trong nhà: Điều hòa, tủ lạnh, lò vi sóng, máy giặt, máy lọc nước, bình nóng lạnh, quạt, bếp, máy xay sinh tố…<br>Không gian sống siêu thoải mái với không gian học tập và làm việc, không gian đọc sách, tiếp khách<br>Giờ giấc sinh hoạt tự do không chung chủ<br>Khu vực an ninh, cực kỳ yên tĩnh, chưa từng xảy ra trộm cắp<br>Gần chợ, mua đồ siêu thuận tiện<br>Gần bến xe buýt<br>Gần Hồ Tây, Hồ Gươm, thuận tiện tập thể dục, đi chơi, du lịch, nhiều Tây tha hồ học tiếng anh<br>Có giường riêng cho người thân bạn bè ghé thăm <br>Có homemates là 2 em mèo siêu đáng yêu<br><br>Một khoản đầu tư quá hời cho một cuộc sống tiện nghi đầy đủ, bạn chỉ cần xách vali đến và ở<br>Địa chỉ: Số 18 ngách 62 ngõ 108 Nghi Tàm - Homestay Nghi Tàm<br>Sdt: 01688257253 (Trâm Anh) - 01633678645 (Huyền)<br>Chỉ cho nữ thuê &lt;3<br><br><br></div>', 'eyIwIjoiU1x1MDBlMm4gcGhcdTAxYTFpIiwiMSI6IkludGVybmV0IiwiMiI6Ilx1MDExMGlcdTFlYzF1IGhcdTAwZjJhIiwiMyI6IkJcdTAwZWNuaCBuXHUwMGYzbmcgbFx1MWVhMW5oIiwiNCI6Ik1cdTAwZTF5IGdpXHUxZWI3dCJ9', 1, 0, '{\"0\":\"21.0560637\",\"1\":\"105.83623540000008\"}', 1, 0, '2019-05-14 18:57:17', '2019-05-14 18:57:17');
