cáp trung ương<br>Chỉ nhận 2 xe máy để free ở tầng 1.<br>&gt;&gt;&gt;&gt; Mọi chi tiết xin liên hệ Hằng 0904040387 hoặc pm zalo facebook imes, cảm ơn.<br>*** Ngoài ra mình còn trống 1 căn 2 ngủ 1 phòng tắm &gt;100m2 cùng tòa nhà giá 7 triệu nhé ạ.<br></div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJUaGFuZyBtXHUwMGUxeSIsIjMiOiJJbnRlcm5ldCIsIjQiOiJcdTAxMTBpXHUxZWMxdSBoXHUwMGYyYSIsIjUiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCIsIjYiOiJNXHUwMGUxeSBnaVx1MWViN3QiLCI3IjoiVHJ1eVx1MWVjMW4gaFx1MDBlY25oIGNcdTAwZTFwIn0=', 1, 0, '{\"0\":\"21.060983716700537\",\"1\":\"105.83438189947515\"}', 1, 0, '2019-05-14 18:57:20', '2019-05-14 18:57:20');
