5\":\"con-phong-chung-cu-mini-2-ngu-100m2-moi-sang-sach-thoang-tai-ngo-34-au-co-hang-0904040387-rideb.jpg\",\"16\":\"con-phong-chung-cu-mini-2-ngu-100m2-moi-sang-sach-thoang-tai-ngo-34-au-co-hang-0904040387-odabc.jpg\"}', '<div class=\"dis-content\">Xin chào, nhà mình vừa trống 1 căn chung cư mini trên 100m2, tại tầng 6 có thang máy<br>Địa chỉ : tầng 6, số 27 ngõ 34 Âu Cơ, Quận Tây Hồ (ngay đầu Âu Cơ – Nghi Tàm) Không khí trong lành yên tĩnh, là khu Tây giữa lòng Hà Nội. Gần chợ gần phố cổ đường đi thuận lợi. Cách trung tâm phố Tây-Xuân Diệu 3 phút xe máy, đi bộ qua đường là Sheraton luôn.<br>&gt;&gt;&gt; Kết cấu gồm 2 phòng ngủ + phòng bếp + phòng khách + 1 nhà tắm<br>Có sân phơi đồ rộng (tính cả sân phơi 120m2)<br>Bạn có thể thêm bình phong/ rèm để thêm phòng ngủ 3 nếu cần<br>Các đồ có sẵn : 3 điều hòa 2 chiều, 1 bình nóng lạnh. 1 kệ tivi to, 1 tủ tường gỗ + 2 giường 1m6 x 2m<br>&gt;&gt;&gt; HOÀN TOÀN RIÊNG BIỆT, KO QUẢN LÝ GIỜ GIẤC, KO CHUNG ĐỤNG !<br>Điều hòa tiết kiệm điện, chống nhiệt dày, ánh sáng tốt, phòng đẹp, mời bạn xem ảnh hoặc pm mình để xem clip thêm.<br>Điện: 3400đ/ số.<br>Nước: 28000đ/ khối.<br>Internet , truyền hình cáp trung ương đã có sẵn<br>Giá thuê 6.8-7.3 triệu tùy độ dài hợp đồng. Chấp nhận đóng tiền tháng một. Thuê càng lâu giá càng ưu đãi<br>Chi tiết xin liên hệ Hằng 0904040387 hoặc nhắn tin zalo facebook imes đều được (mình ko phải trung gian nhé)<br>____ Ngoài ra mình vẫn còn phòng 1 phòng ngủ 40m2 giá 4.5 triệu cùng tòa nhà nhé ạ :)</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJUaGFuZyBtXHUwMGUxeSIsIjMiOiJJbnRlcm5ldCIsIjQiOiJcdTAxMTBpXHUxZWMxdSBoXHUwMGYyYSIsIjUiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCIsIjYiOiJUcnV5XHUxZWMxbiBoXHUwMGVjbmggY1x1MDBlMXAifQ==', 1, 0, '{\"0\":\"21.061202441628843\",\"1\":\"105.83452823815924\"}', 1, 0, '2019-05-14 18:57:25', '2019-05-14 18:57:25');
