INSERT INTO `motelrooms` VALUES (241, 'chuyển nhượng phòng trọ', 'chuyen-nhuong-phong-tro', 1600000, 15.0000, 1, 16, 100, 'số nhà 1A ngõ 43 Doãn kế thiện, Doãn Kế Thiện, Cầu Giấy, Hà Nội', '0981064410', 3, 'Khép kín', '{\"0\":\"chuyen-nhuong-phong-tro-resized-odqc2.jpg\",\"1\":\"chuyen-nhuong-phong-tro-resized-7iyo9.jpg\"}', '<div class=\"dis-content\">Mình mới thuê nhưng do có việc đột xuất nên có cần chượng phòng trong tháng 12 này <br>phòng rộng thoáng mát có thể ở 3 người có đầy đủ bình nóng lạnh điều hòa<br>Rất gần trường đại học thương mại, đại học sư phạm .... đặc biệt rất gần chợ<br>giá điện là 4k/1 số, nước tính theo đầu người<br>ai có nhu cầu liên hệ với mình qua số 0981064410 mình cần chuyển nhượng gấp.</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCIsIjMiOiJcdTAxMTBpXHUxZWMxdSBoXHUwMGYyYSIsIjQiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCJ9', 1, 0, '{\"0\":\"21.0403042\",\"1\":\"105.77895690000003\"}', 1, 0, '2019-05-14 18:57:31', '2019-05-14 18:57:31');
INSERT INTO `motelrooms` VALUES (242, 'Nhà trọ số Hồ Tùng Mậu giờ giấc tự do,khép kín, có nóng lạnh, điều hòa, máy giặt, chỗ để xe miễn phí', 'nha-tro-so-ho-tung-mau-gio-giac-tu-dokhep-kin-co-nong-lanh-dieu-hoa-may-giat-cho-de-xe-mien-phi', 2100000, 22.0000, 1, 16, 39, 'số 47a ngõ 66 Hồ Tùng Mậu, Hồ Tùng Mậu, Cầu Giấy, Hà Nội', '0973612652', 6, 'Chung', '{\"0\":\"nha-tro-so-ho-tung-mau-gio-giac-tu-dokhep-kin-co-nong-lanh-dieu-hoa-may-giat-cho-de-xe-mien-phi-patdh.jpg\",\"1\":\"nha-tro-so-ho-tung-mau-gio-giac-tu-dokhep-kin-co-nong-lanh-dieu-hoa-may-giat-cho-de-xe-mien-phi-hwz6v.jpg\",\"2\":\"nha-tro-so-ho-tung-mau-gio-giac-tu-dokhep-kin-co-nong-lanh-dieu-hoa-may-giat-cho-de-xe-mien-phi-vt3lr.jpg\"}', '<div class=\"dis-content\">Nhà ở địa chỉ số 47a ngõ 66 Hồ Tùng Mậu. Ngõ thôngsang 105 Doãn Kế Thiện<br>Nhà còn 2 phòng rộng cụ thể như sau:<br>Tầng 5 gồm 2 phòng:<br>1 phòng rộng 25m2, có nóng lạnh, máy giặt ,điều hòalắp thêm nếu yêu cầu: 2tr5<br>1 phòng rộng 20m2 có nóng lạnh, máy giặt ,điều hòa lắpthêm nếu yêu cầu: 2tr1 tr<br> <br>Mô tả thêm: <br>- Nhà mặt ngõ kinh doanh có chỗ để xe rộng rãi, cócamera hoạt động 24/24 an ninh cực đảm bảo hoàn toàn free, gần chợ, các trường<br>ĐH Thương Mại, ĐH Ngoại Ngữ, ĐH Sư Phạm, ĐH Báo Chí, CĐ Du Lịch, ĐH sân khấu và<br>điện ảnh… rất gần bến xe bus thuận tiện cho việc đi lại….<br>- Nhà vệ sinh khép kín bên trong phòng, rộng rãi, lịchsự, vòi hoa sen, nóng lạnh, bệt,xịt … đầy đủ<br>- Phòng nào cũng có cửa sổ thoáng , nóng lạnh,máy giặt… <br>- 2 Máy giặt ở tầng 2 và 3 miễn phí cả nhà dùngchung, dây phơi quần áo thoáng ở tầng 3, 4<br>- Internet cáp quang băng thông lớn 60mB +<br>- Điện 4k/ số. Nước 80k/người<br>- Phòng ở nhiều người thoải mái. <br>- Tháng có người qua dọn vệ sinh chung cả nhà thườngxuyên <br>-Giờ giấc đi lại thoải mái, tiếp bạn bè vô tư miễnlà lịch sự và không làm ảnh hưởng đến người khác và hàng xóm xung quanh. <br>- Yêu cầu là ngăn nắp, sạch sẽ, không làm hư hạiphòng và các vật dụng trong nhà. Ngoài ra không thu thêm tiền gì. <br>- Có thể đến ở luôn <br>Hợp đồng lâu dài không tăng giá, chu kỳ đóng tiềnnhà 1 tháng 1 lần, đặt cọc 1 tháng tiền nhà .<br>Liên hệ: 0973 612 652 ( có bớt cho bạn nào nhiệttình)</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCIsIjMiOiJcdTAxMTBpXHUxZWMxdSBoXHUwMGYyYSIsIjQiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCIsIjUiOiJNXHUwMGUxeSBnaVx1MWViN3QifQ==', 1, 0, '{\"0\":\"21.03766\",\"1\":\"105.77678300000002\"}', 1, 0, '2019-05-14 18:57:33', '2019-05-14 18:57:33');
INSERT INTO `motelrooms` VALUES (243, 'Cho thue phong tro o Giang vo', 'cho-thue-phong-tro-o-giang-vo', 2400000, 20.0000, 1, 14, 115, 'số 33 ngách 34 ngõ 612 La Thành, Giảng Võ, Ba Đình, Hà Nội, Đê La Thành, Ba Đình, Hà Nội', '0902114229', 4, 'Khép kín', '{\"0\":\"cho-thue-phong-tro-o-giang-vo-femla.jpg\"}', '<div class=\"dis-content\">Nhà gia đình ở có phòng cho sinh viên hoặc gia đình nhỏ thuê.<br>Chủ nhà là cán bộ bộ đội về hưu, khu dân cư văn minh, cộng đồng dân trí cao, có ý thức, an ninh tốt. Không phải xóm trọ nên không đông đúc, <br>phù hợp với gia đình trẻ, các bạn sinh viên thích không gian yên tĩnh.<br>Nhà ở khu vực trung tâm thành phố, gần trung tâm triển lãm Giảng Võ, gần chợ Thành Công, gần hồ Thành Công, hồ Ngọc Khánh, thuận tiện đi chợ <br>và tập thể dục, gần trường ĐH Văn Hóa và các trường mẫu công lập và tư <br>thục.<br>Căn hộ khép kín có diện tích 20m2, điện nước đầy đủ, vệ sinh riêng, lối đi riêng, nhà đầu hồi, ngay mặt ngõ, thoáng mát.<br>Gía 2 triệu 400 nghìn đồng/tháng, trả tiền 3 tháng/lần, điện nước trả theo công tơ riêng. <br>Địa chỉ: 33 ngách 34 ngõ 612 La Thành, Giảng Võ, Ba Đình, Hà Nội<br>Liên hệ: trực tiếp miễn trung gian – sdt: 0906276081</div>', 'eyIwIjoiSW50ZXJuZXQifQ==', 1, 0, '{\"0\":\"21.0244963\",\"1\":\"105.8129566\"}', 1, 0, '2019-05-14 18:57:35', '2019-05-14 18:57:35');
INSERT INTO `motelrooms` VALUES (244, 'Chính chủ cho thuê phòng trọ khép kín, diện tích 20m2 tại Thanh Đàm, phường Thanh Trì, quận Hoàng Mai', 'chinh-chu-cho-thue-phong-tro-khep-kin-dien-tich-20m2-tai-thanh-dam-phuong-thanh-tri-quan-hoang-mai', 1500000, 20.0000, 1, 57, 131, 'Số 47 ngõ 28 Thanh Đàm, phường Thanh Trì, Hoàng Mai, HN, Thanh Đàm, Hoàng Mai, Hà Nội', '0982349279', 3, 'Khép kín', '{\"0\":\"chinh-chu-cho-thue-phong-tro-khep-kin-dien-tich-20m2-tai-thanh-dam-phuong-thanh-tri-quan-hoang-mai-fvlaw.jpg\",\"1\":\"chinh-chu-cho-thue-phong-tro-khep-kin-dien-tich-20m2-tai-thanh-dam-phuong-thanh-tri-quan-hoang-mai-5hzsc.jpg\",\"2\":\"chinh-chu-cho-thue-phong-tro-khep-kin-dien-tich-20m2-tai-thanh-dam-phuong-thanh-tri-quan-hoang-mai-ps00r.jpg\"}', '<div class=\"dis-content\">Cho thuê phòng trọ khép kín trong nhà 4 tầng.<br>Đầy đủ thiết bị vệ sinh và bàn bếp, có gác xép để đồ.<br>Nhà 04 tầng, sân để xe tầng 1, sân phơi tầng 4 rộng rãi. Giờ giấc tự do, an ninh tốt.<br>Địa chỉ số nhà 47, ngõ 28 Thanh Đàm, phường Thanh Trì, quận Hoàng Mai, Hà Nội.<br>Điện 3.5 nghìn/số.<br>Nước 25 nghìn/số.<br>Diện tích phòng: 20m2.<br>Giá cho thuê: 1.5 tr/tháng.<br>Phòng trong nhà mới xây.<br>Nhà tiện chợ và điểm xe bus ngay đê Nguyễn Khoái.<br>Gần các trường đại học: Kinh Doanh Công Nghệ, Y Tuệ Tĩnh, Kinh Tế Kỹ Thuật Hà Nội, cầu Vĩnh Tuy, Times City...<br>Liên hệ chính chủ: Mr Thuyên 0982349279 (Miễn trung gian).</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCIsIjMiOiJUcnV5XHUxZWMxbiBoXHUwMGVjbmggY1x1MDBlMXAifQ==', 1, 0, '{\"0\":\"20.993912216205306\",\"1\":\"105.89120079922793\"}', 1, 0, '2019-05-14 18:57:37', '2019-05-14 18:57:37');
INSERT INTO `motelrooms` VALUES (245, 'Phòng tầng 3 số 16/220 Nam Dư , Hoàng Mai', 'phong-tang-3-so-16220-nam-du-hoang-mai', 1400000, 10.0000, 1, 57, 132, '16/220 Nam Dư , Hoàng Mai, Hà nội, Nam Dư, Hoàng Mai, Hà Nội', '0969770896', 1, 'Chung', '{\"0\":\"phong-tang-3-so-16220-nam-du-hoang-mai-rxvgy.JPG\",\"1\":\"phong-tang-3-so-16220-nam-du-hoang-mai-ex7cz.JPG\",\"2\":\"phong-tang-3-so-16220-nam-du-hoang-mai-tsgwn.JPG\",\"3\":\"phong-tang-3-so-16220-nam-du-hoang-mai-resized-xpkug.jpg\",\"4\":\"phong-tang-3-so-16220-nam-du-hoang-mai-resized-xqwhn.jpg\"}', '<div class=\"dis-content\">Hi các bạn , hiện tại nhà số 16/220 Nam Dư , Hoàng Mai do bên mình quản lý còn 1 phòng tầng 3 nhỏ xinh , full đồ ,rất phù hợp với bạn nào thích không gian riêng ở một mình. <br>- Địa chỉ: số 16/220 Nam Dư, phía sau trường tiểu học Lĩnh Nam,gần chợ, có thể đi vào từ ngõ 479 Lĩnh Nam , cách trường ĐHKTKT Công Nghiệp 1,4 km.<br>- Phòng đầy đủ giường tủ , bàn ghế , bàn trang điểm, nhà vs có nóng lạnh, chỉ việc mang quần áo vào ở.<br>- Giá thuê : 1.400.000 / tháng , cọc 1 tháng và đóng tháng một.<br>- Điện nước share bill cả nhà, net 60k.<br>- Giờ tự do, không chung chủ, mỗi người chìa khóa.<br>- Ưu tiên người đi làm ở sạch, ngăn nắp, chăm dọn vệ sinh hòa nhập với văn hóa chung của nhà.<br>Liện hệ : 0969.770.896</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCIsIjMiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCJ9', 1, 0, '{\"0\":\"20.981924551258132\",\"1\":\"105.88448612485354\"}', 1, 0, '2019-05-14 18:57:39', '2019-05-14 18:57:39');
INSERT INTO `motelrooms` VALUES (246, 'Cho thuê nhà ở khép kín gần chợ Phùng Khoang', 'cho-thue-nha-o-khep-kin-gan-cho-phung-khoang', 3000000, 40.0000, 1, 10, 92, 'số 55 ngõ 30 đường Phùng Khoang, Trung Văn, Từ Liêm, Hà Nội', '0967781573', 3, 'Khép kín', '{\"0\":\"cho-thue-nha-o-khep-kin-gan-cho-phung-khoang-resized-adndk.jpg\"}', '<div class=\"dis-content\">Cho thuê nhà ở tại số 55 ngõ 30 đường Phùng Khoang, Quận Nam Từ Liêm, Hà nội<br>✽ 40m2 giá 3 triệu đồng/tháng<br>► Điện, nước đầy đủ, giá cả nhà nước.<br>► Có bình tắm nóng lạnh.<br>► Nhà có chỗ để xe rộng rãi (cả tầng 1) an toàn.<br>► Bảo vệ, Camera an ninh 24/24 <br>► Wifi, Internet ADSL, Truyền hình cáp đầy đủ.<br>► Không ở chung với chủ nhà<br>► Nhà nằm gần trường học, bệnh viện và chợ Phùng Khoang <br>► Rất thuận tiện đi lại. <br>► Điện thoại liên hệ: 0967781573 ( Chú Sâm)<br>► Địa chỉ : Số 55 Ngõ 30 Đuờng Phùng Khoang <br>(cách nhà hàng Chiến béo 2 nhà, cổng màu xanh lá cây đậm).<br>► Cam kết tôi là chính chủ, không qua môi giới</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCIsIjMiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCIsIjQiOiJUcnV5XHUxZWMxbiBoXHUwMGVjbmggY1x1MDBlMXAifQ==', 1, 0, '{\"0\":\"20.989171\",\"1\":\"105.78353479999998\"}', 1, 0, '2019-05-14 18:57:41', '2019-05-14 18:57:41');
INSERT INTO `motelrooms` VALUES (247, 'Cho thuê phòng ', 'cho-thue-phong', 3000000, 30.0000, 1, 57, 133, 'số 12 ngõ 18 Định Công Thượng, quận Hoàng Mai, Hà Nội, Cầu Lủ, Hoàng Mai, Hà Nội', '0987198519', 3, 'Khép kín', '{\"0\":\"cho-thue-phong-1513104720gbq2g-resized-3utny.jpg\",\"1\":\"cho-thue-phong-1513104720gbq2g-resized-j1jq8.jpg\",\"2\":\"cho-thue-phong-1513104720gbq2g-resized-bezox.jpg\"}', '<div class=\"dis-content\">Cho thuê phòng 30m2 trong chung cư mini 6 tầng. Đi cầu thang máy,camera 24h, internet tốc độ cao.Phòng rộng thoáng mát, đầy đủ tiện nghi...Gần chợ, trường học, thông ra nhiều tuyến đường rất thuận tiện.Chung cử còn có nhà để xe có cửa từ bảo mật bằng vân tay. có giám sát đảm bảo an ninh cho chung cư.( Gía phòng 3.000.000/tháng có thể thương lượng)<br>Địa chỉ: số 12 ngõ 18 Định Công Thượng, quận Hoàng Mai, Hà Nội.<br>Mọi thông tin LIÊN HỆ : 0987198519</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlRoYW5nIG1cdTAwZTF5IiwiMiI6IkludGVybmV0IiwiMyI6IkJcdTAwZWNuaCBuXHUwMGYzbmcgbFx1MWVhMW5oIn0=', 1, 0, '{\"0\":\"20.9802264\",\"1\":\"105.81917410000005\"}', 1, 0, '2019-05-14 18:57:43', '2019-05-14 18:57:43');
INSERT INTO `motelrooms` VALUES (248, 'cho thuê phòng trọ 20m2 ,tầng 3 ,nhà 4 tầng.', 'cho-thue-phong-tro-20m2-tang-3-nha-4-tang', 2000000, 20.0000, 1, 57, 3, '30b ngõ 192 kim giang, Kim Giang, Hoàng Mai, Hà Nội', '0986903600', 2, 'Chung', '{\"0\":\"cho-thue-phong-tro-20m2-tang-3-nha-4-tang-resized-jfmq6.jpg\"}', '<div class=\"dis-content\">cho thuê phòng tầng 3 trong nhà 4 tầng ,có ban công thoáng mát,phòng đẹp tiện nghi đầy đủ :  điều hòa, bình nóng lạnh, vòi sen tắm, gần đại học thăng long ,đại học khoa học tự nhiên ,đại học hà nội, gần chợ dân sinh giá rẻ. Khu vực an ninh trật tự rất tốt ,yên tĩnh. điện nước theo giá nhà nước .</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJcdTAxMTBpXHUxZWMxdSBoXHUwMGYyYSIsIjMiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCJ9', 1, 0, '{\"0\":\"20.9792134\",\"1\":\"105.81762320000007\"}', 1, 0, '2019-05-14 18:57:45', '2019-05-14 18:57:45');
INSERT INTO `motelrooms` VALUES (249, 'cho thuê phòng tại Số 8, Ngõ 50, Đường Lĩnh Nam', 'cho-thue-phong-tai-so-8-ngo-50-duong-linh-nam', 1500000, 18.0000, 1, 57, 59, 'số 8 ngõ 50 Đường Lĩnh Nam, Phường Mai Động, Quận Hoàng Mai, Lĩnh Nam, Hoàng Mai, Hà Nội', '01254499587', 2, 'Khép kín', '{\"0\":\"cho-thue-phong-tai-so-8-ngo-50-duong-linh-nam-1513070434aromv-cxixc.jpg\"}', '<div class=\"dis-content\">Còn 1 phòng cho nữ thuê ưu tiên sinh viên<br>- Phòng tầng 3, diện tích 18m2.<br>- Có giường, bàn học , bình nóng lạnh<br>- Có chỗ để xe tầng 1.<br>- Nấu ăn tầng 1, chỗ phơi tầng 4 thoáng, rộng.<br>- Nhà tắm, nhà bếp và phòng giặt riêng.<br>Khu vực an ninh tốt, văn minh, giao thông thuận tiện<br>Gần chợ Mai động, siêu thị (FIVIMART, T-Mart), Time City, gần ĐH Kinh doanh công nghệ, KTKTCN, BKHN, Xây dựng, Kinh Tế.<br>Liên hệ : bà Liên , số 8 ngõ 50 đường Lĩnh Nam, Hoàng Mai , Hà Nội</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCJ9', 1, 0, '{\"0\":\"20.9770005\",\"1\":\"105.89655900000002\"}', 1, 0, '2019-05-14 18:57:46', '2019-05-14 18:57:46');
INSERT INTO `motelrooms` VALUES (250, 'Cho thuê phòng chung cư mini 38m2 1 phòng khách + 1 phòng ngủ 34 Âu Cơ', 'cho-thue-phong-chung-cu-mini-38m2-1-phong-khach-1-phong-ngu-34-au-co', 4100000, 38.0000, 1, 19, 113, 'phòng 4,1 triệu 1 phòng khách 1 phòng ngủ - 34 Âu Cơ, Âu Cơ, Tây Hồ, Hà Nội', '0904040387', 4, 'Khép kín', '{\"0\":\"cho-thue-phong-chung-cu-mini-38m2-1-phong-khach-1-phong-ngu-34-au-co-t6we6.jpg\",\"1\":\"cho-thue-phong-chung-cu-mini-38m2-1-phong-khach-1-phong-ngu-34-au-co-rxlni.jpg\",\"2\":\"cho-thue-phong-chung-cu-mini-38m2-1-phong-khach-1-phong-ngu-34-au-co-hthaj.jpg\",\"3\":\"cho-thue-phong-chung-cu-mini-38m2-1-phong-khach-1-phong-ngu-34-au-co-srtu5.jpg\",\"4\":\"cho-thue-phong-chung-cu-mini-38m2-1-phong-khach-1-phong-ngu-34-au-co-voyhl.jpg\",\"5\":\"cho-thue-phong-chung-cu-mini-38m2-1-phong-khach-1-phong-ngu-34-au-co-lpyln.jpg\",\"6\":\"cho-thue-phong-chung-cu-mini-38m2-1-phong-khach-1-phong-ngu-34-au-co-9xure.jpg\",\"7\":\"cho-thue-phong-chung-cu-mini-38m2-1-phong-khach-1-phong-ngu-34-au-co-resized-cjqwl.jpg\"}', '<div class=\"dis-content\">Xin chào, bên nhà mình hiện đang trống phòng 302 tầng 3 trong chung cư mini<br>Tại địa chỉ : số 27 ngõ 34 Âu Cơ, Quận Tây Hồ. (qua Nghi Tàm là đến, đối diện bên đường là khách sạn Sheraton, cách trung tâm phố Tây Xuân Diệu 2 phút xe máy)<br>Phòng kết cấu : 1 phòng ngủ, 1 phòng khách/ phòng bếp, 1 nhà tắm, có khu phơi đồ trước cửa phòng. Tổng diện tích sử dụng 38m2, phòng sáng sạch thoáng, yên tĩnh. Thích hợp cho để ở lâu dài<br>HOÀN TOÀN RIÊNG BIỆT, KO CHUNG ĐỤNG, KHÔNG QUẢN LÝ GIỜ GIẤC.<br>Trong phòng đã có sẵn : điều hòa 2 chiều, bình nóng lạnh, giường 1m6 x 2m, bộ bàn ghế uống trà, máy hút mùi.<br>Điện 3.400đ/ số ; nước 28.000đ/ khối. Internet cáp quang 100k/ tháng nếu dùng, truyền hình cáp 50k/ tháng nếu dùng.<br>Giờ giấc thoải mái, đèn khu vực chung sáng 24/24; về khuya nhờ các bạn đi lại nhẹ nhàng.<br>Để miễn phí 2 xe máy ở tầng 1<br>Camera an ninh 24/24, an ninh trật tự rất tốt.<br>Giá 4.100.000đ/ tháng. Vui lòng không mặc cả. Đóng tiền nhà tháng một, cọc 1 tháng, hợp đồng ít nhất nửa năm.<br>Mọi chi tiết xin liên hệ Hằng 0904040387 hoặc pm facebook imes zalo đều được.<br>*** Ngoài ra mình vẫn còn phòng 401 giá 4.500.000 cùng chung cư nhé.</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCIsIjMiOiJcdTAxMTBpXHUxZWMxdSBoXHUwMGYyYSIsIjQiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCIsIjUiOiJUcnV5XHUxZWMxbiBoXHUwMGVjbmggY1x1MDBlMXAiLCI2IjoiVGl2aSJ9', 1, 0, '{\"0\":\"21.061220925780784\",\"1\":\"105.83446502117931\"}', 1, 0, '2019-05-14 18:57:48', '2019-05-14 18:57:48');
