<br>Mọi chi tiết xin liên hệ Hằng 0904040387 hoặc pm facebook imes zalo đều được.*** Ngoài ra mình vẫn còn phòng 302 giá 4.100.000 cùng chung cư nhé.</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJUaGFuZyBtXHUwMGUxeSIsIjMiOiJJbnRlcm5ldCIsIjQiOiJcdTAxMTBpXHUxZWMxdSBoXHUwMGYyYSIsIjUiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCIsIjYiOiJUcnV5XHUxZWMxbiBoXHUwMGVjbmggY1x1MDBlMXAifQ==', 1, 0, '{\"0\":\"21.061182417390306\",\"1\":\"105.83446386514288\"}', 1, 0, '2019-05-14 18:57:50', '2019-05-14 18:57:50');
INSERT INTO `motelrooms` VALUES (252, 'Nhà trọ  Hồ Tùng Mậu giờ giấc tự do, có nóng lạnh,máy giặt, điều hòa,chỗ để xe miễn phí', 'nha-tro-ho-tung-mau-gio-giac-tu-do-co-nong-lanhmay-giat-dieu-hoacho-de-xe-mien-phi', 2200000, 20.0000, 1, 16, 39, 'số 47a ngõ 66 Hồ Tùng Mậu, Hồ Tùng Mậu, Cầu Giấy, Hà Nội', '0973612652', 5, 'Chung', '{\"0\":\"nha-tro-ho-tung-mau-gio-giac-tu-do-co-nong-lanhmay-giat-dieu-hoacho-de-xe-mien-phi-g3pqi.jpg\",\"1\":\"nha-tro-ho-tung-mau-gio-giac-tu-do-co-nong-lanhmay-giat-dieu-hoacho-de-xe-mien-phi-vvlzi.jpg\",\"2\":\"nha-tro-ho-tung-mau-gio-giac-tu-do-co-nong-lanhmay-giat-dieu-hoacho-de-xe-mien-phi-pp7pg.jpg\",\"3\":\"nha-tro-ho-tung-mau-gio-giac-tu-do-co-nong-lanhmay-giat-dieu-hoacho-de-xe-mien-phi-8q3a2.jpg\"}', '<div class=\"dis-content\">Nhà ở địa chỉ số 47angõ 66 Hồ Tùng Mậu. Ngõ thông sang 105 Doãn Kế Thiện<br>Nhà còn 2 phòng cụ thể như sau:<br>Tầng 4:402 :25m2-3tr/th :có nóng lạnh,máy giặt,điều hòa,giường,vệsinh khép kín <br>Tầng 5: 501: 20m2-2,2tr/th :có nóng lạnh,máy giặt,vệ sinh cạnhphòng <br>Mô tả thêm: <br>- Nhà mặt ngõ kinh doanh có chỗ để xe rộng rãi, có camera hoạtđộng 24/24 an ninh cực đảm bảo hoàn toàn free, gần chợ, các trường ĐH Thương Mại,<br>ĐH Ngoại Ngữ, ĐH Sư Phạm, ĐH Báo Chí, CĐ Du Lịch, ĐH sân khấu và điện ảnh… rất<br>gần bến xe bus thuận tiện cho việc đi lại….<br>- Nhà vệ sinh khép kín bên trong phòng, rộng rãi, lịch sự,vòi hoa sen, nóng lạnh, bệt,xịt … đầy đủ<br>- Phòng nào cũng có cửa sổ thoáng , nóng lạnh,giường, … <br>- 2 Máy giặt ở tầng 2 và 3 miễn phí cả nhà dùng chung, dâyphơi quần áo thoáng ở tầng 3, 4<br>- Internet cáp quang băng thông lớn 60mB +<br>- Điện 4k/ số. Nước 80k/người<br>- Phòng ở nhiều người thoải mái. <br>- Tháng có người qua dọn vệ sinh chung cả nhà thường xuyên <br>-Giờ giấc đi lại thoải mái, tiếp bạn bè vô tư miễn là lịch sựvà không làm ảnh hưởng đến người khác và hàng xóm xung quanh. <br>- Yêu cầu là ngăn nắp, sạch sẽ, không làm hư hại phòng và cácvật dụng trong nhà. Ngoài ra không thu thêm tiền gì. <br>- Có thể đến ở luôn <br>Hợp đồng lâu dài không tăng giá, chu kỳ đóng tiền nhà 1 tháng1 lần, đặt cọc 1 tháng tiền nhà .<br>Liên hệ: 0973 612 652</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCIsIjMiOiJcdTAxMTBpXHUxZWMxdSBoXHUwMGYyYSIsIjQiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCIsIjUiOiJNXHUwMGUxeSBnaVx1MWViN3QifQ==', 1, 0, '{\"0\":\"21.0369349\",\"1\":\"105.77781890000006\"}', 1, 0, '2019-05-14 18:57:53', '2019-05-14 18:57:53');
