INSERT INTO `motelrooms` VALUES (255, 'CHO THUÊ CHUNG CƯ MINI DT45M2 CÓ GIƯỜNG TỦ MẶT PHỐ NGUYỄN ĐỔNG CHI– GIÁ 3.2TR/T', 'cho-thue-chung-cu-mini-dt45m2-co-giuong-tu-mat-pho-nguyen-dong-chi-gia-32trt', 4500000, 45.0000, 1, 10, 12, ' Số nhà 118 đường Nguyễn Đổng Chi - Quận Nam Từ Liêm, Mỹ Đình, Từ Liêm, Hà Nội', '0976173640', 3, 'Khép kín', '{\"0\":\"cho-thue-chung-cu-mini-dt45m2-co-giuong-tu-mat-pho-nguyen-dong-chi-gia-32trt-vrfu0.jpg\",\"1\":\"cho-thue-chung-cu-mini-dt45m2-co-giuong-tu-mat-pho-nguyen-dong-chi-gia-32trt-bgyhv.jpg\",\"2\":\"cho-thue-chung-cu-mini-dt45m2-co-giuong-tu-mat-pho-nguyen-dong-chi-gia-32trt-hd3hi.jpg\",\"3\":\"cho-thue-chung-cu-mini-dt45m2-co-giuong-tu-mat-pho-nguyen-dong-chi-gia-32trt-4fl7m.jpg\",\"4\":\"cho-thue-chung-cu-mini-dt45m2-co-giuong-tu-mat-pho-nguyen-dong-chi-gia-32trt-25qoe.jpg\",\"5\":\"cho-thue-chung-cu-mini-dt45m2-co-giuong-tu-mat-pho-nguyen-dong-chi-gia-32trt-onezf.jpg\",\"6\":\"cho-thue-chung-cu-mini-dt45m2-co-giuong-tu-mat-pho-nguyen-dong-chi-gia-32trt-vqqwq.jpg\",\"7\":\"cho-thue-chung-cu-mini-dt45m2-co-giuong-tu-mat-pho-nguyen-dong-chi-gia-32trt-qxock.jpg\",\"8\":\"cho-thue-chung-cu-mini-dt45m2-co-giuong-tu-mat-pho-nguyen-dong-chi-gia-32trt-ylefs.jpg\",\"9\":\"cho-thue-chung-cu-mini-dt45m2-co-giuong-tu-mat-pho-nguyen-dong-chi-gia-32trt-cqm02.jpg\",\"10\":\"cho-thue-chung-cu-mini-dt45m2-co-giuong-tu-mat-pho-nguyen-dong-chi-gia-32trt-kjzzy.jpg\",\"11\":\"cho-thue-chung-cu-mini-dt45m2-co-giuong-tu-mat-pho-nguyen-dong-chi-gia-32trt-a1739.jpg\"}', '<div class=\"dis-content\"><strong>1-Chung cư mini 7 tầng có nhiều loại phòng cho thuê tại số 118 Đường Nguyễn Đổng Chi- Phường Mỹ Đình 2</strong><br>+<strong>Có 1 phòng ngủ + 1 phòng khách+bếp. DT 45m2, giá 4,5 triệu/tháng.</strong><br>- Nội thất: Có nóng lạnh,giường, tủ, kệ bếp, chậu rửa, thiết bị vệ sinh hiện đại, các phòng đều thiết kế có cửa sổ thông thoáng.<br>Tòa nhà có thang máy, bảo vệ 24/24, an ninh đảm bảo, điện nước ổn định.<br>- Vị trí: Nhà mặt đường NGUYỄN ĐỔNG CHI nằm ở khu vực đông dân cư, dân trí cao, gần chợ, trường FPT, dân lập Lê Quý Đôn, mầm non Hoa Anh Đào, sát đô thị Mỹ Đình …cách đường Hàm Nghi 300m.<br>Mặt đường trước cửa 5m, hai ô tô tránh nhau, phù hợp người đi làm, hộ gia đình trẻ có thêm ông bà hoặc giúp việc ở cùng.<br>- Giá cả linh hoạt, thanh toán tối thiểu 3 tháng + cọc 1 tháng.<br><strong><br>- Địa chỉ: Số nhà 118 đường Nguyễn Đổng Chi - Quận Nam Từ Liêm (siêu thị thành đô rẽ vào hoặc đường Hàm Nghi đi vào). Hoặc gần khu đô thị Mỹ Đình 1 đi vào.<br><br>Liên hệ: chị Hương 0978 335 871./0981 056 756 / 0902 212 798</strong><br><br><strong>2- Tòa nhà 8 tầng tại phố Doãn Kế Thiện mới hoàn thiện.</strong><br>- Diện tích các phòng từ 38m2 - 40m2.<br>Giá cho thuê 5.000.000đ/tháng, các phòng bao gồm:<br>Phòng ngủ + phòng khách và khu bếp riêng biệt.<br>- Phòng ngủ được trang bị điều hòa 2 chiều, giường, tủ quần áo...<br>- Phòng khách cũng có thể làm phòng ngủ nếu nhà Đông người.<br>- Phòng bếp được trang bị bàn ăn, bàn bếp, tủ bếp, chậu rửa bát, hút mùi,...<br>- Khu vực nhà vệ sinh được lắp đầy đủ thiết bị hiện đại như chậu rửa mặt, bệt Inax, vòi sen, bình nóng lạnh,...<br>- Tòa nhà có bảo vệ 24/24, đảm bảo an ninh tuyệt đối, giờ giấc ra vào thoải mái.<br>- Khu vực ban công phơi đồ riêng biệt của từng phòng.<br>* Tòa nhà nằm ở vị trí trung tâm, giao thông thuận tiện, cách mặt đường Doãn Kế Thiện 20m, đối diện chợ Đồng Xa nên rất thuận tiện cho việc mua sắm, đi chợ, nằm trong khuôn viên tập quân đội nên an ninh rất tốt, gần các trung tâm thương mại, gần các trường ĐH như quốc gia, ngoại ngữ, gần bến xe Mỹ Đình,...<br><br><strong>Địa chỉ: Số 32CT1 – Đường Doãn Kế Thiện - P Mai Dịch - Cầu Giấy.<br>LH C Hương 0978 335 871. / 0902 212 798 / 0982 96 96 69.<br><br>3/ Tòa nhà 9 tầng tại số nhà D2 ngõ 93 phố Cầu Giấy - P. Quan Hoa - Cầu Giấy, mới hoàn thiện vào ở luôn được.</strong><br>- Nhà ngay phố Cầu Giấy, đường vào rộng, 2 ô tô con tránh nhau, rất thuận tiện cho việc đi lại, sinh hoạt, vui chơi, giải trí.<br>- Các phòng được thiết kế hết sức hợp lý:<br>+ Gồm 1 phòng ngủ hoặc 2 phòng ngủ + 1 phòng khách, đầy đủ ánh sáng, gió và không khí vào phòng. DT: 45m2-50m2.<br>- Mỗi phòng được trang bị 1 điều hòa 2 chiều, giường, tủ quần áo, cửa sổ có rèm cản nắng cực đẹp, trần thạch cao, bàn bếp, bồn rửa bát xịn.<br>- Nhà vệ sinh được lắp thiết bị vệ sinh Inax cao cấp, bình nóng lạnh Ariston, ốp lát gạch Prime sang trọng hiện đại.<br><br><strong>Giá cho thuê: 6.500.000đ- 7.000.000 đ căn/tháng (thanh toán tối thiểu 03 tháng và đặt cọc 1 tháng). <br>DT Các phòng từ 45-50m2.</strong><br>- Tòa nhà trang bị thang máy cao cấp, máy giặt miễn phí, truyền hình cáp, internet tốc độ cao miễn phí, mỗi căn hộ được cấp thẻ từ thang máy riêng.<br>- Tòa nhà có bảo vệ 24/7 nên an ninh cực ổn, ra vào thoải mái, nhà để xe rộng rãi gần 200m2, có thể chứa được đến 100 chiếc xe máy.<br>- Vệ sinh dọn phòng hàng ngày nếu khách có nhu cầu.<br>* Thích hợp cho người nước ngoài, hộ gia đình và người đi làm thuê ở.<br><strong>+ Địa chỉ: Tòa nhà D2 ngõ 93 phố Cầu Giấy, P. Quan Hoa, Q. Cầu Giấy (Cách Cầu Giấy 150m).<br>Liên hệ chủ nhà chị Hương 0978 335 871. A Lượng 0982 9696 69.</strong></div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJUaGFuZyBtXHUwMGUxeSIsIjMiOiJJbnRlcm5ldCIsIjQiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCIsIjUiOiJUcnV5XHUxZWMxbiBoXHUwMGVjbmggY1x1MDBlMXAifQ==', 1, 0, '{\"0\":\"21.0234709\",\"1\":\"105.77326330000005\"}', 1, 0, '2019-05-14 18:58:04', '2019-05-14 18:58:04');
