INSERT INTO `motelrooms` VALUES (258, 'Nhà trọ số 12 Đại Từ không chung chủ, có điều hòa,nóng lạnh, vệ sinh khép kín', 'nha-tro-so-12-dai-tu-khong-chung-chu-co-dieu-hoanong-lanh-ve-sinh-khep-kin', 2200000, 20.0000, 1, 57, 135, 'số 12 Đại Từ, Đại Kim, Hoàng Mai, Hà Nội', '0973612652', 5, 'Khép kín', '{\"0\":\"nha-tro-so-12-dai-tu-khong-chung-chu-co-dieu-hoanong-lanh-ve-sinh-khep-kin-1512286720urcir-resized-n8c8o.jpg\",\"1\":\"nha-tro-so-12-dai-tu-khong-chung-chu-co-dieu-hoanong-lanh-ve-sinh-khep-kin-1512286720urcir-resized-ahqsy.jpg\",\"2\":\"nha-tro-so-12-dai-tu-khong-chung-chu-co-dieu-hoanong-lanh-ve-sinh-khep-kin-1512286720urcir-resized-dyvcx.jpg\"}', '<div class=\"dis-content\">Nhà có 1 phòng  rộng cụ  22m2 giá 2tr2<br>Mô tả thêm: <br>- Nhà mặt đường có chỗđể xe rộng rãi,  có camera hoạt động24/24 an ninh cực đảm bảo hoàn toàn free, gần chợ, các trường đại học Bách<br>Khoa, Xây Dựng, Kinh Tế, Thăng Long… Gần bến xe bus, cách đường giải phóng 10m,<br>gần bến xe Giáp Bát, bến xe Nước Ngầm thuận tiện cho việc đi lại….<br>- Nhà vệ sinh khépkín bên trong phòng, rộng rãi, lịch sự, vòi hoa sen, nóng lạnh, bệt, gương… đầy<br>đủ<br>- Phòng nào cũng có cửa sổ thoáng và đều trang bị điềuhòa, nóng lạnh,giường, tủ… <br>- Máy giặt ở tầng 1miễn phí cả nhà dùng chung, dây phơi quần áo thoáng ở tầng 3<br>- Internet cáp quangbăng thông lớn.<br>- Điện giá nhà nước hoàn toàn. Các phòng đều cócông tơ riêng tự chia. Nước 80k/người<br>- Phòng ở nhiều người thoải mái.  <br>- Tháng có người qua dọn vệ sinh chung cả nhàthường xuyên <br>- Không ở chung chủ. Giờ giấc đi lại thoải mái,tiếp bạn bè vô tư miễn là lịch sự và không làm ảnh hưởng đến người khác và hàng<br>xóm xung quanh. <br>- Yêu cầu là ngăn nắp, sạch sẽ, không làm hư hạiphòng và các vật dụng trong nhà. <br>-Ngoài ra không thuthêm tiền gì. <br>- Có thể thương lượng vs người nhiệt tình<br>Hợp đồng lâu dài không tănggiá, chu kỳ đóng tiền nhà 1 tháng 1 lần, đặt cọc 1 tháng tiền nhà</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIi