+ 1 phòng ngủ <br>Hoàn toàn riêng biệt, hoàn toàn không chung đụng ai. KHÔNG QUẢN LÝ GIỜ GIẤC<br>Trong phòng đã có sẵn :<br>- Điều hòa 2 chiều<br>- Bình nóng lạnh<br>- Giường 1m6x2m <br>- Giá bếp/ bàn bếp, Máy hút mùi<br>Vị trí : cực trung tâm - số 27 ngõ 34 Âu Cơ (ngay đầu Âu Cơ – Nghi Tàm) Không khí trong lành yên tĩnh, là khu Tây giữa lòng Hà Nội. Gần chợ gần phố cổ đường đi thuận lợi. Cách trung tâm phố Tây-Xuân Diệu 3 phút xe máy, đi bộ qua đường là Sheraton luôn.<br>Giờ giấc thoải mái, đèn khu vực chung sáng 24/24; về khuya nhờ các bạn đi lại nhẹ nhàng.<br>Camera an ninh 24/24, an ninh trật tự rất tốt.<br>Điện 3200đ/ số ; nước 28.000đ/ khối<br>Wifi 100k/ tháng nếu dùng, Truyền hình cáp 50k/ tháng nếu dùng<br>Miễn phí để 2 xe dưới tầng 1, ko nuôi chó mèo.<br>Giá thuê : 4.9 triệu/tháng (vui lòng ko mặc cả). Hợp đồng 6 tháng, cọc 1 tháng, đóng tiền tháng một.<br>Mọi chi tiết xin liên hệ chủ nhà Hằng 0904040387 (pm zalo imes facebook sđt này đều được, tớ mới nhổ răng nên có gì nhắn tin giúp nhé)</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJUaGFuZyBtXHUwMGUxeSIsIjMiOiJJbnRlcm5ldCIsIjQiOiJcdTAxMTBpXHUxZWMxdSBoXHUwMGYyYSIsIjUiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCIsIjYiOiJNXHUwMGUxeSBnaVx1MWViN3QiLCI3IjoiVHJ1eVx1MWVjMW4gaFx1MDBlY25oIGNcdTAwZTFwIn0=', 1, 0, '{\"0\":\"21.061163505754585\",\"1\":\"105.83439950534057\"}', 1, 0, '2019-05-14 18:58:17', '2019-05-14 18:58:17');
