INSERT INTO `motelrooms` VALUES (265, 'Nhà trọ số Hồ Tùng Mậu giờ giấc tự do,khép kín, có nóng lạnh, chỗ để xe miễn phí', 'nha-tro-so-ho-tung-mau-gio-giac-tu-dokhep-kin-co-nong-lanh-cho-de-xe-mien-phi', 2300000, 18.0000, 1, 16, 100, 'số 47a ngõ 66 Hồ Tùng Mậu hay 105 Doãn Kế Thiện, Doãn Kế Thiện, Cầu Giấy, Hà Nội', '0976530290', 5, 'Khép kín', '{\"0\":\"nha-tro-so-ho-tung-mau-gio-giac-tu-dokhep-kin-co-nong-lanh-cho-de-xe-mien-phi-angfg.jpg\",\"1\":\"nha-tro-so-ho-tung-mau-gio-giac-tu-dokhep-kin-co-nong-lanh-cho-de-xe-mien-phi-gb5ik.jpg\",\"2\":\"nha-tro-so-ho-tung-mau-gio-giac-tu-dokhep-kin-co-nong-lanh-cho-de-xe-mien-phi-voqwt.jpg\"}', '<div class=\"dis-content\">Nhà ở địa chỉ số 47a ngõ66 Hồ Tùng Mậu. Ngõ thông sang 105 Doãn Kế Thiện<br>Nhà còn 3 phòng rộng cụ thể như sau: <br>Tầng 2 rộng 18m2 vệ sinhriếng, có nóng lạnh, giá 2tr3<br>Tầng 3 rộng 20m2 vệ sinhriếng, có nóng lạnh, giá 2tr5<br>Tầng 4 rộng 20m2 vệ sinhriếng, có nóng lạnh, ( sẽ lắp điều hòa khi vào hè) giá 2tr5<br> <br>Mô tả thêm: <br>- Nhà mặt ngõ kinh doanh có chỗ để xe rộng rãi,có camera hoạt động 24/24 an ninh cực đảm bảo hoàn toàn free, gần chợ, các trường<br>ĐH Thương Mại, ĐH Ngoại Ngữ, ĐH Sư Phạm, ĐH Báo Chí, CĐ Du Lịch, ĐH sân khấu và<br>điện ảnh… rất gần bến xe bus thuận tiện cho việc đi lại….<br>- Nhà vệ sinh khép kín bên trong phòng, rộng rãi,lịch sự, vòi hoa sen, nóng lạnh, bệt,xịt … đầy đủ<br>- Phòng nào cũng có cửa sổ thoáng , nóng lạnh,giường,… <br>- 2 Máy giặt ở tầng 2 và 3 miễn phí cả nhà dùngchung, dây phơi quần áo thoáng ở tầng 3, 4<br>- Internet cáp quang băng thông lớn 60mB +<br>- Điện 4k/ số. Nước 80k/người<br>- Phòng ở nhiều người thoải mái. <br>- Tháng có người qua dọn vệ sinh chung cả nhàthường xuyên <br>-Giờ giấc đi lại thoải mái, tiếp bạn bè vô tư miễnlà lịch sự và không làm ảnh hưởng đến người khác và hàng xóm xung quanh. <br>- Yêu cầu là ngăn nắp, sạch sẽ, không làm hư hạiphòng và các vật dụng trong nhà. Ngoài ra không thu thêm tiền gì. <br>- Cuối tháng có thể chuyển vào luôn.<br>Hợp đồng lâu dài không tăng giá, chu kỳ đóng tiềnnhà 1 tháng 1 lần, đặt cọc 1 tháng tiền nhà . Có bớt cho bạn nhiệt tình<br>Liên hệ: 0976 530 290<br>                                                                       </div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCIsIjMiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCIsIjQiOiJNXHUwMGUxeSBnaVx1MWViN3QifQ==', 1, 0, '{\"0\":\"21.0414805\",\"1\":\"105.77725750000002\"}', 1, 0, '2019-05-14 18:58:25', '2019-05-14 18:58:25');
