thật 100%<br>Hợpđồng lâu dài không tăng giá, chu kỳ đóng tiền nhà 1 tháng 1 lần, đặt cọc 1 tháng<br>tiền nhà . Liên hệ : 0973612652</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCIsIjMiOiJcdTAxMTBpXHUxZWMxdSBoXHUwMGYyYSIsIjQiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCIsIjUiOiJNXHUwMGUxeSBnaVx1MWViN3QiLCI2IjoiVHJ1eVx1MWVjMW4gaFx1MDBlY25oIGNcdTAwZTFwIn0=', 1, 0, '{\"0\":\"20.972002\",\"1\":\"105.839335\"}', 1, 0, '2019-05-14 18:58:28', '2019-05-14 18:58:28');
