 tủ bếp, chậu rửa bát, hút mùi, tủ lạnh ….<br>– Khu vực nhà vệ sinh được lắp đầy đủ thiết bị hiện đại như chậu rửa mặt, bệt Inax, vòi sen, bình nóng lạnh…<br>– Có ban công riêng biệt từng căn hộ và khu vực phơi đồ và để máy giặt.<br>– Tiện ích: Tòa nhà có bảo vệ 24/24, đảm bảo an ninh tuyệt đối, giờ giấc ra vào thoải mái.<br>-Thang máy cao cấp, mỗi hộ gia đình có thẻ từ sử dụng riêng, internet cáp quang, miễn phí tuyền hình cáp, miễn phí máy giặt.<br>– Tòa nhà nằm ở vị trí trung tâm, giao thông thuận tiện, ô tô đỗ cửa, cách mặt đường TÔN ĐỨC THẮNG 100m,nằm ngay ngã ba mặt hồ Văn Chương, không khí thoáng mát trong lành, gần các trung tâm thương mại, đi lại vào phố cổ rất thuận tiện…<br>– Ưu tiên cho hộ gia đình, người đi làm thuê ở lâu dài.<br>Địa chỉ: Số nhà 57A NGÕ 221 PHỐ TÔN ĐỨC THẮNG – PHƯỜNG HÀNG BỘT- ĐỐNG ĐA- HN.</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJUaGFuZyBtXHUwMGUxeSIsIjMiOiJJbnRlcm5ldCIsIjQiOiJcdTAxMTBpXHUxZWMxdSBoXHUwMGYyYSIsIjUiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCJ9', 1, 0, '{\"0\":\"21.0211148\",\"1\":\"105.83273009999994\"}', 1, 0, '2019-05-14 18:58:34', '2019-05-14 18:58:34');
