INSERT INTO `motelrooms` VALUES (294, 'Còn @ phòng trọ khép kín 500k/th ở Hà Đông 12m2', 'con-at-phong-tro-khep-kin-500kth-o-ha-dong-12m2', 500000, 12.0000, 1, 21, 69, 'số 89 Huyền Kỳ phú lãm- Hà Đông- HN, Huyền Kỳ, Hà Đông, Hà Nội', '0968560406', 3, 'Khép kín', '{\"0\":\"con-at-phong-tro-khep-kin-500kth-o-ha-dong-12m2-dibpd.jpg\"}', '<div class=\"dis-content\">Hiện mình có dãy phòng trọcấp 4 sạch sẽ thoáng mát muốn cho thuê .Phòng không khép kín dùng riêng một nhà vệ sinh 400k.Nhàmình chỉ có 1 phòng này là phòng không khép kín thôi 10m2.Ƥhòng có nhà vệsinh khép kín 500k/tháng diện tích khoảng 10-15m2 tùy phòng. Phòng 25m2 giá 700k/tháng. Nước50/người/ tháng và internet 50k/phòng/tháng.Điện 3.5k/số.Anninh đảm bảo,không khí trong lành, yên tĩnh, sân vườn mát mẻ.Ϲhỗđể xe, sân phơi thoải mái,Giờ giấc không quy định, bạn bè người thân đến chơi thoải mái. Gần  chợ. Mình ởgần cɑo đẳngkinh tế kỹ thuật thương mại : 89-Huyền kỳ-tổ 7- phú lãm-hà đông-hà nộiLiên hệ chính chủ: Ƭùng Anh: 0968560406Ϲô Yến :01663416034/0949603182</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCJ9', 1, 0, '{\"0\":\"20.9376727\",\"1\":\"105.75673329999995\"}', 1, 0, '2019-05-14 18:59:26', '2019-05-14 18:59:26');
INSERT INTO `motelrooms` VALUES (295, 'Tìm nữ ở ghép ngõ 31 Phùng Khoang gần Đh Hà Nội, bưu chính, kiến Trúc, CNgtvt', 'tim-nu-o-ghep-ngo-31-phung-khoang-gan-dh-ha-noi-buu-chinh-kien-truc-cngtvt', 700000, 20.0000, 1, 2, 142, 'ngõ 31 Phùng Khoang, Phùng Khoang, Thanh Xuân, Hà Nội', '01648016709', 4, 'Khép kín', '{\"0\":\"tim-nu-o-ghep-ngo-31-phung-khoang-izewi.jpg\"}', '<div class=\"dis-content\">- Mình cần tìm một nữ ở ghép Ngõ 31 Phùng Khoang.<br>- Phòng tầng 2 giá 2tr1, hiện đã có 2 người ở. Phòng thoáng, sạch sẽ, điện nước giá nhà dân.<br>- Phòng đã đủ đồ, mình đi làm cả ngày nên thoải mái<br>- Chỉ cần ngoan ngoãn, sạch sẽ, có thể đến ở luôn<br>Lhe: 01648016709</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCIsIjMiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCJ9', 1, 0, '{\"0\":\"20.9867082\",\"1\":\"105.79400329999999\"}', 1, 0, '2019-05-14 18:59:32', '2019-05-14 18:59:32');
INSERT INTO `motelrooms` VALUES (296, 'Tìm Nam ở ghép tại Hà Đông,gần Hv Quân Y', 'tim-nam-o-ghep-tai-ha-donggan-hv-quan-y', 1200000, 13.0000, 1, 21, 144, 'Phùng Hưng-Phúc La-Hà Đông-Hà Nội, Phùng Hưng, Hà Đông, Hà Nội', '01636003263', 2, 'Chưa xác định', '{\"0\":\"no_img_room.png\"}', '<div class=\"dis-content\">Mình cần tìm một bạn Nam ở ghép tại Hà Đông,địa chỉ gần Học Viện Quân Y. Phòng 1tr2/2 người, nước 60k/người/tháng, điện 4k/số, mạng 50k/người, đi lại tự do thoải mái. Yêu cầu thì mình cũng không yêu cầu gì nhiều, chỉ cần sống sạch sẽ gọn gàng, tôn trọng người kia chút, đang là sinh viên và sinh năm từ 99-96. Bạn nào thấy ổn có thể liên hệ với mình qua sđt . Cảm ơn các bạn đã đọc!</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCJ9', 1, 0, '{\"0\":\"20.9676644\",\"1\":\"105.78818180000007\"}', 1, 0, '2019-05-14 18:59:34', '2019-05-14 18:59:34');
INSERT INTO `motelrooms` VALUES (298, 'Cho thuê nhà tại Đoàn Thị điểm', 'cho-thue-nha-tai-doan-thi-diem', 2500000, 28.0000, 1, 6, 145, '30B Đoàn Thị Điểm, Đoàn Thị Điểm, Đống Đa, Hà Nội', '0971078363', 3, 'Chung', '{\"0\":\"cho-thue-nha-tai-doan-thi-diem-drjwx.jpg\",\"1\":\"cho-thue-nha-tai-doan-thi-diem-vozug.jpg\",\"2\":\"cho-thue-nha-tai-doan-thi-diem-hn7vt.jpg\",\"3\":\"cho-thue-nha-tai-doan-thi-diem-zjnme.jpg\"}', '<div class=\"dis-content\"><div style=\"text-align:center;\">﻿</div>Hiện tại, tôi có phòng rộng (15m2 nhà + bếp và 12m2 sân). Đồ dùng trong nhà gồm có: Tivi, quạt treo tường, giường nằm, bếp điện. Phòng sạch sẽ, mới xây dựng đầu năm, thoải mái và thoáng mát. Nhà nằm tại Đoàn Thị Điểm trên đường Tôn Đức Thắng đi vào. Thuận tiện đi ra Lăng Bác, Văn Miếu và các khu trung tâm nội thành.<br><br>Hiện gia đình không có nhu cầu sử dụng vì thế muốn cho người khác thuê với giá 2,5 tr/th, điện nước tính theo giá nhà nước. Ai có nhu cầu thì vui lòng liên hệ 0971078363 or0934496678(không qua môi giới).<br>P/s: Ưu tiên người đi làm và đã có gia đình</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCIsIjMiOiJUaXZpIn0=', 1, 0, '{\"0\":\"21.026358\",\"1\":\"105.83237269999995\"}', 1, 0, '2019-05-14 18:59:37', '2019-05-14 18:59:37');
