INSERT INTO `motelrooms` VALUES (304, 'CHO THUÊ NHÀ GẦN NHÀ VĂN HÓA THÔN ĐÔNG YÊN, YÊN PHONG, ĐÔNG YÊN, BẮC NINH', 'cho-thue-nha-gan-nha-van-hoa-thon-dong-yen-yen-phong-dong-yen-bac-ninh', 2500000, 120.0000, 1, 57, 0, 'Thôn Đông Yên, Đông Phong, Yên Phong, Bắc Ninh, Hoàng Mai, Hà Nội', '0962850810', 6, 'Khép kín', '{\"0\":\"cho-thue-nha-gan-nha-van-hoa-thon-dong-yen-yen-phong-dong-yen-bac-ninh-ixcdb.png\"}', '<div class=\"dis-content\">Cho thuê nhà Thôn Đông Yên, Yên Phong, Đông Phong Bắc Ninh.<br>Nhà cho thuê gần Nhà Văn Hóa thôn Đông Yên, gần chợ, gần nhà mẫu giáo. <br>Nhà có đầy đủ tiền nghi: Có bếp, có điều hòa, có quạt trần, có tủ gỗ 2 cánh, tủ gỗ 3 cánh, có phòng khách, bàn ghế phòng khách, có 3 phòng ngủ, có 3 gường .....<br>Ưu tiên: hộ gia đình thuê<br>Liên hệ: 0962.850.810</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJcdTAxMTBpXHUxZWMxdSBoXHUwMGYyYSJ9', 1, 0, '{\"0\":\"20.9836984\",\"1\":\"105.86362570000006\"}', 1, 0, '2019-05-14 18:59:50', '2019-05-14 18:59:50');
INSERT INTO `motelrooms` VALUES (305, 'Nhượng phòng trọ khu vực Chùa Láng', 'nhuong-phong-tro-khu-vuc-chua-lang', 1800000, 15.0000, 1, 6, 151, 'ngõ 185 Chùa Láng, Chùa Láng, Đống Đa, Hà Nội', '01234235589', 2, 'Khép kín', '{\"0\":\"nhuong-phong-tro-khu-vuc-chua-lang-vdnik.jpg\"}', '<div class=\"dis-content\">Phòng khép kín trên tầng 6 ở Chùa Láng, gần các trường đại học lớn như Ngoại thương, Ngoại giao, gần chợ và siêu thị, trạm bus, trạm xăng... Chùa Láng nổi tiếng ăn vặt và trà sữa, không lo đói bụng.<br><br>Tiền thuê 1800k/tháng, điện 3.5k/số, nước 12k/khối, cọc 1 tháng, tiền đóng 1 tháng 1<br><br>Chủ nhà dễ tính, để xe tầng trệt có camera, phơi đồ sân thượng. Vì lý do an ninh nên 23h đóng cửa, có việc về muộn có thể thương lượng với bác chủ<br><br>Phòng ở tầng 6, được ở 2 người tối đa. Không thang máy nên đi lại hơi vất vả. Giá 1800 đã fix, chứ mấy phòng tầng dưới toàn 2000-2500k thôi.<br>Không có nóng lạnh, bù lại thoáng và sạch sẽ, phòng mới.<br><br>Các bạn thuê sẽ có hợp đồng rõ ràng nên xin yên tâm về giá cả và không lo bị lừa tăng giá điện nước các kiểu nhé.<br><br>Vui lòng liên hệ qua số đt 01234235589 zalo để xem ảnh<br><br>Các bạn có ý thuê phòng liên lạc sớm với mình để hẹn ngày giờ xem phòng luôn nhé<br></div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCIsIjMiOiJUcnV5XHUxZWMxbiBoXHUwMGVjbmggY1x1MDBlMXAifQ==', 1, 0, '{\"0\":\"21.021773\",\"1\":\"105.80184480000003\"}', 1, 0, '2019-05-14 18:59:53', '2019-05-14 18:59:53');
