INSERT INTO `motelrooms` VALUES (308, 'Tìm Nam ở ghép tại Hà Đông', 'tim-nam-o-ghep-tai-ha-dong', 1200000, 15.0000, 1, 21, 144, 'Làng Xa La, Phúc La Hà Đông Hà Nội, Phùng Hưng, Hà Đông, Hà Nội', '01636003263', 2, 'Chưa xác định', '{\"0\":\"no_img_room.png\"}', '<div class=\"dis-content\">Mình cần tìm một bạn Nam ở ghép tại Hà Đông,địa chỉ gần Học Viện Quân Y. Phòng 1tr2/2 người, nước 60k/người/tháng, điện 4k/số, mạng 50k/người, đi lại tự do thoải mái. Yêu cầu thì mình cũng không yêu cầu gì nhiều, chỉ cần sống sạch sẽ gọn gàng, tôn trọng người kia chút, đang là sinh viên và sinh năm từ 99-96. Bạn nào thấy ổn có thể liên hệ với mình qua sđt . Cảm ơn các bạn đã đọc!</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCJ9', 1, 0, '{\"0\":\"20.9649612\",\"1\":\"105.79165850000004\"}', 1, 0, '2019-05-14 18:59:57', '2019-05-14 18:59:57');
