INSERT INTO `motelrooms` VALUES (311, 'Tìm bạn nam ở gấp tại 8b/24/162 Đội Cấn', 'tim-ban-nam-o-gap-tai-8b24162-doi-can', 750000, 18.0000, 1, 14, 38, '8B/24/162, Đội Cấn, Ba Đình, Hà Nội', '0941919159', 2, 'Khép kín', '{\"0\":\"tim-ban-nam-o-gap-tai-8b24162-doi-can-vqvg6.jpg\"}', '<div class=\"dis-content\">Phòng rộng : 18m2, Có wifi free, có ban công để nấu ăn và phơi đồ. Có chỗ để xe máy, ở riêng chủ nhà. Đi lại tự do, giờ giấc thoải mãi.<br>Tiền phòng là 750.000/ Tháng, Điện 3k/Số. Nước 50k/ng.<br>Mình muốn tìm 1 bạn nam ở ghép để chia sẻ tiền phòng<br>Mình đi làm từ 7h sáng đến 8-9h tối mới về<br>Nếu a.e đọc được thì liên hệ giúp mình vào khoảng 8-9h tối trở đi nhé. Vì ban ngày mình làm việc lên không dùng đ.t ^^ <br>Giới thiệu chút cho a.e dễ xưng hô:<br>Tên : Lâm<br>Sn : 91<br>Sđt: 094.1919.159<br>Công việc : Kinh doanh và Nấu ăn nhà hàng<br>Tính cách : Thân thiện, hòa đồng</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCIsIjMiOiJUaXZpIn0=', 1, 0, '{\"0\":\"21.034711\",\"1\":\"105.82386599999995\"}', 1, 0, '2019-05-14 19:00:00', '2019-05-14 19:00:00');
