INSERT INTO `motelrooms` VALUES (317, 'Cho thuê nhà cấp 4 mới xây khu vực Đường Ngọc  Hồi, Thanh Trì', 'cho-thue-nha-cap-4-moi-xay-khu-vuc-duong-ngoc-hoi-thanh-tri', 2000000, 22.0000, 1, 28, 154, 'Số 67, ngõ 54, Ngọc Hồi, Thanh Trì, Hà Nội', '0984482588', 4, 'Khép kín', '{\"0\":\"no_img_room.png\"}', '<div class=\"dis-content\">Hiện tại nhà mình có 1 phòng cấp 4.+ Diện tích  &gt; 20m2, ngõ vào rộng, có chỗ để xe cộ an toàn.+ Tình trạng mới cứng cựa, vừa xây xong.+ Phòng có gác xép rộng rãi có thể để đồ cũng như ngủ.+ Công trình phụ riêng biệt mỗi phòng.+ Điện nước đầy đủ, có kệ bếp.+ Phòng ở thoáng đãng, môi trường sống văn minh, thuận tiện, an toàn (có chợ và nhà trẻ ngay trong ngõ).+ Địa chỉ : số  67 ngõ 54 đường Ngọc Hồi, Thanh Trì, Hà nội ( khu Quốc Bảo, ngõ đối diện cty ABB)+ Giá thuê 2 triệu /tháng.+ Giá điện, nước thì điện lực, cty nước sạch thu bao nhiêu mình thu bấy nhiêu nộp hộ ng thuê.+ Ưu tiên các bạn, anh chị đã có việc làm ổn định, đã có gia đình và xác định thuê ở lâu dài.+ Trả trước 2 tháng tiền thuê và thanh toán tiền thuê trước ngày 10 hàng tháng.A/c nào có nhu cầu xin liên hệ theo số đt :0988 166 287 - Tuấn Anh (sn 87)0984 48 25 88 - Trang (sn 88)</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIn0=', 1, 0, '{\"0\":\"21.05010986758476\",\"1\":\"105.92330932617188\"}', 1, 0, '2019-05-14 19:00:07', '2019-05-14 19:00:07');
