INSERT INTO `motelrooms` VALUES (322, 'PHÒNG TRỌ TẠI CỬA NAM PHỐ CỔ, WIFI MIỄN PHÍ, GIỜ TỰ DO, AN NINH TỐT', 'phong-tro-tai-cua-nam-pho-co-wifi-mien-phi-gio-tu-do-an-ninh-tot', 3000000, 22.0000, 1, 78, 155, '8 Thợ Nhuộm, Hoàn Kiếm, Hà Nội, Thợ Nhuộm, Hoàn Kiếm, Hà Nội', '0915077338', 3, 'Khép kín', '{\"0\":\"phong-tro-tai-cua-nam-pho-co-wifi-mien-phi-gio-tu-do-an-ninh-tot-ykg8r.PNG\"}', '<div class=\"dis-content\">Chào các bạn,<br> <br>Hiện giờ nhà mình đang có 2 căn phòng cầncho thuê lâu dài, đều có gác xép, với thông tin như sau:<br> <br>Căn 1: Cách mặt đường 5m, diện tích rộng14m2, gác xép rộng 8m2, khép kín tại tầng 1. Có nhà vệ sinh riêng. Thích hợp<br>cho nhóm bạn 2-3 người. Giá: 3 triệu/tháng.<br> <br>Căn 2: Tầng 1 ở sân sau cho các đối tượngsinh viên, người đi làm, diện tích rộng 6m2, gác xép rộng 4m2. Thích hợp cho<br>1-2 người. Giá: 1.5 triệu/tháng<br> <br>Khu vực Thợ Nhuộm giao với Tràng Thi, thuậntiện cho việc đi lại, ăn uống, mua sắm tại khu phố cổ.<br> <br>Các điều khoản chi tiết, các bạn vui lòngliên hệ SĐT: 0915.077.338<br> <br>Trân trọng!</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IkludGVybmV0IiwiMiI6IkJcdTAwZWNuaCBuXHUwMGYzbmcgbFx1MWVhMW5oIn0=', 1, 0, '{\"0\":\"21.027167\",\"1\":\"105.84463030000006\"}', 1, 0, '2019-05-14 19:00:16', '2019-05-14 19:00:16');
INSERT INTO `motelrooms` VALUES (323, 'Có phòng cho thuê', 'co-phong-cho-thue', 2400000, 40.0000, 1, 45, 0, 'số 31B ngõ 151 NGuyễn Đức Cảnh gần trương định, Hai Bà Trưng, Hà Nội', '0984867708', 4, 'Khép kín', '{\"0\":\"no_img_room.png\"}', '<div class=\"dis-content\">Nhượng lại phòng trọ ở Nguyễn Đức Cảnh, gần khu Bách Kinh xây, phòng chỉ cho nữ thuê, trong dãy 6 tầng kiểu ccmn. thích hợp với ai muốn ở lâu dài. Liên Hệ 0984867708 Mơ</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCIsIjMiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCJ9', 1, 0, '{\"0\":\"21.0090571\",\"1\":\"105.86075069999993\"}', 1, 0, '2019-05-14 19:00:17', '2019-05-14 19:00:17');
INSERT INTO `motelrooms` VALUES (324, 'Tìm Nam ở ghép căn hộ chung cư gần cầu Giậu', 'tim-nam-o-ghep-can-ho-chung-cu-gan-cau-giau', 1000000, 60.0000, 1, 57, 156, ' Phòng 4244, CT12A, Kim Văn Kim Lũ, Đại Kim, Hoàng Mai, Nghiêm Xuân Yêm, Hoàng Mai, Hà Nội', '01686499853', 4, 'Khép kín', '{\"0\":\"tim-nam-o-ghep-can-ho-chung-cu-gan-cau-giau-resized-cluao.jpg\",\"1\":\"tim-nam-o-ghep-can-ho-chung-cu-gan-cau-giau-resized-52ton.jpg\",\"2\":\"tim-nam-o-ghep-can-ho-chung-cu-gan-cau-giau-resized-pn9rt.jpg\",\"3\":\"tim-nam-o-ghep-can-ho-chung-cu-gan-cau-giau-resized-rhsql.jpg\"}', '<div class=\"dis-content\">Hello, <br><br>Nhà mình hiện 3 người, vợ chồng mình và một cậu sinh viên. Đang cần thêm một bạn nữa ở cùng phòng cậu sinh viên, càng nhiều người càng vui.<br><br>Căn hộ có hai phòng ngủ, 2 vệ sinh, một phòng khách, 1 ban công, hai cửa sổ, thoáng mát ngay cả trong những ngày nóng nực nhất. Trang bị đầy đủ máy giặt, bếp từ, tủ bếp.<br><br>Địa chỉ: Phòng 4244, CT12A, Kim Văn Kim Lũ, Đại Kim, Hoàng Mai<br><br>Giá phòng: Căn hộ này mình thuê 4.5tr, mình mua tất cả đồ đạc, nhưng chỉ lấy các bạn 1tr/tháng, cả điện nước mạng chắc tầm 1.2tr. </div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJUaGFuZyBtXHUwMGUxeSIsIjMiOiJJbnRlcm5ldCIsIjQiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCIsIjUiOiJNXHUwMGUxeSBnaVx1MWViN3QifQ==', 1, 0, '{\"0\":\"20.9723525\",\"1\":\"105.82021639999994\"}', 1, 0, '2019-05-14 19:00:18', '2019-05-14 19:00:18');
INSERT INTO `motelrooms` VALUES (326, 'Cho thuê phòng trọ khu vực Ngã Tư Sở', 'cho-thue-phong-tro-khu-vuc-nga-tu-so', 2000000, 13.0000, 1, 2, 63, 'Số 04, ngõ 102, phố Khương Trung, Khương Trung, Thanh Xuân, Hà Nội', '01686486562', 2, 'Chưa xác định', '{\"0\":\"cho-thue-phong-tro-khu-vuc-nga-tu-so-hm8sj.jpg\"}', '<div class=\"dis-content\">Mình có 2 phòng cho thuê ở khu vực Ngã tư Sở, số nhà 4 - ngõ 102 - phố Khương Trung - quận Thanh Xuân - Hà Nội.<br>+ Phòng 1: khép kín 15m2 giá 2,2 triệu/tháng.<br>+ Phòng 2: 13 m2 chung công trình phụ với 1 phòng bên (02 người) giá 2 triệu/tháng<br>Cả hai phòng đều có điều hòa, bình nóng lạnh, có khu bếp, Internet, sân để xe, an ninh đảm bảo, gần mặt đường, thuận tiện đi lại.<br>Bạn nào có nhu cầu liên hệ với C. Phúc: 01686486562<br>P/s: đây là nhà mình, ko phải qua trung gian</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCIsIjMiOiJcdTAxMTBpXHUxZWMxdSBoXHUwMGYyYSIsIjQiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCJ9', 1, 0, '{\"0\":\"20.995772\",\"1\":\"105.81575900000007\"}', 1, 0, '2019-05-14 19:00:21', '2019-05-14 19:00:21');
INSERT INTO `motelrooms` VALUES (327, 'Tìm bạn nam ở ghép tại Bạch Mai, Hà Nội', 'tim-ban-nam-o-ghep-tai-bach-mai-ha-noi', 1250000, 18.0000, 1, 45, 97, 'số 71, Ngõ Giếng Mứt, Bạch Mai, Hà Nội, Bạch Mai, Hai Bà Trưng, Hà Nội', '0916840092', 1, 'Khép kín', '{\"0\":\"tim-ban-nam-o-ghep-tai-bach-mai-ha-noi-resized-kgaj1.jpg\"}', '<div class=\"dis-content\">Cần tìm 1 bạn nam ở ghép bắt đầu từ 01/09/2017. Địa chỉ: số 71, ngõ Giếng Mứt, Bạch Mai, Hà Nội. Gần trung tâm Thành Phố, các trường Đại học, bệnh viện, hàng quán, chợ, v...v...rất tiện đi lại.Phòng 18 m2, sạch sẽ, ở tầng 6, ngay cạnh sân thượng phơi phóng thoáng mát, tách biệt với chủ nhà, có lối đi riêng, để xe miễn phí, an ninh đảm bảo, giờ giấc đi về thoải mái.<br>Tiền nhà 1tr250/tháng, đóng 03 tháng/lần, điện 3.500đ/số, nước 25.000đ/khối, mạng 50.000đ/phòng.<br>Phòng có điều hòa, tủ lạnh, nóng lạnh, vệ sinh. Ưu tiên các bạn đi làm (hoặc sinh viên) gọn gàng, sạch sẽ, ý thức tốt, phòng diện tích hạn chế, không có bếp nên sẽ tiện hơn nếu bạn nào không nấu ăn trong phòng.<br>LƯU Ý: KHÔNG HÚT THUỐC, CỜ BẠC, TỤ TẬP.<br>Liên hệ xem nhà: Quân 091.6840.092</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCIsIjMiOiJcdTAxMTBpXHUxZWMxdSBoXHUwMGYyYSIsIjQiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCJ9', 1, 0, '{\"0\":\"20.9981932\",\"1\":\"105.8490885\"}', 1, 0, '2019-05-14 19:00:22', '2019-05-14 19:00:22');
