INSERT INTO `motelrooms` VALUES (329, 'Cho thuê phòng khép ', 'cho-thue-phong-khep', 1800000, 30.0000, 1, 8, 9, 'Ngõ 2, Ngọc Thụy, Long Biên, Hà Nội', '0902152919', 4, 'Khép kín', '{\"0\":\"cho-thue-phong-khep-maq7e.jpg\"}', '<div class=\"dis-content\">Hiện tại mình có phòng khép kín tầng 2trong nhà 2 tầng cho thuê sau Mipec Long Biên gần bến xe Gia Lâm. Điện nước mạng truyền hình cáp đầy đủ theo giá Nhà nước và không chung chủ. Có tủ lạnh bếp ga sẵn chỗ nấu ăn dưới tầng. Trong phòng đã có sẵn tủ gỗ lớn, Ti vi có kệ kê và có tắm nóng lạnh....Chỉ cho nữ thê, giờ giấc đi lại tụ tập bạn bè thoải mái. Nhà đóng 2 tháng 1 lần</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCIsIjMiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCIsIjQiOiJUcnV5XHUxZWMxbiBoXHUwMGVjbmggY1x1MDBlMXAiLCI1IjoiVGl2aSJ9', 1, 0, '{\"0\":\"21.0477329\",\"1\":\"105.86955999999998\"}', 1, 0, '2019-05-14 19:02:02', '2019-05-14 19:02:02');
