INSERT INTO `motelrooms` VALUES (331, 'Cho thuê phòng khép ksin 500k/th ở Hà đông 12m2', 'cho-thue-phong-khep-ksin-500kth-o-ha-dong-12m2', 500000, 12.0000, 1, 21, 69, 'số 89 Huyền Kỳ -Phú Lãm- hà Đông- Hà Nội, Huyền Kỳ, Hà Đông, Hà Nội', '0968560406', 3, 'Khép kín', '{\"0\":\"cho-thue-phong-khep-ksin-500kth-o-ha-dong-12m2-xf1vb.jpg\"}', '<div class=\"dis-content\">Hiện mình có dãy phòng trọ cấp4 sạch sẽ thoáng mát muốn cho thuê .Phòng có nhà vệ sinh khép kín 400k/tháng và 500k/th diện tích khoảng 10-15m2 tùy phòng.Nước50/người/ tháng và internet 50k/người/tháng.Điện 3.5k/số.An ninh đảm bảo,không<br>khí trong lành, yên tĩnh, sân vườn mát mẻ.Chỗ để xe, sân phơi thoải mái,Giờ giấc<br>không quy định, bạn bè người thân đến chơi thoải mái. Mình ở gần cao đẳng kinh<br>tế kỹ thuật thương mại : 89-Huyền kỳ-tổ 7- phú lãm-hà đông-hà nội Liên hệ chính chủ : Tùng Anh: 0968560406                                Cô Yến:01663416034/0949603182</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCJ9', 1, 0, '{\"0\":\"20.93755859230037\",\"1\":\"105.754587555542\"}', 1, 0, '2019-05-14 19:02:42', '2019-05-14 19:02:42');
INSERT INTO `motelrooms` VALUES (332, 'Cho thuê phòng trọ tại Hà đông gần chợ Hà Đông và cầu Đen', 'cho-thue-phong-tro-tai-ha-dong-gan-cho-ha-dong-va-cau-den', 1800000, 18.0000, 1, 21, 56, ' Số nhà 12 đường Nguyễn trãi tổ dân phố 3 Phường Nguyễn trãi, hà đông( Đối diện chợ hà đông), Nguyễn Trãi, Hà Đông, Hà Nội, Nguyễn Trãi, Hà Đông, Hà Nội', '0916994113', 2, 'Khép kín', '{\"0\":\"no_img_room.png\"}', '<div class=\"dis-content\">Hiện tại mình có 1phòng tâng 3 cần cho thuê.<br><br>Địa chỉ: Số nhà 12 đường Nguyễn trãi tổ dân phố 3 Phường Nguyễn trãi, hà đông( Đối diện chợ hà đông)<br><br>Nhà có net+điện nước giá cực rẻ theo giá nhà nước.Nhà có nóng lạnh,máy giặt tủ lạnh mình sắm đủ cả người thuê có thể sử dụng chung mình mua máy to nên mọi người yên tâm nhé.Có chỗ nấu ăn riêng không chung phong ngủ.Chỗ để xe  riêng không chung chủ giờ giac thoải mái nhé có chìa khóa riêng.Nhà cách chợ Hà đông 20m và bến xe buýt 50m gần học viện an ninh, DH Hà Nội bưu chính viễn thông.. giao thông thuận tiện an ninh đảm bảo mình vất xe bên ngoàiđêm k mất vì nhiều hôm mệt quá quên cất xe nên các bạn tên tâm<br><br>Giá phòng: 1,8 tr đóng 3 tháng 1 <br>Yêu cầu ở sạch sẽ chỗ sinh hoạt chung trung thực thật thà k tắt mắt vì nhà mình toàn người đi làm.An ninh cực ký đảm bảo.<br><br>Ai có nhu cầu có thể chuyển đến ở từ ngày 1.8 nhé Liên hệ mình A Chức:0916994113</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCIsIjMiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCIsIjQiOiJNXHUwMGUxeSBnaVx1MWViN3QifQ==', 1, 0, '{\"0\":\"20.996241265713408\",\"1\":\"105.76476019882807\"}', 1, 0, '2019-05-14 19:05:14', '2019-05-14 19:05:14');
