INSERT INTO `motelrooms` VALUES (335, 'tìm nữ ở ghép tại ngõ 43 phùng khoang 2', 'tim-nu-o-ghep-tai-ngo-43-phung-khoang-2', 1600000, 18.0000, 1, 2, 241, 'ngõ 43 phùng khoang 2, Lương Thế Vinh, Thanh Xuân, Hà Nội', '01695437563', 1, 'Chung', '{\"0\":\"tim-nu-o-ghep-tai-ngo-43-phung-khoang-2-eoumk.jpg\"}', '<div class=\"dis-content\">tìm 1 bạn nữa ở ghép.mình ở ngõ 43 phùng khoang 2,,đi từ lương thế vinh hoặc chợ phùng khoang vào đều được,mình đang ở 2 người cùng sn 93 đã đi làm,bọn mk làm h hành chính,nên cũng ít ở p,tìm 1 bạn nữ tinjh thoải mái hòa đồng,thikc nấu ăn,vì bọn mk nấu ăn chứ k ăn ngoài,,(nữ đi làm rồi càng tốt)mk ở p 1tr6..điện 4k.nc 100k /người,,mạng 100k/p,,ở tầng 5,,vệ sinh 2p chung 1 nhà vs.nhưng rất sạch sẽ thoải mái nhé..k ở cùng chủ,nấu nowngs ở ngoài nên rất sạch sẽ thông thoáng,,h giacvs cũng kahs thoải mái 11h30 đóng cửa,,nhưng nếu về muộn có thể báo đi cửa sau..có chỗ để xe,muốn tmf 1 bạn để share tiền p,bọn mk rất thoải mái nhé,,cứ đến xem ở đk thì đầu t8 đến ở,,bọn mk có ddurr đồ nên chỉ viecjsachs mông đén và ở thôi </div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCJ9', 1, 0, '{\"0\":\"20.9911279\",\"1\":\"105.79892659999996\"}', 1, 0, '2019-05-14 19:08:33', '2019-05-14 19:08:33');
