INSERT INTO `motelrooms` VALUES (338, 'Cho thuê phòng trọ Số 37 Ngõ 123 Bằng Liệt', 'cho-thue-phong-tro-so-37-ngo-123-bang-liet', 1200000, 16.0000, 1, 57, 173, ' Số 37 Ngõ 123 Bằng Liệt, Hoàng Liệt, Hoàng Mai, Hà Nội', '0976550176', 1, 'Chưa xác định', '{\"0\":\"cho-thue-phong-tro-so-37-ngo-123-bang-liet-rb9d8.jpg\",\"1\":\"cho-thue-phong-tro-so-37-ngo-123-bang-liet-jx4at.jpg\"}', '<div class=\"dis-content\">o thuê phòng tại Linh Đàm gần cầu dậu.<br>Hiện tại nhà mình còn 1 phòng tầng 3 trong nhà 4 tầng cần cho thuê. <br>Giá phòng: 1,2tr/ người. <br>Điện nước giá nhà nước, có sẵn nóng lạnh, để xe tầng 1, giặt và phơi trên tầng 4. Không chung chủ. Nấu ăn tầng 1. Nhà vệ sinh tách riêng phòng<br>Địa chi. Số 37 ngõ 123 băng liệt. Liên hệ. 0976550176.</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCIsIjMiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCJ9', 1, 0, '{\"0\":\"20.9600282\",\"1\":\"105.82163479999997\"}', 1, 0, '2019-05-14 19:13:30', '2019-05-14 19:13:30');
INSERT INTO `motelrooms` VALUES (339, 'CHÍNH CHỦ CHO THUÊ CHUNG CƯ MINI P. NGỦ, P. KHÁCH DT 30M2 TẠI SỐ 118 ĐƯỜNG NGUYỄN ĐỔNG CHI', 'chinh-chu-cho-thue-chung-cu-mini-p-ngu-p-khach-dt-30m2-tai-so-118-duong-nguyen-dong-chi', 3200000, 30.0000, 1, 10, 39, ' Số nhà 118 Đường nguyễn Đổng Chi - Quận Nam Từ Liêm, Hồ Tùng Mậu, Từ Liêm, Hà Nội', '0902212798', 3, 'Khép kín', '{\"0\":\"chinh-chu-cho-thue-chung-cu-mini-p-ngu-p-khach-dt-30m2-tai-so-118-duong-nguyen-dong-chi-14995324279ygwe-g0c0q.jpg\",\"1\":\"chinh-chu-cho-thue-chung-cu-mini-p-ngu-p-khach-dt-30m2-tai-so-118-duong-nguyen-dong-chi-14995324279ygwe-pjkuo.jpg\",\"2\":\"chinh-chu-cho-thue-chung-cu-mini-p-ngu-p-khach-dt-30m2-tai-so-118-duong-nguyen-dong-chi-14995324279ygwe-zz47n.jpg\",\"3\":\"chinh-chu-cho-thue-chung-cu-mini-p-ngu-p-khach-dt-30m2-tai-so-118-duong-nguyen-dong-chi-14995324279ygwe-ipuqr.jpg\",\"4\":\"chinh-chu-cho-thue-chung-cu-mini-p-ngu-p-khach-dt-30m2-tai-so-118-duong-nguyen-dong-chi-14995324279ygwe-idrru.jpg\",\"5\":\"chinh-chu-cho-thue-chung-cu-mini-p-ngu-p-khach-dt-30m2-tai-so-118-duong-nguyen-dong-chi-14995324279ygwe-x2hpw.jpg\",\"6\":\"chinh-chu-cho-thue-chung-cu-mini-p-ngu-p-khach-dt-30m2-tai-so-118-duong-nguyen-dong-chi-14995324279ygwe-l84y5.jpg\",\"7\":\"chinh-chu-cho-thue-chung-cu-mini-p-ngu-p-khach-dt-30m2-tai-so-118-duong-nguyen-dong-chi-14995324279ygwe-ruqzi.jpg\",\"8\":\"chinh-chu-cho-thue-chung-cu-mini-p-ngu-p-khach-dt-30m2-tai-so-118-duong-nguyen-dong-chi-14995324279ygwe-vowbx.jpg\",\"9\":\"chinh-chu-cho-thue-chung-cu-mini-p-ngu-p-khach-dt-30m2-tai-so-118-duong-nguyen-dong-chi-14995324279ygwe-lxj0y.jpg\",\"10\":\"chinh-chu-cho-thue-chung-cu-mini-p-ngu-p-khach-dt-30m2-tai-so-118-duong-nguyen-dong-chi-14995324279ygwe-zslih.jpg\"}', '<div class=\"dis-content\"><strong>1-Chung cư mini 7 tầng mới hoàn thiện TẠI SỐ 118 ĐƯỜNG NGUYỄN ĐỔNG CHI có nhiều loại phòng cho thuê.Có 1 phòng ngủ + bếp. DT 30M2 giá từ 3.200.000 đ/tháng.<br>- Gía cả linh hoạt, thanh toán tối thiểu 3 tháng + cọc 1 tháng. <br>- Nội thất: Có nóng lạnh, giường, tủ, kệ bếp, chậu rửa, thiết bị vệ sinh hiện đại, các phòng đều thiết kế có cửa sổ thông thoáng.<br>Tòa nhà có thang máy, bảo vệ 24/24, an ninh đảm bảo, điện nước ổn định.<br>- Vị trí: Nhà nằm ở khu vực đông dân cư, dân trí cao, gần chợ, trường FPT, dân lập Lê Qúy Đôn, Đoàn Thị Điểm, mầm non hoa anh đào, sát đô thị Mỹ Đình …, cách đường Hàm Nghi 300m.<br>Mặt đường trước cửa 5m, hai ô tô tránh nhau, phù hợp người đi làm, hộ gia đình trẻ có thêm ông bà hoặc giúp việc ở cùng.<br>- Địa chỉ: Số nhà 118 Đường nguyễn Đổng Chi - Quận Nam Từ Liêm. (siêu thị thành đô rẽ vào hoặc đường Hàm Nghi đi vào). Hoặc gần khu đô thị Mỹ Đình 1 đi vào.<br><br>LH C Hương 0978 335 871./ 0902 212 798 / 0982 9696 69.<br><br>2-Tòa nhà 8 tầng tại phố Doãn Kế Thiện mới hoàn thiện vào ở luôn.<br>- Diện tích các phòng từ 35m2 - 40m2.<br>Giá cho thuê 4.500.000đ - 5.000.000đ/tháng, các phòng bao gồm:<br>Phòng ngủ + phòng khách và khu bếp riêng biệt.<br>- Phòng ngủ được trang bị điều hòa 2 chiều, giường, tủ quần áo...<br>- Phòng khách cũng có thể làm phòng ngủ nếu nhà Đông người.<br>- Phòng bếp được trang bị bàn ăn, bàn bếp, tủ bếp, chậu rửa bát, hút mùi,...<br>- Khu vực nhà vệ sinh được lắp đầy đủ thiết bị hiện đại như chậu rửa mặt, bệt Inax, vòi sen, bình nóng lạnh,...<br>- Tòa nhà có bảo vệ 24/24, đảm bảo an ninh tuyệt đối, giờ giấc ra vào thoải mái.<br>- Khu vực ban công phơi đồ riêng biệt của từng phòng.<br>* Tòa nhà nằm ở vị trí trung tâm, giao thông thuận tiện, cách mặt đường Doãn Kế Thiện 20m, đối diện chợ Đồng Xa nên rất thuận tiện cho việc mua sắm, đi chợ, nằm trong khuôn viên tập quân đội nên an ninh rất tốt, gần các trung tâm thương mại, gần các trường ĐH như quốc gia, ngoại ngữ, gần bến xe Mỹ Đình,...<br>Địa chỉ: Số 32/C1 – Đường Doãn Kế Thiện - P.Mai Dịch - Cầu Giấy.<br>LH C Hương 0978 335 871./ 0902 212 798 / 0982 9696 69</strong></div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJUaGFuZyBtXHUwMGUxeSIsIjMiOiJJbnRlcm5ldCIsIjQiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCIsIjUiOiJUcnV5XHUxZWMxbiBoXHUwMGVjbmggY1x1MDBlMXAifQ==', 1, 0, '{\"0\":\"21.0385759\",\"1\":\"105.77150170000004\"}', 1, 0, '2019-05-14 19:14:11', '2019-05-14 19:14:11');
INSERT INTO `motelrooms` VALUES (340, 'Nhà trọ Tam Trinh thoáng mát, điện nước giá dân, giờ giấc tự do', 'nha-tro-tam-trinh-thoang-mat-dien-nuoc-gia-dan-gio-giac-tu-do', 1500000, 20.0000, 1, 57, 72, 'số 75c số 173 Tam Trinh, Tam Trinh, Hoàng Mai, Hà Nội', '0973612652', 3, 'Khép kín', '{\"0\":\"nha-tro-tam-trinh-thoang-mat-dien-nuoc-gia-dan-gio-giac-tu-do-ek2m7.jpg\",\"1\":\"nha-tro-tam-trinh-thoang-mat-dien-nuoc-gia-dan-gio-giac-tu-do-rgcce.jpg\",\"2\":\"nha-tro-tam-trinh-thoang-mat-dien-nuoc-gia-dan-gio-giac-tu-do-jkqg8.jpg\",\"3\":\"nha-tro-tam-trinh-thoang-mat-dien-nuoc-gia-dan-gio-giac-tu-do-3nz6c.jpg\",\"4\":\"nha-tro-tam-trinh-thoang-mat-dien-nuoc-gia-dan-gio-giac-tu-do-1cmvd.jpg\",\"5\":\"nha-tro-tam-trinh-thoang-mat-dien-nuoc-gia-dan-gio-giac-tu-do-zcujx.jpg\"}', '<div class=\"dis-content\">Phòng trọ số 75C ngõ 173 Tam Trinhthoáng mát, giờ giấc tự do, điện nước giá dân ngay đầu ngã ba Linh Nam, Tam<br>Trinh, gần bến xe bus, các trường đại học lớn như Bách Khoa, Xây Dựng, Kinh<br>Doanh Công Nghệ…<br>Nhà có 6 phòng mới gồm:<br>Tầng 1 có 1 phòng rộng 25m2 có vệ sinhkhép kín, có bếp nấu ăn, có nóng lạnh, có 2 dát giường: giá 1tr9<br>Tầng 2 có 2 phòng: 1 phòng có ban công diện tích 20m2(giá2tr2/th), 1 phòng có diện tích 15m2 (giá 1tr8/th).<br>Tầng 3 có 2 phòng: 1 phòng có ban công diện tích 20m2 (giá2tr1/th), 1 phòng có diện tích 15m2 (giá 1tr7/th).<br>Tầng 4 có 1 phòng: Phòng có diện tích 15m2 (giá 1tr5/th).<br>Mô tả thêm:<br>- Phòng thoáng mát, có 2 cửa sổ gió lùa thoáng mát<br>- Nhà 4 tầng, tầng 1 để xe miễn phí , tầng4 có chỗ nấu ăn rộng rãi<br>- Máy giặt miễn phí cả nhà dùng chung, dây phơi quần áothoáng ở sân thượng.<br>- Nhà vệ sinh đẹp, rộng rãi, lịch sự, vòi hoa sen, nóng lạnh,bệt, gương đầy đủ.<br>- Internet cáp quang 22MB.<br>- Điện nước giá nhà nước hoàn toàn. Các phòng đều có công tơriêng tự chia.<br>- Phòng ở nhiều người thoải mái.<br>- Tháng có người qua dọn vệ sinh chung cả nhà thường xuyên.<br>- Không ở chung chủ. Giờ giấc đi lại thoải mái, tiếp bạn bèvô tư miễn là lịch sự và không làm ảnh hưởng đến người khác và hàng xóm xung<br>quanh.<br>- Yêu cầu là ngăn nắp, sạch sẽ, không làm hư hại phòng và cácvật dụng trong nhà. Ngoài ra không thu thêm tiền gì.<br>- Hợp đồng lâu dài không tăng giá, chu kỳ đóng tiền nhà 1tháng 1 lần, đặt cọc 1 tháng tiền nhà (liên hệ 0973612652)</div>', 'e30=', 1, 0, '{\"0\":\"20.9922261\",\"1\":\"105.86396348308108\"}', 1, 0, '2019-05-14 19:15:39', '2019-05-14 19:15:39');
