INSERT INTO `motelrooms` VALUES (344, 'CHO NGƯỜI NƯỚC NGOÀI THUÊ CĂN HỘ CHUNG CƯ ĐỦ TIỆN NGHI PHỐ CẦU GIẤY', 'cho-nguoi-nuoc-ngoai-thue-can-ho-chung-cu-du-tien-nghi-pho-cau-giay', 7000000, 45.0000, 1, 16, 16, 'NHÀ D2 NGÕ 93 CẦU GIẤY, Cầu Giấy, Cầu Giấy, Hà Nội', '0971504943', 4, 'Khép kín', '{\"0\":\"cho-nguoi-nuoc-ngoai-thue-can-ho-chung-cu-du-tien-nghi-pho-cau-giay-1498571230q27vb-aumlv.jpg\",\"1\":\"cho-nguoi-nuoc-ngoai-thue-can-ho-chung-cu-du-tien-nghi-pho-cau-giay-1498571230q27vb-qo1ey.jpg\",\"2\":\"cho-nguoi-nuoc-ngoai-thue-can-ho-chung-cu-du-tien-nghi-pho-cau-giay-1498571230q27vb-xjflu.jpg\",\"3\":\"cho-nguoi-nuoc-ngoai-thue-can-ho-chung-cu-du-tien-nghi-pho-cau-giay-1498571230q27vb-zo45s.jpg\",\"4\":\"cho-nguoi-nuoc-ngoai-thue-can-ho-chung-cu-du-tien-nghi-pho-cau-giay-1498571230q27vb-jgawe.jpg\"}', '<div class=\"dis-content\">Tòa nhà 9 tầng tại số nhà D2 ngõ 93 phố Cầu Giấy - P.Quan Hoa - Cầu Giấy, vào ở luôn.<br>- Nhà ngay phố Cầu Giấy, đường vào rộng, 2 ô tô con tránh nhau, rất thuận tiện cho việc đi lại.<br>- Các căn hộ rộng được lát sàn gạch cao cấp, căn nào cũng có cửa sổ rộng, ban công phơi đồ riêng biệt. Các căn hộ được thiết kế hết sức hợp lý<br>Gồm 2 phòng ngủ + 1 phòng khách và phòng bếp riêng biệt DT 50m2.<br>- Mỗi phòng được trang bị điều hòa 2 chiều, giường, tủ quần áo, cửa sổ có rèm cản nắng cực đẹp, trần thạch cao, đèn ngủ đủ cả, bàn bếp xịn, hút mùi, bồn rửa bát xịn, sàn gỗ cao cấp.<br>- Nhà vệ sinh được lắp thiết bị vệ sinh Inax cao cấp, bình nóng lạnh Ariston, ốp lát gạch Prime sang trọng, có bồn tắm đứng hiện đại.<br>Giá cho thuê: 6.500.000- 7.000.000đ- 7.500.000đ/căn/tháng (thanh toán tối thiểu 03 tháng và đặt cọc 1 tháng). DT Các phòng từ 45 - 50m2.<br>- Tòa nhà trang bị thang máy cao cấp, máy giặt, truyền hình cáp, internet tốc độ cao miễn phí, mỗi căn hộ được cấp thẻ từ thang máy riêng.<br>- Tòa nhà có 2 bảo vệ 24/24 nên an ninh cực ổn, ra vào thoải mái, nhà để xe rộng rãi gần 200m2, có thể chứa được đến 80 chiếc xe máy.<br>+ Địa chỉ:Tò