chỉ: Số nhà 67 ngõ 39 phố Hào Nam, P. Ô Chợ Dừa-Q. Đống Đa.<br>Hoặc ngõ 318 Đê La Thành đi vào số nhà 67.<br>LH A.LƯỢNG 0982 9696 69 /0978 335 871</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJUaGFuZyBtXHUwMGUxeSIsIjMiOiJJbnRlcm5ldCIsIjQiOiJcdTAxMTBpXHUxZWMxdSBoXHUwMGYyYSIsIjUiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCIsIjYiOiJNXHUwMGUxeSBnaVx1MWViN3QifQ==', 1, 0, '{\"0\":\"21.02186\",\"1\":\"105.82563299999993\"}', 1, 0, '2019-05-14 19:25:00', '2019-05-14 19:25:00');
