H Thủy Lợi, Nhân Văn, Ngoại Ngữ….<br><br>- Căn hộ rộng 45m2 - 50m2 được lát sàn gỗ, căn nào cũng cửa sổ rộng, ban công phơi đồ riêng biệt nhìn sang hồ điều hòa, hít khí trời trong lành nên không độc hại. Căn hộ được thiết kế hết sức hợp lý, 1 phòng ngủ, 1 phòng khách, khu bếp có đầy đủ ánh sáng, gió và không khí vào phòng.<br><br>- Mỗi căn hộ được trang bị giường, cửa sổ có rèm Thái Tuấn cực đẹp, trần thạch cao, đèn ngủ đủ cả, bàn bếp xịn, hút mùi, bồn rửa bát xịn.<br>- Nhà vệ sinh có thiết bị vệ sinh Inax cao cấp, ốp lát gạch Prime sang trọng.<br><strong>Giá cho thuê: 5.000.000 đ - 5.500.000đ/căn/tháng (thanh toán tối thiểu 03 tháng và đặt cọc 01 tháng).</strong><br>Phí dịch vụ:<br>- Điện: 3.500 đồng/số. Nước: 30.000 đồng/khối. Internet: 100.000 đồng/phòng (cáp quang).<br><strong>- Bảo vệ 24/24, gửi xe miễn phí.</strong><br>- Tòa nhà trang bị thang máy cao cấp, máy giặt, truyền hình cáp miễn phí, mỗi căn hộ đư<br>- Tòa nhà có bảo vệ 24/24 nên an ninh cực ổn, ra vào ợc cấp thẻ từ thang máy riêng.thoải mái, nhà để xe rộng rãi gần 200m2, có thể chứa được đến 50 chiếc xe máy.<br>+ Địa chỉ: Số nhà 78 mặt đường Hồ Rùa, ngõ 155 đường Trường Chinh – Đống Đa - HN.<br><strong>Liên hệ chủ nhà A Lượng 0982 9696 69 / Chị Hương 0978 335 871.<br>Chú ý: Tất cả các tòa nhà trên đều là chính chủ cho thuê.</strong></div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJUaGFuZyBtXHUwMGUxeSIsIjMiOiJJbnRlcm5ldCIsIjQiOiJcdTAxMTBpXHUxZWMxdSBoXHUwMGYyYSIsIjUiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCIsIjYiOiJNXHUwMGUxeSBnaVx1MWViN3QifQ==', 1, 0, '{\"0\":\"21.0229024\",\"1\":\"105.82202510000002\"}', 1, 0, '2019-05-14 19:25:26', '2019-05-14 19:25:26');
