èm cản nắng cực đẹp, trần thạch cao, đèn ngủ đủ cả, bàn bếp xịn, bàn ăn, hút mùi, bồn rửa bát xịn, sàn gỗ cao cấp.<br>- Khu bếp có bàn bếp, tủ bếp, tủ lạnh, hút mùi, đầy đủ ánh sáng, gió và không khí vào phòng.<br>- Nhà vệ sinh có thiết bị vệ sinh Inax cao cấp, bình nóng lạnh, ốp lát gạch Prime sang trọng hiện đại.<br>- Tòa nhà trang bị thang máy cao cấp, máy giặt, truyền hình cáp miễn phí, mỗi căn hộ được cấp thẻ từ thang máy riêng.<br>- Tòa nhà có bảo vệ 24/24 nên an ninh cực ổn, ra vào thoải mái, nhà để xe rộng rãi gần 300m2.<br>- Riêng sàn văn phòng tầng 1 diện tích rộng 50m2 giá 9.000.000 đ/ tháng.<br>- Thích hợp làm văn phòng, spa, siêu thị...<br><strong>+ Địa chỉ: Số nhà 18 Đê La Thành nhỏ - P. Phương Liên - Đống Đa.<br>Liên hệ chủ nhà:<br>A Lượng 0982 9696 69 chị Hương 0978 335 871. / 0971 504 943.</strong></div>', '', 1, 0, '{\"0\":\"21.0150419\",\"1\":\"105.83395150000001\"}', 1, 0, '2019-05-14 19:25:30', '2019-05-14 19:25:30');
