INSERT INTO `motelrooms` VALUES (359, 'Nhượng phòng  Hoàng Văn Thái', 'nhuong-phong-hoang-van-thai', 2100000, 20.0000, 1, 2, 171, 'Sn 6, ngõ 210/1, hoàng văn thái, Hoàng Văn Thái, Thanh Xuân, Hà Nội', '0971406499', 3, 'Khép kín', '{\"0\":\"nhuong-phong-hoang-van-thai-resized-mamak.jpg\"}', '<div class=\"dis-content\">Do mình chuyển ra ở cùng bạn nên muốn nhượng lại phòng:<br>- tầng 1trong nhà 3 tầng, rộng 20m2, đã có giường xịn và quạt trần,nên  rất thoáng mát,<br>- điện nước giá nhà nc,  có chỗ để xe, <br>- ngay gần chợ.<br>- Vệ sinh dùng riêng biệt có đầy đủ gương,  nóng lạnh,  vòi hoa sen,  có khu bếp nấu ăn.<br>- Nhà ít ng,  Chỉ cho nữ thuê,<br>- Giá: 2tr1, cọc 1 tháng,  đóng tiền 3 tháng.<br>Chuyen đến ở luôn. <br> lh: 0971406499.</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCIsIjMiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCJ9', 1, 0, '{\"0\":\"20.9956386\",\"1\":\"105.82760789999998\"}', 1, 0, '2019-05-14 19:26:27', '2019-05-14 19:26:27');
INSERT INTO `motelrooms` VALUES (361, 'Nhà trọ Khâm Thiên không chung chủ, có điều hòa', 'nha-tro-kham-thien-khong-chung-chu-co-dieu-hoa', 1500000, 25.0000, 1, 6, 122, 'số 22 ngõ 249 phố chợ khâm thiên, Chợ Khâm Thiên, Đống Đa, Hà Nội', '0973612652', 4, 'Khép kín', '{\"0\":\"nha-tro-kham-thien-khong-chung-chu-co-dieu-hoa-f3de2.jpg\",\"1\":\"nha-tro-kham-thien-khong-chung-chu-co-dieu-hoa-khuh3.jpg\",\"2\":\"nha-tro-kham-thien-khong-chung-chu-co-dieu-hoa-5wsnl.jpg\",\"3\":\"nha-tro-kham-thien-khong-chung-chu-co-dieu-hoa-eplpd.jpg\",\"4\":\"nha-tro-kham-thien-khong-chung-chu-co-dieu-hoa-zerll.jpg\",\"5\":\"nha-tro-kham-thien-khong-chung-chu-co-dieu-hoa-ebvqw.jpg\"}', '<div class=\"dis-content\">Phòng trọ tại nhà số22 ngõ 249 phố chợ Khâm Thiên thoáng mát, giờ giấc tự do, điện nước giá dân<br>ngay đầu Ngã ba Lê Duẩn – Khâm Thiên<br>Nhà gồm 6 phòng cụ thểnhư  sau:<br>*Tầng 1: phòng 13m2thoáng mát không cần điều hòa : giá 1tr5<br>*Tầng 2 có 2 phòng: 1phòng to có ban công, diện tích 25m2, có điều hòa, vệ sinh khép kín:giá 3tr2<br>1 phòng nhỏ diện tích15m2, có cửa sổ, mát mẻ : giá 1tr7<br>*Tầng 3 có 2 phòng:1phòng to có ban công, diện tích 25m2, có điều hòa, vệ sinh khép kín, quạt treo<br>tường, giường, đệm, tivi, tủ quần áo: giá 3tr6<br>1 phòng nhỏ diện tích15m2, có cửa sổ, mát mẻ : giá 1tr6<br>*Tầng 4 có 1 phòng:  phòng có diện tích 15m2 có điều hòa, giườnggiá 1tr7<br>   Mô tả thêm: <br>- Nhà có 2 chỗ để xe rộngrãi, an ninh cực đảm bảo hoàn toàn free, gần chợ, các trường đại học Bách Khoa,<br>Xây Dựng, Kinh Tế… <br>- Nhàliên kề không bị nắng chiếu nên các phòng rất thoáng mát.<br>- Máy giặt miễn phí cảnhà dùng chung, dây phơi quần áo thoáng ở sân thượng <br>- Nhà vệ sinh đẹp, rộng rãi, lịch sự, vòi hoasen, nóng lạnh, bệt, gương… đầy đủ<br>- Internet cáp quang <br>- Điện nước giá nhà nước hoàn toàn. Các phòng đềucó công tơ riêng tự chia. <br>- Phòng ở nhiều người thoải mái.  <br>- Tháng có người qua dọn vệ sinh chung cả nhàthường xuyên <br>- Không ở chung chủ. Giờ giấc đi lại thoải mái,tiếp bạn bè vô tư miễn là lịch sự và không làm ảnh hưởng đến người khác và hàng<br>xóm xung quanh. <br>- Yêu cầu là ngăn nắp, sạch sẽ, không làm hư hạiphòng và các vật dụng trong nhà. Ngoài ra không thu thêm tiền gì. <br>-Hợp đồnglâu dài không tăng giá, chu kỳ đóng tiền nhà 1 tháng 1 lần, đặt cọc 1 tháng tiền<br>nhà ( liên hệ 0973.612.652) </div>', 'e30=', 1, 0, '{\"0\":\"21.0155953\",\"1\":\"105.83762750000005\"}', 1, 0, '2019-05-14 19:26:43', '2019-05-14 19:26:43');
