/tháng.<br>– Tòa nhà trang bị thang máy cao cấp, máy giặt miễn phí, truyền hình cáp, internet tốc độ cao mỗi căn hộ được cấp thẻ từ thang máy riêng.<br>– Tòa nhà có 2 bảo vệ 24/7 nên an ninh cực ổn, ra vào thoải mái, nhà để xe rộng rãi gần 300m2, có thể chứa được đến 200chiếc xe máy.<br>– Vệ sinh dọn phòng hàng ngày nếu khách có nhu cầu.<br>* Thích hợp cho người nước ngoài, hộ gia đình và người đi làm thuê ở.<br>+ Địa chỉ: Tòa nhà 23 Phố Đông Các- P.Ô Chợ Dừa -Đống Đa- hn.<br>LH :CHÍNH CHỦ ANH LƯỢNG 0982 9696 69 / 0978 335 871</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJUaGFuZyBtXHUwMGUxeSIsIjMiOiJJbnRlcm5ldCIsIjQiOiJcdTAxMTBpXHUxZWMxdSBoXHUwMGYyYSIsIjUiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCIsIjYiOiJNXHUwMGUxeSBnaVx1MWViN3QifQ==', 1, 0, '{\"0\":\"21.019386\",\"1\":\"105.82741009999995\"}', 1, 0, '2019-05-14 19:27:45', '2019-05-14 19:27:45');
