INSERT INTO `motelrooms` VALUES (366, 'Nhà trọ 30m2 , Điều hòa 18000 mát lạnh', 'nha-tro-30m2-dieu-hoa-18000-mat-lanh', 2800000, 30.0000, 1, 57, 148, 'số 4 ngách 44 ngõ 177 Định Công, Định Công, Hoàng Mai, Hà Nội', '01659018679', 5, 'Chung', '{\"0\":\"nha-tro-30m2-dieu-hoa-18000-mat-lanh-mmetk.png\"}', '<div class=\"dis-content\">Nhà trọ 30m2 , Điều hòa 18000 mát lạnh  <br>Nhà 4 tầng đẹp địa chỉ4/44/177 Định Công,<br> Tầng 1: Để xe free Còn 1 phòng tầng  3 diện tích 30m2, vệ sinh khép kín đầy đủtrang thiết bị gồm : nóng lạnh, hoa sen, chậu rửa mặt,kệ bếp . Mô tả : <br>-Điều hòa công suất lớn 18000 lạnh rétrun.<br>- Nhà cách cầu Định Công 50m<br>- Phòng thoáng mát có ban công,  và 2 cửa sổ <br>- Máy giặt cả nhà dùng chung, chỗ phơi quần áothoáng ở sân thượng <br>- Nhà vệ sinh đẹp, rộng rãi, lịch sự, vòi hoasen, nóng lạnh<br>- Internet cáp quang 27mb <br>- Điện nước giá nhà nước hoàn toàn. Các phòng đềucó công tơ riêng tự chia. <br>- Phòng ở nhiều người thoải mái. <br>- Tháng có người qua dọn vệ sinh chung cả nhàthường xuyên <br>- Không ở chung chủ. Giờ giấc đi lại thoải mái,tiếp bạn bè vô tư miễn là lịch sự và không làm ảnh hưởng đến người khác và hàng<br>xóm xung quanh. <br>- Yêu cầu là ngăn nắp, sạch sẽ, không làm hư hạiphòng và các vật dụng trong nhà. Ngoài ra không thu thêm tiền gì. <br>Giá phòng :2.8tr/ phòng . Hợp đồng lâu dài khôngtăng giá, chu kỳ đóng tiền nhà 1 tháng 1 lần, đặt cọc 1 tháng tiền nhà ( liên hệ<br>0165.901.8679) </div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IkludGVybmV0IiwiMiI6Ilx1MDExMGlcdTFlYzF1IGhcdTAwZjJhIiwiMyI6IkJcdTAwZWNuaCBuXHUwMGYzbmcgbFx1MWVhMW5oIiwiNCI6Ik1cdTAwZTF5IGdpXHUxZWI3dCJ9', 1, 0, '{\"0\":\"20.982175758860414\",\"1\":\"105.83487241936041\"}', 1, 0, '2019-05-14 19:28:33', '2019-05-14 19:28:33');
