Làm việc tất cả các ngày trong tuần , kể cả dịp lễ tết ?</strong><br>– <strong>Bạn muốn tìm 1 nơi thu mua ống kính máy ảnh tại Hà Nội đến tận nơi của bạn  ?</strong><br><em><strong>( <strong>Hà Nội và toàn bộ các tỉnh miền bắc )</strong></strong></em><br>– <strong>Bạn ngần ngại về giá trị của body / lens bạn sẽ không được định giá chính xác ? </strong><br>– <strong>Bạn đừng lo lắng, chúng tôi sẽ đáp ứng tất cả yêu cầu , thắc mắc của bạn một cách tốt nhất , nhanh gọn nhất !<br><br></strong><br><u><strong>Chúng tôi chuyên :</strong></u><br><em><strong>  – Nhập lại từ người dùng những sản phẩm dòng máy ảnh, ống kính máy ảnh DSRL đã qua sử dụng , hàng xách tay hay new 100%.  </strong></em><em><strong>Máy có thể còn bảo hành cũng như hết bảo hành.</strong></em><br><em><strong>Tại khu vực Hà Nội và các tỉnh lân cận.</strong></em><br><em><strong>  – Tư vấn miễn phí chọn lựa hỗ trợ sử dụng cho những bạn tập chơi</strong></em><br><em><strong>( ở đây là tư vấn , kể cả những người không có nhu cầu bán muốn tìm hiểu thêm về các dòng máy ảnh Nikon hay Canon )</strong></em><br><em><strong>  – Tư vấn miễn phí cách chọn lựa Camera cũng như cách test camera khi chọn mua 1 sản phẩm máy ảnh đã qua sử dụng.<br></strong></em><br><u><strong>Với cam kết :</strong></u><br><strong><em>  – Thái độ mua hàng vui vẻ nhiệt tinh. Báo đúng giá sản phẩm . không chèn giá ép giá khách hàng.</em></strong><br><strong><em>  – Hỗ trợ quí khách , tư vấn lựa chọn mua máy cho khách hàng 1 cách nhiệt tình nhất.</em></strong><br><strong><em>  – Đến tận nơi , test máy nhanh gọn , không cầu kì.<br></em></strong><br><strong>* LƯU Ý : <u>Đơn giản vì chúng tôi là bên chuyên  và hoạt động kinh doanh duy nhất về lĩnh vực máy ảnh /ống kính máy ảnh ( không phải về các lĩnh vực cầm đồ hay kinh doanh cầm cố máy tính laptop ).</u></strong><strong><u>Chúng tôi tiếp cận trực tiếp sản phẩm đến khách hàng và không qua 1 khâu trung gian nào nên việc định giá hay đảm bảo giá trị cho đúng sản phẩm máy ảnh/ ống kính của các bạn là hoàn toàn chính xác với giá trị hiện tại !<br><br></u></strong><br><strong>ĐT </strong>: <strong>0988.225.880<br><em>( Có thể gọi hoặc nhắn tin )  24/24 – Bất kể thời gian nào ở trong này kể cả đêm khuya  – Làm việc tất cả các ngày trong tuần , kể cả dịp lễ tết .</em></strong><br><strong>Địa chỉ :</strong> <strong>Số 7 ngõ 2 Tây Sơn – Hà Nội<br><br></strong><br><u><em><strong>GN Camera – Khách Đến Hài Lòng – Khách Đi Vừa Ý !</strong></em></u><br><u><em><strong><br></strong></em></u></div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJUaGFuZyBtXHUwMGUxeSIsIjMiOiJJbnRlcm5ldCIsIjQiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCIsIjUiOiJNXHUwMGUxeSBnaVx1MWViN3QiLCI2IjoiVGl2aSJ9', 1, 0, '{\"0\":\"21.0083911\",\"1\":\"105.82383819999995\"}', 1, 0, '2019-05-14 19:28:52', '2019-05-14 19:28:52');
INSERT INTO `motelrooms` VALUES (368, 'CHÍNH CHỦ CHO THUÊ  CĂN HỘ CHUNG CƯ NỘI THẤT ĐẸP MẶT PHỐ ĐÔNG CÁC', 'chinh-chu-cho-thue-can-ho-chung-cu-noi-that-dep-mat-pho-dong-cac', 7000000, 40.0000, 1, 6, 119, '95 ĐÔNG CÁC, Đông Các, Đống Đa, Hà Nội', '0971504943', 4, 'Khép kín', '{\"0\":\"chinh-chu-cho-thue-can-ho-chung-cu-noi-that-dep-mat-pho-dong-cac-hi7ro.jpg\",\"1\":\"chinh-chu-cho-thue-can-ho-chung-cu-noi-that-dep-mat-pho-dong-cac-vcah4.jpg\",\"2\":\"chinh-chu-cho-thue-can-ho-chung-cu-noi-that-dep-mat-pho-dong-cac-c5wbx.jpg\",\"3\":\"chinh-chu-cho-thue-can-ho-chung-cu-noi-that-dep-mat-pho-dong-cac-2sqa7.jpg\",\"4\":\"chinh-chu-cho-thue-can-ho-chung-cu-noi-that-dep-mat-pho-dong-cac-i7fai.jpg\",\"5\":\"chinh-chu-cho-thue-can-ho-chung-cu-noi-that-dep-mat-pho-dong-cac-ipeft.jpg\"}', '<div class=\"dis-content\">Nhà mặt đường phố Đông Các, đường vào rộng, 2 ô tô con tránh nhau, rất thuận tiện cho việc đi lại, sinh hoạt, vui chơi, giải trí. Lên phố cổ cũng gần, trung tâm thương mại ngay sát, gần trường đại học mỹ thuật công nghiệp, học viện âm nhạc…<br>– Căn hộ rộng được lát sàn gỗ, căn nào cũng có cửa sổ rộng, ban công phơi đồ riêng biệt. Các phòng được thiết kế hết sức hợp lý: Gồm 1 phòng ngủ, 1 phòng khách, khu bếp có bàn bếp, tủ bếp, hút mùi, đầy đủ ánh sáng, gió và không khí vào phòng.<br>– Mỗi phòng được trang bị điều hòa 2 chiều, giường, tủ quần áo, cửa sổ có rèm cản nắng cực đẹp, trần thạch cao, đèn ngủ đủ cả, bàn bếp xịn, bàn ăn, hút mùi, bồn rửa bát xịn, sàn gỗ cao cấp.<br>– Nhà vệ sinh được lắp thiết bị vệ sinh Inax cao cấp, bình nóng lạnh, ốp lát gạch Prime sang trọng, có bồn tắm đứng hiện đại.<br>Giá cho thuê: 7.000.000đ- 7.500.000đ/căn/tháng (thanh toán tối thiểu 03 tháng và đặt cọc 1 tháng). DT Các phòng từ 45-50m2.<br>– Tòa nhà trang bị thang máy cao cấp, máy giặt, truyền hình cáp, internet tốc độ cao miễn phí, mỗi căn hộ được cấp thẻ từ thang máy riêng.<br>– Tòa nhà có bảo vệ 24/24 nên an ninh cực ổn, ra vào thoải mái, nhà để xe rộng rãi gần 200m2, có thể chứa được đến 80 chiếc xe máy.<br>+ Địa chỉ: Số nhà 93 – 95 mặt phố Đông Các – P. Ô Chợ Dừa, Đống Đa.<br>Liên hệ chủ nhà A Lượng 0982 9696 69 Chị Hương 0978 335 871.</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJUaGFuZyBtXHUwMGUxeSIsIjMiOiJJbnRlcm5ldCIsIjQiOiJcdTAxMTBpXHUxZWMxdSBoXHUwMGYyYSIsIjUiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCIsIjYiOiJNXHUwMGUxeSBnaVx1MWViN3QifQ==', 1, 0, '{\"0\":\"21.019386\",\"1\":\"105.82741009999995\"}', 1, 0, '2019-05-14 19:29:00', '2019-05-14 19:29:00');
