INSERT INTO `motelrooms` VALUES (370, 'cho thuê phòng trọ số 4 ngõ 797 Trương Định', 'cho-thue-phong-tro-so-4-ngo-797-truong-dinh', 2200000, 25.0000, 1, 57, 182, 'số 4 ngõ 797 Trương Định, Hoàng Mai, Hà Nội, Trương Định, Hoàng Mai, Hà Nội', '0976505168', 3, 'Chưa xác định', '{\"0\":\"cho-thue-phong-tro-so-4-ngo-797-truong-dinh-1496328579tzmfa-pqsy0.jpg\",\"1\":\"cho-thue-phong-tro-so-4-ngo-797-truong-dinh-1496328579tzmfa-vfap9.jpg\"}', '<div class=\"dis-content\">Phòng ở tầng 3 trong toà nhà 5 tầng, phòng thoáng mát , sạch sẽ,có chỗ nấu ăn trong phòng, có sẵn giường, wifi tốc độ cao, chỗ phơi đồ thoáng mát, bình nóng lạnh, điện 3,500d, nước 80k/người đặc biệt nằm trong khu an ninh cực tốt. Ai có nhu cầu xin liên hệ Bác Nụ (chủ nhà) 0976505168</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCIsIjMiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCJ9', 1, 0, '{\"0\":\"20.9858848\",\"1\":\"105.84651499999995\"}', 1, 0, '2019-05-14 19:31:16', '2019-05-14 19:31:16');
INSERT INTO `motelrooms` VALUES (372, 'Nhượng lại phòng ở đường hoàng mai, hà nội', 'nhuong-lai-phong-o-duong-hoang-mai-ha-noi', 2500000, 20.0000, 1, 57, 57, '2/218 hoang mai , hoang van thu, ha noi, Hoàng Mai, Hoàng Mai, Hà Nội', '0943085521', 3, 'Khép kín', '{\"0\":\"nhuong-lai-phong-o-duong-hoang-mai-ha-noi-resized-mpanb.jpg\",\"1\":\"nhuong-lai-phong-o-duong-hoang-mai-ha-noi-resized-tiojt.JPG\",\"2\":\"nhuong-lai-phong-o-duong-hoang-mai-ha-noi-resized-9fwxe.jpg\",\"3\":\"nhuong-lai-phong-o-duong-hoang-mai-ha-noi-resized-nzyix.jpg\",\"4\":\"nhuong-lai-phong-o-duong-hoang-mai-ha-noi-yr96d.jpg\",\"5\":\"nhuong-lai-phong-o-duong-hoang-mai-ha-noi-resized-jjrfn.jpg\",\"6\":\"nhuong-lai-phong-o-duong-hoang-mai-ha-noi-resized-whnli.jpg\"}', '<div class=\"dis-content\">Mình muốn nhượng lại phòng của mình đang thuê, nhà cách trung tâm thành phố 4km, và gần các trường đại học, bệnh viện và time city trong bán kính 1km chất lượng với giá bình dân. Day la nhà riêng được xây lên giống chung cư mini, nhà có 7 lầu và có thang máy đi lại . Phòng có giường ngủ + mềm, gối nằm và khăn trải giường của mình để lại, có cả bình nước uống nóng lạnh mình mua 1tr và để lại cho các bạn. Phòng có điều hòa, nhà vệ sinh riêng có nước tắm nóng lạnh. Giá 2tr5 + 100,000 tien phi an ninh, gui xe, do rac và internet, rất thuận tiện, trên tầng thượng được cung cấp máy giặt đồ và sấy khô, 15,000 VNĐ mỗi lần giặt. Tien diện: 3,500đ/1 số và nước: 15000d/1m3. Ông bà chủ rất thân thiện, bạn có thể xin họ một cái tủ lạnh để để đồ ăn, bạn có quyền nấu nướng. Mình thì thích ra ngoài đi ăn vì nơi ở gần chợ và siêu thị mini vinmart nên rất tiện và đồ ăn rất rẻ, xe hơi có thể vào được nên các bạn có thể bắt taxi bất cứ lúc nào. Kèm theo phòng có thể chứa lên tới 3 người nên không cần phải lo, phần lớn các người thuê ở đây là các anh chị đi làm nên không gian rất yên tĩnh và mọi người rất lịch sự và tôn trọng lẫn nhau, mình có chụp rất nhiều hình ảnh về nơi mình ở nên các bạn nên xem qua. Mình muốn nhượng lại từ ngày 10/6/2017 nên các bạn cứ liên hệ mình để xem qua chỗ ở trước. Liên hệ: sdt: 0943085521, email va viber: markkennyhuynh@gmail.com, skype: phongdiver gap Phong. Cảm ơn các bạn đã quan tâm.</div>', 'e30=', 1, 0, '{\"0\":\"20.9874667\",\"1\":\"105.85872210000002\"}', 1, 0, '2019-05-14 19:31:56', '2019-05-14 19:31:56');
