INSERT INTO `motelrooms` VALUES (375, 'Cho thuê phòng khép kín 400k/th ở hà Đông 12m2', 'cho-thue-phong-khep-kin-400kth-o-ha-dong-12m2', 500000, 12.0000, 1, 21, 69, '89 Huyền Kỳ- Phú Lãm -Hà Đông- hà Nội, Huyền Kỳ, Hà Đông, Hà Nội', '0968560406', 3, 'Chung', '{\"0\":\"cho-thue-phong-khep-kin-400kth-o-ha-dong-12m2-1495894125me2n7-m1h2j.jpg\"}', '<div class=\"dis-content\">Hiện mình có dãy phòng trọ cấp4 sạch sẽ thoáng mát muốn cho thuê .Phòng có nhà vệ sinh khép kín 400k/tháng và 500k/th diện tích khoảng 10-15m2 tùy phòng.Nước50/người/ tháng và internet 50k/người/tháng.Điện 3.5k/số.An ninh đảm bảo,không<br>khí trong lành, yên tĩnh, sân vườn mát mẻ.Chỗ để xe, sân phơi thoải mái,Giờ giấc<br>không quy định, bạn bè người thân đến chơi thoải mái. Mình ở gần cao đẳng kinh<br>tế kỹ thuật thương mại : 89-Huyền kỳ-tổ 7- phú lãm-hà đông-hà nội.<br>Đặc điểm của nhà trọlà có người chuyển đi rồi chuyển đến. Nên bất cứ khi nào các bạn cần đều có thể<br>liên lạc nhé<br> Liên hệ chính chủ : Tùng Anh: 0968560406<br>                                Cô Yến:01663416034/0949603182</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCJ9', 1, 0, '{\"0\":\"20.933069378842465\",\"1\":\"105.75227012695314\"}', 1, 0, '2019-05-14 19:33:07', '2019-05-14 19:33:07');
INSERT INTO `motelrooms` VALUES (376, 'CHO THUÊ CĂN HỘ CHUNG CƯ ĐỦ TIỆN NGHI SỐ 18 ĐÊ LA THÀNH TIỆN Ở, LÀM VĂN PHÒNG GIÁ CHỈ 7,5 TRIỆU', 'cho-thue-can-ho-chung-cu-du-tien-nghi-so-18-de-la-thanh-tien-o-lam-van-phong-gia-chi-75-trieu', 7500000, 35.0000, 1, 6, 115, '18 ĐÊ LA THÀNH, ĐỐNG ĐA, HÀ NỘI, La Thành, Đống Đa, Hà Nội', '0978335871', 4, 'Khép kín', '{\"0\":\"cho-thue-can-ho-chung-cu-du-tien-nghi-so-18-de-la-thanh-tien-o-lam-van-phong-gia-chi-75-trieu-bs0tt.jpg\",\"1\":\"cho-thue-can-ho-chung-cu-du-tien-nghi-so-18-de-la-thanh-tien-o-lam-van-phong-gia-chi-75-trieu-eagms.jpg\",\"2\":\"cho-thue-can-ho-chung-cu-du-tien-nghi-so-18-de-la-thanh-tien-o-lam-van-phong-gia-chi-75-trieu-4us4i.jpg\",\"3\":\"cho-thue-can-ho-chung-cu-du-tien-nghi-so-18-de-la-thanh-tien-o-lam-van-phong-gia-chi-75-trieu-ytamm.jpg\",\"4\":\"cho-thue-can-ho-chung-cu-du-tien-nghi-so-18-de-la-thanh-tien-o-lam-van-phong-gia-chi-75-trieu-tmoi0.jpg\",\"5\":\"cho-thue-can-ho-chung-cu-du-tien-nghi-so-18-de-la-thanh-tien-o-lam-van-phong-gia-chi-75-trieu-1ccyh.jpg\",\"6\":\"cho-thue-can-ho-chung-cu-du-tien-nghi-so-18-de-la-thanh-tien-o-lam-van-phong-gia-chi-75-trieu-qrbkg.jpg\",\"7\":\"cho-thue-can-ho-chung-cu-du-tien-nghi-so-18-de-la-thanh-tien-o-lam-van-phong-gia-chi-75-trieu-8ifqi.jpg\",\"8\":\"cho-thue-can-ho-chung-cu-du-tien-nghi-so-18-de-la-thanh-tien-o-lam-van-phong-gia-chi-75-trieu-srycd.jpg\"}', '<div class=\"dis-content\">Tòa nhà 9 tầng tại số 18 phố Đê La Thành nhỏ - P. Phương Liên, tầm 22/5 vào ở được luôn.<br>- Nhà mặt đường phố Đê La Thành nhỏ, đường vào rộng, 2 tô con tránh nhau, ngay ngã tư Ô Chợ Dừa và Xã Đàn rất thuận tiện cho việc đi lại, sinh hoạt, vui chơi, giải trí. Lên phố Cổ cũng gần, trung tâm thương mại ngay sát.<br>- Căn hộ rộng được lát sàn gỗ, căn nào cũng có cửa sổ rộng, ban công phơi đồ riêng biệt. Các phòng được thiết kế hết sức hợp lý:<br>+ Loại 1: Gồm 1 phòng ngủ, 1 phòng khách và bếp.<br>+ Giá cho thuê: 7.500.000 đ/căn/tháng (thanh toán tối thiểu 06 tháng và đặt cọc 1 tháng). DT các phòng 45m2.<br><br>+ Giá cho người nước ngoài từ 9 triệu/th -10 triệu /tháng.<br>- Mỗi phòng được trang bị điều hòa 2 chiều, giường, tủ quần áo, bộ bàn ghế, cửa sổ có rèm cản nắng cực đẹp, trần thạch cao, đèn ngủ đủ cả, bàn bếp xịn, bàn ăn, hút mùi, bồn rửa bát xịn, sàn gỗ cao cấp.<br>- Khu bếp có bàn bếp, tủ bếp, tủ lạnh, hút mùi, đầy đủ ánh sáng, gió và không khí vào phòng.<br>- Nhà vệ sinh có thiết bị vệ sinh Inax cao cấp, bình nóng lạnh, ốp lát gạch Prime sang trọng hiện đại.<br>- Tòa nhà trang bị thang máy cao cấp, máy giặt, truyền hình cáp miễn phí, mỗi căn hộ được cấp thẻ từ thang máy riêng.<br>- Tòa nhà có bảo vệ 24/24 nên an ninh cực ổn, ra vào thoải mái, nhà để xe rộng rãi gần 300m2.<br>- Riêng sàn văn phòng tầng 1 diện tích rộng 50m2 giá 10.000.000 đ/ tháng.<br>- Thích hợp làm văn phòng, spa, siêu thị...<br>+ Địa chỉ: Số nhà 18 Đê La Thành nhỏ - P. Phương Liên - Đống Đa.<br>Liên hệ chủ nhà:<br>A Lượng 0982 9696 69 chị Hương 0978 335 871. / 0971 504 943.</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJUaGFuZyBtXHUwMGUxeSIsIjMiOiJJbnRlcm5ldCIsIjQiOiJcdTAxMTBpXHUxZWMxdSBoXHUwMGYyYSIsIjUiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCJ9', 1, 0, '{\"0\":\"21.0220073\",\"1\":\"105.82027029999995\"}', 1, 0, '2019-05-14 19:33:41', '2019-05-14 19:33:41');
