n là lịch sự và không làm ảnh hưởng đến người khác và hàng<br>xóm xung quanh. <br>- Yêu cầu là ngăn nắp, sạch sẽ, không làm hư hạiphòng và các vật dụng trong nhà. Ngoài ra không thu thêm tiền gì. <br>-Hợp đồnglâu dài không tăng giá, chu kỳ đóng tiền nhà 1 tháng 1 lần, đặt cọc 1 tháng tiền<br>nhà ( liên hệ 0973612652) </div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCIsIjMiOiJcdTAxMTBpXHUxZWMxdSBoXHUwMGYyYSIsIjQiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCIsIjUiOiJNXHUwMGUxeSBnaVx1MWViN3QiLCI2IjoiVHJ1eVx1MWVjMW4gaFx1MDBlY25oIGNcdTAwZTFwIn0=', 1, 0, '{\"0\":\"20.991932\",\"1\":\"105.8624499\"}', 1, 0, '2019-05-14 19:36:29', '2019-05-14 19:36:29');
