INSERT INTO `motelrooms` VALUES (395, 'TÌM NỮ Ở GHÉP KHU VỰC NGÃ TƯ SỞ', 'tim-nu-o-ghep-khu-vuc-nga-tu-so', 1600000, 15.0000, 1, 2, 25, 'CHÙA KHƯƠNG HẠ, Khương Hạ, Thanh Xuân, Hà Nội', '0914871393', 3, 'Khép kín', '{\"0\":\"tim-nu-o-ghep-khu-vuc-nga-tu-so-1495061049fidty-avftb.jpg\"}', '<div class=\"dis-content\">Hiện tại mình đang muốn tìm 1 bạn nữ ở ghép tại Khương Hạ, gần Ngã Tư Sở. Phòng trọ khép kín, ở với cô chú thoải mái, dễ tính. Đồ đạc mình đã sắm đầy đủ, bạn chỉ việc đến ở luôn. (Có cả wifi). Điện nước 1 mình mình dùng chỉ có 150k/tháng. Mình đang đi làm, rất gọn gàng và sạch sẽ. Chỗ ở an ninh, đảm bảo, gần chợ, gần trường học, gần đồn công an. Các bạn có thể liên hệ trước với mình để xem phòng. mình tên Lan.</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCJ9', 1, 0, '{\"0\":\"20.9901578\",\"1\":\"105.81596830000001\"}', 1, 0, '2019-05-14 19:38:13', '2019-05-14 19:38:13');
