INSERT INTO `motelrooms` VALUES (410, 'Chung cư mini cho các hộ gia đình', 'chung-cu-mini-cho-cac-ho-gia-dinh', 3000000, 20.0000, 1, 57, 46, '41 ngõ Gốc Đề, Hoàng Văn Thụ, Hoàng Mai, Hà Nội, Minh Khai, Hoàng Mai, Hà Nội', '01675871008', 3, 'Khép kín', '{\"0\":\"chung-cu-mini-cho-cac-ho-gia-dinh-hlkci.JPG\"}', '<div class=\"dis-content\">Chung cư mini 25 phòng với hầm gửi xe, thang máy các phòng được trang bị đầy đủ bao gồm giường  tủ, điều hoà, bình nóng lạnh, bếp từ, (vì mục đích phòng chống cháy nổ nên không cho phép sử dụng bếp đun) tất cả đều mới 100%, có trang bị cứu hoả. Phù hợp cho các gia đình. Dự kiến hoàn thiện vào đầu tháng 6/2017, Mỗi phòng từ ~25m2. Mọi thông tin liên hệ số điện thoại 016 758 71008 (Cô Hà). Xin lỗi vì tôi không thể tải ảnh của nhà lên được (do lỗi của website).</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJUaGFuZyBtXHUwMGUxeSIsIjMiOiJJbnRlcm5ldCIsIjQiOiJcdTAxMTBpXHUxZWMxdSBoXHUwMGYyYSIsIjUiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCJ9', 1, 0, '{\"0\":\"20.9924246\",\"1\":\"105.85307839999996\"}', 1, 0, '2019-05-14 20:35:02', '2019-05-14 20:35:02');
