cao, gần chợ, trường FPT, dân lập Lê Quý Đôn, mầm non Hoa Anh Đào, sát đô thị Mỹ Đình … Cách đường Hàm Nghi 300m. <br>Mặt đường trước cửa 15m, hai ô tô tránh nhau, phù hợp người đi làm, hộ gia đình trẻ có thêm ông bà hoặc giúp việc ở cùng. <br><br>- Giá cả linh hoạt, thanh toán tối thiểu 3 tháng + cọc 1 tháng. <br>- Địa chỉ: Số nhà 118 đường Nguyễn Đổng Chi - Quận Nam Từ Liêm (siêu thị Thành Đô rẽ vào hoặc đường Hàm Nghi đi vào). Hoặc gần khu đô thị Mỹ Đình 1 đi vào. <br><br>Liên hệ: Chị Hương 0978 335 871/0982 9696 69. <br><br>http://newlifeapartment.com/</strong></div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJUaGFuZyBtXHUwMGUxeSIsIjMiOiJJbnRlcm5ldCIsIjQiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCIsIjUiOiJUcnV5XHUxZWMxbiBoXHUwMGVjbmggY1x1MDBlMXAifQ==', 1, 0, '{\"0\":\"21.0385759\",\"1\":\"105.77150170000004\"}', 1, 0, '2019-05-14 20:35:28', '2019-05-14 20:35:28');
