INSERT INTO `motelrooms` VALUES (415, 'Cho thuê phòng trọ Số 104P22, Ngõ 260  Tân Mai ', 'cho-thue-phong-tro-so-104p22-ngo-260-tan-mai', 1300000, 14.0000, 1, 57, 58, 'Số 104P22, Ngõ 260 , Tân Mai, Hoàng Mai, Hà Nội', '01636001227', 1, 'Chưa xác định', '{\"0\":\"cho-thue-phong-tro-so-104p22-ngo-260-tan-mai-1494005747gyytf-iota0.jpg\"}', '<div class=\"dis-content\"> thuê phòng ở 1 người - bao trọn điện, nước, mạng, vệ sinh-1.3tr<br>1.300.000 ₫<br>Tân Mai City<br>Chào cả nhà tình hình là nhà mình còn đúng 1 phòng tầng 4 trong nhà 4 tầng tại số 104P22 ngõ 260 Tân Mai (đến cầu đường bộ Tân Mai, rẽ vào ngõ có cái TPbank đầu đường, đi qua sân bóng Tân Mai là đến).<br>Mình muốn cho thuê nốt cho bạn nào có nhu cầu<br>Đặc điểm phòng:<br>--- Nhà sàn gỗ cao cấp, sạch sẽ, diện tích 12m2<br>--- Giờ giấc thoải mái, không chung chủ, an ninh tốt<br>---Giá: 1.5tr bao hết, điện, nước mạng dùng tẹt ga (các phòng khác đang thu nước 70K, mạng 100K, vệ sinh 15K, điện tự chia)<br>---Có bình nóng lạnh, sd chung vs tầng 3.<br>---Có chỗ nấu nướng tầng 4 rộng thoáng và để xe ở tầng 1 thoải mái.<br>Bạn nào có nhu cầu vui lòng liên hệ Nam-01636.001.227 h</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCJ9', 1, 0, '{\"0\":\"20.9800809\",\"1\":\"105.85181\"}', 1, 0, '2019-05-14 20:35:51', '2019-05-14 20:35:51');
