INSERT INTO `motelrooms` VALUES (417, 'Cho thuê phòng trọ số 96 Định Công, Thanh Xuân, Hoàng Ma', 'cho-thue-phong-tro-so-96-dinh-cong-thanh-xuan-hoang-ma', 1600000, 20.0000, 1, 57, 148, 'Số 96 , Định Công, Hoàng Mai, Hà Nội', '0979521516', 3, 'Chưa xác định', '{\"0\":\"cho-thue-phong-tro-so-96-dinh-cong-thanh-xuan-hoang-ma-ivfp9.jpg\",\"1\":\"cho-thue-phong-tro-so-96-dinh-cong-thanh-xuan-hoang-ma-b9xfg.jpg\"}', '<div class=\"dis-content\"> một phòng chung cư 2 phòng ngủ.<br>Địa chỉ: 96 Định Công, Thanh Xuân, Hoàng Mai, Hà Nội.<br>Đặc điểm:<br>1⃣ Diện tích: 20m2 chưa tính ban công.<br>2⃣ Đồ: 1 giường m6, 1 tủ 3 buồng, nóng lạnh, giá phơi quần áo thông minh, bếp ga, tủ lạnh 152l, bộ salon phòng khách, bàn ghế nhà ăn...<br>3⃣ Điện nước: Giá dân, mạng internet 110k cả phòng, xe 60k/thág...<br>4⃣ Khu vực: Dân trí cao, mát mẻ, dưới chân chung cư cơ chợ, siêu thị, phòng tập. Cách phố cổ ~5km. Cách địa điểm bắt bus ~300m. Gần các trường Đh Kinh tế Quốc Dân, Xây dựng, Bách Khoa...<br>5⃣ Yêu cầu: Sạch sẽ, sạch sẽ và thật sạch sẽ... (Ưu tiên người đi làm, ở 2 người, tối đa 3 người)<br>6⃣ Giá cả thương lượng (cọc 1 thág, thanh toán 3 tháng 1), liên hệ: Sđt 0979 52 15 16 (Quốc Anh - 6 tuổi) (miễn trung gian)</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCIsIjMiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCJ9', 1, 0, '{\"0\":\"20.9847639\",\"1\":\"105.839428\"}', 1, 0, '2019-05-14 20:36:32', '2019-05-14 20:36:32');
