INSERT INTO `motelrooms` VALUES (422, 'CHO THUÊ CĂN HỘ CHUNG CƯ TIỆN Ở, LÀM VĂN PHÒNG NGÕ 93 CẦU GIẤY', 'cho-thue-can-ho-chung-cu-tien-o-lam-van-phong-ngo-93-cau-giay', 7000000, 50.0000, 1, 16, 16, 'NHÀ D2 NGÕ 93 CẦU GIẤY, Cầu Giấy, Cầu Giấy, Hà Nội', '0942752374', 5, 'Khép kín', '{\"0\":\"cho-thue-can-ho-chung-cu-tien-o-lam-van-phong-ngo-93-cau-giay-sbw4i.jpg\",\"1\":\"cho-thue-can-ho-chung-cu-tien-o-lam-van-phong-ngo-93-cau-giay-4ek1o.jpg\",\"2\":\"cho-thue-can-ho-chung-cu-tien-o-lam-van-phong-ngo-93-cau-giay-hrksd.jpg\",\"3\":\"cho-thue-can-ho-chung-cu-tien-o-lam-van-phong-ngo-93-cau-giay-t5skv.jpg\"}', '<div class=\"dis-content\">Tòa nhà 9 tầng tại số nhà D2 ngõ 93 phố Cầu Giấy – P. Quan Hoa – Cầu Giấy, mới hoàn thiện vào ở được luôn.<br>* Khuyến mại cho khách hàng 1tr nếu vào thuê phòng trước tết âm lịch.<br>– Nhà ngay phố Cầu Giấy, đường vào rộng, 2 ô tô con tránh nhau, rất thuận tiện cho việc đi lại, sinh hoạt, vui chơi, giải trí. Lên phố cổ cũng gần, trung tâm thương mại ngay sát, gần trường đại học Sư Phạm, Học Viện Báo Chí Và Tuyên Truyền,…<br>– Các căn hộ rộng được lát sàn gạch cao cấp, căn nào cũng có cửa sổ rộng, ban công phơi đồ riêng biệt. Các căn hộ được thiết kế hết sức hợp lý:<br>+ Loại 1: Gồm 1 phòng ngủ + 1 phòng khách, khu bếp có bàn bếp, tủ bếp, hút mùi, đầy đủ ánh sáng, gió và không khí vào phòng. DT: 45m2.<br>+ Loại 2: Gồm 2 phòng ngủ + 1 phòng khách và phòng bếp riêng biệt DT: 50m2.<br>– Mỗi phòng được trang bị điều hòa 2 chiều, giường, tủ quần áo, bộ bàn ăn, cửa sổ có rèm cản nắng cực đẹp, trần thạch cao, đèn ngủ đủ cả, bàn bếp, hút mùi, bồn rửa bát xịn.<br>– Nhà vệ sinh được lắp thiết bị vệ sinh Inax cao cấp, bình nóng lạnh Ariston, ốp lát gạch Prime sang trọng hiện đại.<br><br>Giá cho thuê: 6.500.000 – 7.000.000đ- 7.500.000- 8.000.000 đ/căn/tháng (thanh toán tối thiểu 03 tháng và đặt cọc 1 tháng). DT Các phòng từ 45 – 50m2.<br><br>– Tòa nhà trang bị thang máy cao cấp, máy giặt miễn phí, truyền hình cáp, internet tốc độ cao miễn phí, mỗi căn hộ được cấp thẻ từ thang máy riêng.<br>– Tòa nhà có 2 bảo vệ 24/24 nên an ninh cực ổn, ra vào thoải mái, nhà để xe rộng rãi gần 200m2, có thể chứa được đến 100 chiếc xe máy.<br>– Vệ sinh dọn phòng hàng ngày nếu khách có nhu cầu.<br>+ Địa chỉ: Tòa nhà D2 ngõ 93 phố Cầu Giấy, P. Quan Hoa, Q. Cầu Giấy (Cách Cầu Giấy 150m).<br>Liên hệ chủ nhà 0971 504 943</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJUaGFuZyBtXHUwMGUxeSIsIjMiOiJJbnRlcm5ldCIsIjQiOiJcdTAxMTBpXHUxZWMxdSBoXHUwMGYyYSIsIjUiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCIsIjYiOiJNXHUwMGUxeSBnaVx1MWViN3QifQ==', 1, 0, '{\"0\":\"21.0362368\",\"1\":\"105.79058250000003\"}', 1, 0, '2019-05-14 20:39:26', '2019-05-14 20:39:26');
