Tòa nhà trang bị thang máy cao cấp, máy giặt, truyền hình cáp miễn phí, mỗi căn hộ được cấp thẻ từ thang máy riêng.<br>- Tòa nhà có bảo vệ 24/24 nên an ninh cực ổn, ra vào thoải mái, nhà để xe rộng rãi gần 200m2, có thể chứa được đến 50 chiếc xe máy.<br>+ Địa chỉ: Số nhà 20 mặt đường Hồ Rùa, ngõ 155 đường Trường Chinh – Đống Đa - HN.<br>Liên hệ chủ nhà A Lượng 0982 9696 69 / Chị Hương 0978 335 871</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJUaGFuZyBtXHUwMGUxeSIsIjMiOiJJbnRlcm5ldCIsIjQiOiJcdTAxMTBpXHUxZWMxdSBoXHUwMGYyYSJ9', 1, 0, '{\"0\":\"20.9997048\",\"1\":\"105.83285590000003\"}', 1, 0, '2019-05-14 20:41:27', '2019-05-14 20:41:27');
