INSERT INTO `motelrooms` VALUES (426, 'Tìm người ở ghép T5', 'tim-nguoi-o-ghep-t5', 1000000, 17.0000, 1, 16, 211, 'số nhà 45 hẻm 13 ngách 49 ngõ 165 Dương quảng hàm, Dương Quảng Hàm, Cầu Giấy, Hà Nội', '0974055751', 2, 'Khép kín', '{\"0\":\"tim-nguoi-o-ghep-t5-tjhvu.jpg\"}', '<div class=\"dis-content\">TÌM NỮ Ở GHÉP<br>mình muốn tìm thêm 1 bạn nữa để chia sẻ tiền phòng<br>Phòng rộng khoảng 20m, giá tiền 1tr8. Đóng tiền từng tháng, cọc 1 tháng<br>Nhà 6 tầng, Phòng trên tầng 5, thoáng mát, mình ưng nhất là điểm này, mùa đông phòng ấm, mùa hè mát. Gần chợ<br>Điện 3,8k/số, nước 16k/khối. Có nóng lạnh<br>Mạng 100k 1 phòng<br>Giờ giấc: 23h đóng cửa, tuy nhiên nếu về muộn có thể báo trước để bác chủ để mở cửa, có bảo vệ, camera nên rất an ninh nhé.<br>Có chỗ để xe, nhà cách bến bus 500m<br>Địa chỉ: số nhà 45 hẻm 13 ngách 49 ngõ 165 Dương quảng hàm<br>Liên hệ xem phòng: 0974.055.751<br>( lúc chụp ảnh phòng hơi bừa bộn 1 chút)</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IkludGVybmV0IiwiMiI6IkJcdTAwZWNuaCBuXHUwMGYzbmcgbFx1MWVhMW5oIn0=', 1, 0, '{\"0\":\"21.0361062\",\"1\":\"105.79841490000001\"}', 1, 0, '2019-05-14 20:41:36', '2019-05-14 20:41:36');
INSERT INTO `motelrooms` VALUES (427, 'CẦN CHO THUÊ GẤP PHÒNG TRỌ TẠI 176 VĂN CHƯƠNG, 30m2, VS KHÉP KÍN', 'can-cho-thue-gap-phong-tro-tai-176-van-chuong-30m2-vs-khep-kin', 4200000, 30.0000, 1, 6, 288, '176 Ngõ Văn Chương, Văn Chương, Đống Đa, Hà Nội', '0984569752', 2, 'Khép kín', '{\"0\":\"can-cho-thue-gap-phong-tro-tai-176-van-chuong-30m2-vs-khep-kin-lby7i.jpg\"}', '<div class=\"dis-content\">CẦN CHO THUÊ GẤP PHÒNG TRỌ TẠI 176 VĂN CHƯƠNG, 30m2, VS KHÉP KÍN<br> Phòng Tầng 3 - 4.200.000đ, 30m2, có cửa kính lớn view thoáng, thử tưởng tượng ngồi trong nhà nhâm nhi tách trà và ngắm cơn mưa mùa hạ qua ô cửa kính, cuộc sống đôi khi chỉ cần những phút giây chậm lại để hưởng thụ cuộc sống được trọn vẹn hơn &lt;3 &lt;3<br>Tòa nhà có 6 tầng, có thang máy, để xe tầng 1, phơi đồ trên tầng thượng. Mỗi phòng đều có giường, điều hòa, nóng lạnh, VS khép kín, có quạt trần, quạt thông gió. Nhà ở sạch sẽ, thoáng mát!<br>Dịch vụ:<br>Điện: 3.500đ/số.<br>Nước: chia đầu người.<br>Có nhu cầu thuê liên hệ ngay: <br>Phú - 0984569752</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJUaGFuZyBtXHUwMGUxeSIsIjMiOiJJbnRlcm5ldCIsIjQiOiJcdTAxMTBpXHUxZWMxdSBoXHUwMGYyYSIsIjUiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCJ9', 1, 0, '{\"0\":\"21.0209708\",\"1\":\"105.83751460000008\"}', 1, 0, '2019-05-14 20:41:43', '2019-05-14 20:41:43');
INSERT INTO `motelrooms` VALUES (428, 'CHO THUÊ CĂN HỘ CHUNG CƯ MINI 118 NGUYỄN ĐỔNG CHI MỚI, ĐẸP, TIỆN NGHI GIÁ 4,5 TRIỆU', 'cho-thue-can-ho-chung-cu-mini-118-nguyen-dong-chi-moi-dep-tien-nghi-gia-45-trieu', 4500000, 35.0000, 1, 10, 61, '118 NGUYỄN ĐỔNG CHI, Cầu Diễn, Từ Liêm, Hà Nội', '0978335871', 4, 'Khép kín', '{\"0\":\"cho-thue-can-ho-chung-cu-mini-118-nguyen-dong-chi-moi-dep-tien-nghi-gia-45-trieu-szlid.jpg\",\"1\":\"cho-thue-can-ho-chung-cu-mini-118-nguyen-dong-chi-moi-dep-tien-nghi-gia-45-trieu-gjoqh.jpg\",\"2\":\"cho-thue-can-ho-chung-cu-mini-118-nguyen-dong-chi-moi-dep-tien-nghi-gia-45-trieu-5jft2.jpg\",\"3\":\"cho-thue-can-ho-chung-cu-mini-118-nguyen-dong-chi-moi-dep-tien-nghi-gia-45-trieu-bbwxl.jpg\"}', '<div class=\"dis-content\">-Chung cư mini 7 tầng có nhiều loại phòng cho thuê tại số 118 Đường Nguyễn Đổng Chi - Phường Mỹ Đình 2.<br><br>+ Có 1 phòng ngủ + 1 phòng khách + bếp. DT 40-45m2,<br>Giá 4.000.000đ - 4.500.000 đ/tháng.<br><br>- Nội thất: Có nóng lạnh, giường, tủ, kệ bếp, chậu rửa, thiết bị vệ sinh hiện đại, các phòng đều thiết kế có cửa sổ thông thoáng.<br><br>Tòa nhà có thang máy, bảo vệ 24/24, an ninh đảm bảo, điện nước ổn định.<br>- Vị trí: Nhà mặt đường Nguyễn Đổng Chi nằm ở khu vực đông dân cư, dân trí cao, gần chợ, trường FPT, dân lập Lê Quý Đôn, mầm non Hoa Anh Đào, sát đô thị Mỹ Đình … Cách đường Hàm Nghi 300m.<br><br>Mặt đường trước cửa 15m, hai ô tô tránh nhau, phù hợp người đi làm, hộ gia đình trẻ có thêm ông bà hoặc giúp việc ở cùng.<br><br>- Giá cả linh hoạt, thanh toán tối thiểu 3 tháng + cọc 1 tháng.<br><br>- Địa chỉ: Số nhà 118 đường Nguyễn Đổng Chi - Quận Nam Từ Liêm (siêu thị Thành Đô rẽ vào hoặc đường Hàm Nghi đi vào). Hoặc gần khu đô thị Mỹ Đình 1 đi vào.<br><br>Liên hệ: Chị Hương 0978 335 871/0982 9696 69</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJUaGFuZyBtXHUwMGUxeSIsIjMiOiJJbnRlcm5ldCIsIjQiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCJ9', 1, 0, '{\"0\":\"21.0376152\",\"1\":\"