INSERT INTO `motelrooms` VALUES (429, 'CHO NGƯỜI NƯỚC NGOÀI THUÊ CĂN HỘ DỊCH VỤ NHÀ D2 NGÕ 93 CẦU GIẤY', 'cho-nguoi-nuoc-ngoai-thue-can-ho-dich-vu-nha-d2-ngo-93-cau-giay', 6500000, 45.0000, 1, 16, 16, 'Nhà D2 ngõ 93 Cầu giấy, Cầu Giấy, Cầu Giấy, Hà Nội', '0978335871', 5, 'Khép kín', '{\"0\":\"cho-nguoi-nuoc-ngoai-thue-can-ho-dich-vu-nha-d2-ngo-93-cau-giay-4uhxs.jpg\",\"1\":\"cho-nguoi-nuoc-ngoai-thue-can-ho-dich-vu-nha-d2-ngo-93-cau-giay-juz63.jpg\",\"2\":\"cho-nguoi-nuoc-ngoai-thue-can-ho-dich-vu-nha-d2-ngo-93-cau-giay-k99ul.jpg\"}', '<div class=\"dis-content\">Chính chủ cho người nước ngoài, Việt Nam thuê căn hộ dịch vụ cao cấp tại nhà D2 ngõ 93 Cầu Giấy.<br>Mô tả 1. Vị trí tiện ích:<br>Căn hộ cao cấp đường Cầu Giấy mới hoàn thiện cho thuê được thiết kế thông minh, tiện lợi, đầy đủ tiện ích đi kèm, tầng 1 để xe rộng rãi.<br>Tòa chung cư Newlife Aparment 7tầng nằm tại phố Cầu Giấy giao thông thuận tiện.<br>- Cách công viên Cầu Giay 500m, cách Cầu Giấy 150m.<br>- Rất nhiều nhà hàng với phong cách ẩm thực đa dạng Việt Nam, Hàn Quốc, Nhật Bản, Trung Quốc...<br>- Chỉ 2 phút để tiếp cận hệ thống ngân hàng, siêu thị, trường học đường Cầu Giấy.<br>- Tòa nhà được lắp camera an ninh, đảm bảo, giờ giấc 24/7 thoải mái đi lại.<br><br>2. Thiết kế:<br>- 2 loại diện tích: 45m2, 50m2, thiết kế với kệ bếp nấu ăn.<br>- WC khép kín, có sẵn bình nóng lạnh và thiết bị WC.<br>- Căn hộ có cửa sổ thoáng mát.<br>- Đồ đạc đầy đủ, chỉ xách va li đến ở.<br><br>3. Giá cả:<br>- Giá phòng: 6.5 - 7 - 8 - 9 triệu/tháng.<br>- Điện: 3500/số.<br>- Nước 30.000/m3.<br>- Miễn phí gửi xe, truyền hình, internet cáp quang.<br>- Dọn phòng 2 lần/tuần.<br>- Khách thuê có thể thanh toán tiền thuê căn hộ theo 02 tháng + đặt cọc 01 tháng.<br><br>Hãy tiết kiệm thời gian quý báu của chính các bạn bằng cách nhấc máy lên và gọi ngay cho chúng tôi để được tư vấn.<br><br>Quý khách có thể đến xem phòng trực tiếp tại số nhà D2 ngõ 93 Cầu Giấy, Hà Nội. Trước khi đến xem có thể liên hệ: Chị Hương 0978 335 871/ 0982 9696 69.<br><br>Cảm ơn quý khách đã dành thời gian quan tâm.</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJUaGFuZyBtXHUwMGUxeSIsIjMiOiJJbnRlcm5ldCIsIjQiOiJcdTAxMTBpXHUxZWMxdSBoXHUwMGYyYSIsIjUiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCIsIjYiOiJNXHUwMGUxeSBnaVx1MWViN3QifQ==', 1, 0, '{\"0\":\"21.0362368\",\"1\":\"105.79058250000003\"}', 1, 0, '2019-05-14 20:43:44', '2019-05-14 20:43:44');
INSERT INTO `motelrooms` VALUES (430, 'Cho thuê căn hộ chung cư khép kín', 'cho-thue-can-ho-chung-cu-khep-kin', 3000000, 40.0000, 1, 10, 92, 'số 55 ngõ 30 đường Phùng Khoang Nam Từ Liêm Hà Nội, Trung Văn, Từ Liêm, Hà Nội', '0967781573', 3, 'Khép kín', '{\"0\":\"cho-thue-can-ho-chung-cu-khep-kin-yeh0c.jpg\"}', '<div class=\"dis-content\">Cho thuê căn hộ chung cư khép kín  tại số 55 ngõ 30 đường Phùng Khoang, Quận Nam Từ Liêm, Hà nội<br>✽ 40m2 giá 3 triệu đồng/tháng<br>►Mặt đường thoáng thuận tiện kinh doanh<br>► Điện, nước đầy đủ, giá cả nhà nước.<br>► Có bình tắm nóng lạnh.<br>► Nhà có chỗ để xe rộng rãi (cả tầng 1) an toàn.<br>► Bảo vệ, Camera an ninh 24/24 <br>► Wifi, Internet ADSL, Truyền hình cáp đầy đủ.<br>► Nhà nằm gần trường học, bệnh viện và chợ Phùng Khoang <br>► Rất thuận tiện đi lại<br>► Điện thoại liên hệ: 0967781573 ( Chú Sâm)<br>► Địa chỉ : Số 55 Ngõ 30 Đuờng Phùng Khoang <br>(cách nhà hàng Chiến béo 2 nhà, cổng màu xanh lá cây đậm).<br>► Cam kết tôi là chính chủ, không qua môi giới </div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCIsIjMiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCIsIjQiOiJUcnV5XHUxZWMxbiBoXHUwMGVjbmggY1x1MDBlMXAifQ==', 1, 0, '{\"0\":\"20.988192386656312\",\"1\":\"105.79489767540508\"}', 1, 0, '2019-05-14 20:43:47', '2019-05-14 20:43:47');
INSERT INTO `motelrooms` VALUES (432, 'Còn 1 phòng cho nữ thuê ưu tiên sinh viên', 'con-1-phong-cho-nu-thue-uu-tien-sinh-vien', 1500000, 20.0000, 1, 57, 59, 'số 8 Ngõ 50 Đường Lĩnh Nam, Phường Mai Động, Quận Hoàng Mai, Lĩnh Nam, Hoàng Mai, Hà Nội', '01685669452', 2, 'Chung', '{\"0\":\"con-1-phong-cho-nu-thue-uu-tien-sinh-vien-igutq.jpg\"}', '<div class=\"dis-content\">Còn 1 phòng cho nữ thuê ưu tiên sinh viên<br>- Phòng tầng 2, diện tích 20m2.<br>- Có giường,tủ, bàn học , bình nóng lạnh<br>- Có chỗ để xe tầng 1.<br>- Nấu ăn tầng 1, chỗ phơi tầng 4 thoáng, rộng.<br>- Nhà tắm, nhà bếp và phòng giặt riêng.<br>Khu vực an ninh tốt, văn minh, giao thông thuận tiện<br>Gần chợ Mai động, siêu thị (FIVIMART, T-Mart), Time City, gần ĐH Kinh doanh công nghệ, KTKTCN, BKHN, Xây dựng, Kinh Tế.<br>Liên hệ : bà Liên , số 8 ngõ 50 đường Lĩnh Nam, Hoàng Mai , Hà Nội</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCIsIjMiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCIsIjQiOiJNXHUwMGUxeSBnaVx1MWViN3QifQ==', 1, 0, '{\"0\":\"20.9770005\",\"1\":\"105.89655900000002\"}', 1, 0, '2019-05-14 20:44:34', '2019-05-14 20:44:34');
INSERT INTO `motelrooms` VALUES (433, 'Cho thuê phòng trọ số 35, Ngõ 203 Phố Kim Ngưu,', 'cho-thue-phong-tro-so-35-ngo-203-pho-kim-nguu', 1500000, 15.0000, 1, 45, 136, 'Số 35, Ngõ 203, Kim Ngưu, Hai Bà Trưng, Hà Nội', '0903464227', 3, 'Chưa xác định', '{\"0\":\"cho-thue-phong-tro-so-35-ngo-203-pho-kim-nguu-tde5j.jpg\",\"1\":\"cho-thue-phong-tro-so-35-ngo-203-pho-kim-nguu-zbnwo.jpg\",\"2\":\"cho-thue-phong-tro-so-35-ngo-203-pho-kim-nguu-1nmzt.jpg\",\"3\":\"cho-thue-phong-tro-so-35-ngo-203-pho-kim-nguu-e8uvs.jpg\"}', '<div class=\"dis-content\">O THUÊ PHÒNG TRỌ TẠI PHỐ KIM NGƯU **<br>Phòng chính chủ tầng 4 diện tích 15m2 trong nhà 4 tầng ngõ 203 phố Kim Ngưu, gần ngã tư Trân Khát Trân - Lò Đúc, nhà mới sạch đẹp. Đầy đủ đồ đạc.<br>Mô tả:<br>- Mỗi tầng 2 phòng và 1 WC, nhà sạch sẽ, tiện nghi.<br>- An ninh vệ sinh đảm bảo, khu dân trí cao.<br>- Đường rộng rãi, thoáng ô tô vào nhà.<br>- Không ở chung với chủ, hoàn toàn riêng biệt, đi khóa về mở.<br>- Có chỗ nấu ăn, giặt giũ, phơi quần áo, rộng rãi, để tầng 1 xe miễn phí.<br>- Điện nước giá hộ gia đình, có sẵn mạng internet, truyền hình cab.<br>- Gần chợ (30m), cách mặt đường 50 m, cach trung tâm hoàn Kiếm 10 phút. Đi Lò Đúc - Trần Khát Trân, Cầu Mai Động + Thanh Nhàn rất gần.<br>Giá: 1.500.000đ/ tháng<br>Liên hệ : 0903464227</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCIsIjMiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCJ9', 1, 0, '{\"0\":\"21.004728\",\"1\":\"105.86243999999999\"}', 1, 0, '2019-05-14 20:44:59', '2019-05-14 20:44:59');
INSERT INTO `motelrooms` VALUES (434, 'Cho thuê phòng số 215, Ngõ 381 Nguyễn Khang ', 'cho-thue-phong-so-215-ngo-381-nguyen-khang', 2500000, 23.0000, 1, 16, 64, 'Số 215, Ngõ 381 , Nguyễn Khang, Cầu Giấy, Hà Nội', '0934656140', 3, 'Chưa xác định', '{\"0\":\"cho-thue-phong-so-215-ngo-381-nguyen-khang-2hd1o.jpg\"}', '<div class=\"dis-content\">à mình ở số ngõ 381 Nguyễn Khang vẫn dư 1 phòng từ 01/05/2017.<br>- Phòng tầng 2 trong nhà 3 tầng, tự quản, giờ giấc thoải mái, không chung chủ. 2 phòng chung 1 nhà vệ sinh, có chỗ nấu ăn riêng dưới tầng 1.<br>- Có điều hòa, bình nóng lạnh, máy giặt, tủ lạnh. <br>- Gần nhiều trường Đại Học: Luật, Lao động xã hội, HV Hành chính, Phương Đông, gần chợ...<br>- Khu dân cư văn minh, an ninh tốt.<br>- Điện nước mạng giá dân, chia theo hóa đơn.<br>- Đóng tiền 1 tháng 1, cọc 1 tháng, hợp đồng 6 tháng.<br>- Có thể ở 2 -3 người/phòng.<br>Giá cho thuê: 2.500.000/tháng. <br>Liên hệ 0934656140</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCIsIjMiOiJcdTAxMTBpXHUxZWMxdSBoXHUwMGYyYSIsIjQiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCIsIjUiOiJNXHUwMGUxeSBnaVx1MWViN3QifQ==', 1, 0, '{\"0\":\"21.0282852\",\"1\":\"105.79533459999993\"}', 1, 0, '2019-05-14 20:45:08', '2019-05-14 20:45:08');
INSERT INTO `motelrooms` VALUES (436, 'Cho thuê phòng trọ số 36,  Ngõ 44, đường Trần Thái Tông ', 'cho-thue-phong-tro-so-36-ngo-44-duong-tran-thai-tong', 2000000, 20.0000, 1, 16, 219, 'Số 36,  Ngõ 44,, Trần Thái Tông, Cầu Giấy, Hà Nội', '0946592236', 3, 'Chưa xác định', '{\"0\":\"cho-thue-phong-tro-so-36-ngo-44-duong-tran-thai-tong-1wrco.jpg\",\"1\":\"cho-thue-phong-tro-so-36-ngo-44-duong-tran-thai-tong-7qtfv.jpg\",\"2\":\"cho-thue-phong-tro-so-36-ngo-44-duong-tran-thai-tong-nfmeu.jpg\"}', '<div class=\"dis-content\">o không còn nhu cầu ở nên mình muốn nhượng lại phòng chung cư mini khép kín tại Ngõ 44, đường Trần Thái Tông (gần ngã tư giao với Xuân Thủy)<br>Diện tích phòng : ~20m2<br>Nội thất gồm : giường, nóng lạnh, quạt trần, kệ bếp nấu ăn, giá để bát đĩa. Ngoài ra bọn mình chuyển chắc sẽ để lại 2 tủ quần áo <br>Phòng có 2 cửa sổ và 1 cửa nhỏ ra ban công phơi đồ nên rất thoáng mát<br>Ở được tối đa 3 người<br>Giá thuê hàng tháng : 2 triệu/tháng<br>Trước đây thuê bọn mình đặt cọc 2tr nên giờ muốn nhượng lại 1,5 triệu. Bạn nào thuê thì trả bên mình 1,5tr là vào ở luôn k cần cọc nữa, hết hợp đồng (khoảng tháng 7) nếu k thuê nữa sẽ nhận lại 2tr tiền cọc từ chủ nhà.<br>Sđt mình : 0946 592 236 h</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCIsIjMiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCJ9', 1, 0, '{\"0\":\"21.0344758\",\"1\":\"105.78937389999999\"}', 1, 0, '2019-05-14 20:45:38', '2019-05-14 20:45:38');
INSERT INTO `motelrooms` VALUES (437, 'Cho thuê phòng trọ số 52, Ngõ Phan Phù Tiên, Cát Linh.', 'cho-thue-phong-tro-so-52-ngo-phan-phu-tien-cat-linh', 2000000, 23.0000, 1, 6, 299, 'Số 52, Ngõ Phan Phù Tiê, Cát Linh, Đống Đa, Hà Nội', '01656228678', 3, 'Chưa xác định', '{\"0\":\"cho-thue-phong-tro-so-52-ngo-phan-phu-tien-cat-linh-yh3ff.jpg\"}', '<div class=\"dis-content\">nh mới thuê nhà nguyên căn 3 tầng, còn trống tầng 2 và tầng 3 cần tìm người cho thuê.<br>Nhà có thể để được 4 xe<br>Địa chỉ: Ngõ Phan Phù Tiên, Cát Linh. Gần Văn Miếu, Lăng Bác, Hồ Tây, Hồ Gươm, Công viên Bách Thảo, trường đại học, bệnh viện,...<br>Mỗi tầng có 1 phòng, diện tích khoảng 23m2, vệ sinh khép kín, có chỗ nấu nướng.<br>Tầng 2: giá 2.500.000, có gác xép, ban công phơi đồ, nấu ăn<br>Tầng 3: giá 2200.000, không có gác xép, nhưng có ban công phơi đồ, thoáng mát.<br>Điện nước giá dân, chia theo đầu người.<br>Đóng tiền 3 tháng 1<br>Mỗi phòng có thể ở tối đa 3 người.<br>Có thể đến ở từ giữa tháng 5.<br>Chỉ cho nữ thuê, sinh viên hoặc người làm văn phòng.<br>Bạn nào có nhu cầu liên hệ mình để đến xem phòng, mình sẽ ưu tiên các bạn đến trước ạ.<br>Làn(sn1991): 01656228678</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCIsIjMiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCJ9', 1, 0, '{\"0\":\"21.0291098\",\"1\":\"105.83427979999999\"}', 1, 0, '2019-05-14 20:46:39', '2019-05-14 20:46:39');
INSERT INTO `motelrooms` VALUES (438, 'CHÍNH CHỦ CHO THUÊ CĂN HỘ ĐẦY ĐỦ TIỆN NGHI 2 NGỦ PHỐ CẦU GIẤY', 'chinh-chu-cho-thue-can-ho-day-du-tien-nghi-2-ngu-pho-cau-giay', 6500000, 45.0000, 1, 16, 16, 'SỐ NHÀ D2 NÕ 93 PHỐ CẦU GIẤY, Cầu Giấy, Cầu Giấy, Hà Nội', '0971504943', 4, 'Chung', '{\"0\":\"chinh-chu-cho-thue-can-ho-day-du-tien-nghi-2-ngu-pho-cau-giay-xklma.jpg\",\"1\":\"chinh-chu-cho-thue-can-ho-day-du-tien-nghi-2-ngu-pho-cau-giay-zyjur.jpg\",\"2\":\"chinh-chu-cho-thue-can-ho-day-du-tien-nghi-2-ngu-pho-cau-giay-e9tze.jpg\",\"3\":\"chinh-chu-cho-thue-can-ho-day-du-tien-nghi-2-ngu-pho-cau-giay-icvih.jpg\",\"4\":\"chinh-chu-cho-thue-can-ho-day-du-tien-nghi-2-ngu-pho-cau-giay-fdj6j.jpg\",\"5\":\"chinh-chu-cho-thue-can-ho-day-du-tien-nghi-2-ngu-pho-cau-giay-fxmym.jpg\",\"6\":\"chinh-chu-cho-thue-can-ho-day-du-tien-nghi-2-ngu-pho-cau-giay-ouqvx.jpg\"}', '<div class=\"dis-content\">1-Tòa nhà chung cư mini 7 tầng tại Cầu Giấy-<br>Nhà ngay phố Cầu Giấy, cách cầu giấy 150m,đường vào rộng, 2 ô tô con tránh nhau, rất thuận tiện cho việc đi lại, sinh hoạt, vui chơi, giải trí. Lên phố cổ cũng gần, trung tâm thương mại ngay sát, gần trường đại học sư phạm,Học Viện báo chí và tuyên truyền...<br>- Các căn hộ rộng được lát sàn gạch cao cấp, căn nào cũng có cửa sổ rộng, ban công phơi đồ riêng biệt.<br>+Loại1: Gồm 1 phòng ngủ +1 phòng khách, khu bếp có bàn bếp, tủ bếp, đầy đủ ánh sáng, gió và không khí vào phòng.DT45M2<br>+Loại2: Gồm 2 phòng ngủ +1 phòng khách và phòng bếp riêng biệt DT 50m2.<br>- Mỗi phòng được trang bị điều hòa 2 chiều, giường, tủ quần áo, cửa sổ có rèm cản nắng cực đẹp, trần thạch cao, đèn ngủ đủ cả, bàn bếp xịn, hút mùi, bồn rửa bát xịn.<br>- Nhà vệ sinh được lắp thiết bị vệ sinh Inax cao cấp, bình nóng lạnh Ariston, ốp lát gạch Prime sang trọng, có bồn tắm đứng hiện đại.<br>Giá cho thuê: 6.000.000đ -<br>6.500.000- 7.000.000đ/căn/tháng (thanh toán tối thiểu 03 tháng và đặt cọc 1 tháng)<br>. DT Các phòng từ 45-50m2. <br>- Tòa nhà trang bị thang máy cao cấp, máy giặt miễn phí, truyền hình cáp, internet tốc độ cao miễn phí, mỗi căn hộ được cấp thẻ từ thang máy riêng.<br>- Tòa nhà có 2 bảo vệ 24/24 nên an ninh cực ổn, ra vào thoải mái, để xe miễn phí, nhà để xe rộng rãi gần 200m2, có thể chứa được đến 80 chiếc xe máy.<br>+ Địa chỉ: Số nhà D2 Ngõ 93 Phố Cầu Giấy, P.Quan Hoa, Q.Cầu Giấy.( Cách Cầu Giay 150m)<br>Liên hệ chủ nhà Chị Hương 0978 335 871. A Lượng 0982 9696 69<br>2-Tòa nhà 8 tầng tại phố Doãn Kế Thiện mới hoàn thiện vào ở luôn.<br>- Diện tích các phòng từ 35m2 - 40m2.<br>Giá cho thuê 4.500.000đ - 5.000.000đ/tháng, các phòng bao gồm:<br>Phòng ngủ + phòng khách và khu bếp riêng biệt.<br>- Phòng ngủ được trang bị điều hòa 2 chiều, giường, tủ quần áo...<br>- Phòng khách cũng có thể làm phòng ngủ nếu nhà Đông người.<br>- Phòng bếp được trang bị bàn ăn, bàn bếp, tủ bếp, chậu rửa bát, hút mùi,...<br>- Khu vực nhà vệ sinh được lắp đầy đủ thiết bị hiện đại như chậu rửa mặt, bệt Inax, vòi sen, bình nóng lạnh,...<br>- Tòa nhà có bảo vệ 24/24, đảm bảo an ninh tuyệt đối, giờ giấc ra vào thoải mái.<br>- Khu vực ban công phơi đồ riêng biệt của từng phòng.<br>* Tòa nhà nằm ở vị trí trung tâm, giao thông thuận tiện, cách mặt đường Doãn Kế Thiện 20m, đối diện chợ Đồng Xa nên rất thuận tiện cho việc mua sắm, đi chợ, nằm trong khuôn viên tập quân đội nên an ninh rất tốt, gần các trung tâm thương mại, gần các trường ĐH như quốc gia, ngoại ngữ, gần bến xe Mỹ Đình,...<br>Địa chỉ: Số 32/C1 – Đường Doãn Kế Thiện - P.Mai Dịch - Cầu Giấy.<br>LIÊN HỆ 0971 504 943</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJUaGFuZyBtXHUwMGUxeSIsIjMiOiJJbnRlcm5ldCIsIjQiOiJcdTAxMTBpXHUxZWMxdSBoXHUwMGYyYSIsIjUiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCIsIjYiOiJNXHUwMGUxeSBnaVx1MWViN3QifQ==', 1, 0, '{\"0\":\"21.0362368\",\"1\":\"105.79058250000003\"}', 1, 0, '2019-05-14 20:46:46', '2019-05-14 20:46:46');
INSERT INTO `motelrooms` VALUES (440, 'CHO THUÊ CĂN HỘ ĐỦ ĐỒ 35 M2 DOÃN KẾ THIỆN GIÁ RẺ4,5 TRIỆU', 'cho-thue-can-ho-du-do-35-m2-doan-ke-thien-gia-re45-trieu', 4500000, 35.0000, 1, 16, 100, '32/c1 doãn kế thiện, mai dịch, cầu giấy, hà nội, Doãn Kế Thiện, Cầu Giấy, Hà Nội', '0978335871', 4, 'Khép kín', '{\"0\":\"cho-thue-can-ho-du-do-35-m2-doan-ke-thien-gia-re45-trieu-fzjqp.jpg\",\"1\":\"cho-thue-can-ho-du-do-35-m2-doan-ke-thien-gia-re45-trieu-4kbir.jpg\"}', '<div class=\"dis-content\">Tòa chung cư mini 8 tầng tại số 32/C1 Phố Doãn Kế Thiện mới hoàn thiện vào ở được luôn.<br>– Diện tích các phòng từ 35m2 – 40m2.<br>Giá cho thuê 4.500.000 đ – 5.000.000đ/tháng, các căn hộ bao gồm:<br>1 phòng ngủ + phòng khách và khu bếp riêng biệt.<br>– Phòng ngủ được trang bị điều hòa 2 chiều, giường, tủ quần áo…<br>– Phòng khách cũng có thể làm phòng ngủ nếu nhà Đông người.<br>– Phòng bếp được trang bị bộ bàn ăn, bàn bếp, tủ bếp, chậu rửa bát, hút mùi…<br>– Khu vực nhà vệ sinh được lắp đầy đủ thiết bị hiện đại như chậu rửa mặt, bệt Inax, vòi sen, bình nóng lạnh…<br>-*Tiện ích:-Tòa nhà có bảo vệ 24/24, đảm bảo an ninh tuyệt đối, giờ giấc ra vào thoải mái.<br>-Thang máy cao cấp, mỗi hộ gia đình có thẻ từ sử dụng riêng, internet cáp quang, miễn phí tuyền hình cáp, miễn phí máy giặt.<br>– Khu vực ban công phơi đồ riêng biệt của từng phòng.<br>* nằm trong khuôn viên tập quân đội nên an ninh rất tốt, gần các trung tâm thương mại, gần các trường ĐH như quốc gia, sân khấu điện ảnh,ngoại ngữ, gần bến xe Mỹ Đình…Địa chỉ: Số 32/C1 – Đường Doãn Kế Thiện – P Mai Dịch – Cầu Giấy.<br>LH C Hương 0978 335 871. / A Lương 0982 96 96 69.</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJUaGFuZyBtXHUwMGUxeSIsIjMiOiJJbnRlcm5ldCIsIjQiOiJcdTAxMTBpXHUxZWMxdSBoXHUwMGYyYSIsIjUiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCJ9', 1, 0, '{\"0\":\"21.0421444\",\"1\":\"105.77492410000002\"}', 1, 0, '2019-05-14 20:47:42', '2019-05-14 20:47:42');
