INSERT INTO `motelrooms` VALUES (442, 'PHÒNG TRỌ CHO THUÊ PHỐ HOÀNG MAI - TRƯƠNG ĐỊNH ', 'phong-tro-cho-thue-pho-hoang-mai-truong-dinh', 1900000, 20.0000, 1, 57, 57, 'Số 5 ngách 40 ngõ 288 Hoàng Mai, Hoàng Mai, Hoàng Mai, Hà Nội', '01636677789', 4, 'Chung', '{\"0\":\"phong-tro-cho-thue-pho-hoang-mai-truong-dinh-wurq1.jpg\",\"1\":\"phong-tro-cho-thue-pho-hoang-mai-truong-dinh-r6vdd.jpg\",\"2\":\"phong-tro-cho-thue-pho-hoang-mai-truong-dinh-dxhom.jpg\"}', '<div class=\"dis-content\">PHÒNG TRỌ CHO THUÊ PHỐ HOÀNG MAI - TRƯƠNG ĐỊNH <br>Hiện tại mình còn 1 phòng tầng 3 trong nhà 4 tầng cho thuê.<br>➡️ S=18m2, <br>GIÁ #1TR9<br>- Phòng có nóng lạnh, hai cửa sổ thoáng mát. Xung quanh toàn nhà cao tầng nên thoáng mát vào mùa hè , để xe FREE tầng 1.<br>- KHÔNG chung chủ, Giờ giấc thoải mái.<br>- Điện tính theo số nhà dân 1.5k/ 1 số, Nước 60k/ng, Mạng Cáp quang tốc độ cao 100k/p.<br>- Nấu ăn tại phòng (hoặc tầng 1), phơi đồ tầng 4.<br>Lưu ý: 2P Chung 1 nhà vệ sinh, phòng đối diện là nữ.<br>Đóng tiền 1 tháng 1 đặt cọc 1 tháng<br>☎ Liên hệ SĐT: 0163 6677789<br>➡ Địa Chỉ : Nhà 5 Ngách 288/40 Hoàng Mai. Có thể đi vào từ ngõ 106 Hồ Đền Lừ hoặc ngõ 224 Hoàng Mai</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCIsIjMiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCJ9', 1, 0, '{\"0\":\"20.98717\",\"1\":\"105.86069199999997\"}', 1, 0, '2019-05-14 20:48:22', '2019-05-14 20:48:22');
INSERT INTO `motelrooms` VALUES (443, 'Cho thuê phòng trọ  khu B4 Nguyễn Quý Đức ', 'cho-thue-phong-tro-khu-b4-nguyen-quy-duc', 2000000, 22.0000, 1, 2, 353, 'Khu B4 , Nguyễn Quý Đức, Thanh Xuân, Hà Nội', '01668548593', 2, 'Chưa xác định', '{\"0\":\"cho-thue-phong-tro-khu-b4-nguyen-quy-duc-doyvv.jpg\"}', '<div class=\"dis-content\">ho thuê phòng ở khu B4 Nguyễn Quý Đức <br>Mình còn thừa một phòng trong nhà riêng muốn cho 2 bạn nữa thuê<br>Diện tích khoảng 22m2<br>Điện nước nhà dân không chung chủ<br>Số tiền là 2 triệu. Nhà thoáng mát, có khoảng sân to đằng trước thuận lợi cho việc tập thể dục. <br>Liên hệ sdt : 01668548593<br>Có thể đến xem nhà và nc sau 7h30<br>Xe để trong nhà rất thuận tiện. Là nơi dạy tiếng anh nên có thể thuận tiện cho bạn nào cần học tiếng anh muốn giao tiếp với người nước ngoài. Nếu tốt tiếng anh có thể được mời dạy.</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCIsIjMiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCJ9', 1, 0, '{\"0\":\"20.992399\",\"1\":\"105.79934500000002\"}', 1, 0, '2019-05-14 20:48:48', '2019-05-14 20:48:48');
INSERT INTO `motelrooms` VALUES (444, 'Cho thuê phòng trọ gần cầu Định Công', 'cho-thue-phong-tro-gan-cau-dinh-cong', 1200000, 12.0000, 1, 57, 148, 'số 33 ngõ 209 Định Công (gần cầu Định Công), Hoàng Mai, Hà Nội, Định Công, Hoàng Mai, Hà Nội', '0917313526', 2, 'Chưa xác định', '{\"0\":\"cho-thue-phong-tro-gan-cau-dinh-cong-xnosl.jpg\"}', '<div class=\"dis-content\">Do thay đổi công việc, nhà trọ ở quá xa nên mình cần nhượng lại phòng trọ ở tầng 3 trong nhà 5 tầng, 2 phòng chung 1 nhà vệ sinh, điện nước giá nhà nước, chia đầu người, tiền điện + nước chỉ khoảng 150k/ tháng, net 50k (không dùng thì không phải đóng), có sân phơi riêng trên tầng 5, có chỗ để xe ở tầng 1, giờ giấc đi lại thoải mái, có chìa khóa nhà riêng, an ninh tốt, không sợ trộm cắp, yên tĩnh, rất tiện cho đi học, đi làm.<br><strong>Địa chỉ:</strong> số nhà 33 ngõ 209 Định Công (ngay cầu Định Công), Hoàng Mai, Hà Nội.<br><strong>Diện tích:</strong> 12m2<br><strong>Giá phòng:</strong> 1,2triệu/ tháng, thanh toán 3 tháng/ lần. Nói thật là mình thấy giá này rất rẻ với một phòng sạch sẽ, thoáng như này.<br><strong>Yêu cầu:</strong> thật thà, hiền lành, ưu tiên nữ vì phòng bên cạnh là 1 bạn nữ sn 88, đang đi làm.<br><strong>Lưu ý: </strong>Phòng chỉ cho 1 người thuê, nếu bạn muốn hơn thì thỏa thuận với chủ nhà (chủ nhà sn 88, khá dễ tính)<br><strong>SDT mình:</strong> 0917313526</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCJ9', 1, 0, '{\"0\":\"20.982653761477245\",\"1\":\"105.83446511880175\"}', 1, 0, '2019-05-14 20:48:49', '2019-05-14 20:48:49');
