INSERT INTO `motelrooms` VALUES (446, 'Nhượng lại phòng trọ Số 108 Pháo đài Láng', 'nhuong-lai-phong-tro-so-108-phao-dai-lang', 2600000, 25.0000, 1, 6, 123, 'số 108 Pháo Đài Láng, Pháo Đài Láng, Đống Đa, Hà Nội', '01676344268', 5, 'Khép kín', '{\"0\":\"nhuong-lai-phong-tro-so-108-phao-dai-lang-ucpmz.jpg\"}', '<div class=\"dis-content\">Nhượng phòng trọ tầng 3 diên tích 25m2 thoáng mát có ban công ngắm được hồ cá vàng. Nhà 4 tầng 1 tum che, Giờ giấc thoải mái tự quản, có<br>nóng lạnh, có máy giặt dùng chung cả nhà, sạch sẽ, an ninh đảm bảo, điện nước<br>giá gia đình, có chỗ để xe máy tầng 1 miễn phí. Mình có việc phải chuyển đi nên<br>nhượng lại.<br>Địa chỉ: Số 108 Pháo đài Láng<br>Giá 2tr600k<br>Liên hệ xem phòng: 01676344268 or 0978278452 ( Khánh )</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCIsIjMiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCIsIjQiOiJNXHUwMGUxeSBnaVx1MWViN3QiLCI1IjoiVHJ1eVx1MWVjMW4gaFx1MDBlY25oIGNcdTAwZTFwIn0=', 1, 0, '{\"0\":\"21.0194123\",\"1\":\"105.80549599999995\"}', 1, 0, '2019-05-14 20:48:54', '2019-05-14 20:48:54');
