Tư Sở 3 phút đi xe máy, đường vào rộng, 2 tô con tránh nhau, rất thuận tiện cho việc đi lại, sinh hoạt, vui chơi, giải trí. Lên phố cổ cũng gần, trung tâm thương mại ngay sát, gần Trường Đại Học Y, trường ĐH Kinh Tế Quốc Dân….<br><br>- <strong>Căn hộ rộng 45m2 - 50m2</strong> được lát sàn gỗ, căn nào cũng cửa sổ rộng, ban công phơi đồ riêng biệt nhìn sang hồ điều hòa, hít khí trời trong lành nên không độc hại. Căn hộ được thiết kế hết sức hợp lý, 1 phòng ngủ, 1 phòng khách, khu bếp có đầy đủ ánh sáng, gió và không khí vào phòng.<br><br>- Mỗi căn hộ được trang bị giường, cửa sổ có rèm Thái Tuấn cực đẹp, trần thạch cao, đèn ngủ đủ cả, bàn bếp xịn, hút mùi, bồn rửa bát xịn.<br>- Nhà vệ sinh có thiết bị vệ sinh Inax cao cấp, ốp lát gạch Prime sang trọng.<br>Giá cho thuê: <br><strong>4.500.000 - 5.000.000-5.500.000đ/căn/tháng</strong><br> (thanh toán tối thiểu 03 tháng và đặt cọc 01 tháng).<br>- Bảo vệ 24/24, gửi xe miễn phí.<br>- Tòa nhà trang bị thang máy cao cấp, máy giặt, truyền hình cáp miễn phí, mỗi căn hộ được cấp thẻ từ thang máy riêng.<br>- Tòa nhà có bảo vệ 24/24 nên an ninh cực ổn, ra vào thoải mái, nhà để xe rộng rãi gần 200m2, có thể chứa được đến 50 chiếc xe máy.<br><strong>+ Địa chỉ: Số nhà 78 mặt đường Hồ Rùa, ngõ 155 Trường Chinh (Phố Nguyễn Lân) – Đống Đa - HN.<br>Liên hệ chủ nhà A Lượng 0982 9696 69 / Chị Hương 0978 335 871.</strong><br><br><strong>2/ Tòa chung cư mini tại số 213 Phố Xã Đàn.</strong><br>- <strong>Diện tích các căn hộ từ 35m2 - 45m2  Giá cho thuê từ 5.500.000đ -6.000.000 đ- 7.000.000 đ/căn.</strong><br>- Thanh toán tối thiểu 3 tháng + đặt cọc 1 tháng.<br>Các căn hộ bao gồm:<br>+ 1 phòng ngủ riêng biệt có cửa sổ thông thoáng được trang bị điều hòa 2 chiều, giường, tủ quần áo.<br>+ Khu bếp được trang bị bàn ăn, bàn bếp, tủ bếp, chậu rửa bát….<br>+ Khu vực nhà vệ sinh được lắp đầy đủ thiết bị hiện đại như chậu rửa mặt, bệt Inax, vòi sen, bình nóng lạnh...<br>+ Có ban công riêng biệt từng căn hộ và khu vực phơi đồ và để máy giặt.<br>- Tiện ích: Tòa nhà có bảo vệ 24/24, đảm bảo an ninh tuyệt đối, giờ giấc ra vào thoải mái.<br>Thang máy cao cấp, mỗi hộ gia đình có thẻ từ sử dụng riêng, internet cáp quang, miễn phí tuyền hình cáp, miễn phí máy giặt.<br>- Tòa nhà nằm ở vị trí trung tâm, giao thông thuận tiện, cách mặt đường Xã Đàn  30m, gần ngã tư Ô chợ Dừa, gần các trung tâm thương mại, đi lại vào phố cổ rất thuận tiện...<br>- Ưu tiên cho hộ gia đình, người đi làm thuê ở<br><strong>Địa chỉ: Số 213 Xã Đàn- p.Phương Liên- Đống Đa - HN.<br>Liên hệ:- chị Hương 0978 335 871.- Anh Lượng 0982 9696 69 <br></strong><br>(Tất cả các tòa nhà trên đều là chính chủ cho thuê không qua môi).</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJUaGFuZyBtXHUwMGUxeSIsIjMiOiJJbnRlcm5ldCIsIjQiOiJcdTAxMTBpXHUxZWMxdSBoXHUwMGYyYSIsIjUiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCIsIjYiOiJNXHUwMGUxeSBnaVx1MWViN3QiLCI3IjoiVHJ1eVx1MWVjMW4gaFx1MDBlY25oIGNcdTAwZTFwIn0=', 1, 0, '{\"0\":\"21.000111\",\"1\":\"105.83126130000005\"}', 1, 0, '2019-05-14 20:50:20', '2019-05-14 20:50:20');
