cấp tọa lạc trong tòa nhà 09 tầng, nằm ven hồ Rùa cách đường Trường Chinh 300m, đường vào 2 tô con tránh nhau, rất thuận tiện cho việc đi lại, sinh hoạt, vui chơi, giải trí. </strong><br><strong>- Lên phố cổ cũng gần, trung tâm thương mại ngay sát, gần bệnh viện Đại Học y, trường học, như trường ĐH như Kinh Tế Quốc Dân, ĐH Thủy Lợi, Nhân Văn, Ngoại Ngữ…. </strong><br><strong>- Căn hộ rộng 45- 50m2 được lát sàn gỗ, căn nào cũng cửa sổ rộng, ban công phơi đồ riêng biệt nhìn sang hồ điều hòa. Căn hộ được thiết kế hết sức hợp lý, 1 phòng ngủ, 1 phòng khách, khu bếp có đầy đủ ánh sáng, gió và không khí vào phòng. </strong><br><br><strong>- Mỗi căn hộ được trang bị giường, cửa sổ có rèm Thái Tuấn cực đẹp, trần thạch cao, đèn ngủ đủ cả, bàn bếp xịn, hút mùi, bồn rửa bát xịn. </strong><br><strong>- Nhà vệ sinh có thiết bị vệ sinh inax cao cấp, ốp lát gạch Prime sang trọng, mỗi nhà vệ sinh đều được trang bị bình Nóng Lạnh Ariston loại xin mới tinh.. </strong><br><br><strong>Giá cho thuê: 5.000.000-  5.500.000đ/căn/tháng </strong><br><strong>- Bảo vệ 24/7 Gửi xe miễn phí. </strong><br><strong>- Tòa nhà trang bị thang máy cao cấp, máy giặt, truyền hình cáp miễn phí, mỗi căn hộ được cấp thẻ từ thang máy riêng. </strong><br><strong>- Tòa nhà có bảo vệ 24/24 nên an ninh cực ổn, ra vào thoải mái, nhà để xe rộng rãi gần 200m2, có thể chứa được đến 80 chiếc xe máy. </strong><br><strong>- Thích hợp hộ gia đình kèm theo người giúp việc hoặc ông bà ở cùng, người đi làm, sinh viên ngoan... </strong><br><strong>+ Địa chỉ: Số nhà 78 mặt đường Hồ Rùa-Ngõ 155(đường Nguyễn Lân) - Phố Trường Chinh– Đống Đa- HN. </strong><br><strong>Liên hệ chủ nhà A Lượng 0982 9696 69/ Chị Hương 0978 335 871.<br> </strong><br>2- <strong>Tòa chung cư mini 8 tầng tại số 213 phố Xã Đàn mới hoàn thiện vào ở luôn.</strong><br><strong>- Diện tích các phòng từ 35m2 - 40m2. </strong><br><strong>          Giá cho thuê 6.000.000đ - 7.000.000đ /tháng, các căn hộ bao gồm: </strong><br><strong>       1 phòng ngủ + phòng khách và khu bếp riêng biệt. </strong><br><strong>- Phòng ngủ được trang bị điều hòa 2 chiều, giường, tủ quần áo... </strong><br><strong>- Phòng bếp được trang bị bàn ăn, bàn bếp, tủ bếp, chậu rửa bát... </strong><br><strong>- Khu vực nhà vệ sinh được lắp đầy đủ thiết bị hiện đại như chậu rửa mặt, bệt Inax, vòi sen, bình nóng lạnh... </strong><br><strong>- Tòa nhà có bảo vệ 24/24, đảm bảo an ninh tuyệt đối, giờ giấc ra vào thoải mái. </strong><br><strong>- Khu vực ban công phơi đồ riêng biệt của từng phòng. </strong><br><br><strong>* Tòa nhà nằm ở vị trí trung tâm, giao thông thuận tiện, cách mặt đường Xã Đàn 20m, nằm trong khuôn viên Tập Thể Học Viện Kỹ Thuật Quân Sự nên an ninh rất tốt, gần các trung tâm thương mại, lên phố cổ cũng gần, cách ngã tư Xã Đàn 300m... </strong><br><br><strong>Địa chỉ: Số 213 Xã Đàn- P. Kim Liên- Q. Đống Đa. </strong><br><strong>           LH C Hương 0978 335 871 - A Lượng 0982 9696 69. </strong><br><br><strong>( TẤT CẢ CÁC TÒA NHÀ TRÊN ĐỀU LÀ CHÍNH CHỦ CHO THUÊ)</strong></div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJUaGFuZyBtXHUwMGUxeSIsIjMiOiJJbnRlcm5ldCIsIjQiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCIsIjUiOiJNXHUwMGUxeSBnaVx1MWViN3QiLCI2IjoiVHJ1eVx1MWVjMW4gaFx1MDBlY25oIGNcdTAwZTFwIn0=', 1, 0, '{\"0\":\"21.000111\",\"1\":\"105.83126130000005\"}', 1, 0, '2019-05-14 20:53:22', '2019-05-14 20:53:22');
