INSERT INTO `motelrooms` VALUES (458, 'CHO THUÊ CĂN HỘ 35M2 1 NGỦ, 1 KHÁCH, 1 BẾP TIỆN NGHI PHỐ DOÃN KẾ THIỆN', 'cho-thue-can-ho-35m2-1-ngu-1-khach-1-bep-tien-nghi-pho-doan-ke-thien', 5000000, 35.0000, 1, 16, 100, '32/c1 doãn kế thiện, mai dịch, cầu giấy, hà nội, Doãn Kế Thiện, Cầu Giấy, Hà Nội', '0978335871', 4, 'Khép kín', '{\"0\":\"cho-thue-can-ho-35m2-1-ngu-1-khach-1-bep-tien-nghi-pho-doan-ke-thien-f4ity.jpg\",\"1\":\"cho-thue-can-ho-35m2-1-ngu-1-khach-1-bep-tien-nghi-pho-doan-ke-thien-6oely.jpg\",\"2\":\"cho-thue-can-ho-35m2-1-ngu-1-khach-1-bep-tien-nghi-pho-doan-ke-thien-zpxho.jpg\"}', '<div class=\"dis-content\">Tòa chung cư mini 8 tầng tại số 34/C1 Phố Doãn Kế Thiện mới hoàn thiện cuối tháng 2 vào ở được.<br>- Diện tích các phòng từ 35m2 - 40m2.<br>Giá cho thuê 4.500.000đ - 5.000.000đ/tháng, các căn hộ bao gồm:<br>1 phòng ngủ + phòng khách và khu bếp riêng biệt.<br>- Phòng ngủ được trang bị điều hòa 2 chiều, giường, tủ quần áo...<br>- Phòng khách cũng có thể làm phòng ngủ nếu nHà Đông người.<br>- Phòng bếp được trang bị bàn ăn, bàn bếp, tủ bếp, chậu rửa bát, hút mùi...<br>- Khu vực nhà vệ sinh được lắp đầy đủ thiết bị hiện đại như chậu rửa mặt, bệt Inax, vòi sen, bình nóng lạnh...<br>- Tòa nhà có bảo vệ 24/24, đảm bảo an ninh tuyệt đối, giờ giấc ra vào thoải mái.<br>- Khu vực ban công phơi đồ riêng biệt của từng phòng.<br><br>* Tòa nhà nằm ở vị trí trung tâm, giao thông thuận tiện, cách mặt đường Doãn Kế Thiện 20m, đối diện chợ Đồng Xa nên rất thuận tiện cho việc mua sắm, đi chợ, nằm trong khuôn viên tập quân đội nên an ninh rất tốt, gần các trung tâm thương mại, gần các trường ĐH như quốc gia, ngoại ngữ, gần bến xe Mỹ Đình...<br>Địa chỉ: Số 34/C1 – Đường Doãn Kế Thiện - P Mai Dịch - Cầu Giấy.<br>LH C Hương 0978 335 871. - A Lượng 0982 9696 69.</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJUaGFuZyBtXHUwMGUxeSIsIjMiOiJJbnRlcm5ldCIsIjQiOiJcdTAxMTBpXHUxZWMxdSBoXHUwMGYyYSIsIjUiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFu