INSERT INTO `motelrooms` VALUES (467, 'Cho thuê phòng trọ sinh viên ', 'cho-thue-phong-tro-sinh-vien', 1000000, 16.0000, 1, 45, 235, 'số 6, ngách 164/9 Hồng Mai, Hai Bà Trưng, Hà Nội, Hồng Mai, Hai Bà Trưng, Hà Nội', '0436275896', 1, 'Chung', '{\"0\":\"cho-thue-phong-tro-sinh-vien-1490562733eemvv-7zt1r.jpg\"}', '<div class=\"dis-content\">Cho sinh viên nam, nữ thuê phòng.<br>Địa điểm gần các trường Đại học như Bách Khoa, Xây Dựng, Kinh tế quốc dân, Mở, ,...<br>Giao thông tiện lợi, gần đường lớn, gần trung tâm thành phố.<br>Gần chợ.<br>Hình ảnh không liên quan, đến nơi để xem phòng.</div>', 'eyIwIjoiU1x1MDBlMm4gcGhcdTAxYTFpIiwiMSI6IkludGVybmV0IiwiMiI6IkJcdTAwZWNuaCBuXHUwMGYzbmcgbFx1MWVhMW5oIiwiMyI6IlRydXlcdTFlYzFuIGhcdTAwZWNuaCBjXHUwMGUxcCIsIjQiOiJUaXZpIn0=', 1, 0, '{\"0\":\"20.999129\",\"1\":\"105.85498200000006\"}', 1, 0, '2019-05-14 21:03:00', '2019-05-14 21:03:00');
INSERT INTO `motelrooms` VALUES (469, 'Cho thuê phòng trọ số 46, Ngõ 196 Cầu Giấy.', 'cho-thue-phong-tro-so-46-ngo-196-cau-giay', 1700000, 14.0000, 1, 16, 16, 'Số 46, Ngõ 196, Cầu Giấy, Cầu Giấy, Hà Nội', '0913096282', 2, 'Chưa xác định', '{\"0\":\"cho-thue-phong-tro-so-46-ngo-196-cau-giay-pytrk.jpg\",\"1\":\"cho-thue-phong-tro-so-46-ngo-196-cau-giay-enajy.jpg\"}', '<div class=\"dis-content\">ỉ: ngõ 196 Cầu giấy.<br>- Đặc điểm: phòng DT 14 m2, nhà tầng, 2 giường riêng biệt, sạch sẽ, thoáng mát.<br>- Đánh giá mặt bằng: Nhà nằm gần trường ĐH Giao thông, ĐH Sư Phạm... Nhà nằm ở vị trí thoáng, có nơi để xe riêng, nhà ở rất yên tĩnh,<br>phù hợp cho học tập nghiên cứu, sinh hoạt biệt lập không liên quan đến chủ nhà (nhà có ít người)<br>, nơi ở rất an toàn, phòng cho ở tối đa 2 người, ưu tiên ở lâu năm,<br>an ninh điện nước tốt.<br>- Giá: 2 người 1.7 triệu/ tháng, thu tiền hàng tháng.(có phòng nhỏ hơn 1.6 triệu/tháng)<br>- Liên hệ; Chủ nhà - ĐT 0913096282.</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCIsIjMiOiJcdTAxMTBpXHUxZWMxdSBoXHUwMGYyYSIsIjQiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCJ9', 1, 0, '{\"0\":\"21.03501\",\"1\":\"105.79879729999993\"}', 1, 0, '2019-05-14 21:03:05', '2019-05-14 21:03:05');
INSERT INTO `motelrooms` VALUES (470, 'cho thuê căn hộ chung cư 40m2, 1 ngủ,1 khách, 1 bếp đủ đồ doãn kế thiện', 'cho-thue-can-ho-chung-cu-40m2-1-ngu1-khach-1-bep-du-do-doan-ke-thien', 5000000, 40.0000, 1, 16, 100, '32/c1 doãn kế thiện, mai dịch, cầu giấy, hà nội, Doãn Kế Thiện, Cầu Giấy, Hà Nội', '0978335871', 4, 'Khép kín', '{\"0\":\"cho-thue-can-ho-chung-cu-40m2-1-ngu1-khach-1-bep-du-do-doan-ke-thien-amtcd.jpg\",\"1\":\"cho-thue-can-ho-chung-cu-40m2-1-ngu1-khach-1-bep-du-do-doan-ke-thien-xlfpq.jpg\",\"2\":\"cho-thue-can-ho-chung-cu-40m2-1-ngu1-khach-1-bep-du-do-doan-ke-thien-nzqg4.jpg\",\"3\":\"cho-thue-can-ho-chung-cu-40m2-1-ngu1-khach-1-bep-du-do-doan-ke-thien-nvpgw.jpg\",\"4\":\"cho-thue-can-ho-chung-cu-40m2-1-ngu1-khach-1-bep-du-do-doan-ke-thien-xiiiq.jpg\"}', '<div class=\"dis-content\">Tòa chung cư mini 8 tầng tại số 34/C1 Phố Doãn Kế Thiện mới hoàn thiện cuối tháng 2 vào ở được.<br>- Diện tích các phòng từ 35m2 - 40m2.<br>Giá cho thuê 4.500.000đ - 5.000.000đ/tháng, các căn hộ bao gồm:<br>1 phòng ngủ + phòng khách và khu bếp riêng biệt.<br>- Phòng ngủ được trang bị điều hòa 2 chiều, giường, tủ quần áo...<br>- Phòng khách cũng có thể làm phòng ngủ nếu nHà Đông người.<br>- Phòng bếp được trang bị bàn ăn, bàn bếp, tủ bếp, chậu rửa bát, hút mùi...<br>- Khu vực nhà vệ sinh được lắp đầy đủ thiết bị hiện đại như chậu rửa mặt, bệt Inax, vòi sen, bình nóng lạnh...<br>- Tòa nhà có bảo vệ 24/24, đảm bảo an ninh tuyệt đối, giờ giấc ra vào thoải mái.<br>- Khu vực ban công phơi đồ riêng biệt của từng phòng.<br><br>* Tòa nhà nằm ở vị trí trung tâm, giao thông thuận tiện, cách mặt đường Doãn Kế Thiện 20m, đối diện chợ Đồng Xa nên rất thuận tiện cho việc mua sắm, đi chợ, nằm trong khuôn viên tập quân đội nên an ninh rất tốt, gần các trung tâm thương mại, gần các trường ĐH như quốc gia, ngoại ngữ, gần bến xe Mỹ Đình...<br>Địa chỉ: Số 34/C1 – Đường Doãn Kế Thiện - P Mai Dịch - Cầu Giấy.<br>LH C Hương 0978 335 871. - A Lượng 0982 9696 69.</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExX