INSERT INTO `motelrooms` VALUES (480, 'cho thuê căn hộ chung cư 40 m2 1ngủ, 1 khách, 1 bếp La Thành', 'cho-thue-can-ho-chung-cu-40-m2-1ngu-1-khach-1-bep-la-thanh', 5000000, 40.0000, 1, 6, 115, ' 96 Đê La Thành, La Thành, Đống Đa, Hà Nội', '0978335871', 4, 'Khép kín', '{\"0\":\"cho-thue-can-ho-chung-cu-40-m2-1ngu-1-khach-1-bep-la-thanh-76bap.jpg\",\"1\":\"cho-thue-can-ho-chung-cu-40-m2-1ngu-1-khach-1-bep-la-thanh-sdexm.jpg\",\"2\":\"cho-thue-can-ho-chung-cu-40-m2-1ngu-1-khach-1-bep-la-thanh-hozfw.jpg\",\"3\":\"cho-thue-can-ho-chung-cu-40-m2-1ngu-1-khach-1-bep-la-thanh-6wcyw.jpg\",\"4\":\"cho-thue-can-ho-chung-cu-40-m2-1ngu-1-khach-1-bep-la-thanh-fsxaq.jpg\",\"5\":\"cho-thue-can-ho-chung-cu-40-m2-1ngu-1-khach-1-bep-la-thanh-rn7of.jpg\",\"6\":\"cho-thue-can-ho-chung-cu-40-m2-1ngu-1-khach-1-bep-la-thanh-xtik7.jpg\"}', '<div class=\"dis-content\">Tòa chung cư mini tại số 96 Đê La Thành.<br>- Diện tích các căn hộ từ 35m2 - 45m2 - 50m2. Giá cho thuê từ 5.000.000đ - 5.000.000đ - 6.500.000đ - 7.500.000 đ/căn.<br>- Thanh toán tối thiểu 3 tháng + đặt cọc 2 tháng.<br>Các căn hộ bao gồm:<br>+ 2 phòng ngủ riêng biệt có cửa sổ thông thoáng được trang bị điều hòa 2 chiều, giường, tủ quần áo.<br>+ 1 phòng khách cũng có thể bố trí làm phòng ngủ nếu nhà có đông người.<br>+ Phòng bếp được trang bị bàn ăn, bàn bếp, tủ bếp, chậu rửa bát, hút mùi….<br>+ Khu vực nhà vệ sinh được lắp đầy đủ thiết bị hiện đại như chậu rửa mặt, bệt Inax, vòi sen, bình nóng lạnh...<br>+ Có ban công riêng biệt từng căn hộ và khu vực phơi đồ và để máy giặt.<br>- Tiện ích: Tòa nhà có bảo vệ 24/24, đảm bảo an ninh tuyệt đối, giờ giấc ra vào thoải mái.<br>Thang máy cao cấp, mỗi hộ gia đình có thẻ từ sử dụng riêng, internet cáp quang, miễn phí tuyền hình cáp, miễn phí máy giặt.<br>- Tòa nhà nằm ở vị trí trung tâm, giao thông thuận tiện, cách mặt đường La Thành 10m, gần hồ Hoàng Cầu, không khí thoáng mát trong lành, gần các trung tâm thương mại, đi lại vào phố cổ rất thuận tiện...<br>- Ưu tiên cho hộ gia đình, người đi làm thuê ở.<br>- Chú ý: Hiện nay tòa nhà còn 1 căn hộ 2 phòng ngủ DT 50m2 giá 7,5tr/th.<br><br>Địa chỉ: Số 96 Đê La Thành - Ô Chợ Dừa - Đống Đa - HN.<br>Liên hệ: Anh Lượng 0982 9696 69 - chị Hương 0978 335 871</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJUaGFuZyBtXHUwMGUxeSIsIjMiOiJJbnRlcm5ldCIsIjQiOiJcdTAxMTBpXHUxZWMxdSBoXHUwMGYyYSIsIjUiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCIsIjYiOiJNXHUwMGUxeSBnaVx1MWViN3QifQ==', 1, 0, '{\"0\":\"21.013762\",\"1\":\"105.83520399999998\"}', 1, 0, '2019-05-14 21:08:57', '2019-05-14 21:08:57');
