 biệt. <br>- Phòng ngủ được trang bị điều hòa 2 chiều, giường, tủ quần áo,... <br>- Phòng khách cũng có thể làm phòng ngủ nếu nhà Đông người. <br>- Phòng bếp được trang bị bàn ăn, bàn bếp, tủ bếp, chậu rửa bát, hút mùi,... <br>- Khu vực nhà vệ sinh được lắp đầy đủ thiết bị hiện đại như chậu rửa mặt, bệt Inax, vòi sen, bình nóng lạnh,... <br>- Tòa nhà có bảo vệ 24/24, đảm bảo an ninh tuyệt đối, giờ giấc ra vào thoải mái. <br>- Khu vực ban công phơi đồ riêng biệt của từng phòng. <br>* Tòa nhà nằm ở vị trí trung tâm, giao thông thuận tiện, cách mặt đường Doãn Kế Thiện 20m, đối diện chợ Đồng Xa nên rất thuận tiện cho việc mua sắm, đi chợ, nằm trong khuôn viên tập quân đội nên an ninh rất tốt, gần các trung tâm thương mại, gần các trường ĐH như quốc gia, ngoại ngữ, gần bến xe Mỹ Đình,... <br><br>Địa chỉ: Số 32/C1 – Đường Doãn Kế Thiện - P Mai Dịch - Cầu Giấy. <br>LH C Hương 0978 335 871. / A Lương 0982 96 96 69.</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJUaGFuZyBtXHUwMGUxeSIsIjMiOiJJbnRlcm5ldCIsIjQiOiJcdTAxMTBpXHUxZWMxdSBoXHUwMGYyYSIsIjUiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCIsIjYiOiJNXHUwMGUxeSBnaVx1MWViN3QiLCI3IjoiVHJ1eVx1MWVjMW4gaFx1MDBlY25oIGNcdTAwZTFwIn0=', 1, 0, '{\"0\":\"21.041481\",\"1\":\"105.77726570000004\"}', 1, 0, '2019-05-14 21:15:03', '2019-05-14 21:15:03');
