INSERT INTO `motelrooms` VALUES (499, 'Cho thuê phòng trọ Số 41, Ngõ 67 Khương Trung.', 'cho-thue-phong-tro-so-41-ngo-67-khuong-trung', 2500000, 15.0000, 1, 2, 63, 'Số 41, Ngõ 67, Khương Trung, Thanh Xuân, Hà Nội', '01642444286', 3, 'Chưa xác định', '{\"0\":\"cho-thue-phong-tro-so-41-ngo-67-khuong-trung-1488901680xd6lj-jalbc.jpg\",\"1\":\"cho-thue-phong-tro-so-41-ngo-67-khuong-trung-1488901680xd6lj-ptyq7.jpg\",\"2\":\"cho-thue-phong-tro-so-41-ngo-67-khuong-trung-1488901680xd6lj-q5yio.jpg\",\"3\":\"cho-thue-phong-tro-so-41-ngo-67-khuong-trung-1488901680xd6lj-ic0m6.jpg\"}', '<div class=\"dis-content\">IỆN TẠI GIA ĐÌNH TÔI MUỐN CHO THUÊ PHÒNG TRỌ:<br>- Địa chỉ: Số 41 ngõ 67 khương trung.<br>- Nằm trong khu vực trung tâm, cách ngã tư sở 200m, thuận tiện đi lại.<br>- Còn 2 phòng tầng 3 trong nhà 4 tầng:<br>+ Phòng bé rộng 15m2, có cửa sổ rộng, thoáng.<br>+ Phòng to rộng 28m2, 2 gian, có ban công, cửa sổ thoáng mát, có sẵn giường, điều hòa LG, ở max 4 người<br>- Nhà tắm phía ngoài, ngay cạnh phòng, có nóng lạnh (KHÔNG KHÉP KÍN)<br>- Có internet cáp quang, sân phơi thoáng mát, chỗ để xe free rộng rãi, chỗ nấu ăn riêng.<br>- Tự quản giờ giấc, có chìa khóa riêng.<br>- Thường xuyên thuê người dọn vệ sinh không gian chung.<br>- GIÁ PHÒNG: <br>+ Bé: 2,5tr, ở 2-3 người<br>+ Lớn: 3,6tr, ở 3 -&gt; 5 người<br>- ĐÓNG TIỀN 2 THÁNG, đặt cọc 1 tháng.<br>- Ưu tiên người đi làm, sinh viên. Không nhận hộ gia đình<br>- Có thể chuyển đến ở ngay.<br>Liên hệ: 01642.444.286. (Gọi trước khi đến)</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCIsIjMiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCJ9', 1, 0, '{\"0\":\"20.995772\",\"1\":\"105.81575900000007\"}', 1, 0, '2019-05-14 21:16:04', '2019-05-14 21:16:04');
INSERT INTO `motelrooms` VALUES (501, 'Tìm nữ ở ghép times city', 'tim-nu-o-ghep-times-city', 2200000, 75.0000, 1, 45, 385, 'times city, Cầu Vĩnh Tuy, Hai Bà Trưng, Hà Nội', '0969096391', 2, 'Khép kín', '{\"0\":\"tim-nu-o-ghep-times-city-9kkkt.jpg\",\"1\":\"tim-nu-o-ghep-times-city-hdnxv.jpg\",\"2\":\"tim-nu-o-ghep-times-city-bc11g.jpg\"}', '<div class=\"dis-content\">Mình đang cần tìm 2 nữ (có lý lịch rõ ràng) ở ghép trong phòng NHỎ thuộc căn hộ cao cấp Times City. Diện tích căn hộ 75M2, 2 phòng ngủ, 2 phòng khách, 2 nhà vệ sinh có phòng tắm đứng, 1 bếp. Phòng có ĐỦ ĐỒ chỉ việc dọn đến ở (có thể ở 1 hoặc 2 người), bạn có thể ở 1 mình một phòng, nếu bạn muốn ở 2 người mà chưa tìm được người ở cùng thì mình sẽ hỗ trợ tìm giúp. Đóng tiền 6 tháng và đặt cọc 1 tháng. Các dịch vụ ở Times City thì mọi người đều biết là rất tốt, ngoài ra khi là cư dân Times City thì ban sẽ được sử dụng hồ bơi 4 mùa miễn phí. <br>Bạn nào có nhu cầu liên hệ sdt 0969096391 (Quỳnh 95)</div>', '', 1, 0, '{\"0\":\"20.9948536\",\"1\":\"105.86853859999997\"}', 1, 0, '2019-05-14 21:17:17', '2019-05-14 21:17:17');
