INSERT INTO `motelrooms` VALUES (503, 'Nhà trọ Thái Trinh, gần ĐH Công nghiệp, nhà tầng, máy giặt, tiết kiệm', 'nha-tro-thai-trinh-gan-dh-cong-nghiep-nha-tang-may-giat-tiet-kiem', 1700000, 18.0000, 1, 10, 39, 'Số nhà 5, ngõ 289, Xuân Phương ( gần đại học Công nghiệp), Hồ Tùng Mậu, Từ Liêm, Hà Nội', '0947888904', 7, 'Khép kín', '{\"0\":\"nha-tro-thai-trinh-gan-dh-cong-nghiep-nha-tang-may-giat-tiet-kiem-zpgyk.jpg\",\"1\":\"nha-tro-thai-trinh-gan-dh-cong-nghiep-nha-tang-may-giat-tiet-kiem-tlius.jpg\",\"2\":\"nha-tro-thai-trinh-gan-dh-cong-nghiep-nha-tang-may-giat-tiet-kiem-imkz5.jpg\",\"3\":\"nha-tro-thai-trinh-gan-dh-cong-nghiep-nha-tang-may-giat-tiet-kiem-tgrzz.jpg\",\"4\":\"nha-tro-thai-trinh-gan-dh-cong-nghiep-nha-tang-may-giat-tiet-kiem-wbhzo.jpg\"}', '<div class=\"dis-content\">Nhà trọ Thái Trinh mình cho thuê phòng trọ tại số nhà 05, ngõ 289, Xuân Phương, Hà Nội.<br>Bạn cứ đến cổng đại học công nghiệp, nhìn đối diện sang bên đường là đường Xuân Phương. Đi thẳng Xuân Phương, nhìn bên tay trái là ngõ 289 nhé.<br><br>Nhà gần Đại học công nghiệp ( cách 1,42km). Gần đại học Thương Mại ( cách 3,2km), đi xe máy 13p đến nơi nhé.<br>Đi bộ 2 phút đến bến bus 57( tuyến qua cả đh công nghiệp, đh thương mại và bến xe Mỹ Đình)<br><br>Ngay gần chợ đi chợ nấu cơm.<br><br>Nhà nằm trong ngõ tuyệt đối yên tĩnh, qua 3 lần cửa mới vào phòng bạn. Có chìa khóa riêng an toàn, hàng xóm chỉ có gia đình. Xung quanh cây xanh. Bên cạnh là vườn trồng cây nhà mình, phơi quần áo.<br><br>Nhà 4 tầng, mới sơn lại,<br>- Tầng 1 để xe miễn phí, phòng bếp chung miễn phí nấu cơm ăn.<br>- Tầng 2 và 3 mỗi tầng 2 phòng, sơn đẹp, wc riêng khép kín, nóng lạnh.<br>- Đều có cửa sổ, thoáng mát, có nóng lạnh, có máy giặt, có sẵn giường tủ bạn chỉ việc đến ở.<br><br>Không cho thuê đông người,( chỉ cho nhân viên văn phòng, sinh viên đại học và cao đẳng thuê). Ưu tiên 2 bạn học cùng lớp, chơi chung lâu hoặc cùng cơ quan.<br><br>Nấu ăn dùng bếp chung ( không nấu trên tầng), để xe tầng 1, máy giặt ở sân phơi, nóng lạnh tầng 2, internet cáp quang, giữ gìn vệ sinh chung cho nhà.<br><br>- Giá thuê 1,2tr -1,7tr /tháng.<br>- Diện tích 18m2/phòng.<br>- Điện: 3,500 đồng/số.<br>- Nước: 20,000đ/m3/người/tháng<br>- Internet cáp quang 27MBs: 50,000đ/tháng.<br>- Vệ sinh : 20,000đ/người.<br>- Máy giặt 8kg : miễn phí ( Tiết kiệm 300,000đ/tháng)<br>- Bếp ( tùy chọn): miễn phí<br>- Để xe: Miễn Phí ( tiết kiệm 100,000đ/tháng)<br>- Vườn: miền phí<br><br>Liên hệ: 0947 888 904( gặp Thái Trinh)</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCIsIjMiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCIsIjQiOiJNXHUwMGUxeSBnaVx1MWViN3QifQ==', 1, 0, '{\"0\":\"21.0385759\",\"1\":\"105.77150170000004\"}', 1, 0, '2019-05-14 21:17:28', '2019-05-14 21:17:28');
INSERT INTO `motelrooms` VALUES (504, 'Cho thuê phòng trọ tại Ngõ 92, Đào Tấn, Ba Đình', 'cho-thue-phong-tro-tai-ngo-92-dao-tan-ba-dinh', 2200000, 25.0000, 1, 14, 99, 'Ngõ 92, Đào Tấn, Ba Đình, Hà Nội', '01667884224', 2, 'Chung', '{\"0\":\"cho-thue-phong-tro-tai-ngo-92-dao-tan-ba-dinh-oi6jv.jpg\"}', '<div class=\"dis-content\">{{ CHO THUÊ PHÒNG }}<br>Giữa tháng 3 mình có 1 phòng tầng 3 trong 1 nhà 5 tầng ở ngõ 92, đào tấn , ba đình cho thuê. Phòng sạch sẽ, thoáng mát, an ninh tốt.<br>Giá phòng: 2tr2<br>Phòng rộng 25m2 có thể ở đc 2-3ng. Nvs bên cạnh, có nóng lạnh.<br>Tiền điện, nước , tính giá nhà nước, tháng hết bn chia đều. <br>Tầng 1 để xe và nấu ăn rộng, thoải mái.Ai muốn nấu ăn có thể nấu ăn ở tầng 1.<br>Đây là nhà riêng, ko chung chủ, các bạn đi về giờ giấc thoải mái, bb đến chơi ok.<br>Ai có nhu cầu LH mình nhé.<br>Sđt: 0166.788.4224<br>Có thể đến xem phòng vào các buổi tối hàng ngày, vì ban ngày mk đi làm.<br>Hiện mk đang đi làm chưa chụp đc ảnh, ảnh sẽ đăng ở cmt sau ạ.</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCIsIjMiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCJ9', 1, 0, '{\"0\":\"21.0335102\",\"1\":\"105.80663860000004\"}', 1, 0, '2019-05-14 21:17:32', '2019-05-14 21:17:32');
INSERT INTO `motelrooms` VALUES (505, 'Cho thuê phòng trọ tại Ngõ 157, Pháo Đài Láng', 'cho-thue-phong-tro-tai-ngo-157-phao-dai-lang', 3500000, 50.0000, 1, 6, 123, 'Ngõ 157, Pháo Đài Láng, Đống Đa, Hà Nội', '01214151698', 3, 'Chung', '{\"0\":\"cho-thue-phong-tro-tai-ngo-157-phao-dai-lang-x6z4k.jpg\",\"1\":\"cho-thue-phong-tro-tai-ngo-157-phao-dai-lang-auq2k.jpg\",\"2\":\"cho-thue-phong-tro-tai-ngo-157-phao-dai-lang-neqnx.jpg\"}', '<div class=\"dis-content\">CHO THUÊ PHÒNG ĐẸP, ĐỦ TIỆN NGHI - PHÁO ĐÀI LÁNG<br>Cho thuê 03 phòng trong 1 căn nhà riêng biệt 4 tầng, diện tích 55m2/tầng, cụ thể như sau:<br>- 01 Phòng tầng 2: diện tích 50m2, nhà vệ sinh bên ngoài, giá 3.5 tr/tháng. ở tối đa 3 người.<br>- 02 phòng Tầng 3: diện tích 25m2, giá 1 phòng 2.5 tr/tháng, 1 phòng 2.7 tr/tháng, WC 2 phòng chung. ở tối đa 2 người/phòng.<br>Đóng tiền 3 tháng/lần.<br>Để xe và bếp tầng 1 (rất rộng rãi). Tầng 4 có 1 phòng để đồ riêng, máy giặt và sân phơi.<br>Nhà có đầy đủ nóng lạnh, máy điều hoà, máy giặt, bếp từ, bồn tắm đứng…... Nói chung nhà rất đẹp các bạn đến xem sẽ ưng ngay. Điện nước giá nhà nước chia đầu người.<br>Nhà mình đều là người đã đi làm, gọn gàng và sạch sẽ.<br>Địa chỉ: ngõ 157 Pháo đài láng, gần chợ, tiện đi lại.<br>Các bạn xem nhà vui lòng liên hệ: Mến: 01214151698/ hoặc Hiền: O978944968.</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCIsIjMiOiJcdTAxMTBpXHUxZWMxdSBoXHUwMGYyYSIsIjQiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCJ9', 1, 0, '{\"0\":\"21.017534\",\"1\":\"105.80473619999998\"}', 1, 0, '2019-05-14 21:17:36', '2019-05-14 21:17:36');
INSERT INTO `motelrooms` VALUES (506, 'Cho thuê phòng trọ tại Số 46, Ngõ 50, Đình Thôn', 'cho-thue-phong-tro-tai-so-46-ngo-50-dinh-thon', 2500000, 20.0000, 1, 10, 0, 'Số 46, Ngõ 50, Đình Thôn, Từ Liêm, Hà Nội', '0966592575', 9, 'Khép kín', '{\"0\":\"cho-thue-phong-tro-tai-so-46-ngo-50-dinh-thon-ldt4v.jpg\",\"1\":\"cho-thue-phong-tro-tai-so-46-ngo-50-dinh-thon-u06yg.jpg\",\"2\":\"cho-thue-phong-tro-tai-so-46-ngo-50-dinh-thon-aqcgg.jpg\"}', '<div class=\"dis-content\">Chung cư mini 6 tầng cho thuê! Không hạn chế thời gian đi lại, chìa khoá riêng!<br>Địa chỉ: Số nhà 46, ngõ 50 Đình Thôn, Nam Từ Liêm, HN<br>Vị trí: Nằm trong khu dân cư, dân trí cao yên tĩnh. Cách cổng làng Đình Thôn 100m, tiện đi lại, bắt xe đi ngoại tỉnh dễ dàng. Đi bộ sang The Garden mất 5p đi bộ, gần Kangnam.<br>Diện tích: Toà nhà 70m2, 6 tầng mỗi tầng 2 phòng diện tích 25m2 phòng rộng, vuông vắn đều có ban công phơi đồ, cửa sổ thoáng mát, vệ sinh khép kín.<br>Nội thất và tiện nghi: Phòng đã bố trí sẵn giường ngủ, kệ bếp, bồn rửa bát, tủ bếp, phòng vệ sinh đầy đủ thiết bị và có sẵn Bình nóng lạnh.<br>An ninh an toàn: Có Camera 24/24 nhiều vị trí.<br>Vệ sinh sạch sẽ đều đặn hàng tuần có người dọn dẹp.<br>Mạng internet cáp quang FPT tốc độ cao, TH cáp TW nhiều kênh!<br>Tầng 1 có chỗ để xe và free!<br>Điện 4k/số, Nước 100k/ng, wifi: 80k/phòng, vsinh: 20k/phòng.<br>Giá phòng: 2,5tr ( có điều hoà)<br>Liên hệ: Cô Lan 094 5730089./0966592575.</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCIsIjMiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCJ9', 1, 0, '{\"0\":\"21.046723\",\"1\":\"105.74843120000003\"}', 1, 0, '2019-05-14 21:17:41', '2019-05-14 21:17:41');
