INSERT INTO `motelrooms` VALUES (511, 'Cho thuê phòng trọ số 16, Ngách 115, Ngõ 99, Định Công Hạ', 'cho-thue-phong-tro-so-16-ngach-115-ngo-99-dinh-cong-ha', 2100000, 20.0000, 1, 57, 181, 'Số 16, Ngách 115, Ngõ 99, Định Công Hạ, Hoàng Mai, Hà Nội', '01659018679', 3, 'Khép kín', '{\"0\":\"cho-thue-phong-tro-so-16-ngach-115-ngo-99-dinh-cong-ha-1488622104qmxoq-tposj.jpg\",\"1\":\"cho-thue-phong-tro-so-16-ngach-115-ngo-99-dinh-cong-ha-1488622104qmxoq-k7v3l.jpg\",\"2\":\"cho-thue-phong-tro-so-16-ngach-115-ngo-99-dinh-cong-ha-1488622104qmxoq-2mtcp.jpg\"}', '<div class=\"dis-content\">ho thuê phòng rẻ, đẹp, tiện nghi ở Định CôngNhà trong khu dân trí cao, rất yên tĩnh số 16 ngách 115 ngõ 99 Định Công Hạ ( ngay gần sân bóng Định Công)<br>Nhà 5 tầng đẹp, cực thoáng mát,cách mặt đường Định Công Hạ 100m,ngõ rộng, gần bến xe bus, an ninh cực kì đảm bảo, gần chợ. <br>Tầng 1: chỗ để xe rộng rãi, có chỗ nấu ăn chung có kệ bếp + tủ bếp <br>Tầng 2: Còn 1 phòng, nhà vệ sinh ở giữa có đầy đủ trang thiết bị, nóng lạnh. <br>- Phòng ngoài 20m2 có ban công, giá 2tr1/tháng<br>Mô tả :<br>- Để xe tầng 1 miễn phí <br>- Máy giặt cả nhà dùng chung, chỗ phơi quần áo thoáng ở tầng thượng. <br>- Nhà vệ sinh đẹp, rộng rãi, lịch sự, vòi hoa sen, nóng lạnh<br>- Hàng tuần có nhân viên vệ sinh, cọ toilet chung và lối đi chung tòa nhà. <br>- Internet cáp quang 24mb 80k/phòng, vệ sinh 60k/phòng. <br>- Điện nước giá nhà nước hoàn toàn. Các phòng đều có công tơ riêng. Ngoài ra không thu thêm tiền gì. <br>- Phòng ở nhiều người thoải mái không thu thêm tiền. Ưu tiên ở 2-3 người/phòng. - Không ở chung chủ. Giờ giấc đi lại thoải mái, tiếp bạn bè vô tư miễn là lịch sự và không làm ảnh hưởng đến người khác và hàng xóm xung quanh. <br>- Yêu cầu duy nhất là ngăn nắp, sạch sẽ, không làm hư hại phòng và các vật dụng trong nhà. <br>Hợp đồng lâu dài không tăng giá, chu kỳ đóng tiền nhà 1 tháng 1 lần, đặt cọc 1 tháng tiền nhà.<br>Mình chỉ đăng hộ, chi tiết các bạn liên hệ trực tiếp chủ nhà: +84 165 9018679 (Không trung gian).</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCIsIjMiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCJ9', 1, 0, '{\"0\":\"20.983162168497074\",\"1\":\"105.82835912704468\"}', 1, 0, '2019-05-14 21:17:58', '2019-05-14 21:17:58');
