INSERT INTO `motelrooms` VALUES (519, 'Tìm nam ở ghép phòng trọ  Khu Tập Thể 215, K2 Giảng Võ.', 'tim-nam-o-ghep-phong-tro-khu-tap-the-215-k2-giang-vo', 5000000, 80.0000, 1, 6, 110, 'Khu Tập Thể 215, K2, Giảng Võ, Đống Đa, Hà Nội', '0989989715', 4, 'Chưa xác định', '{\"0\":\"tim-nam-o-ghep-phong-tro-khu-tap-the-215-k2-giang-vo-dsnf0.jpg\",\"1\":\"tim-nam-o-ghep-phong-tro-khu-tap-the-215-k2-giang-vo-brypf.jpg\",\"2\":\"tim-nam-o-ghep-phong-tro-khu-tap-the-215-k2-giang-vo-lgsic.jpg\"}', '<div class=\"dis-content\">m nam ở ghép.<br>*Địa chỉ: Tầng 2. Khu tập thể 215-K2 Giảng Võ.<br>*Diện tích: 80m2. <br>- 2 phòng ngủ. <br>- 1 phòng khách ( có thể thành phòng ngủ ).<br>- 1 phòng bếp + phòng ăn.<br>- 1 vệ sinh.<br>- 1 phòng kho.<br>*Tiện nghi: Đầy đủ đồ đạc bao gồm 2 điều hòa, tủ lạnh, nóng lạnh, bếp và đồ dùng sinh hoạt, điện nước giá nhà dân.<br>-Phòng thoáng mát phía trước có ban công rộng phơi đồ và để xe. Giờ giấc thoải mái. An ninh khu vực rất an toàn vì gần có doanh trại quân đội.<br>Yêu cầu: Sạch sẽ, ngăn nắp, có ý thức chung, không hút thuốc trong phòng.<br>Giá cho thuê 5tr/tháng. Ở tối đa 4 người. Thanh toán 3 tháng/lần.<br>Liên hệ: 0989989715. Inbox mình trước rồi hãy gọi nhé. Thanks.</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCIsIjMiOiJcdTAxMTBpXHUxZWMxdSBoXHUwMGYyYSIsIjQiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCJ9', 1, 0, '{\"0\":\"21.0285957\",\"1\":\"105.8299389\"}', 1, 0, '2019-05-14 21:19:33', '2019-05-14 21:19:33');
INSERT INTO `motelrooms` VALUES (520, 'Cho thuê phòng trọ tại Số 7, Ngõ 322/53, Nhân Mỹ', 'cho-thue-phong-tro-tai-so-7-ngo-32253-nhan-my', 2800000, 24.0000, 1, 10, 0, 'Số 7, Ngõ 322/53, Nhân Mỹ, Từ Liêm, Hà Nội', '0934628790', 4, 'Chung', '{\"0\":\"cho-thue-phong-tro-tai-so-7-ngo-32253-nhan-my-4wmj0.jpg\"}', '<div class=\"dis-content\">CHO THUÊ PHÒNG TRỌ MỸ ĐÌNH<br>Tại Số 7, ngõ 322/53 Nhân Mỹ. Cách Sân vận động mỸ Đình 300m, cách bến xe Mỹ Đình 500m, tiện bến xe bus, gần trường ĐH Thương Mại, gần các khu văn phòng KeangNam, khu đô thị Mễ Trì.....<br>- Hết tháng này mình còn 01 phòng tầng 2 trong nhà 3 tầng, phòng rộng 24m2, có ban công, có sân phơi đồ giặt giũ, nấu nướng trong phòng, 3 phòng tầng 2 chung 1 nhà vs ( thjk hợp cho 3-4ng ở, cho hộ gia đình ở).<br>- Điện nước giá dân chia đầu người, mạng 70k/phòng, vs 10k/ng<br>- Giờ giấc đi lại thoải mái, tự do<br>- Liên hệ xem phòng: 0934 628 790</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCJ9', 1, 0, '{\"0\":\"21.046723\",\"1\":\"105.74843120000003\"}', 1, 0, '2019-05-14 21:19:47', '2019-05-14 21:19:47');
