INSERT INTO `motelrooms` VALUES (522, 'Cho thuê phòng trọ tại Ngõ 111, Triều Khúc, Thanh Xuân', 'cho-thue-phong-tro-tai-ngo-111-trieu-khuc-thanh-xuan', 1700000, 20.0000, 1, 2, 74, 'Ngõ 111, Triều Khúc, Thanh Xuân, Hà Nội', '0971279074', 3, 'Chưa xác định', '{\"0\":\"cho-thue-phong-tro-tai-ngo-111-trieu-khuc-thanh-xuan-m7wx0.jpg\",\"1\":\"cho-thue-phong-tro-tai-ngo-111-trieu-khuc-thanh-xuan-q54er.jpg\"}', '<div class=\"dis-content\">Cho thuê phòng sạch đẹp, yên tĩnh, an ninh tốt, đi lại thoải mái; có chỗ nấu ăn riêng, để xe riêng. <br>Cách bến xe bus đường Nguyễn Trãi 6 phút đi bộ có nhiều tuyến xe bus. Gần nhiều trường ĐH tại quận Thanh Xuân.<br>Ưu tiên 2-3 nam thuê phòng.<br>Liên hệ: 0971279074<br>Ps. Không trung gian.</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCJ9', 1, 0, '{\"0\":\"20.9974161\",\"1\":\"105.81690559999993\"}', 1, 0, '2019-05-14 21:19:54', '2019-05-14 21:19:54');
