i-nuoc-ngoai-thue-can-ho-chung-cu-mini-cao-cap-day-du-do-dt-50m2-toa-nha-d2-pho-cau-giay-1488446181lqmzr-evjvl.jpg\",\"13\":\"cho-nguoi-nuoc-ngoai-thue-can-ho-chung-cu-mini-cao-cap-day-du-do-dt-50m2-toa-nha-d2-pho-cau-giay-1488446181lqmzr-tbnaa.jpg\",\"14\":\"cho-nguoi-nuoc-ngoai-thue-can-ho-chung-cu-mini-cao-cap-day-du-do-dt-50m2-toa-nha-d2-pho-cau-giay-1488446181lqmzr-kmw9y.jpg\"}', '<div class=\"dis-content\"> Tòa nhà 9 tầng tại số nhà D2 ngõ 93 phố Cầu Giấy - P. Quan Hoa - Cầu Giấy mới hoàn thiện..<br>- Nhà ngay phố Cầu Giấy, đường vào rộng, 2 ô tô con tránh nhau, rất thuận tiện cho việc đi lại, sinh hoạt, vui chơi, giải trí. Lên phố cổ cũng gần, trung tâm thương mại ngay sát, gần trường đại học Sư Phạm, Học Viện Báo Chí Và Tuyên Truyền... <br>- Các căn hộ rộng được lát sàn gạch cao cấp, căn nào cũng có cửa sổ rộng, ban công phơi đồ riêng biệt. Các căn hộ được thiết kế hết sức hợp lý: <br>+ Loại 1: Gồm 1 phòng ngủ + 1 phòng khách, khu bếp có bàn bếp, tủ bếp, hút mùi, đầy đủ ánh sáng, gió và không khí vào phòng. DT 45m2. <br>+ Loại 2: Gồm 2 phòng ngủ + 1 phòng khách và phòng bếp riêng biệt DT 50m2. <br>- Mỗi phòng được trang bị điều hòa 2 chiều, giường, tủ quần áo, cửa sổ có rèm cản nắng cực đẹp, trần thạch cao, đèn ngủ đủ cả, bàn bếp xin, bồn rửa bát xịn.<br>- Nhà vệ sinh được lắp thiết bị vệ sinh Inax cao cấp, bình nóng lạnh Ariston, ốp lát gạch Prime sang trọng, có bồn tắm đứng hiện đại. <br><br><strong>Giá cho thuê: 6.500.000đ- 7.000.000- 7.500.000 đ/căn/tháng (thanh toán tối thiểu 03 tháng và đặt cọc 1 tháng). DT Các phòng từ 45 - 50m2.</strong> <br><br>- Tòa nhà trang bị thang máy cao cấp, máy giặt, truyền hình cáp, internet tốc độ cao miễn phí, mỗi căn hộ được cấp thẻ từ thang máy riêng. <br>- Tòa nhà có 2 bảo vệ 24/24 nên an ninh cực ổn, ra vào thoải mái, nhà để xe rộng rãi gần 200m2, có thể chứa được đến 100 chiếc xe máy. <br>=&gt; Phù hợp cho người nước ngoài, hộ gia đình, người đi làm thuê ở.<br><br><strong>+ Địa chỉ: Tòa nhà D2 ngõ 93 phố Cầu Giấy, P. Quan Hoa, Q. Cầu Giấy. (Cách Cầu Giấy 300m). </strong><br><strong>Liên hệ chủ nhà  chị Hương </strong><strong>0978 335 871 /  anh Lượng </strong><strong>0982 9696 69 </strong> </div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJUaGFuZyBtXHUwMGUxeSIsIjMiOiJJbnRlcm5ldCIsIjQiOiJcdTAxMTBpXHUxZWMxdSBoXHUwMGYyYSIsIjUiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCIsIjYiOiJNXHUwMGUxeSBnaVx1MWViN3QiLCI3IjoiVHJ1eVx1MWVjMW4gaFx1MDBlY25oIGNcdTAwZTFwIn0=', 1, 0, '{\"0\":\"21.0362368\",\"1\":\"105.79058250000003\"}', 1, 0, '2019-05-14 21:20:18', '2019-05-14 21:20:18');
INSERT INTO `motelrooms` VALUES (525, 'Tìm nữ ở ghép số 42, Ngõ 167 Thanh Nhàn,, Hai Bà Trưng', 'tim-nu-o-ghep-so-42-ngo-167-thanh-nhan-hai-ba-trung', 935000, 24.0000, 1, 45, 234, 'Số 42, Ngõ 167, Thanh Nhàn, Hai Bà Trưng, Hà Nội', '01658963916', 3, 'Khép kín', '{\"0\":\"tim-nu-o-ghep-so-42-ngo-167-thanh-nhan-hai-ba-trung-znl0s.jpg\",\"1\":\"tim-nu-o-ghep-so-42-ngo-167-thanh-nhan-hai-ba-trung-hh2i4.jpg\",\"2\":\"tim-nu-o-ghep-so-42-ngo-167-thanh-nhan-hai-ba-trung-nqbmj.jpg\",\"3\":\"tim-nu-o-ghep-so-42-ngo-167-thanh-nhan-hai-ba-trung-wvpt9.jpg\"}', '<div class=\"dis-content\">[TÌM 1 NỮ Ở GHÉP, THANH NHÀN, HAI BÀ TRƯNG - HN]<br>Hiện nhà mình đã có sẵn 2 người, mong muốn tìm thêm 1 người chuyển đến ở từ đầu tháng 3 để share tiền phòng. Có thể chuyển đến ở từ đầu tháng này luôn.- Địa điểm nhà: Ngõ 167 Thanh Nhàn, Hai Bà Trưng. Gần Bạch Mai, Lê Thanh Nghị, Võ Thị Sáu. Đối diện công viên Tuổi Trẻ, gần bệnh viện Thanh Nhàn.<br>- Không chung chủ, đi lại giờ giấc thoải mái, có chỗ để xe rộng.<br>- An ninh, có camera ở cổng và có bác bảo vệ cũng thường hay qua lại xem xét.<br>- Diện tích nhà: 24m2 (chưa kể ban công, bếp và phòng tắm), cộng lại tổng cộng phải ~ 30m2. Nhà có 2 cửa sổ nên tràn ngập ánh sáng. Phòng tầng 4 trong tổng 6 tầng (5 tầng ở 1 tầng thượng). Trong phòng không gián không chuột.<br>- Nhà tắm rộng, sạch sẽ (yên tâm về vụ này vì mình không chịu được nhà vệ sinh bẩn), có nóng lạnh đầy đủ.<br>- Chỗ nấu ăn riêng, không ám mùi. Có ban công phơi đồ riêng, mỗi phòng 1 ban công.<br>- Vứt rác ngay đầu ngõ, quán bán đồ ăn đi 50m là tới, chợ thì đi tầm 200m là đến.<br>- Bến xe bus thì khá nhiều (18, 51, 26, 36, 38) đủ cả.Giá cả: <br>+ Tiền nhà: mỗi người 935k/tháng. <br>+ Mạng: 70k/phòng.<br>+ Nước: 70k/người.<br>+ Điện: 4k/số.<br>+ Vệ sinh chung: 10k/người.Đóng tiền mỗi tháng 1 lần. Thu đầu tháng. Tiền cọc nhà 3tr, ở 3 thì 1tr/ người, đến khi chuyển đi thì trả lại tiền cọc.Phòng đã đầy đủ đồ, chỉ cần xách người đến ở. Nếu có nhiều đồ thì phòng cũng rộng, còn có gác nhỏ để đồ nên cũng không lo :))Mình thì mong muốn bạn nào muốn ở lâu dài (đến cuối năm nay). Tính tình thoải mái, sạch sẽ (có thể bừa bộn nhưng đừng bừa quá :)) ). Nấu ăn thì nấu ăn chung với nhau, ăn chung cho thân thiết. Có gì có thể tâm sự, mình siêu giỏi lắng nghe, nhưng nếu không muốn cũng không sao vì quan điểm của mình là tôn trọng quyền tự do cá nhân.Liên hệ: <br>+ Hạnh (0169.2810.359)<br>+ Nguyệt (01658963916)</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCIsIjMiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCJ9', 1, 0, '{\"0\":\"21.0017049\",\"1\":\"105.85581960000002\"}', 1, 0, '2019-05-14 21:20:25', '2019-05-14 21:20:25');
INSERT INTO `motelrooms` VALUES (526, 'Cho thuê phòng trọ số 94,  Ngõ 82, Mễ Trì Hạ, Nam Từ Liêm, Hà Nội. -', 'cho-thue-phong-tro-so-94-ngo-82-me-tri-ha-nam-tu-liem-ha-noi', 3000000, 32.0000, 1, 10, 24, 'Số 94,  Ngõ 82, Mễ Trì Hạ,, Mễ Trì, Từ Liêm, Hà Nội', '0989076210', 4, 'Khép kín', '{\"0\":\"cho-thue-phong-tro-so-94-ngo-82-me-tri-ha-nam-tu-liem-ha-noi-ntqcd.jpg\",\"1\":\"cho-thue-phong-tro-so-94-ngo-82-me-tri-ha-nam-tu-liem-ha-noi-esv78.jpg\",\"2\":\"cho-thue-phong-tro-so-94-ngo-82-me-tri-ha-nam-tu-liem-ha-noi-3hccw.jpg\",\"3\":\"cho-thue-phong-tro-so-94-ngo-82-me-tri-ha-nam-tu-liem-ha-noi-qcs48.jpg\",\"4\":\"cho-thue-phong-tro-so-94-ngo-82-me-tri-ha-nam-tu-liem-ha-noi-14fxy.jpg\"}', '<div class=\"dis-content\">Hiện tại gia đình tôi có phòng kiểu CCMN cho thuê ở ngõ 82 Mễ Trì Hạ Mễ Trì Hạ, Nam Từ Liêm, Hà Nội. <br>1. Diện tích: 28m2-32m2. <br>2. Địa chỉ: Ngõ 82 Mễ Trì Hạ-Nam Từ Liêm-Hà Nội. - Vị trí: Gần KeangNam đối diện với khu mua sắm The Manor / BigC Garden, cách khách sạn Merriot 300m, cách đường lớn Mễ Trì 400m. Cách bến xe Mỹ Đình 1.5km, gần chợ Mễ Trì. Rất tiện cho sinh hoạt. <br>3. Căn hộ nằm trong toàn nhà 5 tầng. Các phòng có diện tích từ 28m2-32m2, có gác xép ngủ được 4 người, gồm 1 phòng đơn thông, WC khép kín, có ban công phơi đồ riêng.. <br>4. Nội thất: Bao gồm giường ,tủ, nóng lạnh, quạt trần, kệ bếp, chậu rửa, bồn rửa mặt, vòi hoa sen, gương, bồn cầu vệ sinh cao cấp...<br>5. An ninh tuyệt đối: Có khóa vân tay (chỉ người trong nhà mới có thể ra vào 0, Camera an ninh theo dõi 24/24h.<br>6. Giá thuê: 2.8-3.0tr/tháng.Giá cả thương lượng.k chung chủ,giờ tự do.<br>7. Phí dịch vụ: Điện 3.8k/số, nước 26k/khối, mạng internet 100k/phòng/tháng.<br>Liên hệ chính chủ: bạn Huyền (0989076210).</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCIsIjMiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFl