INSERT INTO `motelrooms` VALUES (527, 'Tìm nữ ở ghép số 41/268 Đê La Thành Nhỏ ( Ngõ 478 Xã Đàn)', 'tim-nu-o-ghep-so-41268-de-la-thanh-nho-ngo-478-xa-dan', 2500000, 22.0000, 1, 6, 116, 'Số 41/268 Đê La Thành Nhỏ, Ngõ 478 , Xã Đàn, Đống Đa, Hà Nội', '01654682306', 3, 'Chưa xác định', '{\"0\":\"tim-nu-o-ghep-so-41268-de-la-thanh-nho-ngo-478-xa-dan-0nfgz.jpg\"}', '<div class=\"dis-content\">Đầu tháng 3 mình cần 1 bạn ở ghép ở đê la thành con ( hoặc đường xã đàn) <br>Hiện tại phòng có 2 người ở ( đều sn98 ạ ☺️☺️) yêu cầu bạn nữ hoà đồng vui vẻ, k có tính gian. Phòng khoảng 20-22m2. Điện nc giá dân, wf miễn phí.tháng 2tr5 tiền phòng chia 3. Vệ sinh ở bên ngoài phòng chỉ có phòng mình dùng nhé. Có chỗ để xe. <br>Liên hệ 01654682306 ( hương) <br>Địa chỉ 41/268 đê la thành nhỏ ( ngõ 478 xã đàn)</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCIsIjMiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCJ9', 1, 0, '{\"0\":\"21.0113\",\"1\":\"105.83633770000006\"}', 1, 0, '2019-05-14 21:20:46', '2019-05-14 21:20:46');
INSERT INTO `motelrooms` VALUES (528, 'Tìm nữ ở ghép số 139, Ngõ 162, Ngách 32, Đường Khương Trung, Quận Thanh Xuân , Hà Nội .', 'tim-nu-o-ghep-so-139-ngo-162-ngach-32-duong-khuong-trung-quan-thanh-xuan-ha-noi', 700000, 15.0000, 1, 2, 63, 'Số 139, Ngõ 162, Ngách 32,, Khương Trung, Thanh Xuân, Hà Nội', '0947476932', 3, 'Chưa xác định', '{\"0\":\"tim-nu-o-ghep-so-139-ngo-162-ngach-32-duong-khuong-trung-quan-thanh-xuan-ha-noi-b4aqa.jpg\"}', '<div class=\"dis-content\">Tìm nữ ở ghép:<br>Phòng t đã có 2 nữ (đã đi làm,), muốn tìm thêm một bạn nữa đến ở ghép cùng từ tháng 3 (ưu tiên người đã đi làm). <br>Phòng rộng, nóng lạnh, phòng tắm rất rộng rãi và sạch sẽ .<br>Ở riêng chủ nên rất thoải mái ạ. <br>Phòng ở ngõ 162 nghách 32 Đường Khương Trung, Quận Thanh Xuân , Hà Nội .<br>Bạn nào có nhu cầu ở cùng thì liên hệ với mình qua số :0947476932.</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCIsIjMiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCJ9', 1, 0, '{\"0\":\"20.9971504\",\"1\":\"105.82169109999995\"}', 1, 0, '2019-05-14 21:20:54', '2019-05-14 21:20:54');
