INSERT INTO `motelrooms` VALUES (530, 'CHO THUÊ NHÀ TRỌ KHU TRUNG TÂM HN', 'cho-thue-nha-tro-khu-trung-tam-hn', 2500000, 12.0000, 1, 45, 359, 'số 4 ngõ 63, Vân Hồ III, Hai Bà Trưng, Hà Nội', '0913150063', 4, 'Khép kín', '{\"0\":\"cho-thue-nha-tro-khu-trung-tam-hn-tnwen.jpg\"}', '<div class=\"dis-content\">Cho thuê nhà trọ, diện tích tầm 13m2. Nhà 2 tầng, 2 gác xép. Có bếp riêng, wc riêng có nóng lạnh, xe máy xe đạp có chỗ để. An ninh tốt, yên tĩnh, thoải mái. Nhà khu trung tâm tiện đi lại gần các bệnh viện, cao đẳng đại học, khu vui chơi giải trí lớn. Giá điện nước tính theo nhà dân</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCJ9', 1, 0, '{\"0\":\"21.0114646\",\"1\":\"105.84876650000001\"}', 1, 0, '2019-05-14 21:21:42', '2019-05-14 21:21:42');
INSERT INTO `motelrooms` VALUES (531, 'Cho thuê phòng trọ số 175 Lạc Long Quân, Tây Hồ ( Ngõ 291 Cũ', 'cho-thue-phong-tro-so-175-lac-long-quan-tay-ho-ngo-291-cu', 2300000, 30.0000, 1, 19, 20, 'Số 175, Lạc Long Quân, Tây Hồ, Hà Nội', '01645093333', 3, 'Chưa xác định', '{\"0\":\"cho-thue-phong-tro-so-175-lac-long-quan-tay-ho-ngo-291-cu-nrd18.jpg\"}', '<div class=\"dis-content\">Cho thuê phòng trọ<br>Phòng tầng 2 trong nhà 4 tầng, tầng 1 để xe và nấu ăn, tầng 4 phơi đồ. phòng rộng 40m vuông chưa kể ban công vệ sinh khép kín, phòng thoáng mát không bị chắn, có cửa sổ to, nằm trong khu dân cư yên tĩnh an ninh tốt<br>Không chung chủ, giờ giấc thoải mái thích hợp với hộ gia đình nhỏ hoặc sinh viên, ở tối đa 3 người<br>Giá 2tr3 ; điện nước, internet theo hóa đơn nhà nước, đóng tiền 3 tháng 1, cọc 1 tháng<br>Địa chỉ : 175 Lạc Long Quân, Tây Hồ ( ngõ 291 cũ), tiện xe buýt đi lại, gần chợ to<br>SĐT mình (Tiến sn 95) : 01645093333, các bạn đến xem nhà vào buổi chiều hoặc tối các ngày trong tuần vì sáng mình đi học</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCIsIjMiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCJ9', 1, 0, '{\"0\":\"21.0564478\",\"1\":\"105.80887589999998\"}', 1, 0, '2019-05-14 21:21:56', '2019-05-14 21:21:56');
INSERT INTO `motelrooms` VALUES (533, 'Tìm nữ ở ghép Tran Thai Tong, Cau Giay, Hanoi', 'tim-nu-o-ghep-tran-thai-tong-cau-giay-hanoi', 1000000, 25.0000, 1, 16, 380, 'Ngo 28 so nha 126A Com Vong, Cốm Vòng, Cầu Giấy, Hà Nội', '0977601628', 3, 'Khép kín', '{\"0\":\"tim-nu-o-ghep-tran-thai-tong-cau-giay-hanoi-s3zit.jpg\"}', '<div class=\"dis-content\">TÌM NỮ Ở GHÉP TRẦN THÁI TÔNG THÁNG 3 2017!!!1.000.000 ₫Hà NộiMình hiện cần tìm 1-2 bạn nữ ở ghép vào tháng 3, ưu tiên chuyển đến vào cuối tháng 2 luôn. Phòng mình ở tầng 2, sn 126a ngõ 28- tức là ngõ làng cốm Vòng, đường Trần Thái Tông. Cầu thang gỗ, bậc thấp, chuyển đồ rất tiện. Phòng khép kín rộng 20m2, có cửa sổ to, nhà tắm rộng, có nóng lạnh, khá thoáng và mát, có bồn rửa mặt, vòi hoa sen, có kệ bếp và quạt thông gió. Nói chung là phòng đẹp, mình ưng ^^ Có wifi, có mạng dây, chỗ để xe rộng, có camera quan sát, ko chung chủ, bạn bè thoải mái, phơi đồ tầng 7.<br>Phòng giá 2tr5/tháng bất kể 2-3người, cọc 2tr5/phòng, điện 3k/số, nước 60k/người. Mạng 60k/người. Toàn người đi làm nên rất yên tĩnh. Gần chợ, giặt là…<br>Mình tính cũng thoải mái, mong chị/bạn/em cùng phòng cũng thoáng tính chút ^^<br>Có gì ib mình hoặc viber zalo 0977601628</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCIsIjMiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCJ9', 1, 0, '{\"0\":\"21.035795\",\"1\":\"105.78817800000002\"}', 1, 0, '2019-05-14 21:22:39', '2019-05-14 21:22:39');
INSERT INTO `motelrooms` VALUES (534, 'Cho thuê phòng trọ tại Ngõ 318, Đê La Thành', 'cho-thue-phong-tro-tai-ngo-318-de-la-thanh', 4000000, 30.0000, 1, 6, 115, 'Ngõ 318, Đê La Thành, Đống Đa, Hà Nội', '0969633422', 5, 'Chưa xác định', '{\"0\":\"cho-thue-phong-tro-tai-ngo-318-de-la-thanh-i6n1x.jpg\",\"1\":\"cho-thue-phong-tro-tai-ngo-318-de-la-thanh-kxteo.jpg\",\"2\":\"cho-thue-phong-tro-tai-ngo-318-de-la-thanh-anfit.jpg\",\"3\":\"cho-thue-phong-tro-tai-ngo-318-de-la-thanh-jhqoy.jpg\",\"4\":\"cho-thue-phong-tro-tai-ngo-318-de-la-thanh-yzbtp.jpg\",\"5\":\"cho-thue-phong-tro-tai-ngo-318-de-la-thanh-eou8d.jpg\"}', '<div class=\"dis-content\">==== CHO THUÊ PHÒNG ĐẸP ( có thể ở gia đình) ====<br>Cho thuê phòng tại ngõ 318 đê la thành (thông ra hào nam, vũ thạnh, đi bộ ra trường văn hoá, mỹ thuật) khu trung tâm, tiện đi lại lắm lắm nhé<br>Nhà 3 tầng, thiết kế mỗi tầng 1 phòng ngủ riêng biệt<br>Nhà có đầy đủ đồ: tủ lạnh, bếp ga, lò vi sóng, máy giặt, điều hoà, nóng lạnh, tủ bếp, đệm, tủ, quạt trần, tủ quần áo, ...chỉ cần xách quần áo là đến ở luôn<br>À lại còn có bồn tắm cực sang chảnh, dàn năng lượng mặt trời không bao giờ lo hết nước nóng, ban công thoáng đãng phơi quần áo,<br>Điện nước giá dân siêu hạt dẻ<br>Giá: 4tr phòng tầng 2 rộng &gt; 30m2 có ban công thoáng mát, có thể ở 3-5 (có thương lượng),<br>Nấu ăn ngoài ban công hoặc tầng 1 tuỳ ý, để xe tầng 1, nhà không chủ đi về giờ giấc thoải mái<br>Khu dân trí cao, sáng + thoáng, yên tĩnh, cực cực an toàn<br>Có thể chuyển ngay và luôn trong tháng<br>Nhà đẹp lung linh y hình luôn<br>Liên hệ: Trang 93 - 0969633422</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJcdTAxMTBpXHUxZWMxdSBoXHUwMGYyYSIsIjMiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCIsIjQiOiJNXHUwMGUxeSBnaVx1MWViN3QifQ==', 1, 0, '{\"0\":\"21.0230599\",\"1\":\"105.82238180000002\"}', 1, 0, '2019-05-14 21:22:55', '2019-05-14 21:22:55');
