ang máy cao cấp, máy giặt miễn phí, truyền hình cáp, Internet tốc độ cao miễn phí, mỗi căn hộ được cấp thẻ từ thang máy riêng.<br>- Tòa nhà có 2 bảo vệ 24/7 nên an ninh cực ổn, ra vào thoải mái, nhà để xe rộng rãi gần 200m2, có thể chứa được đến 100 chiếc xe máy.<br>- Vệ sinh dọn phòng hàng ngày nếu khách có nhu cầu.<br>* Thích hợp cho người nước ngoài, hộ gia đình và người đi làm thuê ở.<br><strong>+ Địa chỉ: Tòa nhà D2 ngõ 93 phố Cầu Giấy, P. Quan Hoa, Q. Cầu Giấy (Cách Cầu Giấy 150m).<br>Liên hệ chủ nhà chị Hương 0978 335 871. A Lượng 0982 9696 69.</strong></div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJUaGFuZyBtXHUwMGUxeSIsIjMiOiJJbnRlcm5ldCIsIjQiOiJcdTAxMTBpXHUxZWMxdSBoXHUwMGYyYSIsIjUiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCIsIjYiOiJNXHUwMGUxeSBnaVx1MWViN3QiLCI3IjoiVHJ1eVx1MWVjMW4gaFx1MDBlY25oIGNcdTAwZTFwIn0=', 1, 0, '{\"0\":\"21.0323856\",\"1\":\"105.80052410000008\"}', 1, 0, '2019-05-14 21:23:05', '2019-05-14 21:23:05');
