INSERT INTO `motelrooms` VALUES (540, 'tìm 1 bạn nữ ở ghép tại khu đô thị văn quán hà đông hà nội', 'tim-1-ban-nu-o-ghep-tai-khu-do-thi-van-quan-ha-dong-ha-noi', 900000, 15.0000, 1, 21, 287, 'chung cư ct3a, khu đô thị văn quán, hà đông, hà nội, Nguyễn Khuyến, Hà Đông, Hà Nội', '0902198699', 1, 'Khép kín', '{\"0\":\"tim-1-ban-nu-o-ghep-tai-khu-do-thi-van-quan-ha-dong-ha-noi-b4yjq.jpg\",\"1\":\"tim-1-ban-nu-o-ghep-tai-khu-do-thi-van-quan-ha-dong-ha-noi-ivrk6.jpg\"}', '<div class=\"dis-content\">Mình muốn tìm một bạn ở ghép cùng mình.<br>địa chỉ tại: khu đô thị văn quán, hà đông, hà nội. <br>phòng có diện tích khoảng 15m2, phòng đủ đồ, từ điều hòa, nóng lạnh, máy giặt,..bạn chỉ việc xách balo đến.<br>giá phòng: 900k/người, điện, nước giá nhà nước, mạng, phí dịch vụ tổng khoảng 300k/người.<br>nhà toàn nữ và đã đi làm nên rất yên tĩnh. <br>mình muốn tìm một bạn hiền lành, ngoan ngoãn, ở cùng. bạn nữ nào muốn ở cùng mình thì liên hệ hoặc nhắn tin cho mình theo số điện thoại 0902198699 nhé. mình muốn tìm gấp trong tháng 2 nên bạn nào có nhu cầu thì liên hệ với mình để xem nhà.<br>cảm ơn các bạn!</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJUaGFuZyBtXHUwMGUxeSIsIjMiOiJJbnRlcm5ldCIsIjQiOiJcdTAxMTBpXHUxZWMxdSBoXHUwMGYyYSIsIjUiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCIsIjYiOiJNXHUwMGUxeSBnaVx1MWViN3QifQ==', 1, 0, '{\"0\":\"20.971077405168014\",\"1\":\"105.81848859786987\"}', 1, 0, '2019-05-14 21:24:04', '2019-05-14 21:24:04');
INSERT INTO `motelrooms` VALUES (541, 'Nhượng lại phòng trọ tại Ngõ 178, Tây Sơn', 'nhuong-lai-phong-tro-tai-ngo-178-tay-son', 2300000, 25.0000, 1, 6, 130, 'Ngõ 178, Tây Sơn, Đống Đa, Hà Nội', '01644905119', 4, 'Chung', '{\"0\":\"nhuong-lai-phong-tro-tai-ngo-178-tay-son-rt2jq.jpg\"}', '<div class=\"dis-content\">Cho thuê phòng Tây Sơn đối diện đại học công đoàn <br>Giá 2tr3<br>Mình mới thuê 1 phòng trong ngõ 178 Tây Sơn nhưng do không đủ người để share tiền phòng nên mình muốn nhượng lại.<br>Phòng rộng 25m2, có giường, có ban công thoáng mát, phơi đồ rộng rãi, chung vệ sinh, không giới hạn số người ở nhưng ưu tiên ở 3,4 ng.<br>Điện 3,5k/ 1 số, nước 25k/ khối, không chung chủ, có chỗ để xe ngay dưới tầng 1, giờ giấc thoải mái. Khu vực ngõ to nên thuận tiện đi lại, cách mặt đường Tây Sơn 10m, an ninh tốt. Ngay chân cầu vượt Tây Sơn. <br>Ai có nhu cầu thì liên hệ với m<br>Sđt: 01644905119</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCJ9', 1, 0, '{\"0\":\"21.0083911\",\"1\":\"105.82383819999995\"}', 1, 0, '2019-05-14 21:24:10', '2019-05-14 21:24:10');
INSERT INTO `motelrooms` VALUES (542, 'Tìm nữ ổ ghép tại 308, Xã Đàn, Đống Đa, Hà Nội', 'tim-nu-o-ghep-tai-308-xa-dan-dong-da-ha-noi', 600000, 35.0000, 1, 6, 116, '308, Xã Đàn, Đống Đa, Hà Nội', '01685384361', 5, 'Khép kín', '{\"0\":\"tim-nu-o-ghep-tai-308-xa-dan-dong-da-ha-noi-sr08b.jpg\"}', '<div class=\"dis-content\">Có bạn nữ nào đang muốn ở ghép ko ạ?<br>Chỉ cần xách vali đến và ở thôi ạ. Phòng mình đang 4 người. Giờ cần thêm 1 người nữa là 5. Phòng có đầy đủ đồ. Có thể nấu ăn, có kệ bếp . Điều hoà nóng lạnh đầy đủ ạ. Giờ giấc đi lại thoải mái. Mỗi người chìa khoá riêng. có chỗ để xe ko lo nắng mưa. Vì là mọi người đi làm suốt. Nên chỉ có buổi tối là ở cùng nhau thôi. Để share tiền nhà cho rẻ. Nếu ở 5 thì mỗi người chỉ mất khoảng 6-700k thôi ạ. Bạn nữ nào muốn ở ghép thì lhe với mình nhé. Địa chỉ ở 308 xã đàn-đống đa-hnoi. Sđt 01685384361 . Ib hoặc nt fb cho mình nha.</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCJ9', 1, 0, '{\"0\":\"21.0157879\",\"1\":\"105.83281379999994\"}', 1, 0, '2019-05-14 21:24:21', '2019-05-14 21:24:21');
