INSERT INTO `motelrooms` VALUES (548, 'Cho thuê phòng trọ tại Ngõ 535, Lạc Long Quân, Tây Hồ', 'cho-thue-phong-tro-tai-ngo-535-lac-long-quan-tay-ho', 1650000, 25.0000, 1, 19, 20, 'Ngõ 535, Lạc Long Quân, Tây Hồ, Hà Nội', '0969106095', 9, 'Chung', '{\"0\":\"cho-thue-phong-tro-tai-ngo-535-lac-long-quan-tay-ho-yv60t.jpg\"}', '<div class=\"dis-content\">Cần tìm gấp người ở ghép!<br>Mình thuê nhà nguyên căn, có 2 phòng ở. Hiện tại 1 phòng đã có một bạn nữ đang ở, có nhu cầu tìm thêm một hoặc hai bạn nữ nữa tới ở ghép, chậm nhất là đầu tháng 3/2017.<br>Phòng rộng 25m2, có nhà bếp, nhà ăn, phòng tắm riêng, sân để xe rộng, có nơi phơi đồ trên sân thượng.<br>Giá phòng 1.650.000vnđ/1 tháng/1phòng. Giá điện, nước tính theo giá quy định của nhà nước.<br>Nhà tại ngõ 535 đường Lạc Long Quân, Tây Hồ, Hà Nội (cách Hồ Tây 200m, cách chợ Xuân La 50m, giao với ngõ 28 Xuân La)<br>Yêu cầu người ở ghép: Phải thật thà, sạch sẽ, gọn gàng.<br>Ai có nhu cầu liên hệ theo sđt: 0969106095</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCJ9', 1, 0, '{\"0\":\"21.0633812\",\"1\":\"105.80915260000006\"}', 1, 0, '2019-05-14 21:25:07', '2019-05-14 21:25:07');
