INSERT INTO `motelrooms` VALUES (566, 'Cho thuê phòng trọ số 29, Ngõ 41 Thái Hà.', 'cho-thue-phong-tro-so-29-ngo-41-thai-ha', 2500000, 25.0000, 1, 6, 146, 'Số 29, Ngõ 41 , Thái Hà, Đống Đa, Hà Nội', '01632922018', 3, 'Chưa xác định', '{\"0\":\"cho-thue-phong-tro-so-29-ngo-41-thai-ha-zfulg.jpg\",\"1\":\"cho-thue-phong-tro-so-29-ngo-41-thai-ha-qsvqu.jpg\",\"2\":\"cho-thue-phong-tro-so-29-ngo-41-thai-ha-mc0g3.jpg\"}', '<div class=\"dis-content\">Cho thuê phòng tại ngõ 41 Thái Hà. Phòng có sẵn giường, tủ gỗ , có ban cộng, rộng tầm 25m2. Nhà Vệ Sinh ngay cạnh, đầy đủ nóng lạnh, wifi ... Chỗ để xe thoải mái. khu bếp riêng ở tầng 1, giặt và phơi đồ ở tầng thượng, nhà ko được mới nhưng đc cái an ninh tốt, vị trí địa lí tốt nên đi lại tiện ^^!. Giờ giấc thoải mái phòng có thể ở tối đa 3 người nếu là gái. còn ở 2 ng thì thoải mái giới tính :)). Phòng 2550k. Điện, nc, nét chia đầu người giá nhà nước. Đóng 3 tháng 1 .Ai muốn qua xem phòng liên hệ qua sdt 01632922018 để hỏi thêm chi tiết nhé. Còn muốn hỏi j thêm cứ cmt hoặc inbox nhé</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCIsIjMiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCJ9', 1, 0, '{\"0\":\"21.0102376\",\"1\":\"105.82083139999997\"}', 1, 0, '2019-05-14 21:28:34', '2019-05-14 21:28:34');
INSERT INTO `motelrooms` VALUES (567, 'Cho thuê phòng trọ số 21, Ngách 51, Ngõ 146, Đường 19/5 Văn Quán ,Hà Đông ', 'cho-thue-phong-tro-so-21-ngach-51-ngo-146-duong-195-van-quan-ha-dong', 2100000, 20.0000, 1, 21, 292, 'Số 21, Ngách 51, Ngõ 146,, 19/5, Hà Đông, Hà Nội', '0966069994', 2, 'Chưa xác định', '{\"0\":\"cho-thue-phong-tro-so-21-ngach-51-ngo-146-duong-195-van-quan-ha-dong-mx6f5.jpg\",\"1\":\"cho-thue-phong-tro-so-21-ngach-51-ngo-146-duong-195-van-quan-ha-dong-kubi1.jpg\",\"2\":\"cho-thue-phong-tro-so-21-ngach-51-ngo-146-duong-195-van-quan-ha-dong-le81p.jpg\"}', '<div class=\"dis-content\">Ngày 25/2 mình chuyển nên mình muốn nhượng lại phòng tầng 2 trong nhà 5 tầng mới xây <br>K chung chủ, giờ giấc thoải mái <br>Tầng 1 để xe có camera <br>Mình là người đầu tiên ở và mới ở Đc 3 tháng thôi, mình ở giữ gìn nên rất sạch sẽ <br>Phòng rộng , 2 ng ở Đc <br>Có hành lang tương đối thoải mái , ở hành lang có chỗ để bếp, bồn rửa, chỗ phơi quần áo <br>Có nóng lạnh , có mạng có wi-fi <br>An ninh tốt <br>Tiện mua bán, đi chợ, ăn uống<br>Gần ĐH kiến trúc, bưu chính, hvan , hồ gươm plaza và một số siêu thị, ....<br>Đóng tiền nhà 3 tháng 1 lần<br>Cọc 1 tháng <br>Anh chị chủ dễ tính , thoải mái <br>Giá 2tr1 <br>Điện nước giá dân <br>Mỗi phòng có 1 công tơ riêng <br>Địa chỉ : số nhà 21 ngách 51 ngõ 146 đường 19/5 Văn Quán ,Hà Đông <br>Thắc mắc gì ib cho mình hoặc liên hệ chị chủ nhà <br>Sđt chị chủ nhà : <br>0966069994</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCIsIjMiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCJ9', 1, 0, '{\"0\":\"20.9757884\",\"1\":\"105.78937100000007\"}', 1, 0, '2019-05-14 21:28:54', '2019-05-14 21:28:54');
INSERT INTO `motelrooms` VALUES (568, 'Cho thuê phòng trọ tại C12, Ngõ 8, An Hòa, Hà Đông', 'cho-thue-phong-tro-tai-c12-ngo-8-an-hoa-ha-dong', 2200000, 25.0000, 1, 21, 139, 'C12, Ngõ 8, An Hòa, Hà Đông, Hà Nội', '0985562638', 9, 'Khép kín', '{\"0\":\"cho-thue-phong-tro-tai-c12-ngo-8-an-hoa-ha-dong-pm7yd.jpg\"}', '<div class=\"dis-content\">ĐĂNG HỘ:<br>Hiện mìn còn phòng trọ tầng 3 trong nhà dân 3 tầng. Rộng 24-25m2, không chung chủ, chỗ để xe tầng 1 rất rộng.<br>Giá từ 2tr2-2tr5 tùy theo số người ở. Điện chia đầu người. Nước 60k mạng 50k.<br>Địa chỉ: c12 ngõ 8, An Hòa, Hà Đông (đối diện hv an ninh) rất gần các trường kiến trúc, bưu chính, y cổ truyền, đh hà nội, cn gtvt,...<br>***CHỈ CHO NỮ SV THUÊ***<br>LH:0985562638</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCJ9', 1, 0, '{\"0\":\"20.984103\",\"1\":\"105.79016449999995\"}', 1, 0, '2019-05-14 21:29:19', '2019-05-14 21:29:19');
