INSERT INTO `motelrooms` VALUES (575, 'Cho thuê phòng trọ tại Ngõ 3, Cầu Giấy', 'cho-thue-phong-tro-tai-ngo-3-cau-giay', 2200000, 20.0000, 1, 16, 16, 'Ngõ 3, Cầu Giấy, Cầu Giấy, Hà Nội', '0913440764', 9, 'Khép kín', '{\"0\":\"cho-thue-phong-tro-tai-ngo-3-cau-giay-zfqic.jpg\"}', '<div class=\"dis-content\">Mình có 2 phòng không sử dụng đến muốn cho thuê tại ngõ 3 đường Cầu Giấy, bên cạnh trường ĐH Giao thông vận tải (Số nhà P2 B15 Tập thể GV GTVT). Khu trung tâm, an ninh tốt, dân trí cao... <br>- Phòng khoảng 20m giá 2,2 triệu<br>- Phòng khoảng 16m giá 2 triệu<br>- Điện 3000đ/số<br>- Nước 50K/người<br>- Internet 70k/phòng<br>Chú ý: ưu tiên sinh viên nữ thuê.<br>Liên hệ sđt: 0913.440.764</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCJ9', 1, 0, '{\"0\":\"21.0443216\",\"1\":\"105.7785083\"}', 1, 0, '2019-05-14 21:30:45', '2019-05-14 21:30:45');
INSERT INTO `motelrooms` VALUES (576, 'CHÍNH CHỦ CHO THUÊ CHUNG CƯ MINI DT 35-40M2 ĐẦY ĐỦ TIỆN NGHI ĐIỀU HÒA NÓNG LẠNH SỐ 213 PHỐ XÃ ĐÀN', 'chinh-chu-cho-thue-chung-cu-mini-dt-35-40m2-day-du-tien-nghi-dieu-hoa-nong-lanh-so-213-pho-xa-dan', 6000000, 40.0000, 1, 6, 116, 'Số 213 Xã Đàn- P. Kim Liên- Q. Đống Đa., Xã Đàn, Đống Đa, Hà Nội', '0982969669', 3, 'Khép kín', '{\"0\":\"chinh-chu-cho-thue-chung-cu-mini-dt-35-40m2-day-du-tien-nghi-dieu-hoa-nong-lanh-so-213-pho-xa-dan-ya8e3.jpg\",\"1\":\"chinh-chu-cho-thue-chung-cu-mini-dt-35-40m2-day-du-tien-nghi-dieu-hoa-nong-lanh-so-213-pho-xa-dan-9i6zd.jpg\",\"2\":\"chinh-chu-cho-thue-chung-cu-mini-dt-35-40m2-day-du-tien-nghi-dieu-hoa-nong-lanh-so-213-pho-xa-dan-suex6.jpg\",\"3\":\"chinh-chu-cho-thue-chung-cu-mini-dt-35-40m2-day-du-tien-nghi-dieu-hoa-nong-lanh-so-213-pho-xa-dan-g8a93.jpg\",\"4\":\"chinh-chu-cho-thue-chung-cu-mini-dt-35-40m2-day-du-tien-nghi-dieu-hoa-nong-lanh-so-213-pho-xa-dan-sxyfy.jpg\",\"5\":\"chinh-chu-cho-thue-chung-cu-mini-dt-35-40m2-day-du-tien-nghi-dieu-hoa-nong-lanh-so-213-pho-xa-dan-cyp8s.jpg\",\"6\":\"chinh-chu-cho-thue-chung-cu-mini-dt-35-40m2-day-du-tien-nghi-dieu-hoa-nong-lanh-so-213-pho-xa-dan-bxasm.jpg\",\"7\":\"chinh-chu-cho-thue-chung-cu-mini-dt-35-40m2-day-du-tien-nghi-dieu-hoa-nong-lanh-so-213-pho-xa-dan-xqjek.jpg\",\"8\":\"chinh-chu-cho-thue-chung-cu-mini-dt-35-40m2-day-du-tien-nghi-dieu-hoa-nong-lanh-so-213-pho-xa-dan-7ryz6.jpg\",\"9\":\"chinh-chu-cho-thue-chung-cu-mini-dt-35-40m2-day-du-tien-nghi-dieu-hoa-nong-lanh-so-213-pho-xa-dan-gaola.jpg\"}', '<div class=\"dis-content\"><strong>1/ Tòa chung cư mini 8 tầng tại số 213 phố Xã Đàn mới hoàn thiện cuối tháng 2 vào ở được</strong>.<br>- Diện tích các phòng từ 35m2 - 40m2.<br>Giá cho thuê<strong> 6.000.000đ - 7.000.000đ /tháng</strong>, các căn hộ bao gồm:<br>1 phòng ngủ + phòng khách và khu bếp riêng biệt.<br>- Phòng ngủ được trang bị điều hòa 2 chiều, giường, tủ quần áo...<br>- Phòng bếp được trang bị bàn ăn, bàn bếp, tủ bếp, chậu rửa bát...<br>- Khu vực nhà vệ sinh được lắp đầy đủ thiết bị hiện đại như chậu rửa mặt, bệt Inax, vòi sen, bình nóng lạnh...<br>- Tòa nhà có bảo vệ 24/24, đảm bảo an ninh tuyệt đối, giờ giấc ra vào thoải mái.<br>- Khu vực ban công phơi đồ riêng biệt của từng phòng.<br><br>* Tòa nhà nằm ở vị trí trung tâm, giao thông thuận tiện, cách mặt đường Xã Đàn 20m, nằm trong khuôn viên Tập Thể Học Viện Kỹ Thuật Quân Sự nên an ninh rất tốt, gần các trung tâm thương mại, lên phố cổ cũng gần, cách ngã tư Xã Đàn 300m...<br><br><strong>Địa chỉ: Số 213 Xã Đàn- P. Kim Liên- Q. Đống Đa.<br>LH C Hương 0978 335 871. -A Lượng 0982 9696 69.</strong><br><br><strong>2/</strong> Căn hộ chung cư mini nội thất cao cấp tọa lạc trong tòa nhà 09 tầng, nằm ven hồ Rùa cách đường Trường Chinh 300m, đường vào 2 tô con tránh nhau, rất thuận tiện cho việc đi lại, sinh hoạt, vui chơi, giải trí.<br>- Lên phố cổ cũng gần, trung tâm thương mại ngay sát, gần bệnh viện Đại Học y, trường học, như trường ĐH như Kinh Tế Quốc Dân, ĐH Thủy Lợi, Nhân Văn, Ngoại Ngữ….<br>- Căn hộ rộng 45- 50m2 được lát sàn gỗ, căn nào cũng cửa sổ rộng, ban công phơi đồ riêng biệt nhìn sang hồ điều hòa, hít khí trời trong lành nên không độc hại. Căn hộ được thiết kế hết sức hợp lý, 1 phòng ngủ, 1 phòng khách, khu bếp có đầy đủ ánh sáng, gió và không khí vào phòng.<br><br>- Mỗi căn hộ được trang bị giường, cửa sổ có rèm Thái Tuấn cực đẹp, trần thạch cao, đèn ngủ đủ cả, bàn bếp xịn, hút mùi, bồn rửa bát xịn.<br><br>- Nhà vệ sinh có thiết bị vệ sinh inax cao cấp, ốp lát gạch Prime sang trọng, mỗi nhà vệ sinh đều được trang bị bình Nóng Lạnh Ariston loại xin mới tinh..<br><br>Giá cho thuê: <strong>4.500.000đ- 5.500.000đ/căn/tháng</strong> (thanh toán tối thiểu 03 tháng và đặt cọc 01 tháng). Hộ nào thanh toán 6 tháng trở lên sẽ được ưu đãi giảm giá.<br>- Bảo vệ 24/7 Gửi xe miễn phí.<br>- Tòa nhà trang bị thang máy cao cấp, máy giặt, truyền hình cáp miễn phí, mỗi căn hộ được cấp thẻ từ thang máy riêng.<br>- Tòa nhà có bảo vệ 24/24 nên an ninh cực ổn, ra vào thoải mái, nhà để xe rộng rãi gần 200m2.<br>- Thích hợp hộ gia đình kèm theo người giúp việc hoặc ông bà ở cùng, người đi làm, sinh viên ngoan...<br><strong>+ Địa chỉ: Số nhà 78 mặt đường Hồ Rùa-Ngõ 155(đường Nguyễn Lân) - Phố Trường Chinh– Đống Đa- HN.<br>Liên hệ chủ nhà A Lượng 0982 9696 69/ Chị Hương 0978 335 871.</strong></div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJUaGFuZyBtXHUwMGUxeSIsIjMiOiJJbnRlcm5ldCIsIjQiOiJcdTAxMTBpXHUxZWMxdSBoXHUwMGYyYSIsIjUiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCIsIjYiOiJNXHUwMGUxeSBnaVx1MWViN3QiLCI3IjoiVHJ1eVx1MWVjMW4gaFx1MDBlY25oIGNcdTAwZTFwIn0=', 1, 0, '{\"0\":\"21.0128799\",\"1\":\"105.83559579999996\"}', 1, 0, '2019-05-14 21:30:54', '2019-05-14 21:30:54');
INSERT INTO `motelrooms` VALUES (577, 'CHO THUÊ CHUNG CƯ MINI KHÉP KÍN ĐẦY ĐỦ ĐỦ TIỆN NGHI DT40M2 MẶT PHỐ DOÃN KẾ THIỆN - CẦU GIẤY', 'cho-thue-chung-cu-mini-khep-kin-day-du-du-tien-nghi-dt40m2-mat-pho-doan-ke-thien-cau-giay', 4500000, 40.0000, 1, 16, 16, 'Tòa nhà D2 ngõ 93 phố Cầu Giấy, P. Quan Hoa, Q. Cầu Giấy, Cầu Giấy, Cầu Giấy, Hà Nội', '0978335871', 3, 'Khép kín', '{\"0\":\"cho-thue-chung-cu-mini-khep-kin-day-du-du-tien-nghi-dt40m2-mat-pho-doan-ke-thien-cau-giay-5gyju.jpg\",\"1\":\"cho-thue-chung-cu-mini-khep-kin-day-du-du-tien-nghi-dt40m2-mat-pho-doan-ke-thien-cau-giay-8ravo.jpg\",\"2\":\"cho-thue-chung-cu-mini-khep-kin-day-du-du-tien-nghi-dt40m2-mat-pho-doan-ke-thien-cau-giay-9cmqe.jpg\",\"3\":\"cho-thue-chung-cu-mini-khep-kin-day-du-du-tien-nghi-dt40m2-mat-pho-doan-ke-thien-cau-giay-emzau.jpg\",\"4\":\"cho-thue-chung-cu-mini-khep-kin-day-du-du-tien-nghi-dt40m2-mat-pho-doan-ke-thien-cau-giay-er3rl.jpg\",\"5\":\"cho-thue-chung-cu-mini-khep-kin-day-du-du-tien-nghi-dt40m2-mat-pho-doan-ke-thien-cau-giay-fa5iz.jpg\",\"6\":\"cho-thue-chung-cu-mini-khep-kin-day-du-du-tien-nghi-dt40m2-mat-pho-doan-ke-thien-cau-giay-fucdk.jpg\",\"7\":\"cho-thue-chung-cu-mini-khep-kin-day-du-du-tien-nghi-dt40m2-mat-pho-doan-ke-thien-cau-giay-hdixh.jpg\",\"8\":\"cho-thue-chung-cu-mini-khep-kin-day-du-du-tien-nghi-dt40m2-mat-pho-doan-ke-thien-cau-giay-tjqcb.jpg\",\"9\":\"cho-thue-chung-cu-mini-khep-kin-day-du-du-tien-nghi-dt40m2-mat-pho-doan-ke-thien-cau-giay-wx9jf.jpg\",\"10\":\"cho-thue-chung-cu-mini-khep-kin-day-du-du-tien-nghi-dt40m2-mat-pho-doan-ke-thien-cau-giay-y6o1j.jpg\"}', '<div class=\"dis-content\"><strong>Hiện nay tôi đang có nhiều phòng khép kín cho thuê, với nhiều diện tích khác nhau. Tất cả các tòa đều là chính chủ cho thuê không qua trung gian, môi giới. </strong><br><strong><br>1- Tòa nhà 9 tầng tại số nhà D2 ngõ 93 phố Cầu Giấy - P. Quan Hoa - Cầu Giấy, mới hoàn thiện vào ở luôn đượ</strong>c. <br>- Nhà ngay phố Cầu Giấy, đường vào rộng, 2 ô tô con tránh nhau, rất thuận tiện cho việc đi lại, sinh hoạt, vui chơi, giải trí. Lên phố cổ cũng gần, trung tâm thương mại ngay sát, gần trường đại học Sư Phạm, Học Viện Báo Chí Và Tuyên Truyền,... <br>- Các phòng rộng được lát sàn gạch cao cấp, phòng nào cũng có cửa sổ rộng, ban công phơi đồ riêng biệt. Các phòng được thiết kế hết sức hợp lý: <br>+ Loại 1: Gồm 1 phòng ngủ + 1 phòng khách, khu bếp có bàn bếp, tủ bếp, hút mùi, đầy đủ ánh sáng, gió và không khí vào phòng. DT: 45m2. <br>+ Loại 2: Gồm 2 phòng ngủ + 1 phòng khách và phòng bếp riêng biệt DT: 50m2. <br>- Mỗi phòng được trang bị điều hòa 2 chiều, giường, tủ quần áo, bộ bàn ăn, cửa sổ có rèm cản nắng cực đẹp, trần thạch cao, đèn ngủ đủ cả, bàn bếp, hút mùi, bồn rửa bát xịn. <br>- Nhà vệ sinh được lắp thiết bị vệ sinh Inax cao cấp, bình nóng lạnh Ariston, ốp lát gạch Prime sang trọng hiện đại. <br><strong><br>Giá cho thuê: 6.000.000-6.500.000đ- 7.000.000đ căn/tháng</strong> (thanh toán tối thiểu 03 tháng và đặt cọc 1 tháng). DT Các phòng từ 45 - 50m2. <br><br>- Tòa nhà trang bị thang máy cao cấp, máy giặt miễn phí, truyền hình cáp, internet tốc độ cao miễn phí, mỗi căn hộ được cấp thẻ từ thang máy riêng. <br>- Tòa nhà có 2 bảo vệ 24/7 nên an ninh cực ổn, ra vào thoải mái, nhà để xe rộng rãi gần 200m2, có thể chứa được đến 100 chiếc xe máy. <br>- Vệ sinh dọn phòng hàng ngày nếu khách có nhu cầu. <br>* Thích hợp cho người nước ngoài, hộ gia đình và người đi làm thuê ở. <br>+ <strong>Địa chỉ: Tòa nhà D2 ngõ 93 phố Cầu Giấy, P. Quan Hoa, Q. Cầu Giấy (Cách Cầu Giấy 150m).</strong> <br>Liên hệ chủ nhà chị Hương 0978 335 871. A Lượng 0982 9696 69. <br><strong><br>2-Tòa chung cư mini 8 tầng tại số 34/C1 Phố Doãn Kế Thiện mới hoàn thiện cuối tháng 2 vào ở được.</strong> <br>- Diện tích các phòng từ 35m2 - 40m2. <br><strong>Giá cho thuê 4.500.000đ - 5.000.000đ/tháng, </strong>các căn hộ bao gồm: <br>1 phòng ngủ + phòng khách và khu bếp riêng biệt. <br>- Phòng ngủ được trang bị điều hòa 2 chiều, giường, tủ quần áo... <br>- Phòng khách cũng có thể làm phòng ngủ nếu nhà Đông người. <br>- Phòng bếp được trang bị bàn ăn, bàn bếp, tủ bếp, chậu rửa bát, hút mùi... <br>- Khu vực nhà vệ sinh được lắp đầy đủ thiết bị hiện đại như chậu rửa mặt, bệt Inax, vòi sen, bình nóng lạnh... <br>- Tòa nhà có bảo vệ 24/24, đảm bảo an ninh tuyệt đối, giờ giấc ra vào thoải mái. <br>- Khu vực ban công phơi đồ riêng biệt của từng phòng. <br>* Tòa nhà nằm ở vị trí trung tâm, giao thông thuận tiện, cách mặt đường Doãn Kế Thiện 20m, đối diện chợ Đồng Xa nên rất thuận tiện cho việc mua sắm, đi chợ, nằm trong khuôn viên tập quân đội nên an ninh rất tốt, gần các trung tâm thương mại, gần các trường ĐH như quốc gia, ngoại ngữ, gần bến xe Mỹ Đình... <br><strong>Địa chỉ: Số 34/C1 – Đường Doãn Kế Thiện - P Mai Dịch - Cầu Giấy. <br>LH C Hương 0978 335 871./ 0982 9696 69</strong></div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJUaGFuZyBtXHUwMGUxeSIsIjMiOiJJbnRlcm5ldCIsIjQiOiJcdTAxMTBpXHUxZWMxdSBoXHUwMGYyYSIsIjUiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCIsIjYiOiJNXHUwMGUxeSBnaVx1MWViN3QiLCI3IjoiVHJ1eVx1MWVjMW4gaFx1MDBlY25oIGNcdTAwZTFwIn0=', 1, 0, '{\"0\":\"21.0323856\",\"1\":\"105.80052410000008\"}', 1, 0, '2019-05-14 21:30:58', '2019-05-14 21:30:58');
INSERT INTO `motelrooms` VALUES (578, 'Cho thuê phòng trọ số 61/12 Phan Đình Giót, Phương Liệt, Thanh Xuân', 'cho-thue-phong-tro-so-6112-phan-dinh-giot-phuong-liet-thanh-xuan', 1000000, 15.0000, 1, 57, 232, 'Số 61/12 , Phan Đình Giót, Hoàng Mai, Hà Nội', '0945513514', 2, 'Khép kín', '{\"0\":\"cho-thue-phong-tro-so-6112-phan-dinh-giot-phuong-liet-thanh-xuan-wttiz.jpg\",\"1\":\"cho-thue-phong-tro-so-6112-phan-dinh-giot-phuong-liet-thanh-xuan-aormv.jpg\"}', '<div class=\"dis-content\">Mình có 1 phòng cho thuê tại địa chỉ số 61/12 phan đình giót phương liệt - thanh xuan - hn. <br>phòng 1 triệu cho 1-2 người ở<br>Ngay dưới là chợ. Gần các trường đại học như bach khoa, kt, xd , hoc viện giáo dục. Phòng tầng3. Tầng 1 để xe có cảmera giám sát. Bạn nào cần alo mình nhe, An ninh tốt, giờ giấc thoải mái, không chung chủ. Chỉ cần giữ ý thức tập thể là ở được rất lâu.<br>Bên mình các bạn ấy ở hết thời sinh viên mới chuyển. Mình cũng ở đó 3 năm rồi, và cảm thấy rát thuận tiện cho đi lại, mua sắm, chợ ngay dưới nhà luôn.<br>0945513514. Đến ở ngay vào luôn hôm nay.<br>Bạn nào ok mình giảm giá cho nhé. 1000 000 cả điện nước luôn nhé</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCIsIjMiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCJ9', 1, 0, '{\"0\":\"20.990531\",\"1\":\"105.84066699999994\"}', 1, 0, '2019-05-14 21:31:01', '2019-05-14 21:31:01');
