INSERT INTO `motelrooms` VALUES (581, 'Cho thuê phòng trọ số 35, Ngõ 54 Nguyễn Chí Thanh ', 'cho-thue-phong-tro-so-35-ngo-54-nguyen-chi-thanh', 1500000, 15.0000, 1, 14, 7, 'Số 35, Ngõ 54 , Nguyễn Chí Thanh, Ba Đình, Hà Nội', '01282308759', 2, 'Khép kín', '{\"0\":\"cho-thue-phong-tro-so-35-ngo-54-nguyen-chi-thanh-k5mca.jpg\",\"1\":\"cho-thue-phong-tro-so-35-ngo-54-nguyen-chi-thanh-yxp5k.jpg\",\"2\":\"cho-thue-phong-tro-so-35-ngo-54-nguyen-chi-thanh-dnhoo.jpg\"}', '<div class=\"dis-content\">- Cho thuê phòng trọ dạng chung cư mini khép kín gần ĐH Luật, ĐH Ngoại Giao, Ngoại Thương,...<br>- Diện tích 15m2-20m2-28m2<br>khép kín, giá từ 1,500,000-2,000,000-2,600,000đ ở từ 2-4 người <br>- Ưu tiên sinh viên và người đi làm <br>- Nhà an ninh tốt, đầy đủ tiện nghi<br>- LH 0128 230 8759 MTG</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCIsIjMiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCJ9', 1, 0, '{\"0\":\"21.01617\",\"1\":\"105.80580399999997\"}', 1, 0, '2019-05-14 21:31:19', '2019-05-14 21:31:19');
