INSERT INTO `motelrooms` VALUES (587, 'Cho thuê phòng trọ số 8, Ngõ 2, Phố Kim Hoa ', 'cho-thue-phong-tro-so-8-ngo-2-pho-kim-hoa', 1850000, 15.0000, 1, 6, 221, 'Số 8, Ngõ 2, Kim Hoa, Đống Đa, Hà Nội', '01672862457', 2, 'Chưa xác định', '{\"0\":\"cho-thue-phong-tro-so-8-ngo-2-pho-kim-hoa-spfsm.jpg\"}', '<div class=\"dis-content\">in phép admin .Cho thuê nhà trọ ở số nhà 8 ngõ 2 phố kim hoa gần công viên thống nhất ,ngay ngã tư đại cồ việt giao giải phóng sát đường tàu ngay đầu xã đàn ( cạnh thế giới di động) ^.^ gần các trường bách khoa ,kinh tế, xây dựng, đại học mở gần bến xe buýt không chung chủ, giờ giấc đi lại thoải mái .Từ ngày 1/3/2017 nhà còn trống 1 phòng tầng 3 trong nhà 5 tầng Giá phòng 1tr850 đóng tiền nhà 2 tháng 1 lần, ko cần đặt cọc tiền nhà,có thể ở 2 người rộng ~15m2, điện nc cả nhà dùng bao nhiêu chia đều theo đầu người ,2 phòng chung 1 nhà vệ sinh , khép kín ,có nóng lạnh nhưng các bạn dùng mới hỏng chưa sửa ^ ^. ưu tiên các bạn sinh viên nhá có gì alo theo số 01672862457 mình đi làm nên các bạn gặp sau 18h chiều và cả ngày chủ nhật . các bạn ngang qua cho xin 1 chấm đỡ trôi bài</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCIsIjMiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCJ9', 1, 0, '{\"0\":\"21.0096549\",\"1\":\"105.8391322\"}', 1, 0, '2019-05-14 21:32:32', '2019-05-14 21:32:32');
INSERT INTO `motelrooms` VALUES (588, 'Cho thuê phòng chính chủ gần hồ Đền Lừ', 'cho-thue-phong-chinh-chu-gan-ho-den-lu', 1500000, 15.0000, 1, 57, 58, 'Số 14B, ngõ 139, phố Tân Mai, quận Hoàng Mai, Hà Nội, Tân Mai, Hoàng Mai, Hà Nội', '0916122234', 2, 'Khép kín', '{\"0\":\"cho-thue-phong-chinh-chu-gan-ho-den-lu-1487266781n9txl-resized-zz95e.jpg\",\"1\":\"cho-thue-phong-chinh-chu-gan-ho-den-lu-1487266781n9txl-resized-t1bax.jpg\",\"2\":\"cho-thue-phong-chinh-chu-gan-ho-den-lu-1487266781n9txl-resized-ef3ci.jpg\"}', '<div class=\"dis-content\">CHO THUÊ PHÒNG <br>Hiện nay mình ở có phòng. Công trình phụ khép kín, rộng 15m2. Có gác xép để ngủ, chỗ nấu ăn. Sân vườn rộng rãi. Chỗ để xe thoải mái. 5h30 mở cửa, 11h khóa cửa. Nhà đằng sau trường Tiểu học Tân Mai, gần hồ Đền Lừ. Giá thuê 1tr500, thanh toán tháng/lần. Điện 3000đ/số. Nước 20.000đ/khối. Địa chỉ số 14B, ngõ 139, phố Tân Mai, quận Hoàng Mai, Hà Nội. Bạn nào có nhu cầu liên hệ số điện thoại: 0916122234</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCJ9', 1, 0, '{\"0\":\"20.9834922\",\"1\":\"105.85023849999993\"}', 1, 0, '2019-05-14 21:32:52', '2019-05-14 21:32:52');
INSERT INTO `motelrooms` VALUES (589, 'CHÍNH CHỦ CHO THUÊ CHUNG CƯ MINI DT 38-40M2 ĐẦY ĐỦ TIỆN NGHI ĐIỀU HÒA NÓNG LẠNH SỐ 213 PHỐ XÃ ĐÀN', 'chinh-chu-cho-thue-chung-cu-mini-dt-38-40m2-day-du-tien-nghi-dieu-hoa-nong-lanh-so-213-pho-xa-dan', 6000000, 40.0000, 1, 6, 116, 'Số 213 Xã Đàn- P. Phương liên- Q. Đống Đa., Xã Đàn, Đống Đa, Hà Nội', '0978335871', 3, 'Khép kín', '{\"0\":\"chinh-chu-cho-thue-chung-cu-mini-dt-38-40m2-day-du-tien-nghi-dieu-hoa-nong-lanh-so-213-pho-xa-dan-qvbg8.jpg\",\"1\":\"chinh-chu-cho-thue-chung-cu-mini-dt-38-40m2-day-du-tien-nghi-dieu-hoa-nong-lanh-so-213-pho-xa-dan-998wl.jpg\",\"2\":\"chinh-chu-cho-thue-chung-cu-mini-dt-38-40m2-day-du-tien-nghi-dieu-hoa-nong-lanh-so-213-pho-xa-dan-xlhfi.jpg\",\"3\":\"chinh-chu-cho-thue-chung-cu-mini-dt-38-40m2-day-du-tien-nghi-dieu-hoa-nong-lanh-so-213-pho-xa-dan-37buc.jpg\",\"4\":\"chinh-chu-cho-thue-chung-cu-mini-dt-38-40m2-day-du-tien-nghi-dieu-hoa-nong-lanh-so-213-pho-xa-dan-rtuva.jpg\",\"5\":\"chinh-chu-cho-thue-chung-cu-mini-dt-38-40m2-day-du-tien-nghi-dieu-hoa-nong-lanh-so-213-pho-xa-dan-qzebj.jpg\",\"6\":\"chinh-chu-cho-thue-chung-cu-mini-dt-38-40m2-day-du-tien-nghi-dieu-hoa-nong-lanh-so-213-pho-xa-dan-ar3jk.jpg\"}', '<div class=\"dis-content\">1/ Tòa chung cư mini 8 tầng tại số 213 phố Xã Đàn mới hoàn thiện cuối tháng 2 vào ở được.<br>- Diện tích các phòng từ 35m2 - 40m2.<br>Giá cho thuê 6.000.000đ - 7.000.000đ /tháng, các căn hộ bao gồm:<br>1 phòng ngủ + phòng khách và khu bếp riêng biệt.<br>- Phòng ngủ được trang bị điều hòa 2 chiều, giường, tủ quần áo...<br>- Phòng bếp được trang bị bàn ăn, bàn bếp, tủ bếp, chậu rửa bát...<br>- Khu vực nhà vệ sinh được lắp đầy đủ thiết bị hiện đại như chậu rửa mặt, bệt Inax, vòi sen, bình nóng lạnh...<br>- Tòa nhà có bảo vệ 24/24, đảm bảo an ninh tuyệt đối, giờ giấc ra vào thoải mái.<br>- Khu vực ban công phơi đồ riêng biệt của từng phòng.<br><br>* Tòa nhà nằm ở vị trí trung tâm, giao thông thuận tiện, cách mặt đường Xã Đàn 20m, nằm trong khuôn viên Tập Thể Học Viện Kỹ Thuật Quân Sự nên an ninh rất tốt, gần các trung tâm thương mại, lên phố cổ cũng gần, cách ngã tư Xã Đàn 300m...<br><br>Địa chỉ: Số 213 Xã Đàn- P. Phương liên- Q. Đống Đa.<br>LH C Hương 0978 335 871. -A Lượng 0982 9696 69.<br><br>2/ Căn hộ chung cư mini nội thất cao cấp tọa lạc trong tòa nhà 09 tầng, nằm ven hồ Rùa cách đường Trường Chinh 300m, đường vào 2 tô con tránh nhau, rất thuận tiện cho việc đi lại, sinh hoạt, vui chơi, giải trí.<br>- Lên phố cổ cũng gần, trung tâm thương mại ngay sát, gần bệnh viện Đại Học y, trường học, như trường ĐH như Kinh Tế Quốc Dân, ĐH Thủy Lợi, Nhân Văn, Ngoại Ngữ….<br>- Căn hộ rộng 45- 50m2 được lát sàn gỗ, căn nào cũng cửa sổ rộng, ban công phơi đồ riêng biệt nhìn sang hồ điều hòa, hít khí trời trong lành nên không độc hại. Căn hộ được thiết kế hết sức hợp lý, 1 phòng ngủ, 1 phòng khách, khu bếp có đầy đủ ánh sáng, gió và không khí vào phòng.<br><br>- Mỗi căn hộ được trang bị giường, cửa sổ có rèm Thái Tuấn cực đẹp, trần thạch cao, đèn ngủ đủ cả, bàn bếp xịn, hút mùi, bồn rửa bát xịn.<br><br>- Nhà vệ sinh có thiết bị vệ sinh inax cao cấp, ốp lát gạch Prime sang trọng, mỗi nhà vệ sinh đều được trang bị bình Nóng Lạnh Ariston loại xin mới tinh..<br><br>Giá cho thuê: 4.500.000đ- 5.500.000đ/căn/tháng (thanh toán tối thiểu 03 tháng và đặt cọc 01 tháng). Hộ nào thanh toán 6 tháng trở lên sẽ được ưu đãi giảm giá.<br><br>Phí dịch vụ:<br>- Điện: 3.500 đồng/số. Nước: 30.000 đồng/khối. Internet: 100.000 đồng/phòng (cáp quang).<br>- Bảo vệ 24/7 Gửi xe miễn phí.<br>- Tòa nhà trang bị thang máy cao cấp, máy giặt, truyền hình cáp miễn phí, mỗi căn hộ được cấp thẻ từ thang máy riêng.<br>- Tòa nhà có bảo vệ 24/24 nên an ninh cực ổn, ra vào thoải mái, nhà để xe rộng rãi gần 200m2, có thể chứa được đến 80 chiếc xe máy.<br>- Thích hợp hộ gia đình kèm theo người giúp việc hoặc ông bà ở cùng, người đi làm, sinh viên ngoan...<br>+ Địa chỉ: Số nhà 78 mặt đường Hồ Rùa-Ngõ 155(đường Nguyễn Lân) - Phố Trường Chinh– Đống Đa- HN.<br>Liên hệ chủ nhà A Lượng 0982 9696 69/ Chị Hương 0978 335 871.</div>', '', 1, 0, '{\"0\":\"21.0138313\",\"1\":\"105.8341259\"}', 1, 0, '2019-05-14 21:32:59', '2019-05-14 21:32:59');
INSERT INTO `motelrooms` VALUES (590, 'Tìm nữ ở ghép số 2, ngõ 1150 Đường Láng', 'tim-nu-o-ghep-so-2-ngo-1150-duong-lang', 2800000, 32.0000, 1, 6, 183, 'số 2 - ngõ 1150 - Đường Láng - Đống Đa - Hà Nội, Đường Láng, Đống Đa, Hà Nội', '0945200675', 4, 'Khép kín', '{\"0\":\"tim-nu-o-ghep-so-2-ngo-1150-duong-lang-1487239882oddhr-9lecy.jpg\",\"1\":\"tim-nu-o-ghep-so-2-ngo-1150-duong-lang-1487239882oddhr-vrt7c.jpg\",\"2\":\"tim-nu-o-ghep-so-2-ngo-1150-duong-lang-1487239882oddhr-6scl8.jpg\"}', '<div class=\"dis-content\">CẦN TÌM NỮ Ở GHÉP<br>Nhà mình hiện đang có 2 chị em ở cùng nhau, đã đi làm, muốn tìm thêm 1 hoặc nhiều lắm là 2 bạn nữ ở ghép.<br>Địa chỉ: Số nhà 2, ngõ 1150 đường Láng (gần siêu thị Trần Anh). Nhà gần đường lớn, bến xe bus, ngõ rộng 2 ô tô tránh nhau thoải mái, ngay ngõ Công an phường nên vô cùng an ninh đảm bảo.<br>Phòng đẹp, rộng rãi, khép kín, có 2 cửa sổ 2 hướng ánh sáng tự nhiên, phòng tầng 3, thoáng mát, để xe tầng 1 không mất phí. <br>Mặc dù ở chung chủ nhưng chủ nhà rất tốt dễ tính, thoải mái mình ở đây hơn 2 năm rồi mà không hề có ý định chuyển đi.<br>Phòng có sẵn tủ gỗ để quần áo, quạt, nóng lạnh, sân phơi đồ riêng. <br>Tiền nhà: 2,8 trđ/1 tháng, đóng 1 tháng 1 lần. <br>Điện: 3500đ/1 số, Nước: 90k/ 1 người,Net: 50k/ 1 phòng<br>Bạn nào có nhu cầu liên hệ xem phòng nhé: Yến 0945 200 675</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCIsIjMiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCJ9', 1, 0, '{\"0\":\"21.0140057\",\"1\":\"105.8067337\"}', 1, 0, '2019-05-14 21:33:13', '2019-05-14 21:33:13');
INSERT INTO `motelrooms` VALUES (591, 'Cho thuê phòng trọ số  18, Ngõ 68/53/16 Cầu Giấy, ', 'cho-thue-phong-tro-so-18-ngo-685316-cau-giay', 1800000, 12.0000, 1, 16, 16, 'Số  18, Ngõ 68/53/16 , Cầu Giấy, Cầu Giấy, Hà Nội', '0983243991', 3, 'Chưa xác định', '{\"0\":\"cho-thue-phong-tro-so-18-ngo-685316-cau-giay-oerx0.jpg\",\"1\":\"cho-thue-phong-tro-so-18-ngo-685316-cau-giay-n7ebk.jpg\"}', '<div class=\"dis-content\"><br>- diện tích: 12m2 kèm phòng vệ sinh riêng<br>- ngõ rộng, an ninh, gần chợ (cách 20m)<br>- phòng tắm trong phòng, biệt lập, sạch sẽ<br>- lối đi tách biệt chủ nhà, cầm chìa khoá riêng tự quản lý<br>- gần Đại học Giao thông vận tải (cách 300m), ĐH Ngoại Thương (cách 1,3km), Hv Ngoại giao, cách phố Dương Quảng Hàm 800m. <br>- Bến xe bus ngay đầu ngõ, cách đầu ngõ 68 chỉ 10m lol. Cách trung tâm bến xe trung chuyển DH GTVT chỉ 100m<br>- môi trường sạch sẽ thoáng mát, nhà mình mỗi lần cho thuê xong đều sửa sang sơn lại nên rất sạch sẽ, mới mẻ<br>- có thể ở 1-2 người, ở 3 người sẽ hơi chật <br>- nếu ở 2 người nhà mình offer mua giường tầng để các bạn tận dụng được diện tích phòng :) <br>- liên hệ: Yến - 0983243991<br>- Giá: 1,800,000/ tháng. Đóng 3 tháng.</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCIsIjMiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCJ9', 1, 0, '{\"0\":\"21.0362368\",\"1\":\"105.79058250000003\"}', 1, 0, '2019-05-14 21:33:17', '2019-05-14 21:33:17');
