INSERT INTO `motelrooms` VALUES (595, 'phòng trọ 1tr nguyễn ngọc vũ', 'phong-tro-1tr-nguyen-ngoc-vu', 1000000, 12.0000, 1, 6, 183, 'đầu Nguyễn Ngọc Vũ, Đường Láng, Đống Đa, Hà Nội', '0967847812', 2, 'Chung', '{\"0\":\"phong-tro-1tr-nguyen-ngoc-vu-jnkxg.jpg\"}', '<div class=\"dis-content\">hiện e/t (sn 97) đag ở 1 phòng ở đầu Nguyễn Ngọc Vũ, giá 1tr, phòng khá bé , vệ sinh chung nhưng sạch sẽ, phòng tắm ko tiện nghi, điện 4k nước chia theo đầu ng, mạng 50k 1 phòng, <br>mình tìm ng đã đi làm chỉ về ngủ buổi tối  hoặc bạn nào sn 98, + mình đã nói rõ điều kiện (ko tiện nghi lắm nhưnh phòng giá rẻ &amp; sạch sẽ là do mình)<br>nên chị nào cân nhắc kĩ thì ib/zalo cho e (vui lòng ko gọi điện)  để xem ảnh phòng</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IkludGVybmV0In0=', 1, 0, '{\"0\":\"21.0108512\",\"1\":\"105.80953\"}', 1, 0, '2019-05-14 21:34:04', '2019-05-14 21:34:04');
