INSERT INTO `motelrooms` VALUES (601, 'Cho thuê phòng trọ số 4, Ngõ 250 Khương Trung ', 'cho-thue-phong-tro-so-4-ngo-250-khuong-trung', 1700000, 15.0000, 1, 2, 63, 'Số 4, Ngõ 250, Khương Trung, Thanh Xuân, Hà Nội', '01233167176', 2, 'Chưa xác định', '{\"0\":\"cho-thue-phong-tro-so-4-ngo-250-khuong-trung-1487138210kzqju-qrqey.jpg\"}', '<div class=\"dis-content\">hết tháng mình còn 2 phòng cho thuê, điều hòa, nóng lạnh đầy đủ, ở chung với gia đình mình, k quản lý giờ giấc tự do thoái mái, các bạn có chìa khóa đi đi về về tự mở.<br>- phòng to có ban công nhìn ra hồ 2tr5 ở được 3 đến 4 người <br>- phòng nhỏ 1tr7 ở được 2 người.<br>- có Fix nhé các bạn <br>- nhà 5 tầng, tầng 1 để xe, tầng 2 bếp, cho thuê tầng 3 và 4, tầng 5 phơi giặt quần áo.<br>- Điện 4k / 1số, nc 100 / 1ng, mạng / 100 tháng<br>- Đc số 4 ngõ 250 khương trung (cũ) <br>- ĐT: 0919. 730 .994 -------- 01233. 167. 176</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCIsIjMiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCJ9', 1, 0, '{\"0\":\"20.995772\",\"1\":\"105.81575900000007\"}', 1, 0, '2019-05-14 21:34:51', '2019-05-14 21:34:51');
INSERT INTO `motelrooms` VALUES (602, 'Cho thuê phòng tại Số 16, Ngách 43, Ngõ 337, Cầu Giấy ', 'cho-thue-phong-tai-so-16-ngach-43-ngo-337-cau-giay', 2800000, 28.0000, 1, 16, 16, 'Số 16, Ngách 43, Ngõ 337, Cầu Giấy, Cầu Giấy, Hà Nội', '0934576604', 9, 'Khép kín', '{\"0\":\"cho-thue-phong-tai-so-16-ngach-43-ngo-337-cau-giay-7pitq.jpg\",\"1\":\"cho-thue-phong-tai-so-16-ngach-43-ngo-337-cau-giay-rcgth.jpg\",\"2\":\"cho-thue-phong-tai-so-16-ngach-43-ngo-337-cau-giay-qo5dd.jpg\",\"3\":\"cho-thue-phong-tai-so-16-ngach-43-ngo-337-cau-giay-eiqwf.jpg\"}', '<div class=\"dis-content\">Cho thuê phòng trọ xây mới gia chi tu 2.8tr có gác xép xây mới số 16 ngách 43 ngõ 337 Cầu Giấy <br>Căn phòng toilet KHEP KIN (gương, bồn rửa tay, vòi sen, bồn vệ sinh - hoàn toàn chưa qua sử dụng).<br>- Có kệ bếp nắm riêng biệt.<br>- Có wifi.<br>- Có nơi phơi đồ.<br>- Có nóng lạnh Aniston 20l mới 100%.<br>- Có thang máy (hàng Nhật nhập nguyên bản).<br>Có bảo vệ và camera giám sát 24/24h, có lối đi riêng và nhà xe riêng.<br>Khu an ninh, yên tĩnh,<br>Địa thế căn nhà: Cách đường Cầu Giấy 300m, chợ 337 Dịch Vọng 300m, Cách công viên Cầu Giấy 500m, cách đường Trần Thái Tông và khu Duy Tân 300m. Giao thông thuận tiện.<br>Xung quanh nhà có nhiều trạm xe bus.<br>Đây là khu dân trí cao nhất quận Cầu Giấy. Hàng quán, siêu thị, khu vui chơi giải trí...<br>Phòng có giếng trời, cửa sổ, ban công. Bảo đảm thoáng mát.<br>Giá phòng và diện tích phòng tính cả gác xép.<br>1/ 3.2tr/th: Phòng 35m28<br>2/ 2.8tr/th : phòng 28m2.<br>3/ 3500/số điện, 26000/ khối nước <br>Lưu ý: Quý khách muốn tới xem phòng xin gọi điện trước <br>Với lại đây là nhà mình, chủ trương của mình là vui vẻ, thoải mái.<br>Số DĐ cua minh : 0934576604</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJUaGFuZyBtXHUwMGUxeSIsIjMiOiJJbnRlcm5ldCJ9', 1, 0, '{\"0\":\"21.0362368\",\"1\":\"105.79058250000003\"}', 1, 0, '2019-05-14 21:34:54', '2019-05-14 21:34:54');
INSERT INTO `motelrooms` VALUES (603, 'Tìm nữ ở ghép tại Ngõ 78, Giải Phóng', 'tim-nu-o-ghep-tai-ngo-78-giai-phong', 2200000, 20.0000, 1, 45, 31, 'Ngõ 78, Giải Phóng, Hai Bà Trưng, Hà Nội', '01639014816', 3, 'Chung', '{\"0\":\"tim-nu-o-ghep-tai-ngo-78-giai-phong-egofh.jpg\",\"1\":\"tim-nu-o-ghep-tai-ngo-78-giai-phong-gjplw.jpg\",\"2\":\"tim-nu-o-ghep-tai-ngo-78-giai-phong-jmtd8.jpg\"}', '<div class=\"dis-content\">Tìm người ở Ghép.<br>Mình hiện đang ở ngõ 78, đường Giải Phóng cần tìm người ở ghép trong tháng 3 này. Nhà tập thể ở tầng 2, có 2 phòng ở và một phòng khách, đầy đủ các tiện nghi: điều hoà, nóng lạnh, máy giặt, có chỗ nấu ăn và tiền điện nước tự chia nhanh thanh toán theo giá nhà dân (rất rẻ). Giá phòng 2tr2, ngay gần mặt đường giải phóng chỗ chân cầu vượt ngã tư vọng nên đi đâu cũng tiện. Giờ giấc thoải mái. Mình cần tìm 1-2 người đã đi làm thuê cùng cho tiện vì mình đã đi làm. Ai cần thì liện hệ mình théo sđt: 01639014816.</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCIsIjMiOiJcdTAxMTBpXHUxZWMxdSBoXHUwMGYyYSIsIjQiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCIsIjUiOiJNXHUwMGUxeSBnaVx1MWViN3QifQ==', 1, 0, '{\"0\":\"20.9991332\",\"1\":\"105.84021849999999\"}', 1, 0, '2019-05-14 21:34:57', '2019-05-14 21:34:57');
INSERT INTO `motelrooms` VALUES (604, 'Nhượng lại phòng trọ tại Số 12, Ngõ 1, Phạm Văn Đồng', 'nhuong-lai-phong-tro-tai-so-12-ngo-1-pham-van-dong', 2800000, 20.0000, 1, 16, 32, ' Số 12, Ngõ 1, Phạm Văn Đồng, Cầu Giấy, Hà Nội', '0985086293', 3, 'Khép kín', '{\"0\":\"nhuong-lai-phong-tro-tai-so-12-ngo-1-pham-van-dong-zbuzf.jpg\",\"1\":\"nhuong-lai-phong-tro-tai-so-12-ngo-1-pham-van-dong-hzn17.jpg\",\"2\":\"nhuong-lai-phong-tro-tai-so-12-ngo-1-pham-van-dong-n4nal.jpg\",\"3\":\"nhuong-lai-phong-tro-tai-so-12-ngo-1-pham-van-dong-dlvmx.jpg\"}', '<div class=\"dis-content\">Cuối tháng mình chuyển nhà nên muốn nhượng nhà cũ cho bạn nào có nhu cầu<br>Diện tích khoảng xấp xỉ 30mv<br>Có hai phòng, ở được từ 3-5 người hoặc hộ gia đình thuê, giường 1-2 hoặc giường tầng theo yêu cầu. Phòng trên tầng 5, có nóng lạnh, điều hoà cần lắp chủ nhà sẽ lắp . Cửa cách âm, thoáng mát kho ráo<br>Bảo vệ 24/24 an ninh cực tốt<br>giá thuê : 2,8tr / tháng <br>Liên hệ : 0985086293 <br>Địa chỉ Số 12 ngõ 1 Phạm Văn Đồng, gần cầu vượt Mai Dịch</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCIsIjMiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCJ9', 1, 0, '{\"0\":\"21.042437\",\"1\":\"105.78001500000005\"}', 1, 0, '2019-05-14 21:35:00', '2019-05-14 21:35:00');
