INSERT INTO `motelrooms` VALUES (607, 'Cho thuê phòng trọ số 34, Ngõ 72 Nguyễn Trãi', 'cho-thue-phong-tro-so-34-ngo-72-nguyen-trai', 3000000, 22.0000, 1, 2, 56, 'Số 34, Ngõ 72, Nguyễn Trãi, Thanh Xuân, Hà Nội', '0988567595', 3, 'Chưa xác định', '{\"0\":\"cho-thue-phong-tro-so-34-ngo-72-nguyen-trai-budor.jpg\"}', '<div class=\"dis-content\">Cho thuê phòng khép kín 22m2. Đầy đủ tiện nghi ( bình nóng lạnh , có chỗ nấu ăn dưới tầng 1, phơi quần áo trên tầng 5) <br>Không chung chủ , giá điện nước hộ gia đình nên rất rẻ ạ . Đi lại thoải mái có chìa khoá riêng , không giới hạn giờ giấc. <br>Gần royal city , gần đường lớn , chợ , trường học . <br>Địa chỉ ngõ 72 nguyễn trãi .<br>Giá : 3tr/tháng ( ở 2-3 người ,giá có thương lượng cho 1 người ở )<br>Liên hệ 0988567595</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCIsIjMiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCJ9', 1, 0, '{\"0\":\"20.996745\",\"1\":\"105.80929500000002\"}', 1, 0, '2019-05-14 21:35:32', '2019-05-14 21:35:32');
INSERT INTO `motelrooms` VALUES (608, 'Cho thuê phòng chung cư tại Toà CT1 The pride, Khu đô thị mới An Hưng, La khê, Hà Đông ', 'cho-thue-phong-chung-cu-tai-toa-ct1-the-pride-khu-do-thi-moi-an-hung-la-khe-ha-dong', 2500000, 20.0000, 1, 21, 0, 'Toà CT1 The pride, Khu đô thị mới An Hưng, Hà Đông, Hà Nội', '0934429362', 1, 'Chung', '{\"0\":\"no_img_room.png\"}', '<div class=\"dis-content\">Căn hộ nhà mình thuộc khu HÀ ĐÔNG trong căn có 3 ngủ . Hiện đang cho khách thuê 2 phòng đang còn trống 1phòng do có ng mới chuyển đi. Phòng sạch sẽ thoáng , cửa sổ to view đẹp. <br>Khu căn hộ cao cấp, dịch vụ thì siêu tiện : Hầm gửi xe máy ô tô, TAXI sảnh 1, Phòng GYm tầng 5 , sờ pa mát xa mát gần Salon các kiểu cũng nhiều max nhiều phục vụ các anh chị em có nhu cầu làm đẹp luôn, siêu thị tầng 1 ,chợ cách 100 mét, nhà hàng ăn uống tâng 1 có luôn. Cần gì nhấc điện thoại lên gọi là đồ ăn đồ uống giấy má lên tận cửa chỉ việc ôm ví ra cửa trả xiền hoy.<br>Ai có nhu cầu ở cùng bên trong căn hộ thi g cho m để m đưa qua xem phòng ( CHÍNH CHỦ k cò quay gì nha). Mọi thứ trong nhà sử dụng như nhà mình nên yên tâm nhé. Ti vi bếp tủ lạnh máy giặt nóng lạnh gi gỉ gì gi cái gì có tất. Chỉ cần mua thêm bộ ga gối chăn, xách đồ qua ở thôi. Tủ quần áo mua thì mua k mua thì biết như nào r đấy .... mặc ít thôi khỏi phải thay nhiều... Ahihi. Phòng này nhà mình k hỗ trợ tủ quần áo đâu nhé....<br>Số lượng : 1 người/phòng<br>YÊU CẦU : sạch sẽ gọn gàng ,ý thức,<br>Gía cho thuê : 2 500 000đ - CHƯA BAO GỒM phí dịch vụ ĐIỆN, NƯỚC, MẠNG CAB. Phí dịch vụ tính theo hóa đơn chia số phòng số người.( Khoảng trên dưới 3 triêu là full).<br>Hình thức thanh toán: Thanh toán tiền nhà 3 tháng cọc 1 tháng<br>Địa chỉ : Toà CT1 The pride - Khu đô thị mới An Hưng. Phường La khê Hà đông -Hn<br>Cứ qua mà xem thực tế chứ hình ảnh chỉ mang tính chất KHOE nhà đang dư phòng có phòng cho thuê. AHIHI. <br>Dt : 0934429362 gặp HƯỜNG<br>Chủ nhà dễ tính nên giai gái ở đều oke hết.<br>Không thuê k nói lời cay đắng</div>', '', 1, 0, '{\"0\":\"20.955835\",\"1\":\"105.75636580000003\"}', 1, 0, '2019-05-14 21:35:47', '2019-05-14 21:35:47');
INSERT INTO `motelrooms` VALUES (609, 'Cho thuê phòng trọ tại 18/33, Ngõ 162, Khương Đình, Thanh Xuân, Hà Nội.', 'cho-thue-phong-tro-tai-1833-ngo-162-khuong-dinh-thanh-xuan-ha-noi', 1800000, 18.0000, 1, 2, 89, '18/33, Ngõ 162, Khương Đình, Thanh Xuân, Hà Nội', '0914210788', 3, 'Chung', '{\"0\":\"cho-thue-phong-tro-tai-1833-ngo-162-khuong-dinh-thanh-xuan-ha-noi-ixhs8.jpg\"}', '<div class=\"dis-content\">Cho thuê phòng trọ tầng 2 - Ngã tư sở - Chỉ cho nữ thuê.<br>Phòng sạch sẽ, đẹp đẽ, an ninh tốt, yên tĩnh, có chỗ để xe. Các phòng còn lại toàn người đi làm, hộ gia đình, khu trọ dân trí cao.<br>Phòng 2 cửa sổ, 1 cửa ra vào. Vệ sinh ở ngoài, có chỗ nấu ăn bên ngoài.<br>Giá: 1.800.000 VNĐ <br>Điện 4k, nước 60k/ người<br>Phòng rộng 18m2, ở được 2-3 người thoải mái, có điều hòa, nóng lạnh. <br>địa chỉ: 18/33 ngõ 162 khương đình, thanh xuân, HN.<br>Cách Royal City 200m, cách đại học công đoàn, thủy lợi 1km.<br>Giới hạn giờ đi chơi về 23h30<br>Liên hệ: 0914210788<br>Ảnh minh họa</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCIsIjMiOiJcdTAxMTBpXHUxZWMxdSBoXHUwMGYyYSIsIjQiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCJ9', 1, 0, '{\"0\":\"20.9963836\",\"1\":\"105.81384309999999\"}', 1, 0, '2019-05-14 21:35:52', '2019-05-14 21:35:52');
INSERT INTO `motelrooms` VALUES (610, 'Cho thuê phòng CCMN tại Toà chung cư Kim Văn Kim Lũ, Nguyễn Xiển', 'cho-thue-phong-ccmn-tai-toa-chung-cu-kim-van-kim-lu-nguyen-xien', 2500000, 25.0000, 1, 57, 60, 'Toà chung cư Kim Văn Kim Lũ, Nguyễn Xiển, Hoàng Mai, Hà Nội', '0944792593', 2, 'Chung', '{\"0\":\"cho-thue-phong-ccmn-tai-toa-chung-cu-kim-van-kim-lu-nguyen-xien-3yklm.jpg\"}', '<div class=\"dis-content\">CHO THUÊ PHÒNG CHUNG CƯ<br>Cho thuê phòng ở duoc ngay và luôn giá 2,5 triệu. ( đặt cọc 1 tháng, đóng 3 tháng 1) . Ở đc 1-2 người<br>Căn ho chung cư 2 phòng ngủ, 2 phòng vệ sinh,1pK,1ban công. Còn trống 1 phòng nên cho thuê giá 2tr5<br>Địa chỉ: toà chung cư kim văn kim lũ, nguyễn xiển gần đh thăng long, gần khu đt linh làm,bx giáp bát...<br>Phòng đã có tủ quần áo, chăn màn,quạt...<br>Điện, nước giá nhà nước<br>Hầm để xe may 80k/thang) sạch sẽ, gần chợ, siêu thị dưới sảnh.<br>ĐỒ DÙNG SẴN CÓ: BÌNH NÓNG LẠNH, TỦ LẠNH, MÁY GIẶT<br>CHỈ VIỆC XÁCH VALI ĐẾN Ở<br>Liên hệ: 0944792593 hoặc ib<br>P/s: chỉ cho nữ ở</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCJ9', 1, 0, '{\"0\":\"20.9735108\",\"1\":\"105.8206103\"}', 1, 0, '2019-05-14 21:35:53', '2019-05-14 21:35:53');
