INSERT INTO `motelrooms` VALUES (612, 'Phòng đủ đồ tiện sinh hoạt chung cư mini số 29/229 Nguyễn Văn Linh - Q.Long Biên', 'phong-du-do-tien-sinh-hoat-chung-cu-mini-so-29229-nguyen-van-linh-qlong-bien', 2800000, 20.0000, 1, 8, 51, 'Chung cư mini 7 tầng, số 29 ngõ 229 Nguyễn Văn Linh – Phúc Đồng, Q. Long Biên., Nguyễn Văn Linh, Long Biên, Hà Nội', '0904748688', 3, 'Khép kín', '{\"0\":\"phong-du-do-tien-sinh-hoat-chung-cu-mini-so-29229-nguyen-van-linh-qlong-bien-o8bor.jpg\",\"1\":\"phong-du-do-tien-sinh-hoat-chung-cu-mini-so-29229-nguyen-van-linh-qlong-bien-bu2ew.jpg\",\"2\":\"phong-du-do-tien-sinh-hoat-chung-cu-mini-so-29229-nguyen-van-linh-qlong-bien-9wzxw.jpg\",\"3\":\"phong-du-do-tien-sinh-hoat-chung-cu-mini-so-29229-nguyen-van-linh-qlong-bien-alvc7.jpg\",\"4\":\"phong-du-do-tien-sinh-hoat-chung-cu-mini-so-29229-nguyen-van-linh-qlong-bien-adtv4.jpg\",\"5\":\"phong-du-do-tien-sinh-hoat-chung-cu-mini-so-29229-nguyen-van-linh-qlong-bien-6oqzj.jpg\"}', '<div class=\"dis-content\">Gia đình mình còn 1 phòng đủ đồ trên tầng 3 có thang máy<br>Địa chỉ: Chung cư mini 7 tầng, số 29 ngõ 229 Nguyễn Văn Linh – Phúc Đồng, Q. Long Biên.<br>Ngay sát chân cần Vĩnh Tuy, cách Aeon Mall 1km, cách BigC Long Biên , Vincom Long Biên 1km, gần chợ, cạnh nhà là cửa hàng tạp hóa, cách điểm dừng xe bus 40,11… 200m.<br>Diện tích sử dụng &gt; 20m2<br>Trong phòng đã có sẵn ĐIỀU HÒA, NÓNG LẠNH, GIƯỜNG, TỦ QUẦN ÁO 2 BUỒNG, TIVI VÀ KỆ TIVI, TỦ LẠNH, KHU BẾP VÀ BUỒNG TẮM RIÊNG (mình xin lỗi vì không có ảnh đồ cụ thể, ảnh trong bài chỉ là ảnh phòng cơ bản), đảm bảo sinh hoạt hoàn toàn riêng biệt không chung đụng với ai<br>Mỗi phòng được để 01 xe máy ở tầng 1<br>Giờ giấc tự do, camera an ninh, để xe tầng 1. <br>GIÁ THUÊ : 2.8 TRIỆU/ THÁNG , cọc 1 tháng, thanh toán mỗi tháng một lần, hợp đồng ít nhất nửa năm<br>Điện 3.200/Số - Nước 30.000/ khối<br>Internet wifi 100.000đ/ tháng nếu dùng<br>Liên lạc với chủ nhà: Hưng 0904748688.</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUw