INSERT INTO `motelrooms` VALUES (613, 'Tìm người ở ghép tại Ngõ 110, Trần Duy Hưng ', 'tim-nguoi-o-ghep-tai-ngo-110-tran-duy-hung', 2200000, 20.0000, 1, 16, 390, 'Ngõ 110, Trần Kim Xuyến, Cầu Giấy, Hà Nội', '01639713534', 3, 'Khép kín', '{\"0\":\"tim-nguoi-o-ghep-tai-ngo-110-tran-duy-hung-01y6e.jpg\",\"1\":\"tim-nguoi-o-ghep-tai-ngo-110-tran-duy-hung-uuknk.jpg\",\"2\":\"tim-nguoi-o-ghep-tai-ngo-110-tran-duy-hung-klvjw.jpg\"}', '<div class=\"dis-content\">Em đăng lại để tìm người ở ghép luôn trong tháng này ạ<br>Địa chỉ ngõ 110 Trần Duy Hưng <br>Giá phòng 2tr2 <br>Mạng 70k<br>Nước 50k<br>Điện 4k <br>Phòng tầng 4, phơi đồ tầng 5 <br>Phòng có đầy đủ điều hòa, nóng lạnh, máy giặt, tủ lạnh <br>Nói chung các bạn chỉ cần xách quần áo vào ở thôi<br>Chung chủ, ac chủ nhà thoải mái <br>Tìm nữ ở ghép, thật thà vui tính :))<br>Phòng này mình ở 3 năm rồi đấy ạ, bạn kia về quê làm việc nên mới phải tìm ở ghép thôi <br>P/s nhà chỉ có một phòng cho thuê thôi ạ<br>call 01639 713 534 để xe phòg</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCIsIjMiOiJcdTAxMTBpXHUxZWMxdSBoXHUwMGYyYSIsIjQiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCJ9', 1, 0, '{\"0\":\"21.0180609\",\"1\":\"105.79606460000002\"}', 1, 0, '2019-05-14 21:36:32', '2019-05-14 21:36:32');
