INSERT INTO `motelrooms` VALUES (616, 'Cho thuê phòng trọ tại Ngõ 14, Tân Triều, Thanh Trì, Hà Nội', 'cho-thue-phong-tro-tai-ngo-14-tan-trieu-thanh-tri-ha-noi', 2100000, 20.0000, 1, 28, 95, ' Ngõ 14, Tân Triều, Thanh Trì, Hà Nội', '0983322285', 3, 'Khép kín', '{\"0\":\"cho-thue-phong-tro-tai-ngo-14-tan-trieu-thanh-tri-ha-noi-k0kuk.jpg\"}', '<div class=\"dis-content\">Cho thuê 02 phòng trọ khép kín diện tích 20m2 (ở tầng 2 và tầng 3), trong nhà 4 tầng. Ngõ tõ xe tải 1,25 tấn đỗ cửa. (MTG)<br>Tại ngõ 14 Tân Triều, gần UBND Tân Triều mới.<br><br>Phòng tầng 2 (có điều hòa): 2,3 tr - max 3 người.<br>Phòng tầng 3: 2,1 tr - max 3 người (2,4 max 4)<br>(Đến trao đổi cụ thể để có sự điều chỉnh).<br><br>Sạch sẽ, sáng thoáng, an ninh yên tĩnh.<br>Bình nóng lạnh, internet, VTVCab, điều hòa, tủ bếp, hút mùi bếp, bếp ga.<br>Riêng chủ, giờ giấc tự quản, cho thuê lâu dài.<br><br>Cách ĐH CN GTVT 1 km, ĐH DL Thăng Long 1 km, HV Mật Mã 1 km,...<br>Cách đường Nguyễn Xiển 300m, đường Nguyễn Trãi 1,2km.<br>Gần nhiều chợ, siêu thị, nhiều trường Mầm non, cấp 1.<br><br>Tầng 1 là 50m2, làm không gian dùng chung, để xe và nấu nướng.<br>Tầng 2, 3 và 4 là các phòng ở và wc (có hút mùi).<br>Tầng 4 rộng 25m2 có sân phơi, khu để máy giặt, để bếp nấu, để bàn ghế ăn uống.<br><br>Lh: 0915982013 - 0983322285. Miễn trung gian.<br></div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCIsIjMiOiJcdTAxMTBpXHUxZWMxdSBoXHUwMGYyYSIsIjQiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCJ9', 1, 0, '{\"0\":\"20.9975217\",\"1\":\"105.8174027\"}', 1, 0, '2019-05-14 21:37:24', '2019-05-14 21:37:24');
