o-thue-chung-cu-mini-phong-ngu-phong-khach-day-du-tien-nghi-tai-96-la-thanh-1486573651d3kyy-i5kfd.jpg\"}', '<div class=\"dis-content\"><strong>1/ Tòa chung cư mini tại số 96 Đê La Thành.</strong><br>- Diện tích các căn hộ từ <strong>35m2 - 45m2 - 50m2.</strong> Giá cho thuê từ 5.000.000đ - 5.000.000đ - 6.500.000đ - 7.500.000 đ/căn.<br>- Thanh toán tối thiểu 3 tháng + đặt cọc 2 tháng.<br>Các căn hộ bao gồm:<br>+ 1 phòng ngủ riêng biệt có cửa sổ thông thoáng được trang bị điều hòa 2 chiều, giường, tủ quần áo.<br>+ 1 phòng khách cũng có thể bố trí làm phòng ngủ nếu nhà có đông người.<br>+ Phòng bếp được trang bị bàn ăn, bàn bếp, tủ bếp, chậu rửa bát, hút mùi….<br>+ Khu vực nhà vệ sinh được lắp đầy đủ thiết bị hiện đại như chậu rửa mặt, bệt Inax, vòi sen, bình nóng lạnh...<br>+ Có ban công riêng biệt từng căn hộ và khu vực phơi đồ và để máy giặt.<br>- Tiện ích: Tòa nhà có bảo vệ 24/24, đảm bảo an ninh tuyệt đối, giờ giấc ra vào thoải mái.<br>Thang máy cao cấp, mỗi hộ gia đình có thẻ từ sử dụng riêng, internet cáp quang, miễn phí tuyền hình cáp, miễn phí máy giặt.<br>- Tòa nhà nằm ở vị trí trung tâm, giao thông thuận tiện, cách mặt đường La Thành 10m, gần hồ Hoàng Cầu, không khí thoáng mát trong lành, gần các trung tâm thương mại, đi lại vào phố cổ rất thuận tiện...<br>- Ưu tiên cho hộ gia đình, người đi làm thuê ở.<br><br>Địa chỉ: <strong>Số 96 Đê La Thành - Ô Chợ Dừa - Đống Đa - HN.</strong><br>Liên hệ: Anh Lượng 0982 9696 69 - chị Hương 0978 335 871.<br><br><strong> 2/ </strong><strong>Tòa chung cư mini 8 tầng tại số 67 ngõ 39 phố Hào Nam.</strong><br>- Diện tích các phòng từ 35m2 - 45m2 - 50m2.<br>Giá cho thuê từ <strong>5.000.000đ - 6.500.000 đ/th- 7.500.000 đ/th</strong>, các căn hộ bao gồm:<br>+ Loại: 1 phòng ngủ + phòng khách và bếp, DT: 30m2.<br>+ Loại: 2 phòng ngủ + 1 phòng khách + phòng bếp, DT: 45m2 - 50m2.<br>- Phòng ngủ được trang bị điều hòa 2 chiều, giường, tủ quần áo...<br>- Phòng bếp được trang bị bàn ăn, bàn bếp, tủ bếp, chậu rửa bát, hút mùi...<br>- Khu vực nhà vệ sinh được lắp đầy đủ thiết bị hiện đại như chậu rửa mặt, bệt Inax, vòi sen, bình nóng lạnh...<br>- Tòa nhà có bảo vệ 24/24, đảm bảo an ninh tuyệt đối, giờ giấc ra vào thoải mái.<br><br>* Miễn phí các dịch vụ như: Gửi xe miễn phí, thang máy cao cấp, internet cáp quang, miễn phí tuyền hình cáp, miễn phí máy giặt.<br><br>* Tòa nhà nằm ở vị trí trung tâm, giao thông thuận tiện, cách mặt đường La Thành 10m, gần hồ Hoàng Cầu, không khí thoáng mát trong lành, gần các trung tâm thương mại, đi lại vào phố cổ rất thuận tiện....<br>Địa chỉ:<strong> Số nhà 67 ngõ 39 phố Hào Nam, P. Ô Chợ Dừa - Q. Đống Đa. Hoặc ngõ 318 Đê La Thành</strong>.<br>LH <strong>A Lượng 0982 9696 69 - C Hương 0978 335 871.</strong></div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJUaGFuZyBtXHUwMGUxeSIsIjMiOiJJbnRlcm5ldCIsIjQiOiJcdTAxMTBpXHUxZWMxdSBoXHUwMGYyYSIsIjUiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCIsIjYiOiJNXHUwMGUxeSBnaVx1MWViN3QiLCI3IjoiVHJ1eVx1MWVjMW4gaFx1MDBlY25oIGNcdTAwZTFwIn0=', 1, 0, '{\"0\":\"21.0236543\",\"1\":\"105.82276509999997\"}', 1, 0, '2019-05-14 21:38:49', '2019-05-14 21:38:49');
