'<div class=\"dis-content\">Tòa nhà 9 tầng tại số 78 ngõ 155 Trường Chinh:<br>- Nằm ven hồ Rùa cách đường Trường Chinh 300m , ra ngã Tư Sở 3 phút đi xe máy, đường vào rộng, 2 tô con tránh nhau, rất thuận tiện cho việc đi lại, sinh hoạt, vui chơi, giải trí. Lên phố cổ cũng gần, trung tâm thương mại ngay sát, gần Trường Đại Học Y, trường ĐH Kinh Tế Quốc Dân, ĐH Thủy Lợi, Nhân Văn, Ngoại Ngữ….<br><br>- Căn hộ rộng 45m2 - 50m2 được lát sàn gỗ, căn nào cũng cửa sổ rộng, ban công phơi đồ riêng biệt nhìn sang hồ điều hòa, hít khí trời trong lành nên không độc hại. Căn hộ được thiết kế hết sức hợp lý, 1 phòng ngủ, 1 phòng khách, khu bếp có đầy đủ ánh sáng, gió và không khí vào phòng.<br><br>- Mỗi căn hộ được trang bị giường, cửa sổ có rèm Thái Tuấn cực đẹp, trần thạch cao, đèn ngủ đủ cả, bàn bếp xịn, hút mùi, bồn rửa bát xịn.<br>- Nhà vệ sinh có thiết bị vệ sinh Inax cao cấp, ốp lát gạch Prime sang trọng.<br>Giá cho thuê: 5.000.000 đ - 5.500.000đ/căn/tháng (thanh toán tối thiểu 03 tháng và đặt cọc 01 tháng).<br>- Bảo vệ 24/24, gửi xe miễn phí.<br>- Tòa nhà trang bị thang máy cao cấp, máy giặt, truyền hình cáp miễn phí, mỗi căn hộ được cấp thẻ từ thang máy riêng.<br>- Tòa nhà có bảo vệ 24/24 nên an ninh cực ổn, ra vào thoải mái, nhà để xe rộng rãi gần 200m2, có thể chứa được đến 50 chiếc xe máy.<br>+ Địa chỉ: Số nhà 78 mặt đường Hồ Rùa, ngõ 155 đường Trường Chinh – Đống Đa - HN.<br>Liên hệ chủ nhàChị Hương 0978 335 871./A Lượng 0982 9696 69 . </div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJUaGFuZyBtXHUwMGUxeSIsIjMiOiJJbnRlcm5ldCIsIjQiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCIsIjUiOiJNXHUwMGUxeSBnaVx1MWViN3QiLCI2IjoiVHJ1eVx1MWVjMW4gaFx1MDBlY25oIGNcdTAwZTFwIn0=', 1, 0, '{\"0\":\"21.0180725\",\"1\":\"105.8299495\"}', 1, 0, '2019-05-14 21:38:55', '2019-05-14 21:38:55');
