ều thiết kế có cửa sổ thông thoáng.<br>Tòa nhà có thang máy, bảo vệ 24/24, an ninh đảm bảo, điện nước ổn định.<br>- Vị trí: Nhà nằm ở khu vực đông dân cư, dân trí cao, gần chợ, trường FPT, dân lập Lê Quý Đôn, mầm non Hoa Anh Đào, sát đô thị Mỹ Đình …cách đường Hàm Nghi 300m. Gần bến xe mỹ đình, đi lại thuận tiện...<br>Mặt đường trước cửa 5m, hai ô tô tránh nhau, phù hợp người đi làm, hộ gia đình trẻ có thêm ông bà hoặc giúp việc ở cùng.<br>- Giá cả linh hoạt, thanh toán tối thiểu 3 tháng + cọc 1 tháng.<br><br>- Địa chỉ: Số nhà 118 đường Nguyễn Đổng Chi - Quận Nam Từ Liêm (siêu thị thành đô rẽ vào hoặc đường Hàm Nghi đi vào). Hoặc gần khu đô thị Mỹ Đình 1 đi vào.<br>Liên hệ: Anh Lượng 0978 335 871./ 0982 9696 69. </div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCIsIjMiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCIsIjQiOiJUcnV5XHUxZWMxbiBoXHUwMGVjbmggY1x1MDBlMXAifQ==', 1, 0, '{\"0\":\"21.0385759\",\"1\":\"105.77150170000004\"}', 1, 0, '2019-05-14 21:38:58', '2019-05-14 21:38:58');
INSERT INTO `motelrooms` VALUES (623, 'Cho thuê phòng tại A52 TT5, Văn Quán, Hà Đông', 'cho-thue-phong-tai-a52-tt5-van-quan-ha-dong', 2500000, 25.0000, 1, 21, 174, ' A52 TT5, Văn Quán, Hà Đông, Hà Nội', '0988985605', 9, 'Chưa xác định', '{\"0\":\"no_img_room.png\"}', '<div class=\"dis-content\"> Chính chủ không mất phí môi giới. <br>Cho thuê phòng trong nhà liền kề 5 tầng khu đô thị Văn Quán, Hà Đông, Hà Nội. <br>Địa chỉ: A52 TT5 văn quán, Hà Đông (sau siêu thị Vinmart Văn Quán). <br>Gần học viện an ninh, học viện kỹ thuật Mật Mã, ĐH Kiến Trúc, bưu chính viễn thông, sư phạm nhạc hoạ... <br>- Còn 4 phòng rộng từ 20- 30m2, mỗi tầng 2 phòng 1 vệ sinh. <br>- Tiện ích đầy đủ: <br>Có nóng lạnh, máy giặt, giường ngủ 1.6m x2m, phòng mới, có cửa sổ, giá 2.5 tr/tháng. <br>- Có chỗ nấu ăn. <br>- Không chung chủ<br>- Thời gian đi lại thoải mái<br>- Chỗ để xe miễn phí ở tầng 1. <br>- Có internet wifi VNPT gói cáp quang dùng chung cả nhà. <br>- Có người vệ sinh lau dọn thường xuyên, đảm bảo không gian sống sạch sẽ. <br>- Điện có công tơ riêng 3.5 đ/số. <br>- Nước 80.000đ/ người. <br>- Thanh toán 01 tháng đặt cọc 1 tháng. <br>LH: <br>0915.130.898/ 0988.985.605.</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCIsIjMiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCIsIjQiOiJNXHUwMGUxeSBnaVx1MWViN3QifQ==', 1, 0, '{\"0\":\"20.9796446\",\"1\":\"105.79233939999995\"}', 1, 0, '2019-05-14 21:39:14', '2019-05-14 21:39:14');
INSERT INTO `motelrooms` VALUES (624, 'Cho thuê phòng tại 192, Kim Mã, Ba Đình, Hà Nội', 'cho-thue-phong-tai-192-kim-ma-ba-dinh-ha-noi', 3500000, 20.0000, 1, 14, 206, '192, Kim Mã, Ba Đình, Hà Nội', '0964057123', 9, 'Khép kín', '{\"0\":\"cho-thue-phong-tai-192-kim-ma-ba-dinh-ha-noi-kr36r.jpg\",\"1\":\"cho-thue-phong-tai-192-kim-ma-ba-dinh-ha-noi-iudux.jpg\"}', '<div class=\"dis-content\">Có bạn thuê nhà xong bùng nên mình đăng lại, k tiếp môi giới hay bạn nào k có ý định ở lâu dài nhé)<br>CHO THUÊ PHÒNG Ở 192 KIM MÃ<br>Mình cho thuê phòng tầng 2 vs 4 trong nhà 5 tầng, ưu tiên các bạn nữ đã đi làm, hoặc cặp vợ chồng có nhu cầu ở lâu dài, sạch sẽ và ý thức chung tốt. Không chung chủ. Nhà có sẵn máy giặt loại to, có thể cho dùng chung.<br>Nhà căn góc, 2 mặt thoáng nên phòng nào cũng có 2 cửa sổ to đẹp, rèm gỗ cao cấp. Nhà mới sơn sửa sạch đẹp, phòng lát sàn gỗ, trang bị nóng lạnh, điều hoà, quạt trần.<br>Tầng 1 để xe và bếp, tầng 5 phòng thờ và sân phơi. (Nếu ở tầng 4 thì có chỗ nấu ăn trên tầng 5). Tầng 2,3,4 mỗi tầng 1 phòng ở và 1 vs riêng biệt.<br>Điện nước giá dân chia đầu người. Bước 2 bước là ra chợ (thích nhất ở khu này là thực phẩm sạch giá rẻ)<br>Có thể chuyển vào ở ngay.<br>Tầng 2: 3,5 tr ( k nấu ăn giảm ngay 500k)<br>Tầng 4: 3 tr<br>Đóng tiền nhà 3th, cọc 1th.<br>Ở một mình có giá ưu đãi.<br>Liên hệ: 0964 057 123 (bạn nào thiện chí thì gọi điện trực tiếp trao đổi cho nhanh gọn, mình có con nhỏ nên k có tg trả lời cmt, tn hay ib đâu)</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCJ9', 1, 0, '{\"0\":\"21.0314938\",\"1\":\"105.82363329999998\"}', 1, 0, '2019-05-14 21:39:19', '2019-05-14 21:39:19');
INSERT INTO `motelrooms` VALUES (625, 'Tìm người ở ghép tại Ngõ 259, Vĩnh Hưng, Hoàng Mai ', 'tim-nguoi-o-ghep-tai-ngo-259-vinh-hung-hoang-mai', 1000000, 20.0000, 1, 57, 189, 'Ngõ 259, Vĩnh Hưng, Hoàng Mai, Hà Nội', '0948952826', 2, 'Chưa xác định', '{\"0\":\"tim-nguoi-o-ghep-tai-ngo-259-vinh-hung-hoang-mai-w6a9p.jpg\",\"1\":\"tim-nguoi-o-ghep-tai-ngo-259-vinh-hung-hoang-mai-mwtac.jpg\"}', '<div class=\"dis-content\">Xin phép ad ạ<br>Tìm người ở ghép.<br>Tình hình là tháng này phòng bạn mình có người chuyển đi nên muốn tìm 1 người ở ghép bạn mình đi làm cả ngày tối mới về.<br>Phòng tầng 3 trong nhà 5 tầng điều hoà tủ lạnh nóng lạnh máy giặt có đủ. Điện nước giá dân mạng 100k<br>Yêu cầu : sạch sẽ , trung thực<br>Tiền phòng : 2 triệu chia đôi<br>Địa chỉ : Ngõ 259 vĩnh hưng- hoàng mai <br>Bạn nào có nhu cầu thì inbox hoặc gọi qua số 0948952826</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCIsIjMiOiJcdTAxMTBpXHUxZWMxdSBoXHUwMGYyYSIsIjQiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCIsIjUiOiJNXHUwMGUxeSBnaVx1MWViN3QifQ==', 1, 0, '{\"0\":\"20.9950318\",\"1\":\"105.84265499999992\"}', 1, 0, '2019-05-14 21:39:20', '2019-05-14 21:39:20');
INSERT INTO `motelrooms` VALUES (626, 'Nhượng lại phòng trọ tại 99, Thịnh Quang, Tây Sơn', 'nhuong-lai-phong-tro-tai-99-thinh-quang-tay-son', 1000000, 22.0000, 1, 6, 130, '99, Thịnh Quang, Tây Sơn, Đống Đa, Hà Nội', '0945733475', 9, 'Khép kín', '{\"0\":\"nhuong-lai-phong-tro-tai-99-thinh-quang-tay-son-vb2gu.jpg\"}', '<div class=\"dis-content\">Nhượng phòng<br>Hiện mình muốn nhượng lại 1 phòng ở ngõ Thịnh Quang Tây sơn gần chùa Phúc Khánh. Phòng rộng rãi thoáng mái có ban công,giường,cửa sổ to, <br>-Ưu điểm: phòng rộng, ở 3 thoải mái,chỗ nấu ăn phơi quần áo ở ngoài,.da co giuong,ban hoc,gia sach. An ninh tốt,ko mất cắp bao giờ. Qtrong là giá điện nước cực rẻ luôn.gần trg dh Công đoàn,Thuỷ lợi,Ngân hàng. Gần các điểm xe buýt vì ngay đầu Láng luôn,rất thuận tiện<br>-Nhược điểm: chung chủ, ông bà già nên hơi lẫn tý. Chỗ để xe thì để dc 1 xe máy hoặc 1 xe đạp điện thôi,vsinh chung. </div>', 'e30=', 1, 0, '{\"0\":\"21.0041083\",\"1\":\"105.82179129999997\"}', 1, 0, '2019-05-14 21:39:23', '2019-05-14 21:39:23');
