7 nên an ninh cực ổn, ra vào thoải mái, nhà để xe rộng rãi gần 200m2, có thể chứa được đến 100 chiếc xe máy.<br>- Vệ sinh dọn phòng hàng ngày nếu khách có nhu cầu.<br>* Thích hợp cho người nước ngoài, hộ gia đình và người đi làm thuê ở.<br>+ Địa chỉ: Tòa nhà D2 ngõ 93 phố Cầu Giấy, P. Quan Hoa, Q. Cầu Giấy (Cách Cầu Giấy 150m).<br>Liên hệ chủ nhà chị Hương 0978 335 871. A Lượng 0982 9696 69.</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJUaGFuZyBtXHUwMGUxeSIsIjMiOiJJbnRlcm5ldCIsIjQiOiJcdTAxMTBpXHUxZWMxdSBoXHUwMGYyYSIsIjUiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCIsIjYiOiJNXHUwMGUxeSBnaVx1MWViN3QiLCI3IjoiVHJ1eVx1MWVjMW4gaFx1MDBlY25oIGNcdTAwZTFwIn0=', 1, 0, '{\"0\":\"21.0323856\",\"1\":\"105.80052410000008\"}', 1, 0, '2019-05-14 21:39:49', '2019-05-14 21:39:49');
INSERT INTO `motelrooms` VALUES (630, 'Chính chủ cho thuê phòng trọ tại ngõ 260 đường Cầu Giấy', 'chinh-chu-cho-thue-phong-tro-tai-ngo-260-duong-cau-giay', 1400000, 18.0000, 1, 16, 16, 'số 1 ngách 28 ngõ 260 đường Cầu Giấy, Cầu Giấy, Cầu Giấy, Hà Nội', '0982211284', 3, 'Khép kín', '{\"0\":\"chinh-chu-cho-thue-phong-tro-tai-ngo-260-duong-cau-giay-nknnf.jpg\"}', '<div class=\"dis-content\">Hiện nhà mình còn một phòng trốngkhông sử dụng có nhu cầu cho thuê. Cụ thể:Phòng đẹp diện tích 18m2 vệ sinhkhép kín rộng rãi thoáng mát, có 2 cửa sổ và ban công, có nơi nấu ăn giặt giũ<br>riêng biệt.-        Giờ giấc đi lại thoải mái-Điện nước giá hợp lý ( điện:3000/số, nước 55k/ người)-        Có Wifi tốc độ cao, cáp truyền hình đầy đủ-        Nhà ngay sát chợ cóc họp buổi sáng tiện sinh hoạt hàngngày, dân trí cao an ninh tốt, yên tĩnh.-        Gần các cơ quan trường học như ĐH Sư Phạm, Quốc Gia,Báo Chí, ĐH thủ đô… gần bến xe Bus tiện đi lại.Giá thuê: 1,4 triệu/ tháng ( với 1 người ở) Liên hệ: 0982.211.284LƯU Ý: Chỉ cho NỮ thuê và ưu tiên người đã đi làm muốn ổnđịnh lâu dài</div>', 'eyIwIjoiU1x1MDBlMm4gcGhcdTAxYTFpIiwiMSI6IkludGVybmV0IiwiMiI6IlRydXlcdTFlYzFuIGhcdTAwZWNuaCBjXHUwMGUxcCJ9', 1, 0, '{\"0\":\"21.0362368\",\"1\":\"105.79058250000003\"}', 1, 0, '2019-05-14 21:40:21', '2019-05-14 21:40:21');
