INSERT INTO `motelrooms` VALUES (636, 'Tìm nam ở ghép tại Ngõ 110, Trần Duy Hưng, Cầu Giấy', 'tim-nam-o-ghep-tai-ngo-110-tran-duy-hung-cau-giay', 2200000, 20.0000, 1, 16, 167, 'Ngõ 110, Trần Duy Hưng, Cầu Giấy, Hà Nội', '01675071105', 4, 'Khép kín', '{\"0\":\"no_img_room.png\"}', '<div class=\"dis-content\">Tìm nam ở ghép gấp<br>Mk cần tìm 1 bạn nam sinh viên càng tốt ở chung phòng 2tr2 ở 4 người. Điện nước dùng bao nhiêu trả bấy nhiêu.ko quản giờ giấc. Địa chỉ ngõ 110 trần duy hưng hoặc 81 trung kính. Ưu tiên bạn nào thoải mái sạch sẽ. Liên hệ : 01675071105</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCJ9', 1, 0, '{\"0\":\"21.0117902\",\"1\":\"105.79961330000003\"}', 1, 0, '2019-05-14 21:40:42', '2019-05-14 21:40:42');
