INSERT INTO `motelrooms` VALUES (638, 'Cho thuê phòng trọ số 35, Ngõ 189 Hoàng Hoa Thám', 'cho-thue-phong-tro-so-35-ngo-189-hoang-hoa-tham', 2300000, 20.0000, 1, 14, 161, 'Số 35, Ngõ 189 , Hoàng Hoa Thám, Ba Đình, Hà Nội', '0987550325', 2, 'Chưa xác định', '{\"0\":\"cho-thue-phong-tro-so-35-ngo-189-hoang-hoa-tham-abyfj.jpg\",\"1\":\"cho-thue-phong-tro-so-35-ngo-189-hoang-hoa-tham-6y8ah.jpg\",\"2\":\"cho-thue-phong-tro-so-35-ngo-189-hoang-hoa-tham-5ofyh.jpg\"}', '<div class=\"dis-content\">Cho Thuê nhà chính chủ tại ngõ 189 Hoàng Hoa Thám.<br>Mình đang có 2 phòng cho thuê tại ngõ 189 Hoàng Hoa Thám, Liễu Giai, Ba Đình, Hà Nội.<br>Nhà 4 tầng mới xây, nội thất đẹp, có nóng lạnh, máy giặt. Điện, nước tính theo giá nhà nước. <br>1 Phòng 20m2 giá 2tr3 và 1 Phòng 25m2 giá 2tr5. Mình chỉ cho con gái or vợ chồng trẻ thuê. Ở tối đa 1 phòng 2 người.<br>Phòng thiết kế rất thoáng, 2 cửa sổ, một bên trông ra vườn cây của quận nên rất trong lành. Bạn nào yêu thích yên tĩnh sẽ thích chỗ bọn mình.<br>Bạn nào có nhu cầu liên hệ Phương - 0987.550.325</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCIsIjMiOiJcdTAxMTBpXHUxZWMxdSBoXHUwMGYyYSIsIjQiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCIsIjUiOiJNXHUwMGUxeSBnaVx1MWViN3QifQ==', 1, 0, '{\"0\":\"21.0465812\",\"1\":\"105.80836840000006\"}', 1, 0, '2019-05-14 21:41:05', '2019-05-14 21:41:05');
