INSERT INTO `motelrooms` VALUES (640, 'Cho thuê phòng trọ số 77, Ngách 27, Ngõ 41 Phố Vọng', 'cho-thue-phong-tro-so-77-ngach-27-ngo-41-pho-vong', 2500000, 30.0000, 1, 45, 49, 'Số 77, Ngách 27, Ngõ 41, Phố Vọng, Hai Bà Trưng, Hà Nội', '0987677123', 3, 'Chưa xác định', '{\"0\":\"cho-thue-phong-tro-so-77-ngach-27-ngo-41-pho-vong-pkswh.jpg\"}', '<div class=\"dis-content\">Đâu tháng 3còn trống 4p trong nhà 3 tầng<br>Địa chỉ:sn77 ngách 27,ngõ 41 phố vọng<br>Ngõ to sát cổng kinh tế quốc dân,1 mặt nhà sát với giảng đường d2 của trường kinh tế<br>Ko chung chủ(mình chủ nhà ở nơi khác)<br>Giá thuê phòng<br>Phòng to:~30m cho phép ở 3 bạn cùng giới(ko chấp nhận các cặp đôi sống thử)giá :2,5tr/1 tháng<br>Điện:giá rẻ(có công tơ giá nhà nước,các phòng tự chia nhau số điện)nước chia đầu người(mình kd ko ai cho thuê nhà mà cho các bạn tự quyết tiền điện nước như mình nhé<br>Yêu cầu:ở sạch sẽ,ko nấu cơm là 1 lợi thế(mấy bạn nấu nướng bẩn thỉu nên mình ko cho thuê nữa)<br>Giá thuê tham chiếu :giá rẻ so với khu vực trung tâm như nhà mình nên yêu cầu ăn ở sạch sẽ,ngăn nắp <br>Liên hệ xem phòng từ 1/2<br><br>Sát trường kinh tế.xây dựng,bách khoa<br>Địa chỉ:sn77 ngách 27 ngõ 41 phố vọng<br>Điện nước giá nhà nước đóng<br><br>0987677123(chị Minh chủ nhà)</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCIsIjMiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCJ9', 1, 0, '{\"0\":\"20.9969292\",\"1\":\"105.84276890000001\"}', 1, 0, '2019-05-14 21:41:11', '2019-05-14 21:41:11');
