háng.<br>+ Loại 2: Có 1 phòng ngủ + bếp. DT 30m2 giá từ 2.8.00 000-3.200 000 đ/tháng.<br>- Nội thất: Có nóng lạnh, giường, tủ, kệ bếp, chậu rửa, thiết bị vệ sinh hiện đại, các phòng đều thiết kế có cửa sổ thông thoáng.<br>Tòa nhà có thang máy, bảo vệ 24/24, an ninh đảm bảo, điện nước ổn định.<br>- Vị trí: Nhà nằm ở khu vực đông dân cư, dân trí cao, gần chợ, trường FPT, dân lập Lê Qúy Đôn, mầm non hoa anh đào, sát đô thị Mỹ Đình …, cách đường Hàm Nghi 300m.<br>Mặt đường trước cửa 5m, hai ô tô tránh nhau, phù hợp người đi làm, hộ gia đình trẻ có thêm ông bà hoặc giúp việc ở cùng.<br>- Gía cả linh hoạt, thanh toán tối thiểu 3 tháng + cọc 1 tháng.<br><br><strong>Chú ý: Hiện nay còn 1 căn 3.2tr/th DT 30m2 gồm 1 phòng ngủ, phòng khách và bếp. </strong><br>- Địa chỉ: Số nhà 118 Đường nguyễn Đổng Chi - Quận Nam Từ Liêm. (siêu thị thành đô rẽ vào hoặc đường Hàm Nghi đi vào). Hoặc gần khu đô thị Mỹ Đình 1 đi vào.<br>Liên hệ anh Lượng : 0982 9696 69 / 0978 335 871</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJUaGFuZyBtXHUwMGUxeSIsIjMiOiJJbnRlcm5ldCIsIjQiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCIsIjUiOiJNXHUwMGUxeSBnaVx1MWViN3QiLCI2IjoiVHJ1eVx1MWVjMW4gaFx1MDBlY25oIGNcdTAwZTFwIn0=', 1, 0, '{\"0\":\"21.0385759\",\"1\":\"105.77150170000004\"}', 1, 0, '2019-05-14 21:41:26', '2019-05-14 21:41:26');
