INSERT INTO `motelrooms` VALUES (649, 'Cho thuê phòng trọ tại Ngõ Văn Chương, Khâm Thiên, Đống Đa ', 'cho-thue-phong-tro-tai-ngo-van-chuong-kham-thien-dong-da', 1700000, 25.0000, 1, 6, 122, 'Ngõ Văn Chương, Khâm Thiên, Đống Đa, Hà Nội', '0934382490', 2, 'Khép kín', '{\"0\":\"cho-thue-phong-tro-tai-ngo-van-chuong-kham-thien-dong-da-fe54e.jpg\"}', '<div class=\"dis-content\">Nhà mình còn 1 phòng tại tầng 3 cần cho thuê. Nhà 3 tầng + 1 sân thượng, có phòng khách, phòng bếp chung . Phòng tắm có nóng lạnh. Có chỗ để xe tại tầng 1 của nhà không mất phí, không ở chung với chủ, chìa khóa nhà + phòng riêng cho mỗi người. <br>- Địa điểm: Trong ngõ Văn Chương, Khâm Thiên, Đống Đa <br>- Diện tích nhà: 25m2/1 tầng, <br>- Nhà đang có 4 người 3 nam + 1 nữ, đều xinh xắn đáng yêu thân thiện, sạch sẽ gọn gàng, đang đi làm hoặc là sinh viên.<br>- Giờ: mỗi người một chìa khóa riêng, đi về tùy ý, không ai quản, thoải mái level max =))<br>- Điện/nước: theo số nhà nước, chia cùng với cả nhà cuối mỗi tháng <br>- Internet: đường truyền siêu nhanh, chia cùng cả nhà cuối tháng <br>- Phòng ở được 2 người, đã có giường.<br>- Giá thuê:<br>+ Ở 2 người: 1tr700k / 1 tháng, đóng tiền 2 tháng 1 lần, đặt cọc 1 tháng <br>Liên hệ : cô Phương: 0934382490 để xem nhà ( không nhận tin nhắn)</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCIsIjMiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCJ9', 1, 0, '{\"0\":\"21.0223721\",\"1\":\"105.83546060000003\"}', 1, 0, '2019-05-14 21:42:03', '2019-05-14 21:42:03');
