INSERT INTO `motelrooms` VALUES (651, 'Cho thuê phòng trọ số 20, Ngõ 270 Lê Trọng Tấn', 'cho-thue-phong-tro-so-20-ngo-270-le-trong-tan', 2200000, 20.0000, 1, 2, 163, 'Số 20, Ngõ 270, Lê Trọng Tấn, Thanh Xuân, Hà Nội', '01673934727', 3, 'Chưa xác định', '{\"0\":\"cho-thue-phong-tro-so-20-ngo-270-le-trong-tan-1486196362jkzk1-ow7ex.jpg\",\"1\":\"cho-thue-phong-tro-so-20-ngo-270-le-trong-tan-1486196362jkzk1-lpm2i.jpg\",\"2\":\"cho-thue-phong-tro-so-20-ngo-270-le-trong-tan-1486196362jkzk1-ykxpb.jpg\"}', '<div class=\"dis-content\">Nhà 6 tầng với mặt sàn 120m2 với nhiều phòng cho thuê diện tích 18 đến 20m2, wc nấu ăn khép kín giá dao động từ 2,2 triệu đến 2,5 triệu tùy theo số tầng,phòng điều hòa + thêm 300k, đặt cọc 1 triệu, thanh toán tiền nhà 1 tháng một vào đầu tháng, nhà ở số 20 ngõ 270 Lê Trọng Tấn quận Thanh Xuân gần khu đô thị Định Công, gần chợ, sân bóng, sân gold, bến xe buýt, bệnh viện Bưu Điện, siêu thị, trường học, có chỗ để xe, có nóng lạnh có đầy đủ dịch vụ internet cáp quang FTTH FPT Business 45M, camera an ninh bảo vệ 24/24. Thích hợp cho các bạn đã đi làm hộ gia đình nhỏ ở lâu dài phòng ở tối đa 3 người. Ai có nhu cầu xin liên hệ theo số 0972 999 010 hoặc 01673934727 (Nhà chính chủ miễn TG)</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCIsIjMiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCJ9', 1, 0, '{\"0\":\"20.9902799\",\"1\":\"105.83351600000003\"}', 1, 0, '2019-05-14 21:42:13', '2019-05-14 21:42:13');
INSERT INTO `motelrooms` VALUES (652, 'Cho thuê phòng trọ tại Tòa  N2D, Lê Văn Lương, Khu đô thị Trung Hòa, Nhân Chính, Cầu Giấy', 'cho-thue-phong-tro-tai-toa-n2d-le-van-luong-khu-do-thi-trung-hoa-nhan-chinh-cau-giay', 3000000, 20.0000, 1, 16, 48, 'Tòa  N2D, Lê Văn Lương, Cầu Giấy, Hà Nội', '0973371840', 3, 'Chung', '{\"0\":\"cho-thue-phong-tro-tai-toa-n2d-le-van-luong-khu-do-thi-trung-hoa-nhan-chinh-cau-giay-u3txz.jpg\",\"1\":\"cho-thue-phong-tro-tai-toa-n2d-le-van-luong-khu-do-thi-trung-hoa-nhan-chinh-cau-giay-poxdk.jpg\",\"2\":\"cho-thue-phong-tro-tai-toa-n2d-le-van-luong-khu-do-thi-trung-hoa-nhan-chinh-cau-giay-v2bvn.jpg\",\"3\":\"cho-thue-phong-tro-tai-toa-n2d-le-van-luong-khu-do-thi-trung-hoa-nhan-chinh-cau-giay-naxwh.jpg\",\"4\":\"cho-thue-phong-tro-tai-toa-n2d-le-van-luong-khu-do-thi-trung-hoa-nhan-chinh-cau-giay-5j5kc.jpg\"}', '<div class=\"dis-content\">NHẮN TÌM NGƯỜI NHÀ &lt;3<br>Mình có thuê 1 căn chung cư rộng khoảng 65m2 tại khu đô thị Trung Hòa- Nhân Chính. Khu mình đang tọa ngay ngã tư Lê Văn Lương giao với Hoàng Minh Giám thuộc khu trung tâm nên rất thuận tiện về giao thông, trog khu đô thị là cụm chung cư nên có khu chợ và siêu thị cũng như không gian thoáng thư dãn cho người dân.<br>Trong căn của mình có 2 phòng (như hình), giữa tháng 2 này bạn mình chuyển đi nên cần vài bạn gái đến ở cùng phòng bên cạnh share tiền nhà ^^!<br>Giá cả căn: 6 triệu, 3 triệu/phòng<br>Phí gửi xe và vệ sinh chung 90k/người (hầm để xe nên rất rộng rãi thoải mái k phải bon chen như ở khu trọ nhé)<br>Giá điện, nước nhà nước.<br>Giờ giấc đi lại tự do, thoải mái.<br>Chung cư ốp sàn gỗ, có bình nóng lạnh, tủ lạnh, mát về mùa hè ấm về mùa đông ^^, và mình đã sắm đồ dùng sinh hoạt chung khá đầy đủ rồi nên các bạn chuyển đến cũng khá nhàn nhé!<br>Giá chung cư này là mình đã đàm phán giá cả thấp hơn giá thị trường xét về an ninh, thuận lợi giao thông và thuận lợi khoản chợ búa ăn uống :D<br>Phòng có thể ở 2-3 người nha, vì sống chung trong 1 căn nên mong muốn kết giao vs các bạn thân thiện, gọn gàng và có ý thức nha, vì tính mình cũng thoải mái ^^<br>Các bạn có thể ib hỏi chi tiết mình nếnu ưng có thể xem nhà từ 10h sáng ngày cuối tuần từ ngày mai và nhớ gọi trc cho mình nha <br>Đ/c: N2D- Lê Văn Lương- Khu đô thị Trung Hòa Nhân Chính- Cầu Giấy<br>0973371840 (mình sn 92). Cảm ơn các bạn đã quan tâm ^^!</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCIsIjMiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCJ9', 1, 0, '{\"0\":\"21.0027984\",\"1\":\"105.80025560000001\"}', 1, 0, '2019-05-14 21:42:21', '2019-05-14 21:42:21');
