 </strong>(thanh toán tối thiểu 03 tháng và đặt cọc 1 tháng). DT Các phòng từ 45-50m2. <br><br>- Tòa nhà trang bị thang máy cao cấp, máy giặt, truyền hình cáp, internet tốc độ cao miễn phí, mỗi căn hộ được cấp thẻ từ thang máy riêng. <br>- Tòa nhà có 2 bảo vệ 24/24 nên an ninh cực ổn, ra vào thoải mái, nhà để xe rộng rãi gần 200m2, có thể chứa được đến 80 chiếc xe máy. <br><br><strong>+ Địa chỉ: Số nhà D2 Ngõ 93 Phố Cầu Giấy, P.Quan Hoa, Q.Cầu Giấy.( Cách Cầu Giay 300m) <br><br>Liên hệ chủ nhà Chị Hương 0978 335 871. A Lượng 0982 9696 69 </strong></div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJUaGFuZyBtXHUwMGUxeSIsIjMiOiJJbnRlcm5ldCIsIjQiOiJcdTAxMTBpXHUxZWMxdSBoXHUwMGYyYSIsIjUiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCIsIjYiOiJNXHUwMGUxeSBnaVx1MWViN3QiLCI3IjoiVHJ1eVx1MWVjMW4gaFx1MDBlY25oIGNcdTAwZTFwIn0=', 1, 0, '{\"0\":\"21.0323856\",\"1\":\"105.80052410000008\"}', 1, 0, '2019-05-14 21:44:34', '2019-05-14 21:44:34');
