INSERT INTO `motelrooms` VALUES (716, 'Tìm nữ ở ghép số 64, Ngõ 4 Đỗ Đức Dục', 'tim-nu-o-ghep-so-64-ngo-4-do-duc-duc', 1800000, 20.0000, 1, 10, 39, 'Số 64, Ngõ 4 Đỗ Đức Dục, Hồ Tùng Mậu, Từ Liêm, Hà Nội', '0972335602', 3, 'Khép kín', '{\"0\":\"tim-nu-o-ghep-so-64-ngo-4-do-duc-duc-erzlq.jpg\"}', '<div class=\"dis-content\">Mình đang có nhu cầu cần tìm thêm 1 bạn ở ghép<br>Đ/c: ngõ 4, Đỗ Đức Dục, Nam Từ Liêm( đối diện cổng khách sạn Marriott).<br>Đặc điểm: phòng khép kín rộng 20m2, có nhà để xe tầng 1. An ninh cực kỳ đảm bảo thích hợp với bạn nào đang đi làm.<br>Giá thuê: 1,8tr( chưa bao gồm điện, nước,mạng)<br>Hiện tại mình đang ở cùng 1 chị, cả 2 đều đi làm nên chỉ về buổi tối, muốn tìm 1 bạn nữ ở cùng để share tiền phòng. <br>Ai có nhu cầu thì ib mình hoặc call theo: 0972.335.602<br>Cảm ơn ^.^</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCIsIjMiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCJ9', 1, 0, '{\"0\":\"21.0385759\",\"1\":\"105.77150170000004\"}', 1, 0, '2019-05-14 21:50:32', '2019-05-14 21:50:32');
INSERT INTO `motelrooms` VALUES (717, 'Tìm nam ở ghép phòng trọ số 35, Ngõ 444 Đội Cấn', 'tim-nam-o-ghep-phong-tro-so-35-ngo-444-doi-can', 3600000, 30.0000, 1, 14, 38, 'Số 35, Ngõ 444, Đội Cấn, Ba Đình, Hà Nội', '0964246893', 3, 'Khép kín', '{\"0\":\"tim-nam-o-ghep-phong-tro-so-35-ngo-444-doi-can-lvhdc.jpg\",\"1\":\"tim-nam-o-ghep-phong-tro-so-35-ngo-444-doi-can-wqkae.jpg\",\"2\":\"tim-nam-o-ghep-phong-tro-so-35-ngo-444-doi-can-8m0p6.jpg\"}', '<div class=\"dis-content\">mình đang ở 1 mình trong phòng 3tr6 tại ngõ 444 Đội Cấn - thông với ngõ 60 Linh Lang . ví trí quá trung tâm luôn ạ.<br>Hết tháng 1 này cần tìm 2 bạn qua ở ghép cùng để share tiền phòng. , nếu các b có 2-3 ng rồi (nam/nữ ok) thì m nhượng lại cả phòng cho nhóm bạn. <br>Đồ đạc đầy đủ chỉ việc đến ở , phòng 30m2 như ảnh, phòng ở tầng 3 trong toà nhà 5 tầng, wc nóng lạnh, sạch rộng đẹp. <br>Điện 4k, nước 70/ng, phòng đóng 3 tháng 1 lần. <br>Để xe tầng 1 có camera ra vào khoá cửa, giờ giấc tự do, ko chung chủ.<br>An ninh tuyệt đối luôn ạ. <br>Đi bộ 400m ra toà nhà Lotte Kim Mã. Cách Lăng Bác 1,5km , cách chợ 200m <br>Tiện ra các đường Văn Cao- Liễu Giai - Kim Mã - Đào Tấn - Nguyễn Chí Thanh - Nguyễn Khánh Toàn. <br>Ai có nhu cầu liên hệ mình: 0964246893</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCIsIjMiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCJ9', 1, 0, '{\"0\":\"21.0347594\",\"1\":\"105.8258042\"}', 1, 0, '2019-05-14 21:50:45', '2019-05-14 21:50:45');
INSERT INTO `motelrooms` VALUES (719, 'Cho thuê phòng trọ  tại Ngõ 1, Bùi Xương Trạch, Thanh Xuân', 'cho-thue-phong-tro-tai-ngo-1-bui-xuong-trach-thanh-xuan', 1300000, 20.0000, 1, 2, 175, 'ngõ 1, Bùi Xương Trạch, Thanh Xuân, Hà Nội', '0976521293', 2, 'Khép kín', '{\"0\":\"cho-thue-phong-tro-tai-ngo-1-bui-xuong-trach-thanh-xuan-tubrx.jpg\",\"1\":\"cho-thue-phong-tro-tai-ngo-1-bui-xuong-trach-thanh-xuan-wqxa9.jpg\",\"2\":\"cho-thue-phong-tro-tai-ngo-1-bui-xuong-trach-thanh-xuan-z7ns8.jpg\"}', '<div class=\"dis-content\"><br>+ Không chung chủ, có chỗ để xe máy, giờ giấc thoải mái.<br>+ Thuận lợi là rất mát vào mùa hè, nhà thông thoáng khí và ánh sáng tự nhiên.<br>+ Có khu nấu ăn riêng.<br>+ Khu vực an ninh tốt<br>+ Tiền điện nước mạng đều chia đầu người theo hóa đơn.<br>+ Phòng to nhất trong 3 phòng, với diện tích 20m2.<br>+ Ở không quá 2 người, và chỉ cho người ở,sạch sẽ có ý thức.<br>Gía phòng 1tr300. Nộp 1 tháng 1 lần, đặt cọc 1 tháng, tiền nhà tính từ ngày 20/1/2017.<br>Đến ở luôn vào ngày 20-1-2017, nếu bạn đến ở luôn thì chưa cần đóng 1 tháng vì chưa đến đợt nộp tiền cho chủ nhà.<br>Liên hệ 0976521293.<br></div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCJ9', 1, 0, '{\"0\":\"20.9923499\",\"1\":\"105.81937760000005\"}', 1, 0, '2019-05-14 21:51:47', '2019-05-14 21:51:47');
INSERT INTO `motelrooms` VALUES (720, 'Cho thuê phòng trọ số  45C, Ngõ 12 Lương Khánh Thiện, Tương Mai', 'cho-thue-phong-tro-so-45c-ngo-12-luong-khanh-thien-tuong-mai', 2500000, 22.0000, 1, 57, 223, 'Số  45C, Ngõ 12 , Lương Khánh Thiện, Hoàng Mai, Hà Nội', '01676356081', 4, 'Chưa xác định', '{\"0\":\"cho-thue-phong-tro-so-45c-ngo-12-luong-khanh-thien-tuong-mai-op722.jpg\"}', '<div class=\"dis-content\">Vì mình ở một mình mà phòng rộng quá nên cầm nhượng lại phòng. Có thể đến ở luôn.<br>Địa chỉ: 45c ngõ 12 Lương Khánh Thiện, Tương Mai, Hoàng Mai, Hà Nội<br>Nhà chủ vừa mới mua xong, tự quản, tầng 1 tiếp khách để xe, ăn uống.<br>Phòng mình ở tầng 3 ở 3-4 người rát thoải mái, có sẵn tủ quần áo, tủ sách, giường, nhà có tủ lạnh và máy giặt cửa sổ thoáng đãng, đầu ngõ có chợ. Gần các trường đh kinh tế quốc dân, bkhoa, xd..... Gần phố xá đông vui.<br>Đảm bảo các bạn qua là mê luôn.<br>Giá phòng 2.500.000 đóng theo từng tháng, cọc một tháng, điện nước giá nhà nước chia đầu người. Mạng tầm 50k một tháng.<br>Liện hệ: Hường 0165 780 4363 <br>Ngọc Anh: 0167.635.6081<br>Huyền: 098.799.6613</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCIsIjMiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCIsIjQiOiJNXHUwMGUxeSBnaVx1MWViN3QifQ==', 1, 0, '{\"0\":\"20.986149\",\"1\":\"105.85026399999992\"}', 1, 0, '2019-05-14 21:52:13', '2019-05-14 21:52:13');
INSERT INTO `motelrooms` VALUES (721, 'Cho thuê phòng trọ số 34, Ngõ 160 Nguyễn Khánh Toàn - Cầu Giấy', 'cho-thue-phong-tro-so-34-ngo-160-nguyen-khanh-toan-cau-giay', 1600000, 15.0000, 1, 16, 118, 'Số 34, Ngõ 160 , Nguyễn Khánh Toàn, Cầu Giấy, Hà Nội', '01682143026', 5, 'Chưa xác định', '{\"0\":\"cho-thue-phong-tro-so-34-ngo-160-nguyen-khanh-toan-cau-giay-9lozg.jpg\"}', '<div class=\"dis-content\">PHÒNG CHO NỮ THUÊ: Ngõ 160 Nguyễn Khánh Toàn - Cầu Giấy - HN (gần trường ĐH Thủ Đô, HV Báo Chí, trường Ngoại Thương...rất tiện bắt xe buýt). Giá phòng từ 1,6tr-2,2tr/tháng, đóng tiền tháng một. Điện nước theo giá nhà nước, nước máy, internet cáp quang tốc độ cao, an ninh tốt, tự do thời gian 24/24, phòng ở được từ 3-5 người. Chủ nhà cực kỳ thân thiện, dễ tính. LIÊN HỆ NGAY: 0168.214.3026</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCIsIjMiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCJ9', 1, 0, '{\"0\":\"21.0390978\",\"1\":\"105.80037560000005\"}', 1, 0, '2019-05-14 21:52:14', '2019-05-14 21:52:14');
INSERT INTO `motelrooms` VALUES (722, 'Cho thuê phòng trọ số 545 Vũ Tông Phan, Thanh Xuân', 'cho-thue-phong-tro-so-545-vu-tong-phan-thanh-xuan', 2800000, 40.0000, 1, 2, 159, 'Số 545, Vũ Tông Phan, Thanh Xuân, Hà Nội', '0964547677', 5, 'Chưa xác định', '{\"0\":\"cho-thue-phong-tro-so-545-vu-tong-phan-thanh-xuan-hthx1.jpg\"}', '<div class=\"dis-content\">Chuyển nhượng nhà nguyên căn có thể cho cả gia đình hoặc sv ở ( có thể ở 3-5 người cũng được). Nhà có diện tích 40m vuông có gác xép 25m vuông, có sân trc nhà để xe rộng rãi bởi vì là nhà nguyên căn nên cấu trúc bếp, nhà vs sân trc như nhà ở bình thường có cổng. Tiền điện nước giá nhà nc ạ, bà chủ dễ tính lắm nhà cô ý cách chục ngõ. Hình thức thanh toán tiền nhà cọc 1tr thanh toán tháng 1, tiền nhà có 2tr800k 1 tháng thôi, an ninh tốt yên tĩnh và có sân sau trên gác phơi đồ. Bọn mình thích ở lắm mà đứa e gái mình sang năm chuyển xuống cơ sở 2 ở Hưng yên học còn mỗi mình thì sang nhà cô, ở 1 mình thì nhà rộng với lại nặng tiền nhà quá. Lh để biết thêm tt hoặc xem nhà: 0964547677 - 01698909161Đ/c: 545 vũ tông phan, Thanh Xuân gần Khương trung</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCIsIjMiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCJ9', 1, 0, '{\"0\":\"20.9906743\",\"1\":\"105.8137994\"}', 1, 0, '2019-05-14 21:52:17', '2019-05-14 21:52:17');
INSERT INTO `motelrooms` VALUES (723, 'Cho thuê phòng trọ số  3B, Ngõ 211 Khương Trung', 'cho-thue-phong-tro-so-3b-ngo-211-khuong-trung', 1600000, 12.0000, 1, 2, 63, 'Số 3B, Ngõ 211, Khương Trung, Thanh Xuân, Hà Nội', '0969780759', 2, 'Chưa xác định', '{\"0\":\"cho-thue-phong-tro-so-3b-ngo-211-khuong-trung-1484125494quewx-w1yvp.jpg\"}', '<div class=\"dis-content\">Cho thuê phòng trọ ở ngã tư sở, phòng 12-14m2, có điều hòa, wc riêng, có chỗ nấu ăn, giá 1.6-1.7tr tùy phòng tại địa chỉ số nhà 3B ngõ 211 Khương trung cách ngã tư sở 500m<br>Gần các trường đại học như Thủy Lợi, Công Đoàn, Luật, HV Hành chính, HV Ngân Hàng, ĐH Nhân Văn khoảng 1km-2km, tiện xe bus. <br>GIAO PHÒNG NGAY, phù hợp ở 1 -2 người hoặc ít đồ <br>Liên hệ 0969780759</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCIsIjMiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCJ9', 1, 0, '{\"0\":\"20.994106\",\"1\":\"105.82194400000003\"}', 1, 0, '2019-05-14 21:52:54', '2019-05-14 21:52:54');
INSERT INTO `motelrooms` VALUES (724, 'Cho thuê phòng trọ Số 89, Ngõ 12 Lương Khánh Thiện', 'cho-thue-phong-tro-so-89-ngo-12-luong-khanh-thien', 2200000, 25.0000, 1, 57, 223, ' Số 89, Ngõ 12 , Lương Khánh Thiện, Hoàng Mai, Hà Nội', '0973383718', 3, 'Chưa xác định', '{\"0\":\"cho-thue-phong-tro-so-89-ngo-12-luong-khanh-thien-2mgfw.jpg\"}', '<div class=\"dis-content\">CHO THUÊ PHÒNG TRỌ<br>Mình đăng hộ cô chủ nhà vì tháng tới có 1 phòng chuyển đi<br>- Phòng tầng 2 diện tích khoảng hơn 25m2 đến 30m2 mình ko rõ. Nói chung 4 người ở vẫn thoải mái.<br>- Có nhà vệ sinh riêng rộng rãi khép kín từng phòng. Nấu ăn tầng 1 có bàn ăn đầy đủ hoặc nấu trong phòng tùy thích. Chỗ để xe tầng 1. <br>- Ở riêng chủ, ngõ rộng ô tô đi thoải mái. Nhà rất rộng nhé. Có sân và có tầng thượng.<br>- Có nóng lạnh. Wifi cáp quang. Điện nước hộ gia đình chia hóa đơn theo đầu người.<br>- Gần các trường bách khoa, kinh tế xây dựng. <br>- Nếu ở 2 hoặc 3 người giá là 2tr2. Cô chủ rất dễ tính. Nói khéo có khi cô bớt cho.<br>Mình chỉ đăng hộ vì mình ở tầng trên, phòng đó vẫn đang ở hết tháng mới chuyển nên mình ko có ảnh phòng đó đâu. Các bạn tốt nhất nên đến xem trực tiếp đảm bảo sẽ ưng. Đồ đạc cô chủ để hết lại cho dùng. Có tủ quần áo gỗ. Tủ sách. Bàn học. Giường cất trên tầng 4 các bạn nằm thì mang xuống lắp. Giường đôi hay giường đơn đều có<br>Yêu cầu: thật thà, ngoan ngoãn, sạch sẽ. Ưu tiên sinh viên.<br>Địa chỉ: Số 89, ngõ 12 Lương Khánh Thiện. ( Có thể đi theo ngõ 139 Tân Mai hoặc 22 Nguyễn Đức Cảnh). Mình bận nên ai muốn xem phòng thì gọi sdt: 0973 383 718. Nhắn tin mình ko trả lời đâu nhé.</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCIsIjMiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCJ9', 1, 0, '{\"0\":\"20.986149\",\"1\":\"105.85026399999992\"}', 1, 0, '2019-05-14 21:53:07', '2019-05-14 21:53:07');
INSERT INTO `motelrooms` VALUES (725, 'Cho thuê phòng trọ số 17, Ngách 71/14 Hoàng Văn Thái,', 'cho-thue-phong-tro-so-17-ngach-7114-hoang-van-thai', 1600000, 16.0000, 1, 2, 171, 'Số 17, Ngách 71/14 , Hoàng Văn Thái, Thanh Xuân, Hà Nội', '0987980352', 3, 'Chưa xác định', '{\"0\":\"cho-thue-phong-tro-so-17-ngach-7114-hoang-van-thai-ydxvq.jpg\"}', '<div class=\"dis-content\">à mình còn phòng cho thuê tại số 17, ngách 71/14 Hoàng Văn Thái, gần ngay mặt đường Hoàng Văn Thái, ngõ ngay sát chợ. Cách Ngã Tư Sở gần 2km, ngay sau Bảo tàng phòng không Trường Chinh.<br>Phòng 16m2, ở tầng 3 có khu bếp riêng, sân phơi, nhà vệ sinh dùng chung 1 phòng. Ở tối đa 3 người, có nóng lạnh ở tầng 1. Giá 1,6tr/1 tháng.<br>Giờ giấc đi lại thoải mái, không ở chung chủ. Điện nước giá nhà nước chia đầu người, internet cáp quang 22mb. Khu dân cư an ninh cực tốt, mặt ngõ rộng rãi ô tô vào thoải mái.<br>Liên hệ số 0942682226 hoặc 0987980352 để qua xem phòng ngoài giờ hành chính.</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCIsIjMiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCJ9', 1, 0, '{\"0\":\"20.9967108\",\"1\":\"105.82528509999997\"}', 1, 0, '2019-05-14 21:53:46', '2019-05-14 21:53:46');
