INSERT INTO `motelrooms` VALUES (730, 'Cho thuê phòng trọ số 3, Ngõ 90 Hoa Bằng', 'cho-thue-phong-tro-so-3-ngo-90-hoa-bang', 3000000, 30.0000, 1, 16, 193, 'Số 3, Ngõ 90, Hoa Bằng, Cầu Giấy, Hà Nội', '0989740584', 2, 'Chưa xác định', '{\"0\":\"cho-thue-phong-tro-so-3-ngo-90-hoa-bang-1483977674pk4yc-yr38w.jpg\"}', '<div class=\"dis-content\">Còn phòng:<br>Nhà số 3/90 Hoa Bằng, Yên Hòa, Cầu Giấy.<br>Cho thuê phòng ở tầng 2. Diện tích 30m2.<br>Wc riêng có nóng lạnh. Có điều hòa.<br>Giá 3 triệu.<br>Xe và nấu ăn ở tầng 1.<br>Điện 2700đ/1 số.<br>Nước giá nhà nước.<br>Chỉ cho ở 1-2 người.<br>Dt trước khi qua xem: 098 974 05 84</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCIsIjMiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCJ9', 1, 0, '{\"0\":\"21.0255164\",\"1\":\"105.79603650000001\"}', 1, 0, '2019-05-14 21:54:19', '2019-05-14 21:54:19');
INSERT INTO `motelrooms` VALUES (733, 'Chính chủ cho người nước ngoài thuê chung cư mini cao cấp đầy đủ đồ tòa nhà D2 ngõ 93 phố Cầu Giấy', 'chinh-chu-cho-nguoi-nuoc-ngoai-thue-chung-cu-mini-cao-cap-day-du-do-toa-nha-d2-ngo-93-pho-cau-giay', 6500000, 50.0000, 1, 16, 16, ' Tòa nhà D2 ngõ 93 phố Cầu Giấy, P. Quan Hoa, Q. Cầu Giấy. , Cầu Giấy, Cầu Giấy, Hà Nội', '0978335871', 4, 'Khép kín', '{\"0\":\"chinh-chu-cho-nguoi-nuoc-ngoai-thue-chung-cu-mini-cao-cap-day-du-do-toa-nha-d2-ngo-93-pho-cau-giay-14838625549bu5b-wu7rk.jpg\",\"1\":\"chinh-chu-cho-nguoi-nuoc-ngoai-thue-chung-cu-mini-cao-cap-day-du-do-toa-nha-d2-ngo-93-pho-cau-giay-14838625549bu5b-ughdt.jpg\",\"2\":\"chinh-chu-cho-nguoi-nuoc-ngoai-thue-chung-cu-mini-cao-cap-day-du-do-toa-nha-d2-ngo-93-pho-cau-giay-14838625549bu5b-lrkwr.jpg\",\"3\":\"chinh-chu-cho-nguoi-nuoc-ngoai-thue-chung-cu-mini-cao-cap-day-du-do-toa-nha-d2-ngo-93-pho-cau-giay-14838625549bu5b-p48no.jpg\",\"4\":\"chinh-chu-cho-nguoi-nuoc-ngoai-thue-chung-cu-mini-cao-cap-day-du-do-toa-nha-d2-ngo-93-pho-cau-giay-14838625549bu5b-f0xre.jpg\",\"5\":\"chinh-chu-cho-nguoi-nuoc-ngoai-thue-chung-cu-mini-cao-cap-day-du-do-toa-nha-d2-ngo-93-pho-cau-giay-14838625549bu5b-8op7c.jpg\",\"6\":\"chinh-chu-cho-nguoi-nuoc-ngoai-thue-chung-cu-mini-cao-cap-day-du-do-toa-nha-d2-ngo-93-pho-cau-giay-14838625549bu5b-glqof.jpg\",\"7\":\"chinh-chu-cho-nguoi-nuoc-ngoai-thue-chung-cu-mini-cao-cap-day-du-do-toa-nha-d2-ngo-93-pho-cau-giay-14838625549bu5b-xnjvg.jpg\",\"8\":\"chinh-chu-cho-nguoi-nuoc-ngoai-thue-chung-cu-mini-cao-cap-day-du-do-toa-nha-d2-ngo-93-pho-cau-giay-14838625549bu5b-kn7ct.jpg\",\"9\":\"chinh-chu-cho-nguoi-nuoc-ngoai-thue-chung-cu-mini-cao-cap-day-du-do-toa-nha-d2-ngo-93-pho-cau-giay-14838625549bu5b-qpjyy.jpg\",\"10\":\"chinh-chu-cho-nguoi-nuoc-ngoai-thue-chung-cu-mini-cao-cap-day-du-do-toa-nha-d2-ngo-93-pho-cau-giay-14838625549bu5b-oete2.jpg\",\"11\":\"chinh-chu-cho-nguoi-nuoc-ngoai-thue-chung-cu-mini-cao-cap-day-du-do-toa-nha-d2-ngo-93-pho-cau-giay-14838625549bu5b-axhpp.jpg\",\"12\":\"chinh-chu-cho-nguoi-nuoc-ngoai-thue-chung-cu-mini-cao-cap-day-du-do-toa-nha-d2-ngo-93-pho-cau-giay-14838625549bu5b-ynsgy.jpg\",\"13\":\"chinh-chu-cho-nguoi-nuoc-ngoai-thue-chung-cu-mini-cao-cap-day-du-do-toa-nha-d2-ngo-93-pho-cau-giay-14838625549bu5b-b631s.jpg\",\"14\":\"chinh-chu-cho-nguoi-nuoc-ngoai-thue-chung-cu-mini-cao-cap-day-du-do-toa-nha-d2-ngo-93-pho-cau-giay-14838625549bu5b-cpncj.jpg\"}', '<div class=\"dis-content\">Tòa nhà 9 tầng tại số nhà D2 ngõ 93 phố Cầu Giấy - P. Quan Hoa - Cầu Giấy.<br>* Khuyến mại cho khách hàng 1tr nếu vào thuê phòng trước ngày tết âm lịch.<br>- Nhà ngay phố Cầu Giấy, đường vào rộng, 2 ô tô con tránh nhau, rất thuận tiện cho việc đi lại, sinh hoạt, vui chơi, giải trí. Lên phố cổ cũng gần, trung tâm thương mại ngay sát, gần trường đại học Sư Phạm, Học Viện Báo Chí và Tuyên Truyền...<br>- Các căn hộ rộng được lát sàn gạch cao cấp, căn nào cũng có cửa sổ rộng, ban công phơi đồ riêng biệt. Các căn hộ được thiết kế hết sức hợp lý:<br>+ Loại 1: Gồm 1 phòng ngủ + 1 phòng khách, khu bếp có bàn bếp, tủ bếp, hút mùi, đầy đủ ánh sáng, gió và không khí vào phòng. DT 40m2.<br>+ Loại 2: Gồm 2 phòng ngủ + 1 phòng khách và phòng bếp riêng biệt DT 50m2.<br>- Mỗi phòng được trang bị điều hòa 2 chiều, giường, tủ quần áo, cửa sổ có rèm cản nắng cực đẹp, trần thạch cao, đèn ngủ đủ cả, bàn bếp xịn, hút mùi, bồn rửa bát xịn.<br>- Nhà vệ sinh được lắp thiết bị vệ sinh Inax cao cấp, bình nóng lạnh Ariston, ốp lát gạch Prime sang trọng hiện đại.<br><br>Giá cho thuê: 6.500.000đ-7.000.000đ - 7.500.000-8.500.000đ/căn/tháng (thanh toán tối thiểu 03 tháng và đặt cọc 1 tháng). DT Các phòng từ 45-50m2.<br><br>- Tòa nhà trang bị thang máy cao cấp, máy giặt, truyền hình cáp, internet tốc độ cao miễn phí, mỗi căn hộ được cấp thẻ từ thang máy riêng.<br>- Tòa nhà có 2 bảo vệ 24/24 nên an ninh cực ổn, ra vào thoải mái, nhà để xe rộng rãi gần 200m2, có thể chứa được đến 100 chiếc xe máy.<br>* Ưu người nước ngoài và hộ gia đình, người đi làm thuê ở.<br><br>+ Địa chỉ: Tòa nhà D2 ngõ 93 phố Cầu Giấy, P. Quan Hoa, Q. Cầu Giấy. (Cách Cầu Giấy 150m).<br>Liên hệ chủ nhà  chị Hương 0978 335 871. A. Lượng 0982 9696 69 </div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJUaGFuZyBtXHUwMGUxeSIsIjMiOiJJbnRlcm5ldCIsIjQiOiJcdTAxMTBpXHUxZWMxdSBoXHUwMGYyYSIsIjUiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCIsIjYiOiJNXHUwMGUxeSBnaVx1MWViN3QiLCI3IjoiVHJ1eVx1MWVjMW4gaFx1MDBlY25oIGNcdTAwZTFwIn0=', 1, 0, '{\"0\":\"21.0362368\",\"1\":\"105.79058250000003\"}', 1, 0, '2019-05-14 21:54:58', '2019-05-14 21:54:58');
INSERT INTO `motelrooms` VALUES (734, 'TÌM NỮ Ở GHÉP 500k/tháng ', 'tim-nu-o-ghep-500kthang', 500000, 18.0000, 1, 10, 24, '59/33 Mễ Trì Hạ, P. Mễ Trì, Q. Nam Từ Liêm, HN, Mễ Trì, Từ Liêm, Hà Nội', '01688164163', 3, 'Khép kín', '{\"0\":\"tim-nu-o-ghep-500kthang-resized-huhip.JPG\"}', '<div class=\"dis-content\">MÌnh cần tìm thêm 01 bạn nữ ở ghép để share tiền phòng. Phòng 1tr5/3 người sạch sẽ, khép kín 18m2 ở Làng Mễ Trì Hạ, gần Kaengnam, The Garden, Svđ Mỹ Đình... Phòng có đủ đồ đạc chỉ việc xách vali đến và ở thôi :) Điện nước giá nhà nước, phòng ở tầng thoáng mát, có chỗ nấu ăn, để xe, an ninh đảm bảo. Phòng toàn những người đã đi làm tối mới về nên muốn tìm 01 bạn có giờ giấc sinh hoạt tương tự. Ai có nhu cầu lh sdt: 01688164163 hoặc 0948782286. Địa chỉ ngõ 59/33 Mễ Trì Hạ nhé.</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCIsIjMiOiJUcnV5XHUxZWMxbiBoXHUwMGVjbmggY1x1MDBlMXAifQ==', 1, 0, '{\"0\":\"21.0124737\",\"1\":\"105.78258319999998\"}', 1, 0, '2019-05-14 21:55:03', '2019-05-14 21:55:03');
