g tâm thương mại ngay sát, gần trường đại học Y, trường ĐH Kinh Tế Quốc Dân...<br><strong>- Căn hộ rộng 45m2 - 50m2 </strong>được lát sàn gỗ, căn nào cũng cửa sổ rộng, ban công phơi đồ riêng biệt nhìn sang hồ điều hòa, hít khí trời trong lành nên không độc hại. Căn hộ được thiết kế hết sức hợp lý, 1 phòng ngủ, 1 phòng khách, khu bếp có đầy đủ ánh sáng, gió và không khí vào phòng.<br><br>- Mỗi căn hộ được trang bị giường, cửa sổ có rèm Thái Tuấn cực đẹp, trần thạch cao, đèn ngủ đủ cả, bàn bếp xịn, hút mùi, bồn rửa bát xịn.<br>- Nhà vệ sinh có thiết bị vệ sinh Inax cao cấp, ốp lát gạch Prime sang trọng.<br><strong>Giá cho thuê: 5.000.000 đ - 5.500.000đ/căn/tháng (thanh toán tối thiểu  03 tháng và đặt cọc 01 tháng).</strong><br>- Bảo vệ 24/24, gửi xe miễn phí.<br>- Tòa nhà trang bị thang máy cao cấp, máy giặt miễn phí, truyền hình cáp miễn phí, mỗi căn hộ được cấp thẻ từ thang máy riêng.<br>- Tòa nhà có bảo vệ 24/24 nên an ninh cực ổn, ra vào thoải mái, nhà để xe rộng rãi gần 200m2, có thể chứa được đến 50 chiếc xe máy.<br>+ Địa chỉ: Số nhà 78 mặt đường Hồ Rùa, ngõ 155 đường Trường Chinh – Đống Đa - HN.<br><strong>Liên hệ chủ nhà A Lượng 0982 9696 69 / Chị Hương 0978 335 871.</strong><br>Chú ý:  tòa nhà trên đều là chính chủ cho thuê.</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJUaGFuZyBtXHUwMGUxeSIsIjMiOiJJbnRlcm5ldCIsIjQiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCIsIjUiOiJNXHUwMGUxeSBnaVx1MWViN3QiLCI2IjoiVHJ1eVx1MWVjMW4gaFx1MDBlY25oIGNcdTAwZTFwIn0=', 1, 0, '{\"0\":\"21.000111\",\"1\":\"105.83126130000005\"}', 1, 0, '2019-05-14 21:57:22', '2019-05-14 21:57:22');
INSERT INTO `motelrooms` VALUES (749, 'Cho thuê phòng tại Ngõ 864, Trương Định.', 'cho-thue-phong-tai-ngo-864-truong-dinh', 2000000, 20.0000, 1, 57, 182, 'Ngõ 864, Trương Định, Hoàng Mai, Hà Nội', '01237736017', 2, 'Khép kín', '{\"0\":\"cho-thue-phong-tai-ngo-864-truong-dinh-y7kie.jpg\",\"1\":\"cho-thue-phong-tai-ngo-864-truong-dinh-vm8t1.jpg\",\"2\":\"cho-thue-phong-tai-ngo-864-truong-dinh-o759y.jpg\"}', '<div class=\"dis-content\">Nhà 5 tầng đẹp, cực thoáng mát, gần bến xe Giáp Bát, gần chợ, trường Bách Khoa, Kinh tế Quốc dân, Xây dựng…. <br>Còn 1 phòng duy nhất mới sơn sạch sẽ, khép kín, đầy đủ điều hòa, nóng lạnh. <br>Phòng tầng 3, 20m2, giá 2 tr/ tháng (ở tối đa 2 người)<br>Mô tả :<br>- Để xe tầng 1 miễn phí <br>- Phơi quần áo trên tầng 5 cực rộng.<br>- Có thể nấu ăn trong phòng hay ngoài hành lang.<br>- Internet cáp quang cực mạnh. <br>- Điện 3k5/số, nước 25k/khối. Các phòng đều có công tơ riêng. <br>- Ở chung chủ, nhưng chủ nhà thanh niên thoải mái tính, 11h đóng cửa, về muộn hơn liên hệ với chủ nhà. Tiếp bạn bè vô tư miễn là lịch sự và không làm ảnh hưởng đến người khác và hàng xóm xung quanh.<br>- Yêu cầu duy nhất là ngăn nắp, sạch sẽ, không làm hư hại phòng và các vật dụng <br>trong nhà. <br>Khu nhà toàn người đi làm, văn minh, lịch sự, nên ưu tiên đối tượng đi làm và hộ gia đình nhé.<br>Hợp đồng lâu dài, chu kỳ đóng tiền nhà 1 tháng 1 lần, đặt cọc 1 tháng tiền nhà. <br>Liên hệ chủ nhà: Cô Nga 01237736017 (Miễn trung gian).</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCIsIjMiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCJ9', 1, 0, '{\"0\":\"20.990389\",\"1\":\"105.84770300000002\"}', 1, 0, '2019-05-14 21:57:30', '2019-05-14 21:57:30');
