INSERT INTO `motelrooms` VALUES (754, 'Nhượng lại phòng tại Số 8, Hẻm 2/28, Ngõ 185, Minh khai', 'nhuong-lai-phong-tai-so-8-hem-228-ngo-185-minh-khai', 2000000, 20.0000, 1, 45, 46, 'Số 8, Hẻm 2/28, Ngõ 185, Minh Khai, Hai Bà Trưng, Hà Nội', '01659005275', 3, 'Khép kín', '{\"0\":\"nhuong-lai-phong-tai-so-8-hem-228-ngo-185-minh-khai-9ex7h.jpg\",\"1\":\"nhuong-lai-phong-tai-so-8-hem-228-ngo-185-minh-khai-fvhcg.jpg\",\"2\":\"nhuong-lai-phong-tai-so-8-hem-228-ngo-185-minh-khai-gaw5f.jpg\"}', '<div class=\"dis-content\">Nhượng phòng 20mv giá 2-2,2tr co thương lượng .<br>Bạn nào chuyển đến ngay tháng này t bớt 1tr luôn nhé! Ở 2-3 người thoải mái. <br>ĐIỆN NƯỚC GIÁ DÂN . CÓ CHỖ ĐỂ XE. Mạng chia đầu người. Gìơ giấc thoải mái. Ko chung chủ. <br>CÁCH ktbkxd 1,7km. Đầu ngõ có xe bus! <br>01659005275<br>Số nhà 8hẻm 2/28 ngõ 185 minh khai. <br>CẢ NHÀ ĐỀU SV NÊN RẤT THOẢI MÁI. <br>NHÀ Ở TẦNG 3 TRONG NHÀ 4 TẦNG. <br>Nấu ăn tầng 4 phơi đồ tầng 4.</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCIsIjMiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCJ9', 1, 0, '{\"0\":\"20.9959104\",\"1\":\"105.85765330000004\"}', 1, 0, '2019-05-14 21:57:44', '2019-05-14 21:57:44');
INSERT INTO `motelrooms` VALUES (755, 'Tìm nam ở ghép tại chung cư B10, Phạm Ngọc Thạch', 'tim-nam-o-ghep-tai-chung-cu-b10-pham-ngoc-thach', 1000000, 20.0000, 1, 6, 34, 'Ngõ 43, Phạm Ngọc Thạch, Đống Đa, Hà Nội', '01679997878', 3, 'Chung', '{\"0\":\"tim-nam-o-ghep-tai-chung-cu-b10-pham-ngoc-thach-zdzpj.jpg\"}', '<div class=\"dis-content\">Mình đang thuê nhà tại chung cư B10 - Phạm Ngọc Thạch. (ngõ 43 Phạm Ngọc Thạch)<br>Do em mình học xong về quê nên muốn tìm 1-2 bạn Nam đến ở ghép share tiền nhà.<br>Nhà 40m2 gồm 2 phòng ngủ. Nhà ở tầng 1, ngõ rộng 3m. Không chung chủ giờ giấc thoải mái, an ninh tốt.<br>Nhà ở tầng 1, cách mặt đường Phạm Ngọc Thạch 50m. Gần các trường Bách Khoa, Kinh tế, xây Dựng, Ngân Hàng, ĐH Y HN, Thủy lợi, công đoàn đều đi chưa tới 1km. xung quanh có rất nhiều chợ, bệnh viện.<br>Điện nước giá nhà nước (cả nhà 1 tháng chưa đến 100k/người tổng tiền điện nước).<br>Giá nhà 1tr/người. Đóng tiền 3 tháng một lần.<br>Mình đi làm sáng đi tối về. Muốn tìm bạn nào có nhu cầu ở lâu dài, ổn đinh, hiền lành sạch sẽ.<br>Bạn nào có nhu cầu liên hệ mình qua sđt: 0919285583 hoặc 01679997878<br>Cảm ơn mọi ng đã quan tâm.</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCJ9', 1, 0, '{\"0\":\"21.0090131\",\"1\":\"105.83567829999993\"}', 1, 0, '2019-05-14 21:57:48', '2019-05-14 21:57:48');
