INSERT INTO `motelrooms` VALUES (757, 'Cho thuê phòng trọ số 36, Ngõ 191, Đường Giáp Bát, Hoàng Mai', 'cho-thue-phong-tro-so-36-ngo-191-duong-giap-bat-hoang-mai', 1300000, 20.0000, 1, 57, 214, 'Số  36, Ngõ 191, Giáp Bát, Hoàng Mai, Hà Nội', '01668311995', 3, 'Chưa xác định', '{\"0\":\"cho-thue-phong-tro-so-36-ngo-191-duong-giap-bat-hoang-mai-z42ub.jpg\"}', '<div class=\"dis-content\">Trong tháng 1 này mình chuyển ra ở với đứa bạn nên cần nhượng lại phòng. Phòng rộng gần 20m vuông ở 1-3 người cũng hợp lý, vệ sinh riêng, rộng rãi, sạch sẽ đặc biệt là an ninh tốt. Giờ giấc thì thoải mái vì không chung chủ.<br>Địa chỉ SN 36, ngõ 191, đường Giáp Bát, Hoàng Mai ( vừa gần bến xe Giáp Bát, lại vừa gần khu Bách-Kinh-Xây).<br>Nếu ai chuyển đến thì có thể mình nhượng 1 số đồ dùng trong phòng như ảnh: bếp, bình ga, giàn để bát... trừ cái tủ lạnh thôi :) đứa bạn cũng đang bán cái tủ khác nên có thể mua tủ đó nhé.<br>Liên hệ mình: Tâm. 01668311995</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCIsIjMiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCJ9', 1, 0, '{\"0\":\"20.9845257\",\"1\":\"105.84419969999999\"}', 1, 0, '2019-05-14 21:58:22', '2019-05-14 21:58:22');
