INSERT INTO `motelrooms` VALUES (759, 'Cho thuê phòng trọ số 8, Ngõ 2 Tân Triều, Triều Khúc', 'cho-thue-phong-tro-so-8-ngo-2-tan-trieu-trieu-khuc', 2500000, 25.0000, 1, 2, 74, 'Số 8, Ngõ 2 Tân Triều,, Triều Khúc, Thanh Xuân, Hà Nội', '0974487475', 3, 'Chưa xác định', '{\"0\":\"cho-thue-phong-tro-so-8-ngo-2-tan-trieu-trieu-khuc-eeoyv.jpg\",\"1\":\"cho-thue-phong-tro-so-8-ngo-2-tan-trieu-trieu-khuc-hxh5m.jpg\",\"2\":\"cho-thue-phong-tro-so-8-ngo-2-tan-trieu-trieu-khuc-lwarm.jpg\"}', '<div class=\"dis-content\">Chung cư mini khép kín trong nhà 6 tầng ở ngõ 2 Tân Triều, Triều Khúc, thanh Trì gần chợ, ĐH Hà Nội, ĐH Thăng Long, Bưu Chính.... Phù hợp gia đình nhỏ.<br>- Phòng đẹp có ban công, khép kín, thoáng mát, rộng 25m2.<br>- Giờ giấc tự do, không chung chủ.<br>- Điện điện 3.5k, nước 50k vệ sinh khép, có nóng lạnh, wifi.<br>- An ninh, ô tô đỗ cửa.<br>- Giá 2-2,5 triệu/ tháng.<br>Địa chỉ: Nhà 8 ngõ 2 Tân Triều, Triều Khúc, (sau ủy ban xã).<br>Bạn nào quan tâm thì gọi cho mình: 0974487475 (chính chủ).</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCIsIjMiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCJ9', 1, 0, '{\"0\":\"20.9801219\",\"1\":\"105.80261199999995\"}', 1, 0, '2019-05-14 21:58:32', '2019-05-14 21:58:32');
