INSERT INTO `motelrooms` VALUES (764, 'Nhượng lại phòng trọ tại Ngõ 151, Nguyễn Đức Cảnh, Hoàng Mai, Hà Nội', 'nhuong-lai-phong-tro-tai-ngo-151-nguyen-duc-canh-hoang-mai-ha-noi', 2300000, 16.0000, 1, 57, 169, 'Ngõ 151, Nguyễn Đức Cảnh, Hoàng Mai, Hà Nội', '01692126879', 9, 'Chung', '{\"0\":\"nhuong-lai-phong-tro-tai-ngo-151-nguyen-duc-canh-hoang-mai-ha-noi-85oh3.jpg\",\"1\":\"nhuong-lai-phong-tro-tai-ngo-151-nguyen-duc-canh-hoang-mai-ha-noi-tk9cc.jpg\",\"2\":\"nhuong-lai-phong-tro-tai-ngo-151-nguyen-duc-canh-hoang-mai-ha-noi-vjvwp.jpg\"}', '<div class=\"dis-content\">Mình có phòng tầng 2 trong nhà riêng ko chung chủ cần nhượng lại tại ngõ 281 trương định và cũng có thể đi vào từ ngõ 151 nguyễn đức cảnh. Gần các trường bk,xd,ktqd,ktcn,kdcn.<br>Nhà 5 tầng. Tầng5 để máy giặt và có sân phơi đồ. Tầng1 để xe. Bạn bè đến chơi thoải mái<br>Phòng rộng 16m2, nấu ăn ngoài hành lang, wc 2 phòng dùng chung. Có ng dọn vệ sinh mỗi tuần<br>Đầy đủ quạt treo tường, quạt trần, nóng lạnh, máy giặt. <br>Có thể dọn đến ở bất kì ngày nào<br>Các bạn đến xem nhà thì alo thằng e mình:<br>01692126879</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCJ9', 1, 0, '{\"0\":\"20.98942\",\"1\":\"105.85384199999999\"}', 1, 0, '2019-05-14 21:59:01', '2019-05-14 21:59:01');
INSERT INTO `motelrooms` VALUES (765, 'Tìm nam ở ghép 600k', 'tim-nam-o-ghep-600k', 600000, 10.0000, 1, 2, 142, '67 phùng khoang, Phùng Khoang, Thanh Xuân, Hà Nội', '0936486293', 2, 'Chung', '{\"0\":\"tim-nam-o-ghep-600k-oxe6m.jpg\"}', '<div class=\"dis-content\">Phòng ở gần chợ phùng khoang gần dại học hà nội, đá hoa đẹp, nước 70k , ở 2 khá thoải mái mỗi người 600, ở trên tầng 3 có hành lang ban công, nhà vệ sinh bên ngoài đủ đẹp chung với 2 fòng. Tôi đang ở 1 mình, đi làm ban ngày và thấy phòng ở 2 là ok. Yêu cầu sống thẳng thắn, đi học hay đi làm chính đáng, ưu tiên sinh viên.</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIn0=', 1, 0, '{\"0\":\"20.9893336\",\"1\":\"105.79152380000005\"}', 1, 0, '2019-05-14 21:59:16', '2019-05-14 21:59:16');
