INSERT INTO `motelrooms` VALUES (776, 'Tìm nữ ở ghép số 150 Chùa Láng', 'tim-nu-o-ghep-so-150-chua-lang', 1700000, 20.0000, 1, 6, 151, 'Số 150, Chùa Láng, Đống Đa, Hà Nội', '01676660413', 3, 'Chưa xác định', '{\"0\":\"tim-nu-o-ghep-so-150-chua-lang-ipcwf.jpg\"}', '<div class=\"dis-content\">Tìm một bạn nữ ở ghép ở Chùa Láng. <br>Hiện phòng mình đã có 2 người (mình và một bạn nữa đã đi làm) bọn mình rất ít khi ở phòng muốn tìm thêm 1 bạn nữ nữa ở cho vui. <br>Giá phòng 1tr7 (chia 3)<br>Phòng ở tầng 3 khá rộng và sạch sẽ... An ninh tốt. <br>Tiền điện+nước cả phòng mỗi tháng gần 200k thôi.<br>Điạ chỉ: 150 Chùa Láng ( gần ĐH Ngoại Thương, Ngoại Giao, Luật, Giao Thông...) gần các đỉêm xe buýt. <br>Sdt:01676660413.</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCJ9', 1, 0, '{\"0\":\"21.0229736\",\"1\":\"105.80851440000004\"}', 1, 0, '2019-05-14 22:01:33', '2019-05-14 22:01:33');
INSERT INTO `motelrooms` VALUES (777, 'Cho thuê phòng tại Ngách 33, Ngõ 105, Doãn Kế Thiện', 'cho-thue-phong-tai-ngach-33-ngo-105-doan-ke-thien', 1300000, 15.0000, 1, 16, 100, 'Ngách 33, Ngõ 105, Doãn Kế Thiện, Cầu Giấy, Hà Nội', '0961250698', 3, 'Khép kín', '{\"0\":\"cho-thue-phong-tai-ngach-33-ngo-105-doan-ke-thien-s6npi.jpg\",\"1\":\"cho-thue-phong-tai-ngach-33-ngo-105-doan-ke-thien-ohs1h.jpg\"}', '<div class=\"dis-content\">Mình đăng hộ chị chủ nhé<br>Hiện ở dãy nhà trọ mình tháng sau có 2 phòng trống.<br>-S : 15m2. Có 1 gác sép nhỏ ở trên. Có thể ở từ 2-3 người. Nhà vệ sinh khép kín<br>-Địa chỉ : Nghách 33 ngõ 105 Đường Doãn Kế Thiện ( giáp trường CĐ thương mại và du lịch, đối diện ĐH Ngoại ngữ )<br>-Tiền phòng : 1tr3. Tầng 2 và 1tr6 tầng 1 ( chưa điện nước )<br>Cấu trúc các phòng như nhau :)<br>Bạn nào có nhu cầu có thể liên hệ qua sđt 0961250698</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCJ9', 1, 0, '{\"0\":\"21.041481\",\"1\":\"105.77726570000004\"}', 1, 0, '2019-05-14 22:01:50', '2019-05-14 22:01:50');
INSERT INTO `motelrooms` VALUES (778, 'Cho thuê phòng tại Số 25, Ngõ 435, Nguyễn Khang, Cầu Giấy', 'cho-thue-phong-tai-so-25-ngo-435-nguyen-khang-cau-giay', 2000000, 20.0000, 1, 16, 64, 'Số 25, Ngõ 435, Nguyễn Khang, Cầu Giấy, Hà Nội', '01277361236', 2, 'Khép kín', '{\"0\":\"cho-thue-phong-tai-so-25-ngo-435-nguyen-khang-cau-giay-domun.jpg\",\"1\":\"cho-thue-phong-tai-so-25-ngo-435-nguyen-khang-cau-giay-sqigi.jpg\",\"2\":\"cho-thue-phong-tai-so-25-ngo-435-nguyen-khang-cau-giay-tmfob.jpg\",\"3\":\"cho-thue-phong-tai-so-25-ngo-435-nguyen-khang-cau-giay-swwmv.jpg\",\"4\":\"cho-thue-phong-tai-so-25-ngo-435-nguyen-khang-cau-giay-wacya.jpg\"}', '<div class=\"dis-content\">Hôm trước nhiều bạn hỏi mà chưa có ảnh phòng bây giờ mình mới chụp với quay được. Phòng mới sơn sửa nên đẹp hẳn.<br>Phòng 1tr8 nếu 1 người ở, 2 người trở lên là 2tr<br>Để xe free rộng rãi<br>Điện 4k nước 30k/khoi (theo thăm dò hàng xóm thì mỗi tháng tầm 300-400k giá khá rẻ)<br>Phơi đồ ngoài hành lang, có camera<br>Qua thì gọi số 0127 7361236 chủ nhà nhé</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCIsIjMiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCJ9', 1, 0, '{\"0\":\"21.0258943\",\"1\":\"105.79760349999992\"}', 1, 0, '2019-05-14 22:02:06', '2019-05-14 22:02:06');
INSERT INTO `motelrooms` VALUES (779, 'Tìm 1-2 nữ ở ghép tại Ngõ 93, Hồ Tùng Mậu', 'tim-1-2-nu-o-ghep-tai-ngo-93-ho-tung-mau', 2200000, 20.0000, 1, 16, 39, 'Ngõ 93, Hồ Tùng Mậu, Cầu Giấy, Hà Nội', '0966634154', 3, 'Khép kín', '{\"0\":\"tim-1-2-nu-o-ghep-tai-ngo-93-ho-tung-mau-rnnpv.jpg\"}', '<div class=\"dis-content\">Tìm 1-2 nữ ở ghép<br>Nhà tầng 4 ngõ 93 Hồ Tùng Mậu<br>Phòng: 2.2tr<br>Điện-nước-wifi: 200-250k<br>Có ban công, chỗ để xe, nóng lạnh, nấu ăn và phơi đồ tầng 5, giờ giấc thoải mái, an ninh ok, còn mình thì nấu ăn ngon và xuề xoà dễ tính nữa ^^<br>Phòng có đầy đủ đồ rồi nên bạn nào qua ở chỉ cần mang mỗi người qua thôi nhé, bonus thêm cho các bạn tín đồ trà sữa nhé đủ các thương hiệu hot luôn.<br>Yêu cầu: nói nhiều (vì mình hay buôn dưa lê), lương thiện <br>Liên hệ qua dt 0966634154 or inbox nhé<br>Thank các bạn đã đọc và chấm bài cho mình nhứ</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCIsIjMiOiJcdTAxMTBpXHUxZWMxdSBoXHUwMGYyYSIsIjQiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCJ9', 1, 0, '{\"0\":\"21.0360853\",\"1\":\"105.7773621\"}', 1, 0, '2019-05-14 22:02:16', '2019-05-14 22:02:16');
INSERT INTO `motelrooms` VALUES (780, 'Nhượng lại phòng trọ tại Ngõ 64, Vũ Trọng Phụng, Thanh Xuân, Hà Nội', 'nhuong-lai-phong-tro-tai-ngo-64-vu-trong-phung-thanh-xuan-ha-noi', 4500000, 35.0000, 1, 2, 224, 'Ngõ 64, Vũ Trọng Phụng, Thanh Xuân, Hà Nội', '0942664404', 3, 'Khép kín', '{\"0\":\"nhuong-lai-phong-tro-tai-ngo-64-vu-trong-phung-thanh-xuan-ha-noi-hdbvi.jpg\",\"1\":\"nhuong-lai-phong-tro-tai-ngo-64-vu-trong-phung-thanh-xuan-ha-noi-lvmsv.jpg\",\"2\":\"nhuong-lai-phong-tro-tai-ngo-64-vu-trong-phung-thanh-xuan-ha-noi-drvju.jpg\"}', '<div class=\"dis-content\">Do vợ mình chuyển vào trong nam công tác nên mình cần pass lại nhà trọ này cho bạn nào cần nhé!<br>nhà ở ngõ 64 vũ trọng phụng,oto vào cách nhà 2m .<br>nhà 2 tầng mặt sàn 35m2.<br>tầng 1 là để xe, pk,bếp và 1 nhà vs<br>tầng 2 mình đã ngăn thạch cao làm 2 phòng riêng biệt nhưng không kịp làm cửa.<br>hợp đồng thuê nhà đến tháng 3/2018 <br>đồ đạc full :máy giặt,tủ lạnh,điều hòa,ban thờ,salon,bếp ga ,kệ bếp đầy đủ cả.<br>hợp đồng kí :4tr5/tháng<br>điện nước giá dân tự đóng.nhà chủ không nhắc bao giờ.<br>đóng tiền vào mùng 5/3 tháng đóng 1 lần.cọc 1 tháng (bạn nào ở mình ko lấy cọc,sau này mình lấy lại nhà cô chủ)<br>nếu bạn nào chuyển ngay trước 10/1/2017.<br>đóng cả 3 tháng mình sẽ giảm ngay cho 2tr, <br>đồ nếu các bạn có nhu cầu mua lại mình bán là 10tr,<br>alo 0942664404 để xem nhà .<br>có ảnh nhé<br>hoặc tìm 3 bạn nam ở ghép !</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCIsIjMiOiJcdTAxMTBpXHUxZWMxdSBoXHUwMGYyYSIsIjQiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCJ9', 1, 0, '{\"0\":\"21.0001705\",\"1\":\"105.80817300000001\"}', 1, 0, '2019-05-14 22:02:23', '2019-05-14 22:02:23');
INSERT INTO `motelrooms` VALUES (782, 'Cho thuê phòng trọ số 14A, Ngõ 230 Định Công Thượng', 'cho-thue-phong-tro-so-14a-ngo-230-dinh-cong-thuong', 1800000, 20.0000, 1, 57, 153, 'Số 14A, Ngõ 230, Định Công Thượng, Hoàng Mai, Hà Nội', '01676138164', 3, 'Chưa xác định', '{\"0\":\"cho-thue-phong-tro-so-14a-ngo-230-dinh-cong-thuong-ytcqz.jpg\",\"1\":\"cho-thue-phong-tro-so-14a-ngo-230-dinh-cong-thuong-rolz4.jpg\"}', '<div class=\"dis-content\">Sang tuần mình chuyển nhà nên mình muốn nhượng lại chỗ mình đang ở.bạn nào đang tìm phòng thì hay chú ý những gạch đầu dòng của mình nhé...:))<br>_giá phòng.1tr500.ở được 2 ng.điện nc giá bình dân<br>_k chung chủ.giờ giấc rất thoải mái<br>_phòng rộng 20m2,tầng 1.rộng rãi ,sạch sẽ, thoáng mát, có đệm để ngủ luôn nhé<br>_nhà vệ sinh bên ngoài rất sạch sẽ,có máy giặt<br>_chỗ để xe rất rộng rãi. An ninh cũng rất ổn<br>_chị chủ nhà rất dễ tính.<br>Vậy ai có nhu cầu thuê lại thì liên hệ vs mình qa sdt.01676138164<br>Nếu bạn nào ưng ý thì sáng mai qa xem phòng luôn nhé..!<br>Địa chỉ: số 14A ngõ 230 định công thượng</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCIsIjMiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCJ9', 1, 0, '{\"0\":\"20.990134\",\"1\":\"105.853791\"}', 1, 0, '2019-05-14 22:03:38', '2019-05-14 22:03:38');
INSERT INTO `motelrooms` VALUES (783, 'Tìm nữ ở ghép số 402, K10A Khu tập thể Bách Khoa, Nguyễn Hiền, Hai Bà Trưng', 'tim-nu-o-ghep-so-402-k10a-khu-tap-the-bach-khoa-nguyen-hien-hai-ba-trung', 1400000, 23.0000, 1, 45, 315, 'Số 402, K10A Khu tập thể Bách Khoa, Nguyễn Hiền, Hai Bà Trưng, Hà Nội', '01658288940', 4, 'Chưa xác định', '{\"0\":\"tim-nu-o-ghep-so-402-k10a-khu-tap-the-bach-khoa-nguyen-hien-hai-ba-trung-ilhs4.jpg\",\"1\":\"tim-nu-o-ghep-so-402-k10a-khu-tap-the-bach-khoa-nguyen-hien-hai-ba-trung-qy1uq.jpg\"}', '<div class=\"dis-content\">- Đặc điểm:Khu tập thể Bách Khoa, an ninh tốt, yên tĩnh ( chủ yếu là các giảng viên của trường ĐH Bách Khoa ở ). Nhà ở tầng 4, để xe ở dưới có chỗ trông. Ở cùng phòng với chị mình. Nhà đã có 3 người nữa đang ở. Mình và 1 chị nữa đang học ĐH Kinh tế. Chị còn lại đã đi làm.<br>- Tiện nghi: Có nóng lạnh, lò vi sóng, máy giặt, nồi niêu bát đũa, mọi thứ đầy đủ hết. Chỉ cần mang quần áo đến và ở thôi. Gần chợ, gần bệnh viện, có đủ các thứ hết.<br>- Điện, nước, internet: đầy đủ, giá nhà dân, tự chia nhau đầu người.<br>- Giá phòng và phương thức thanh toán: Chuyển khoản hoặc tiền mặt, 1.400.000 VND/tháng; thanh toán 4 tháng 1 lần.<br>- Địa chỉ: Số nhà 402, K10A Khu tập thể Bách Khoa, Nguyễn Hiền, Hai Bà Trưng, Hà Nội <br>- Liên hệ: 01658288940</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCIsIjMiOiJcdTAxMTBpXHUxZWMxdSBoXHUwMGYyYSIsIjQiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCIsIjUiOiJNXHUwMGUxeSBnaVx1MWViN3QifQ==', 1, 0, '{\"0\":\"21.0011736\",\"1\":\"105.84766190000005\"}', 1, 0, '2019-05-14 22:03:46', '2019-05-14 22:03:46');
INSERT INTO `motelrooms` VALUES (784, 'Cho thuê phòng tập thể 409 Kim Mã', 'cho-thue-phong-tap-the-409-kim-ma', 2000000, 25.0000, 1, 14, 206, '409, Kim Mã, Ba Đình, Hà Nội', '01689698225', 2, 'Khép kín', '{\"0\":\"cho-thue-phong-tap-the-409-kim-ma-n4uqq.jpg\",\"1\":\"cho-thue-phong-tap-the-409-kim-ma-sjypg.jpg\"}', '<div class=\"dis-content\"><br>Cho thuê phòng tập thể 409 kim mã, tầng 1, có chỗ để xe mien phi, điện nước, Internet giá nhà nước, gần đường, gần bến xe bus. Phòng coá sẵn giường, tủ, nóng lạnh. <br>Chỉ cho 1-2 nữ đi làm thuê<br>Giá 2.000.000đ/1-2 người<br>2.500.000/3 người <br>Đóng tiền 2thang/ lần<br>Đặt cọc: 1.000.000<br>Không khuyến khích ở 3 người . Cần người thật thà, sạch sẽ. Rộng rãi, không ở chung chủ, thoải mái giờ giấc.<br>Liên hệ: 01689698225</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCJ9', 1, 0, '{\"0\":\"21.030375\",\"1\":\"105.81569999999999\"}', 1, 0, '2019-05-14 22:04:10', '2019-05-14 22:04:10');
INSERT INTO `motelrooms` VALUES (785, 'Cho thuê phòng trọ toà nhà NC2,KĐT mới Cầu Bươu,Tân Triều,Thanh Trì', 'cho-thue-phong-tro-toa-nha-nc2kdt-moi-cau-buoutan-trieuthanh-tri', 2000000, 23.0000, 1, 28, 413, 'Toà nhà NC2,KĐT mới Cầu Bươu,Tân Triều,Thanh Trì, Hữu Lê, Thanh Trì, Hà Nội', '01687306056', 2, 'Chưa xác định', '{\"0\":\"cho-thue-phong-tro-toa-nha-nc2kdt-moi-cau-buoutan-trieuthanh-tri-e5w64.jpg\"}', '<div class=\"dis-content\">Vợ chồng tớ và 1 con nhỏ đag ở p1404,toà nhà NC2,kđt mới cầu bươu,tân triều,thah trì( đối diện CT6,gần bv K,103) căn chug cư rộg 86m2. Có 2pn 2nvs 1pk 1 bếp 2 ban công,bếp và đồ đạc đầy đủ,nóng lạh điều hoà tủ lạh máy giạt.<br>Nay vc tớ muốn tìm 2b nữ/nam(sv hs) ở ghép cùg,vì vc t ở thì rộg quá,mà đi làm cả ngày tối mới về. Vc t dễ tíh thoải mái. Đồ đạc dùg chung thoái mái. <br>Giá : 2trieu cho 2 bạn. <br>1ban thi 1.3trieu Nhu cầu ib tớ hoặc alo 01687306056<br>Giờ giấc thoải mái chìa khoá riêng</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCIsIjMiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCJ9', 1, 0, '{\"0\":\"20.9546968\",\"1\":\"105.80334579999999\"}', 1, 0, '2019-05-14 22:04:18', '2019-05-14 22:04:18');
