INSERT INTO `motelrooms` VALUES (794, 'Cho thuê phòng trọ số 176, Tổ 29 phường Hoàng Văn Thụ, quận Hoàng Mai', 'cho-thue-phong-tro-so-176-to-29-phuong-hoang-van-thu-quan-hoang-mai', 1200000, 20.0000, 1, 21, 164, 'Số 176, Tổ 29, Hoàng Văn Thụ, Hà Đông, Hà Nội', '01225257586', 2, 'Chưa xác định', '{\"0\":\"cho-thue-phong-tro-so-176-to-29-phuong-hoang-van-thu-quan-hoang-mai-9yaoj.jpg\"}', '<div class=\"dis-content\">CHO THUÊ PHÒNG TRỌ GIÁ RẺ (1TR2/THÁNG)<br>Liên hệ chú Phương 01225257586<br>Hiện nhà mình còn 1 phòng khép kín muốn cho thuê, diện tích khoang 20 m2.<br>Phòng ở rộng rãi, sạch sẽ, thoáng mát. Điện nước đầy đủ theo giá nhà nước, an ninh tốt. Có chỗ để xe thuận tiện.<br>Có sẵn giường đôi, nhà vệ sinh riêng biệt trong phòng.<br>Chủ nhà ở xa, thoải mái.<br>Nhà ở khu gần nhiều trường đại học như Kinh tế quốc dân, Bách Khoa, Kinh doanh công nghệ...<br>Địa chỉ số 176 tổ 29 phường Hoàng Văn Thụ, quận Hoàng Mai, Hà Nội (trong ngõ 254 Minh Khai)<br>Giá 1tr2/tháng đóng tiền hàng tháng, ở từ 1-2 người<br>Các bạn liên hệ trực tiếp theo SĐT ở trên nhé</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCJ9', 1, 0, '{\"0\":\"20.955835\",\"1\":\"105.75636580000003\"}', 1, 0, '2019-05-14 22:05:47', '2019-05-14 22:05:47');
INSERT INTO `motelrooms` VALUES (795, 'Cho thuê phòng trọ số 53, Ngõ 766 La Thành ', 'cho-thue-phong-tro-so-53-ngo-766-la-thanh', 1700000, 18.0000, 1, 6, 115, 'Số 53, Ngõ 766 , Đê La Thành, Đống Đa, Hà Nội', '0983728435', 2, 'Chưa xác định', '{\"0\":\"cho-thue-phong-tro-so-53-ngo-766-la-thanh-hermw.jpg\"}', '<div class=\"dis-content\">Nhà 6 tầng. Cho thuê 1 phòng tầng 4 tại ngõ 766 La Thành <br>Phòng sạch sẽ, có điều hoà, nóng lạnh <br>2 phòng /tang chung 1 nhà wc ( đầy đủ tiện nghi) <br>Có chỗ để xe <br>An ninh tốt k lo trộm cắp ồn ào.<br>Phơi phóng trên sân thượng ( rộng rãi , thoải mái )<br>Được nấu ăn trong phòng.<br>Giá phòng 1trieu7/người/phòng<br>1trieu8/ 2 người/ phòng<br>( ở tối đa 2 người)<br>Đóng tiền nhà theo tháng.<br>Nơi ở gần các trường đại học , xe bus , chợ, trung tâm thương mại, cơ quan hành chính<br>Cho thuê từ ngày 31/12/2016 <br>Liên hệ : chú Sáu : 0983.728.435</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCIsIjMiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCJ9', 1, 0, '{\"0\":\"21.023446\",\"1\":\"105.82133599999997\"}', 1, 0, '2019-05-14 22:06:12', '2019-05-14 22:06:12');
INSERT INTO `motelrooms` VALUES (796, 'Tìm nữ ở ghép phòng trọ khu tập thể bộ Giao Thông, Ngõ 629 Kim Mã ', 'tim-nu-o-ghep-phong-tro-khu-tap-the-bo-giao-thong-ngo-629-kim-ma', 2200000, 20.0000, 1, 14, 206, 'Khu tập thể bộ Giao Thông, Ngõ 629 , Kim Mã, Ba Đình, Hà Nội', '01689976497', 2, 'Chưa xác định', '{\"0\":\"tim-nu-o-ghep-phong-tro-khu-tap-the-bo-giao-thong-ngo-629-kim-ma-mcvp5.jpg\"}', '<div class=\"dis-content\">**TÌM NGƯỜI Ở GHÉP***<br>Nhà ở khu tập thể bộ Giao Thông ngõ 629 Kim Mã hoặc có thể đi vào từ đường Đê La Thành<br>Bên mình còn một phòng khoảng 20m2 giá 2tr2 đóng hàng tháng<br>Nhà có 2 phòng ngủ và 1 phòng khách<br>TỐI ĐA 2 Người<br>Ưu tiên : người đã đi làm, sạch sẽ, ngăn nắp<br>An ninh tốt, điện nước giá nhà nước<br>Để xe 100k một xe<br>Không gian chung bao gồm nhà vệ sinh và gian bếp<br>Có sẵn điều hòa nóng lạnh<br>Liên hệ : 01689976497<br>Anh Hiến</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCIsIjMiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCJ9', 1, 0, '{\"0\":\"21.0316443\",\"1\":\"105.82462659999999\"}', 1, 0, '2019-05-14 22:06:36', '2019-05-14 22:06:36');
INSERT INTO `motelrooms` VALUES (797, 'Cho thuê phòng tại Ngõ 58, Trương Định', 'cho-thue-phong-tai-ngo-58-truong-dinh', 2500000, 25.0000, 1, 45, 182, 'Ngõ 58, Trương Định, Hai Bà Trưng, Hà Nội', '0948561099', 2, 'Khép kín', '{\"0\":\"cho-thue-phong-tai-ngo-58-truong-dinh-yp8jn.jpg\"}', '<div class=\"dis-content\">Mình đang thuê 1 nhà 4 tầng. Mình đang ở tầng 3. Còn dư 1 phòng tầng 2 muốn cho thuê lại. Phòng khep kín đầy đủ điều hoà, nóng lạnh, giường gỗ, tủ gỗ cao cấp.Trong nhà có tủ lamhj và máy giặt dùng chung. Điện nước chia đầu người.<br>Nhà 4 tầng:<br>- tầng 1: bếp, chỗ để xe<br>- tầng 2: rộng tầm 20-25m2 là 1 phòng ngủ vệ sinh khép kín<br>- tầng 3: như tầng 2. Mình đang ở.<br>- tầng 4: phòng thờ. Sân phơi<br>Mình cho thuê lại tầng 2. <br>Giá ở 2 là 2.500.000 ₫/ tháng.<br>Ở 3 là 2tr8₫/ tháng<br>Đóng tiền 3 tháng. Cọc 1 tháng<br>Địa chỉ: ngõ 58 trương định- gần ngã tư chợ mơ.<br>Inbox or call 0948561099</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCIsIjMiOiJcdTAxMTBpXHUxZWMxdSBoXHUwMGYyYSIsIjQiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCIsIjUiOiJNXHUwMGUxeSBnaVx1MWViN3QifQ==', 1, 0, '{\"0\":\"20.9959479\",\"1\":\"105.85293409999997\"}', 1, 0, '2019-05-14 22:06:52', '2019-05-14 22:06:52');
INSERT INTO `motelrooms` VALUES (798, 'Tìm nữ ở ghép tại Số 63, Ngõ 59, Mễ Trì Hạ, Gần Big C The Garden', 'tim-nu-o-ghep-tai-so-63-ngo-59-me-tri-ha-gan-big-c-the-garden', 1700000, 21.0000, 1, 10, 24, 'Số 63, Ngõ 59, Mễ Trì, Từ Liêm, Hà Nội', '0911498723', 9, 'Khép kín', '{\"0\":\"tim-nu-o-ghep-tai-so-63-ngo-59-me-tri-ha-gan-big-c-the-garden-q3aly.jpg\",\"1\":\"tim-nu-o-ghep-tai-so-63-ngo-59-me-tri-ha-gan-big-c-the-garden-1oxmn.jpg\",\"2\":\"tim-nu-o-ghep-tai-so-63-ngo-59-me-tri-ha-gan-big-c-the-garden-mrlu0.jpg\"}', '<div class=\"dis-content\">TÌM NỮ Ở GHÉP<br>- phòng 21m2, 1tr7/ phongf; bạn cùng phòng đi công tác suốt nên đi làm về chỉ còn 1 mình ở phòng, buồn. Tớ muôn tìm thêm 1 bạn nữ nữa ạ. ƯU TIÊN CŨNG ĐI LÀM, TỐI VỀ NGỦ :))<br>- Nước 30k/ khối, điện 3,5k/ số. Mạng 70k/ phòng. Có quạt trần và kệ rửa bát, nấu nướng<br>- Phòng tầng 5 cực thoáng và mát ạ<br>- Địa chỉ: Số 63, ngõ 59 Mễ trì hạ, gần bigc garden<br>Có gì ib nha, mình sn 92 cho dễ xưng hô :)</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCJ9', 1, 0, '{\"0\":\"21.0125701\",\"1\":\"105.77817340000001\"}', 1, 0, '2019-05-14 22:06:57', '2019-05-14 22:06:57');
INSERT INTO `motelrooms` VALUES (799, 'Cho thuê phòng trọ số 92, Ngõ 461 Bạch Mai', 'cho-thue-phong-tro-so-92-ngo-461-bach-mai', 2000000, 30.0000, 1, 45, 97, 'Số 92, Ngõ 461, Bạch Mai, Hai Bà Trưng, Hà Nội', '0966681990', 3, 'Chưa xác định', '{\"0\":\"cho-thue-phong-tro-so-92-ngo-461-bach-mai-f9ouh.jpg\"}', '<div class=\"dis-content\">M cần Cho Thuê Nhà ở Tầng 2 Riêng Biệt .<br>Địa chỉ : Ngõ 461 Bạch Mai, cách mặt đường 5m. ( TT TM CHỢ MƠ ) <br>Diện tích 30 m2 , vệ sịnh khép kín, có nóng lạnh.<br>- Đã có giường tủ quạt ...... có chỗ nấu ăn rộng rãi. <br>Nhà ngõ bé ( tự túc chỗ để xe quanh khu Trung tâm Chợ Mơ ) <br>Giờ giấc tự do, ko chung chủ, ở 2 đến 3 ng. <br>Ưu tiên : Hs, sv, người đi làm, or làm việc quanh khu Hai Bà Trưng.<br>Rất gần các Trường kinh tế và Bách khoa .... <br>Có điểm xe buýt ngay trước ngõ, ngay sát ngã tư đông đúc, thuận tiện mua bán.<br>Giá thuê 2tr/ tháng ( Đặt cọc 1 tháng ) , Điện 3k5, Nước 70k/n , Mạng 100k/p<br>Chính chủ cho thuê liện hệ : 0966.68.1990</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCIsIjMiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCJ9', 1, 0, '{\"0\":\"21.0047184\",\"1\":\"105.85242930000004\"}', 1, 0, '2019-05-14 22:07:31', '2019-05-14 22:07:31');
INSERT INTO `motelrooms` VALUES (800, 'Cho thuê phòng trọ số 25, Ngõ 79 Cầu Giấy', 'cho-thue-phong-tro-so-25-ngo-79-cau-giay', 2000000, 28.0000, 1, 16, 16, 'Số 25, Ngõ 79, Cầu Giấy, Cầu Giấy, Hà Nội', '01676651384', 4, 'Chưa xác định', '{\"0\":\"no_img_room.png\"}', '<div class=\"dis-content\">Hiện tại chỗ mình đang dư một phòng rộng 28m2 như sau:<br>+ Có nhà vệ sinh và bàn bếp bên trong phòng; Có ban công rộng view ra hồ, chùa và phơi quần áo thoải mái.<br>+ Không gian trong phòng rộng có thể kê được 2 dường ngủ cho 4 người ở. Có gác xép để đồ lên tầng thượng. <br>+ Có một số vật dụng cơ bản như tủ quần áo, phản kê để ngủ, kệ bếp... Thời gian thoải mái, cô chủ nhà dễ tính và có chỗ để xe rộng rãi. Nhà ở ngay trong ngõ 79 Cầu Giấy gần các trường Sư phạm, Báo chí, GTVT ( có thể đi bộ được )<br>*Giá cho thuê 2tr5, thanh toán mùng 5 hàng tháng.<br>Mình đi làm xa nên phải chuyển đăng lên đây giúp cô chủ nhà.<br>--&gt; Ai có nhu cầu liên hệ: 01676651384 gặp Phi nhé.</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCIsIjMiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCJ9', 1, 0, '{\"0\":\"21.0287582\",\"1\":\"105.79854309999996\"}', 1, 0, '2019-05-14 22:07:32', '2019-05-14 22:07:32');
INSERT INTO `motelrooms` VALUES (801, 'Tìm nữ ở ghép phòng trọ số 53, Ngõ 41 Đông Tác', 'tim-nu-o-ghep-phong-tro-so-53-ngo-41-dong-tac', 2200000, 20.0000, 1, 6, 18, 'Số 53, Ngõ 41, Đông Tác, Đống Đa, Hà Nội', '0948596684', 2, 'Khép kín', '{\"0\":\"tim-nu-o-ghep-phong-tro-so-53-ngo-41-dong-tac-twu8k.jpg\"}', '<div class=\"dis-content\">Tìm bạn nữ ở ghép.<br>Mình đang cần tìm nữ ở ghép ở ngõ 41 Đông Tác - Đống Đa - HN.<br>Gần các trường ĐH Y, ĐH Công Đoàn, Thuỷ Lợi, HV Ngân Hàng, ĐH BK, XD, KTQD.<br>Phòng khoảng 20m2, đầy đủ đồ đạc, tầng 2, khép kín, không chung chủ.Nước 80k, điện 3.5k.<br>Giá phòng 2tr2.Chia ra mỗi người cả điện nước là 1tr250 nhé.<br>Bạn nào có nhu cầu ở ghép liên hệ mình theo sđt 0948596684.</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCIsIjMiOiJcdTAxMTBpXHUxZWMxdSBoXHUwMGYyYSIsIjQiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCJ9', 1, 0, '{\"0\":\"21.0046516\",\"1\":\"105.83281369999997\"}', 1, 0, '2019-05-14 22:07:39', '2019-05-14 22:07:39');
INSERT INTO `motelrooms` VALUES (802, 'Cho thuê phòng trọ số 207 Bùi Xương Trạch', 'cho-thue-phong-tro-so-207-bui-xuong-trach', 1200000, 15.0000, 1, 2, 175, 'Số 207, Bùi Xương Trạch, Thanh Xuân, Hà Nội', '01673954985', 3, 'Chưa xác định', '{\"0\":\"cho-thue-phong-tro-so-207-bui-xuong-trach-vcd3j.jpg\"}', '<div class=\"dis-content\">Mình có 1 phòng ở 207 Bùi Xương Trạch muốn nhượng lại.<br>Phòng rộng rãi. Không chung chủ. Khép kín. Có chìa khoá cổng riêng.<br>Do không làm ở HN nữa nên muốn nhượng lại phòng ạ.<br>1tr2/tháng chưa kể tiềm điện nước.<br>Phòng có thể ở 2-3 người ạ </div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCJ9', 1, 0, '{\"0\":\"20.9866751\",\"1\":\"105.81879300000003\"}', 1, 0, '2019-05-14 22:07:40', '2019-05-14 22:07:40');
INSERT INTO `motelrooms` VALUES (803, 'Tìm nữ ở ghép phòng trọ số 38 ,Ngõ 201 Cầu Giấy, Hà Nội', 'tim-nu-o-ghep-phong-tro-so-38-ngo-201-cau-giay-ha-noi', 800000, 20.0000, 1, 16, 16, 'Số 38 ,Ngõ 201 , Cầu Giấy, Cầu Giấy, Hà Nội', '01699035535', 3, 'Chưa xác định', '{\"0\":\"tim-nu-o-ghep-phong-tro-so-38-ngo-201-cau-giay-ha-noi-hfgau.jpg\"}', '<div class=\"dis-content\"> bạn ơi phòng mình cũng đang tìm ng ở ghép hay b sang ở cùng cho vui \"Hi cả nhà,<br>Phòng mình đang có 2 người đã đi làm rồi và hiện cần tìm thêm 1 bạn nữa ở cùng cho tiết kiệm chi phí. Phòng khép kín rộng rãi, sạch sẽ, thoáng mát. Trung bình 1 tháng chỉ tầm 800k/người thui (quá rẻ trong thời kì bão giá này:))). <br>Địa chỉ nhà: Đối diện SN 38 ,Ngõ 201 Cầu Giấy, Hà Nội. <br>Liên hệ xem : Tâm 0988229685 or Thịnh 01699035535<br>Welcome to our home!!\"</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCIsIjMiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCJ9', 1, 0, '{\"0\":\"21.0362368\",\"1\":\"105.79058250000003\"}', 1, 0, '2019-05-14 22:07:42', '2019-05-14 22:07:42');
INSERT INTO `motelrooms` VALUES (804, 'Cho thuê phòng trọ số 10, Ngõ 85 Xuân Thủy, Cầu Giấy', 'cho-thue-phong-tro-so-10-ngo-85-xuan-thuy-cau-giay', 2000000, 20.0000, 1, 16, 157, 'Số 10, Ngõ 85 , Xuân Thủy, Cầu Giấy, Hà Nội', '01656756682', 3, 'Chưa xác định', '{\"0\":\"cho-thue-phong-tro-so-10-ngo-85-xuan-thuy-cau-giay-lkyhz.jpg\"}', '<div class=\"dis-content\">Bọn mình đang có phòng cho thuê tầng 2 của nhà riêng:<br>- 1 phòng 1,7tr ở được 1,2người<br>- 1 phòng to 2triệu ở được 3người<br>=&gt; 2 phòng chung 1 nhà vệ sinh. <br>(Nhà 3 tầng,bọn mình 3 đứa c.g 1 pòng tầng 3 rồi)<br>- Điện,nước có buil hàng tháng chia đầu người.( nhà có tổng cộng 3phòng)<br>- Vệ sinh 10k/người<br>- Chỗ để xe tầng 1 rộng rãi<br>- Tầng 1 còn có 1 nhà vệ sinh,kệ bếp nấu ăn sẵn rồi,chỉ cần bê bếp ga hoặc bếp từ đến nấu thôi<br>- Giờ giấc chắc chắn là thoải mái<br>- Chú ý duy nhất 1điều: muộn muộn ko làm ảnh hưởng quá đến người xung quanh,sạch sẽ,gọn gàng là ok.<br>Địa chỉ : ngõ 85 xuân thủy,cầu giấy hoặc có thể đi từ cổng cốm Vòng trên đường Trần Thái Tông vào.</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCIsIjMiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCJ9', 1, 0, '{\"0\":\"21.0364968\",\"1\":\"105.78562480000005\"}', 1, 0, '2019-05-14 22:07:44', '2019-05-14 22:07:44');
