-do-dt-50m2-toa-nha-d2-ngo-93-pho-cau-giay-laheh.jpg\"}', '<div class=\"dis-content\"><br>Cho Thuê Chung Cư Mini Ở Cầu Giấy cuối Tháng 12 Vào Ở Được  <br><strong>RẤT THÍCH HỢP CHO NGƯỜI NƯỚC NGOÀI VÀ CẢ NGƯỜI VIỆT</strong><br>Tòa nhà chung cư mini 6 tầng tại Cầu Giấy<br>-- Nhà ngay phố Cầu Giấy, đường vào rộng, 2 ô tô con tránh nhau, rất thuận tiện cho việc đi lại, sinh hoạt, vui chơi, giải trí. Lên phố cổ cũng gần, trung tâm thương mại ngay sát, gần trường đại học sư phạm,Học Viện báo chí và tuyên truyền... <br>- Các căn hộ rộng được lát sàn gạch cao cấp, căn nào cũng có cửa sổ rộng, ban công phơi đồ riêng biệt. Các căn hộ được thiết kế hết sức hợp lý: <br>+Loại1: Gồm 1 phòng ngủ +1 phòng khách, khu bếp có bàn bếp, tủ bếp, hút mùi, đầy đủ ánh sáng, gió và không khí vào phòng.DT45M2 <br><br>+Loại2: Gồm 2 phòng ngủ +1 phòng khách và phòng bếp riêng biệt DT 50m2. <br><br>- Mỗi phòng được trang bị điều hòa 2 chiều, giường, tủ quần áo, cửa sổ có rèm cản nắng cực đẹp, trần thạch cao, đèn ngủ đủ cả, bàn bếp xịn, hút mùi, bồn rửa bát xịn. <br>- Nhà vệ sinh được lắp thiết bị vệ sinh Inax cao cấp, bình nóng lạnh Ariston, ốp lát gạch Prime sang trọng, có bồn tắm đứng hiện đại. <br><br>Giá cho thuê:<strong> 6.500.000 - 7.500.000đ - 8.000.000đ- 8.500.000đ/căn/tháng </strong>(thanh toán tối thiểu 03 tháng và đặt cọc 1 tháng). DT Các phòng từ 45-50m2. <br><br>- Tòa nhà trang bị thang máy cao cấp, máy giặt, truyền hình cáp, internet tốc độ cao miễn phí, mỗi căn hộ được cấp thẻ từ thang máy riêng. <br>- Tòa nhà có 2 bảo vệ 24/24 nên an ninh cực ổn, ra vào thoải mái, nhà để xe rộng rãi gần 200m2, có thể chứa được đến 80 chiếc xe máy. <br><br>+ Địa chỉ: Số nhà D2 Ngõ 93 Phố Cầu Giấy, P.Quan Hoa, Q.Cầu Giấy.( Cách Cầu Giay 300m) <br><br>Liên hệ chủ nhà Chị Hương 0978 335 871. A Lượng 0982 9696 69 </div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJUaGFuZyBtXHUwMGUxeSIsIjMiOiJJbnRlcm5ldCIsIjQiOiJcdTAxMTBpXHUxZWMxdSBoXHUwMGYyYSIsIjUiOiJCXHUwMGVjb