t bị vệ sinh Inax cao cấp, ốp lát gạch Prime sang trọng.<br>Giá cho thuê: 5.000.000 đ - 5.500.000đ/căn/tháng (thanh toán tối thiểu 03 tháng và đặt cọc 01 tháng).<br>Phí dịch vụ:<br>- Điện: 3.500 đồng/số. Nước: 30.000 đồng/khối. Internet: 100.000 đồng/phòng (cáp quang).<br>- Bảo vệ 24/24, gửi xe miễn phí.<br>- Tòa nhà trang bị thang máy cao cấp, máy giặt, truyền hình cáp miễn phí, mỗi căn hộ được cấp thẻ từ thang máy riêng.<br>- Tòa nhà có bảo vệ 24/24 nên an ninh cực ổn, ra vào thoải mái, nhà để xe rộng rãi gần 200m2, có thể chứa được đến 50 chiếc xe máy.<br>+ Địa chỉ: Số nhà 20 mặt đường Hồ Rùa, ngõ 155 đường Trường Chinh – Đống Đa - HN.<br>Liên hệ chủ nhà A Lượng 0978 335 871 / 0982 9696 69</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJUaGFuZyBtXHUwMGUxeSIsIjMiOiJJbnRlcm5ldCIsIjQiOiJcdTAxMTBpXHUxZWMxdSBoXHUwMGYyYSIsIjUiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCIsIjYiOiJNXHUwMGUxeSBnaVx1MWViN3QiLCI3IjoiVHJ1eVx1MWVjMW4gaFx1MDBlY25oIGNcdTAwZTFwIn0=', 1, 0, '{\"0\":\"21.000111\",\"1\":\"105.83126130000005\"}', 1, 0, '2019-05-14 22:07:50', '2019-05-14 22:07:50');
