INSERT INTO `motelrooms` VALUES (811, 'Cho thuê phòng trọ số 63, Ngõ 6 Đặng Văn Ngữ', 'cho-thue-phong-tro-so-63-ngo-6-dang-van-ngu', 1500000, 15.0000, 1, 6, 238, 'Số 63, Ngõ 6, Đặng Văn Ngữ, Đống Đa, Hà Nội', '0975005950', 1, 'Chưa xác định', '{\"0\":\"cho-thue-phong-tro-so-63-ngo-6-dang-van-ngu-1482765174ma1gd-ugegd.jpg\",\"1\":\"cho-thue-phong-tro-so-63-ngo-6-dang-van-ngu-1482765174ma1gd-ouh0x.jpg\",\"2\":\"cho-thue-phong-tro-so-63-ngo-6-dang-van-ngu-1482765174ma1gd-njt6q.jpg\",\"3\":\"cho-thue-phong-tro-so-63-ngo-6-dang-van-ngu-1482765174ma1gd-qthev.jpg\"}', '<div class=\"dis-content\">QUÀ GIÁNG SINH MUỘN:<br>Sau những giây phút hạnh phúc bên gia đình, người thân và bạn bè. Các bạn đã thấy thực sự thoải mái và sẵn sàng để tiếp tục cuộc sống thường ngày chưa? Mình có một món quà dành cho những bạn vẫn đang lo lắng về vấn đề nhà ở.<br>Hiện nay mình đang ở một mình tại tầng 3 gồm 2 phòng đơn. mình đang thuê giá 3tr. Nên mình muốn tìm một bạn đến ở cùng để chia sẻ tiền phòng. Mình là nam (thẳng) 23 tuổi, tính thoải mái dí dỏm :))<br>Phòng 1 người, điều hòa nóng lạnh. bếp, ban công và khu vệ sinh...Giá 1Tr5. <br>Địa chỉ là ngõ 6 đặng văn ngữ. Gần đại học Ngân Hàng và các truờng lân cận khác. Chợ ngay trong ngõ cho các bạn thích nấu ăn. Bến bus cách 150m cho các bạn thích đi bộ. Có khu để xe an toàn và không mất phí cho các bạn thích đi xe :))<br>Ưu tiên nam (do mình là nam) và nữ không sơ ma (cũng do mình là nam)<br>Nếu bạn muốn xem qua, hoặc thuê phòng thì liên lạc theo số 0975005950 (Giang) nhé.<br>Cảm ơn bạn đã đọc bài viết này! Mình sẽ rất vui khi bạn tặng bài này 1 *chấm* để giúp bài đăng không bị trôi. Xin cảm ơn</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCIsIjMiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCJ9', 1, 0, '{\"0\":\"21.0118032\",\"1\":\"105.8338013\"}', 1, 0, '2019-05-14 22:08:28', '2019-05-14 22:08:28');
INSERT INTO `motelrooms` VALUES (812, 'Cho thuê phòng trọ số 63, Ngõ 13 Khuất Duy Tiến', 'cho-thue-phong-tro-so-63-ngo-13-khuat-duy-tien', 2300000, 22.0000, 1, 2, 105, 'Số 63, Ngõ 13, Khuất Duy Tiến, Thanh Xuân, Hà Nội', '0962882216', 3, 'Chưa xác định', '{\"0\":\"cho-thue-phong-tro-so-63-ngo-13-khuat-duy-tien-bfa5e.jpg\"}', '<div class=\"dis-content\">Nhà mình hiện có 2 phòng cho thuê NGAY và LUÔN <br>- Địa chỉ: ngõ 13 Khuất Duy Tiến gần ngã tư Nguyễn Trãi - Khuất Duy Tiến, gần các trường Đai học Hà Nôi, Thăng Long, Tự Nhiên, Nhân Văn, Công nghệ giao thông vận tải... Nhà gần chợ và các khu ăn uống mua sắm.<br>Không chung chủ, giờ giấc thoải mái, điện nước hộ gia đình<br>- Phòng rộng rãi, mỗi tầng 1 phòng 1 WC riêng, nấu ăn tầng 1 phơi đồ tầng 5. <br>Nhà chỉ cho nữ thuê, yêu cầu sạch sẽ giữ vệ sinh chung, ở tối đa 3 người 1 phòng. <br>- Giá trung bình: 2.300.000 <br>Liên hệ: 0962 88 22 16 Mình là Trang ( xem nhà sau 6 giờ tối)</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCIsIjMiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCJ9', 1, 0, '{\"0\":\"20.9951037\",\"1\":\"105.79853709999998\"}', 1, 0, '2019-05-14 22:08:42', '2019-05-14 22:08:42');
INSERT INTO `motelrooms` VALUES (813, 'Cho thuê phòng tại Số 8, Ngõ 250/20, khương Trung, Thanh Xuân, Hà Nội.', 'cho-thue-phong-tai-so-8-ngo-25020-khuong-trung-thanh-xuan-ha-noi', 2300000, 30.0000, 1, 2, 63, 'Số 8, Ngõ 250/20, Khương Trung, Thanh Xuân, Hà Nội', '0926100567', 2, 'Khép kín', '{\"0\":\"cho-thue-phong-tai-so-8-ngo-25020-khuong-trung-thanh-xuan-ha-noi-stcbf.jpg\",\"1\":\"cho-thue-phong-tai-so-8-ngo-25020-khuong-trung-thanh-xuan-ha-noi-jhejs.jpg\",\"2\":\"cho-thue-phong-tai-so-8-ngo-25020-khuong-trung-thanh-xuan-ha-noi-kqyts.jpg\",\"3\":\"cho-thue-phong-tai-so-8-ngo-25020-khuong-trung-thanh-xuan-ha-noi-xrjtt.jpg\"}', '<div class=\"dis-content\">CHO THUÊ PHÒNG <br>₫2,300,000<br>Khương Trung Thanh Xuân HN<br>Cho thuê Phòng ở tầng 3 khép kín trong nhà 4 tầng, rộng 30m2, thoáng mát, có sẵn 1 giường 1m8, tủ quần áo, nóng lạnh. Sân để xe tầng 1, Phơi quần áo tầng 4.<br>- Địa chỉ: Số 8 ngõ 250/20 khương Trung - Thanh Xuân Hà Nội. <br>- Khu dân trí cao, yên tĩnh, gần chợ Khương Đình, cách ngã tư sở 1.5 km.<br>- Gía: 2,3tr nếu ở 02 người, đóng tiền 1 tháng 1 lần. Điện: 4k/1 số, nước: 50k/ 1 người, Free mạng wifi, chuyển đến ở từ ngày 31/12/2016. giờ giấc sau thoải mái.<br>- Liên hệ: 0926.100.567(mình tên Nam) hoặc InBox face. <br>Vui lòng xem nhà từ 18h-21h các ngày trong tuần. <br>Cảm ơn bạn đã quan tâm!</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCIsIjMiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCJ9', 1, 0, '{\"0\":\"20.9976956\",\"1\":\"105.81697250000002\"}', 1, 0, '2019-05-14 22:08:55', '2019-05-14 22:08:55');
INSERT INTO `motelrooms` VALUES (814, 'Cho thuê phòng trọ số 17/12/47 Khương Trung ', 'cho-thue-phong-tro-so-171247-khuong-trung', 1500000, 13.0000, 1, 2, 63, 'Số 17/12/47, Khương Trung, Thanh Xuân, Hà Nội', '0973823745', 2, 'Khép kín', '{\"0\":\"cho-thue-phong-tro-so-171247-khuong-trung-1482761340ax5bu-bd2s8.jpg\"}', '<div class=\"dis-content\">Cho thuê phòng trọ <br>Ngõ 47 Khương Trung, Thanh Xuân, Hà Nội<br>Nhà mình còn phòng tầng 2 trong nhà riêng chủ 3 tầng 1 tum tại số nhà 17/12/47 Khương Trung ( ngay cầu vượt Ngã Tư Sở).<br>Diện tích 9m2, mát mẻ, sạch sẽ, an ninh đảm bảo, không chung chủ nên giờ giấc thoải mái.<br>Tầng 2 có 2 phòng chung nhau nhà vệ sinh. Đầy đủ tiện nghi: điều hòa, nóng lạnh (có tủ lạnh ở tầng 1, có thể dùng nếu muốn :D )<br>Điện nước giá nhà nước. Có chỗ nấu ăn, để xe rộng rãi ở tầng 1. Giặt và phơi tầng 4. <br>Có thể ở 1-2 người ( Ưu tiên ở 1 người). <br>Giá phòng: 1tr5. Đóng tiền 3 tháng 1 lần. Đặt cọc 1tr.<br>Liên hệ sđt: 0973 823 745</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCIsIjMiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCJ9', 1, 0, '{\"0\":\"21.000667\",\"1\":\"105.81879600000002\"}', 1, 0, '2019-05-14 22:09:01', '2019-05-14 22:09:01');
INSERT INTO `motelrooms` VALUES (815, 'Cho thuê phòng trọ tại Số 7, Ngách 31/39, Ngõ 639, Hoàng Hoa Thám', 'cho-thue-phong-tro-tai-so-7-ngach-3139-ngo-639-hoang-hoa-tham', 1800000, 20.0000, 1, 14, 161, 'Số 7, Ngách 31/39, Ngõ 639, Hoàng Hoa Thám, Ba Đình, Hà Nội', '0912976581', 9, 'Khép kín', '{\"0\":\"cho-thue-phong-tro-tai-so-7-ngach-3139-ngo-639-hoang-hoa-tham-ia3bi.jpg\"}', '<div class=\"dis-content\">Gia đình chính chủ có nhà cấp 4 cho thuê, phụ riêng biệt,điện nước tốt, gần trường học bệnh viện, chợ.., có sân để xe, khu bếp rất sạch sẽ tiện lợi phù hợp với hộ gia đình nhỏ, học sinh sinh viên, người đi làm... diện tích ~ 20m2 , có gác xép, giá 1 triệu 800 - tại số 7 ngách 31/39 ngõ 639 đường Hoàng Hoa Thám<br>LH : 0912976581 ( chú Kiên )</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCJ9', 1, 0, '{\"0\":\"21.0418661\",\"1\":\"105.82124810000005\"}', 1, 0, '2019-05-14 22:09:02', '2019-05-14 22:09:02');
INSERT INTO `motelrooms` VALUES (817, 'Tìm bạn ở ghép', 'tim-ban-o-ghep', 800000, 16.0000, 1, 16, 44, 'số 95 yên hòa cầu giấy hà nội, Yên Hòa, Cầu Giấy, Hà Nội', '0947465467', 2, 'Chung', '{\"0\":\"tim-ban-o-ghep-pljkd.jpg\"}', '<div class=\"dis-content\">Ở 1 mình hơi chán, nên mình muốn tìm 1 bạn nam ( sn 94&gt;&gt;98) ở ghép cho vui, vừa đỡ tiền nhà, vừa đỡ tự kỷ =)). Phòng thì ở tầng 2 trong căn nhà 5 tầng, mới xây nên cực sạch sẽ. Ở cùng cổng với chủ nhà nên 5h sáng mở cửa, 10h đóng cửa ( thanh niên nào mà bay nhảy thì xác định đê :)), chủ nhà hiền lành vui tính. Phòng chung nhà vs với tầng 2 ( nhà về sinh ngay cửa phòng mình cực tiện mà không khó chịu, hàng tháng có người dọn). Mình thuê phòng là 1tr5/tháng chia đôi mỗi người 1 nữa, điện 4k/số ( mình đi cả ngày, tháng trước hết có 80k tiền điện :D), nước 135k/người dùng tẹt ga.Phòng 2 cửa sổ nên thoáng mát, ấm áp khỏi phải nói... và còn rất nhiều điều tuyệt nữa. </div>', 'eyIwIjoiSW50ZXJuZXQifQ==', 1, 0, '{\"0\":\"21.02862\",\"1\":\"105.79847900000004\"}', 1, 0, '2019-05-14 22:09:13', '2019-05-14 22:09:13');
INSERT INTO `motelrooms` VALUES (818, 'Tìm nữ ở ghép ngõ 1194 đường Láng', 'tim-nu-o-ghep-ngo-1194-duong-lang', 2800000, 18.0000, 1, 6, 183, 'Gần hồ Ao phủ ngõ 1194 đường Láng, Đường Láng, Đống Đa, Hà Nội', '01633795822', 2, 'Khép kín', '{\"0\":\"tim-nu-o-ghep-ngo-1194-duong-lang-ju9cv.jpg\"}', '<div class=\"dis-content\">Mình đang cần tìm nữ ở ghép. Phòng rộng 18m2 khép kín ở ngõ 1194 Đường Láng, Đống Đa ( gần đại học Ngoại thương, Ngoại Giao, Luật, Hành chính quốc gia..) Ưu điểm rất thoáng mát, đầy đủ vật dụng. <br><br>- Giá: 1.3 triệu/1 người ( đã bao gồm điện nước, xe cộ, wifi....)<br><br>- Yêu cầu bạn nữ sạch sẽ, gọn gàng, ngoan ngoãn.<br><br>- Thông tin liên hệ: 01633795822</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCJ9', 1, 0, '{\"0\":\"21.0140057\",\"1\":\"105.8067337\"}', 1, 0, '2019-05-14 22:09:15', '2019-05-14 22:09:15');
INSERT INTO `motelrooms` VALUES (819, 'Nam ở ghép.', 'nam-o-ghep', 800000, 16.0000, 1, 16, 44, 'số 95 phố yên hòa phường yên hòa cầu giấy hà nội., Yên Hòa, Cầu Giấy, Hà Nội', '0947343894', 2, 'Chung', '{\"0\":\"nam-o-ghep-ntzru.jpg\"}', '<div class=\"dis-content\">Ở 1 mình hơi chán, nên mình muốn tìm 1 bạn nam ( sn 94&gt;&gt;98) ở ghép cho vui, vừa đỡ tiền nhà, vừa đỡ tự kỷ =)). Phòng thì ở tầng 2 trong căn nhà 5 tầng, mới xây nên cực sạch sẽ. Ở cùng cổng với chủ nhà nên 5h sáng mở cửa, 10h đóng cửa ( thanh niên nào mà bay nhảy thì xác định đê :)), chủ nhà hiền lành vui tính. Phòng chung nhà vs với tầng 2 ( nhà về sinh ngay cửa phòng mình cực tiện mà không khó chịu, hàng tháng có người dọn). Mình thuê phòng là 1tr5/tháng chia đôi mỗi người 1 nữa, điện 4k/số ( mình đi cả ngày, tháng trước hết có 80k tiền điện :D), nước 135k/người dùng tẹt ga.Phòng 2 cửa sổ nên thoáng mát, ấm áp khỏi phải nói... và còn rất nhiều điều tuyệt nữa. Ai thích thì lh : 0947343894 ( mình tên Hợp sn 94 cho tiện xưng hô). D/c: số 95 phố yên hòa ( cầu cót đi vào) - cầu giấy hà nôi.</div>', 'eyIwIjoiSW50ZXJuZXQifQ==', 1, 0, '{\"0\":\"21.0218044\",\"1\":\"105.79087200000004\"}', 1, 0, '2019-05-14 22:09:39', '2019-05-14 22:09:39');
