INSERT INTO `motelrooms` VALUES (822, 'Cho thuê phòng trọ số 15 Khương Đình', 'cho-thue-phong-tro-so-15-khuong-dinh', 2000000, 20.0000, 1, 2, 89, 'Số 15, Khương Đình, Thanh Xuân, Hà Nội', '0977719933', 4, 'Chưa xác định', '{\"0\":\"cho-thue-phong-tro-so-15-khuong-dinh-1482570330yg5uo-ttv3t.jpg\"}', '<div class=\"dis-content\">Cho thuê phòng trọ .<br>20 m2, giá 2 triệu/ tháng , tầng 3 ( cho ở 3-4 người )<br>( phù hợp cho 3-4 bạn không có xe và đi xe buýt nhé )<br>thuộc nhà 5 tầng mặt đường số nhà 15 Khương Đình giao Nguyễn Trãi , riêng chủ, tự đi lại giờ giấc, cách bến xe bus đường Nguyễn Trãi 30m , cách Royal City 300m , cách DH xã hội nhân văn 300m , gần ĐH thủy lợi - công đoàn - học viện ngân hàng, chung wc với một phòng nhỏ cùng tầng, xe gửi ngoài cách nhà 40 m. điện 3,5 k/ số. nước 60k/người /tháng, nét 60k/phòng ,. liên hệ chính chủ 0977719933 ( hết tháng vào ở được )</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCIsIjMiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCJ9', 1, 0, '{\"0\":\"20.997855\",\"1\":\"105.81351799999993\"}', 1, 0, '2019-05-14 22:09:51', '2019-05-14 22:09:51');
