INSERT INTO `motelrooms` VALUES (825, 'Cho thuê phòng tại P1404, Toà Nhà NC2, khu đô thị mới Cầu Bươu, Tân Triều, Thanh Trì', 'cho-thue-phong-tai-p1404-toa-nha-nc2-khu-do-thi-moi-cau-buou-tan-trieu-thanh-tri', 2000000, 15.0000, 1, 28, 0, 'P1404, Toà Nhà NC2, khu đô thị mới Cầu Bươu, Thanh Trì, Hà Nội', '01687306056', 2, 'Khép kín', '{\"0\":\"cho-thue-phong-tai-p1404-toa-nha-nc2-khu-do-thi-moi-cau-buou-tan-trieu-thanh-tri-d7weo.jpg\"}', '<div class=\"dis-content\"> Vợ chồng tớ và 1 con nhỏ đag ở p1404,toà nhà NC2,kđt mới cầu bươu,tân triều,thah trì( đối diện CT6,gần bv K,103) căn chug cư rộg 86m2. Có 2pn 2nvs 1pk 1 bếp 2 ban công,bếp và đồ đạc đầy đủ,nóng lạh điều hoà tủ lạh máy giạt.<br>Nay vc tớ muốn tìm 2b nữ(sv hs) ở ghép cùg,vì vc t ở thì rộg quá,mà đi làm cả ngày tối mới về. Vc t dễ tíh thoải mái. Đồ đạc dùg chung thoái mái. <br>Giá : 2trieu cho 2 bạn. <br>1ban thi 1.3trieu Nhu cầu ib tớ hoặc alo 01687306056<br>Giờ giấc thoải mái chìa khoá riêng</div>', '', 1, 0, '{\"0\":\"20.9344418\",\"1\":\"105.84622880000006\"}', 1, 0, '2019-05-14 22:10:14', '2019-05-14 22:10:14');
