INSERT INTO `motelrooms` VALUES (828, 'Cho thuê phòng trọ số 125 Chính Kính', 'cho-thue-phong-tro-so-125-chinh-kinh', 2800000, 25.0000, 1, 2, 190, 'Số 125, Chính Kinh, Thanh Xuân, Hà Nội', '0973478739', 4, 'Chưa xác định', '{\"0\":\"cho-thue-phong-tro-so-125-chinh-kinh-1cmcu.jpg\",\"1\":\"cho-thue-phong-tro-so-125-chinh-kinh-kdyd0.jpg\"}', '<div class=\"dis-content\">Mình còn 1 phòng to 25m2 tầng 3 trong nhà 4 tầng. Địa chỉ 125 phố Chính Kinh, Thanh Xuân. Gần trường Nhân Văn, Đại Nam, Kinh tế cơ sở 2. Nhà ngay gần chợ Chính Kinh, cách mặt đường Nguyễn Trãi khoảng 100m, thuận tiện đi lại, khu dân cư cực đông đúc.<br>- Phòng có 2 ban công rộng, thoáng mát, nhà vs bên ngoài ngay cạnh cầu thang, 2 phòng chung 1 nhà vs (bên cạnh là phòng nhỏ 10m2)<br>- Có nóng lạnh đầy đủ<br>- Có 1 tủ to<br>- Có chỗ để xe, nấu ăn, để máy giặt, tủ lạnh.<br>- Phơi đồ tầng 4 rộng rãi.<br>Phòng rộng có thể ở 3,4 người<br>Không chung chủ, thời gian đi lại tự do.<br>Giá 2,8tr. Điện 3,5k/số, nước 70k/người. Mạng chia nhau.<br>LH: 0973.478.739 (chị Mai nhé)</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCIsIjMiOiJcdTAxMTBpXHUxZWMxdSBoXHUwMGYyYSIsIjQiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCJ9', 1, 0, '{\"0\":\"21.0004959\",\"1\":\"105.810832\"}', 1, 0, '2019-05-14 22:10:32', '2019-05-14 22:10:32');
INSERT INTO `motelrooms` VALUES (829, 'Cho thuê phòng trọ số 24, Ngõ 260 Cầu Giấy', 'cho-thue-phong-tro-so-24-ngo-260-cau-giay', 2400000, 25.0000, 1, 16, 16, 'Số 24, Ngõ 260, Cầu Giấy, Cầu Giấy, Hà Nội', '01693149229', 3, 'Chưa xác định', '{\"0\":\"cho-thue-phong-tro-so-24-ngo-260-cau-giay-1wv6l.jpg\"}', '<div class=\"dis-content\">hà mình ở đang có phòng cho nữ thuê tại ngõ 260 Cầu Giấy (cạnh chùa Hà).<br>Là nhà riêng, không chung chủ. Phòng rộng 24m2 ở tầng 3 (chỉ có 2 phòng tầng 3 cho nữ thuê). Mỗi tầng có 1 WC, có nóng lạnh, wifi đầy đủ. Phòng có đầy đủ giường, tủ quần áo. Có chỗ nấu ăn, giặt giũ trên tầng 4, khu vực an ninh tốt, gần chợ, bến xe bus. Vì là nhà riêng nên giờ giấc thoải mái.<br>Giá phòng 2tr4/tháng, có thể ở 2-3 người, điện nước tính theo giá nhà dân.<br>Ai có nhu cầu liên hệ theo SĐT của mình 01693149229</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCIsIjMiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCJ9', 1, 0, '{\"0\":\"21.0356013\",\"1\":\"105.7961808\"}', 1, 0, '2019-05-14 22:10:54', '2019-05-14 22:10:54');
INSERT INTO `motelrooms` VALUES (830, 'Cho thuê phòng trọ số 82/22 Tôn Thất Tùng', 'cho-thue-phong-tro-so-8222-ton-that-tung', 3000000, 25.0000, 1, 6, 178, 'Số 82/22 , Tôn Thất Tùng, Đống Đa, Hà Nội', '01698844237', 5, 'Chưa xác định', '{\"0\":\"cho-thue-phong-tro-so-8222-ton-that-tung-iy78c.jpg\"}', '<div class=\"dis-content\">vì m chuyển công tác cần nhượng lại phòng địa chỉ 82/22 Tôn Thất Tùng( ngõ thông ra Khương Thượng, Trường Chinh) <br>‼‼ Gần các trường Đại học y, thủy lợi, ngan hàng, cong đoàn, ngã 4 sở<br>‼ Phòng thic hợp cho hộ gđ trẻ hoặc 1 nhóm bạn ở từ 4-5ng <br>✅ điện: 4k/số, nước giá kinh doanh<br>✅ có chỗ để xe<br>✅ có nóng lạnh, quạt trần <br>Đóng tiền nhà 3th/lần<br>Bạn nào quan tâm lh sdt 01698844237( Vân) , 0977993406(Nhung) <br>‼‼ k nhận SMS, các bạn quan tam vui lòng gđ</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCIsIjMiOiJcdTAxMTBpXHUxZWMxdSBoXHUwMGYyYSIsIjQiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCJ9', 1, 0, '{\"0\":\"21.002959\",\"1\":\"105.82990100000006\"}', 1, 0, '2019-05-14 22:11:03', '2019-05-14 22:11:03');
