INSERT INTO `motelrooms` VALUES (833, 'Tìm nữ ở ghép tại Số 10, Ngách 20, Ngõ 55, Chính Kinh, Thanh Xuân, Hà Nội', 'tim-nu-o-ghep-tai-so-10-ngach-20-ngo-55-chinh-kinh-thanh-xuan-ha-noi', 1900000, 16.0000, 1, 2, 190, 'Số 10, Ngách 20, Ngõ 55, Chính Kinh, Thanh Xuân, Hà Nội', '01632088794', 3, 'Khép kín', '{\"0\":\"tim-nu-o-ghep-tai-so-10-ngach-20-ngo-55-chinh-kinh-thanh-xuan-ha-noi-qoqq3.jpg\"}', '<div class=\"dis-content\">[ TÌM NỮ Ở GHÉP - NGÃ TƯ SỞ]<br>Phòng khép kín 16m2 chưa kể gác xép, có nóng lạnh, điều hòa, wifi.<br>Tiền phòng 1.900k, điện 4k/số, nước 30k/số chia đầu người, ngoài ra không thu thêm phí gì khác.<br>Phòng mình ở 3 người ở phố Chính Kinh gần Ngã 4 sở, Royal City, hiện tại có 1 bạn chuyển đi, muốn tìm 1 bạn sv ở ghép cùng vì cả 2 đều là sv và 10h-10h30 nhà chủ đóng cổng. Nhà k có chỗ để xe, mn ở đây có xe đều gửi ở cổng chợ Thượng Đình<br>ib mình hoặc l.hệ 01632088794 <br>đ/c sn 10, ngách 20, ngõ 55 phố chính kinh<br>Mình cảm ơn ạ.</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCIsIjMiOiJcdTAxMTBpXHUxZWMxdSBoXHUwMGYyYSIsIjQiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCJ9', 1, 0, '{\"0\":\"20.9992649\",\"1\":\"105.81134889999998\"}', 1, 0, '2019-05-14 22:11:15', '2019-05-14 22:11:15');
INSERT INTO `motelrooms` VALUES (834, 'Cho thuê phòng trọ tại Số 5, Ngõ Hồ Dài, Đống Đa, Hà Nội', 'cho-thue-phong-tro-tai-so-5-ngo-ho-dai-dong-da-ha-noi', 2300000, 25.0000, 1, 6, 0, ' Số 5, Ngõ Hồ Dài, Đống Đa, Hà Nội', '0906068717', 2, 'Khép kín', '{\"0\":\"cho-thue-phong-tro-tai-so-5-ngo-ho-dai-dong-da-ha-noi-94owj.jpg\"}', '<div class=\"dis-content\">Mình có phòng cho thuê,phòng ở tầng 2 rộng khoảng 25m2 giá thuê 2.3 triệu ( nếu ở 1 người giá 2 triệu ), fix nhẹ cho bạn nào thuê lâu dài.Địa chỉ số 5 ngõ Hồ Dài - Đống Đa - Hà Nội ( cạnh số 27 Khâm Thiên đi vào ).Gần các trường Đại Học Y, Bách Khoa, Xây Dựng.......<br><br>Phòng sạch sẽ, có ban công thoáng mát, có chỗ nấu ăn thoải mái, cách mặt đường Khâm Thiên 20m.Để xe tầng 1.Không chung chủ, giờ giấc thoải mái. Khu trung tâm, an ninh và tiện lại, đi bộ 3p là ra tới chợ to và điểm bắt xe bus<br><br>Điện 3k/số, nước 80k/người.Mấy em sinh viên mà không có tủ lạnh thì mình cho gửi nhờ ở tủ nhà mình.<br><br>Liên hệ : 0906068717 ( Mình tên Năm ).Miễn tiếp môi giới và trung gian ạ.</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCIsIjMiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCJ9', 1, 0, '{\"0\":\"21.0180725\",\"1\":\"105.8299495\"}', 1, 0, '2019-05-14 22:11:18', '2019-05-14 22:11:18');
INSERT INTO `motelrooms` VALUES (835, 'Cho thuê phòng trọ tại Ngõ 2, Hoàng Quốc Việt, Hà Nội ', 'cho-thue-phong-tro-tai-ngo-2-hoang-quoc-viet-ha-noi', 1500000, 20.0000, 1, 16, 70, 'Ngõ 2, Hoàng Quốc Việt, Cầu Giấy, Hà Nội', '01698516674', 3, 'Khép kín', '{\"0\":\"cho-thue-phong-tro-tai-ngo-2-hoang-quoc-viet-ha-noi-z2wxh.jpg\",\"1\":\"cho-thue-phong-tro-tai-ngo-2-hoang-quoc-viet-ha-noi-kblmy.jpg\",\"2\":\"cho-thue-phong-tro-tai-ngo-2-hoang-quoc-viet-ha-noi-fhlqy.jpg\"}', '<div class=\"dis-content\">Hiện mình có phòng cho thuê ở ngõ 2 Hoàng Quốc Việt (đi vào khoảng 100m) gần các trường: Học viện Kỹ thuật Quân sự, Đại học Giao thông vận tải, Cao đẳng Du lịch, Cao đẳng mẫu giáo trung ương, Học viện Báo chí và tuyên truyền...<br>- Phòng rộng 20-25-30-35m2 khép kín, sạch sẽ, cửa sổ thoáng mát...(Có thể ở từ 2 đến 3 người/phòng).<br>- Điện nước lắp công tơ riêng, giúp các bạn có thể yên tâm; An ninh tốt.<br>- Giờ giấc tự quản, không chung chủ.<br>- Giá thuê từ 1,5 triệu đến 2,5 triệu/ tháng.<br>- Liên hệ chủ nhà: 01698.516.674 hoặc 0913.383.324 ( Các b gọi trực tiếp cho chủ nhà nhé)</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCIsIjMiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCJ9', 1, 0, '{\"0\":\"21.0473438\",\"1\":\"105.80445529999997\"}', 1, 0, '2019-05-14 22:11:19', '2019-05-14 22:11:19');
INSERT INTO `motelrooms` VALUES (836, 'cho thuê 2 phòng thông nhau  trọ tại Vũ Tông Phan', 'cho-thue-2-phong-thong-nhau-tro-tai-vu-tong-phan', 3600000, 38.0000, 1, 2, 159, 'ngo 509 Vu Tong Phan Ha Noi, Vũ Tông Phan, Thanh Xuân, Hà Nội', '01676090067', 3, 'Khép kín', '{\"0\":\"cho-thue-2-phong-thong-nhau-tro-tai-vu-tong-phan-1482413884iza5g-fljjv.jpg\",\"1\":\"cho-thue-2-phong-thong-nhau-tro-tai-vu-tong-phan-1482413884iza5g-resized-x77bo.jpg\",\"2\":\"cho-thue-2-phong-thong-nhau-tro-tai-vu-tong-phan-1482413884iza5g-yedts.jpg\",\"3\":\"cho-thue-2-phong-thong-nhau-tro-tai-vu-tong-phan-1482413884iza5g-resized-fvvxv.jpg\",\"4\":\"cho-thue-2-phong-thong-nhau-tro-tai-vu-tong-phan-1482413884iza5g-1wuso.jpg\",\"5\":\"cho-thue-2-phong-thong-nhau-tro-tai-vu-tong-phan-1482413884iza5g-resized-pxkti.jpg\"}', '<div class=\"dis-content\">{CHO THUÊ} Còn 1 phòng đôi 36m2( 2 phòng này thông nhau nhé)  tại tầng 3 trong nhà 4 tầng View hồ đẹp ( chiều có thể tập thể dục tại hồ này, rất mát mẻ và dễ chịu) điều hòa cực mát tại ngõ 509 vũ tông phan <br><br>Giá phòng 3tr6/tháng(Đóng tiền 1 tháng,cọc 1 tháng )<br>Bao gồm:  có giường +điều hòa 2 chiều +máy giặt ,bếp, +nóng lạnh…<br>Tầng 1 để xe<br>Tầng 4 máy giặt và phơi đồ<br>Mỗi tầng 1 vệ sinh riêng biệt<br>Giờ giấc thoải mái, không chung chủ<br>Mạng 90k/1p.Điện nước chia đầu người( Giá điện nước nhà dân nhé )<br>Chỉ cho ở tối đa 3 người (hoặc gia đình 3 người có cháu nhỏ)<br>Ưu tiên dân văn phòng, hộ gia đình hoặc nhóm bạn sạch sẽ.<br>ĐỊA CHỈ NHÀ: TRONG NGÕ 509 VŨ TÔNG PHAN<br>Nhà ngõ rộng , xe ba gác vào tận cửa, có camera 24/24 lắp riêng , an ninh, sạch sẽ , view hồ đẹp.<br>Bạn nào cần inbox face hoặc gọi tớ 01676290067 (không qua môi giới) <br><br><br></div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCIsIjMiOiJcdTAxMTBpXHUxZWMxdSBoXHUwMGYyYSIsIjQiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCJ9', 1, 0, '{\"0\":\"20.9906743\",\"1\":\"105.8137994\"}', 1, 0, '2019-05-14 22:11:25', '2019-05-14 22:11:25');
