INSERT INTO `motelrooms` VALUES (841, 'Cho thuê phòng tại Số 30, Phạm Văn Đồng, Hà Nội', 'cho-thue-phong-tai-so-30-pham-van-dong-ha-noi', 2000000, 20.0000, 1, 16, 32, 'Số 30, Phạm Văn Đồng, Cầu Giấy, Hà Nội', '0986913870', 3, 'Khép kín', '{\"0\":\"cho-thue-phong-tai-so-30-pham-van-dong-ha-noi-bhhfo.jpg\",\"1\":\"cho-thue-phong-tai-so-30-pham-van-dong-ha-noi-thsyu.jpg\",\"2\":\"cho-thue-phong-tai-so-30-pham-van-dong-ha-noi-lehma.jpg\",\"3\":\"cho-thue-phong-tai-so-30-pham-van-dong-ha-noi-iccov.jpg\",\"4\":\"cho-thue-phong-tai-so-30-pham-van-dong-ha-noi-dk1d2.jpg\"}', '<div class=\"dis-content\">--MÌnh có thuê một căn hộ ở chung cư lucky building 30 phạm văn đồng Quận cầu giấy ( gần các trường đại học DH quốc gia , báo chí tuyên truyền... gần chợ) dưới chung cư có siêu thị và ngân hàng rất tiện lợi . <br>gồm 2 phòng ngủ 2 phòng vệ sinh một phòng khách 1 phòng bếp<br>có sẵn bếp và tủ lạnh . các bạn ko có đồ rất tiện dụng nếu đến ở<br>Mình ưu tiên ai đến ở luôn dc nhé .<br>*****Mình muốn cho thuê lại 1 phòng ngủ rộng 20m2 có cửa sổ nhìn ra ngoài ( có 1 phòng vệ sinh riêng) <br>--Giá Thuê : 2 triệu ( ở được tối đa 3 người)<br>đóng tiền 3 tháng 1 cọc 1 triệu <br>Phí dịch vụ khu chung cư là 250k 1 tháng chia đầu người ra cũng chả mấy cả<br>--ĐIện nước giá dân cực rẻ . Giờ giấc thoải mái . có chìa khóa phòng riêng và chìa khóa cửa riêng thích về lúc nào cũng dc<br>chung cư an toàn có hầm để xe sạch sẽ rộng rãi<br>--Có camera giám sát an nình tốt<br>vệ sinh phòng đẹp mới có bồn rửa mặt gương bồn cầu bệt vòi hoa sen<br>Mình ko rep comment nên bạn nào nhiệt tình có thể inbox trực tiếp cho mình hoặc chấm để mình inbox Hoặc gọi vào số đt của chị mình Chị Trang:0986913870</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJUaGFuZyBtXHUwMGUxeSIsIjMiOiJJbnRlcm5ldCIsIjQiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCJ9', 1, 0, '{\"0\":\"21.043131\",\"1\":\"105.78119850000007\"}', 1, 0, '2019-05-14 22:12:34', '2019-05-14 22:12:34');
