INSERT INTO `motelrooms` VALUES (843, 'Cho thuê phòng trọ số 21, Ngõ 155 Trường Chinh', 'cho-thue-phong-tro-so-21-ngo-155-truong-chinh', 1600000, 15.0000, 1, 6, 120, 'Số 21, Ngõ 155 , Trường Chinh, Đống Đa, Hà Nội', '0972395115', 2, 'Chưa xác định', '{\"0\":\"cho-thue-phong-tro-so-21-ngo-155-truong-chinh-ajsjm.jpg\"}', '<div class=\"dis-content\">Mình có việc đột xuất phải chuyển nhà đến văn phòng ở, nhượng lại bạn nào có nhu cầu tìm nhà.<br>Phòng tầng 2 trong nhà 4 tầng, rộng cỡ 12-15m, sạch sẽ không ố vàng ẩm mốc, vệ sinh chung với phòng đối diện, nấu ăn tầng 1 hoặc tầng 4, cả nhà có 6 phòng, mùa hè cực mát, đóng tiền 3 tháng 1 và cọc 1 tháng, điện nước nhà dân chia đầu người, thích hợp cho bạn nào ở một mình hoặc 2 người, đây là phòng mình rất ưng giờ có việc phải chuyển đi, bạn nào có nhu cầu alo trực tiếp không inbox nhắn tin mất thời gian: 0972.395.115</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCIsIjMiOiJcdTAxMTBpXHUxZWMxdSBoXHUwMGYyYSIsIjQiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCJ9', 1, 0, '{\"0\":\"20.999641\",\"1\":\"105.83793100000003\"}', 1, 0, '2019-05-14 22:12:51', '2019-05-14 22:12:51');
INSERT INTO `motelrooms` VALUES (844, 'Cho thuê phòng trọ số 8, Ngách 177/22, Ngõ 177 Cầu Diễn ', 'cho-thue-phong-tro-so-8-ngach-17722-ngo-177-cau-dien', 1000000, 17.0000, 1, 10, 61, 'Số 8, Ngách 177/22, Ngõ 177, Cầu Diễn, Từ Liêm, Hà Nội', '01648302337', 3, 'Chưa xác định', '{\"0\":\"cho-thue-phong-tro-so-8-ngach-17722-ngo-177-cau-dien-93pdg.jpg\",\"1\":\"cho-thue-phong-tro-so-8-ngach-17722-ngo-177-cau-dien-lynrf.jpg\",\"2\":\"cho-thue-phong-tro-so-8-ngach-17722-ngo-177-cau-dien-pzox2.jpg\"}', '<div class=\"dis-content\">ình học xong nên chuyển về, trong xóm có 1 em sẽ chuyển sang phòng mình, nên mình muốn nhượng lại phòng của em chuyển sang phòng mình cho bạn nào có nhu cầu<br>+phòng khép kín<br>+sân để xe rộng, thoải mái rộng rãi<br>+an ninh tốt<br>+gần điểm bus kiều mai<br>+phù hợp với sinh viên và người đi làm<br>+đi qua nhà chủ nhưng bác chủ dễ tính, bạn bè tới chơi thoải mái<br>+chìa khoá cổng mỗi người 1 cái, 11h đêm bác sẽ khoá thêm 2 ổ nữa ( đa số bác đóng cửa vào lúc 11h30-12h, nếu ai về muộn có thể gọi điện bảo bác, lúc về gọi bác bác ra mở cửa cho liền )<br>~~Phòng 1 triệu ( có thể ở 2-3, nhưng phòng này chỉ nên ở 2 cho thoải mái )<br>Nước 60k/người/tháng<br>Tiền rác, điện lối đi chung 20k/người/ tháng ( mỗi ngày bác sẽ đổ rác cho cả xóm, các b chỉ cần để vào xô chỗ vệ sinh chung của tầng mình là được)<br>Điện 4k/số<br>Mạng 60k/phòng<br>Mình ở nhà số 8, ngách 177/22, ngõ 177 cầu diễn ( chỗ đường hầm dành cho người đi bộ kiều mai đối diện văn tiến dũng )<br>Sdt: 01648.302.337<br>Ai tới xem phòng có thể liên lạc mình.</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCIsIjMiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCJ9', 1, 0, '{\"0\":\"21.0345864\",\"1\":\"105.76299240000003\"}', 1, 0, '2019-05-14 22:12:56', '2019-05-14 22:12:56');
