INSERT INTO `motelrooms` VALUES (848, 'Ở ghép phố Yên Hòa - Cầu Giay - Hà Nội', 'o-ghep-pho-yen-hoa-cau-giay-ha-noi', 700000, 16.0000, 1, 16, 44, 'số 95 phố yên cầu - phường yên hòa- quận cầu giấy - hà nội, Yên Hòa, Cầu Giấy, Hà Nội', '0947343894', 2, 'Chung', '{\"0\":\"o-ghep-pho-yen-hoa-cau-giay-ha-noi-sfctx.jpg\"}', '<div class=\"dis-content\">Ở 1 mình hơi chán, nên mình muốn tìm 1 bạn nam ( sn 94&gt;&gt;98) ở ghép cho vui, vừa đỡ tiền nhà, vừa đỡ tự kỷ =)). Phòng thì ở tầng 2 trong căn nhà 5 tầng, mới xây nên cực sạch sẽ. Ở cùng cổng với chủ nhà nên 5h sáng mở cửa, 10h đóng cửa ( thanh niên nào mà bay nhảy thì xác định đê :)), chủ nhà hiền lành vui tính. Phòng chung nhà vs với tầng 2 ( nhà về sinh ngay cửa phòng mình cực tiện mà không khó chịu, hàng tháng có người dọn). Mình thuê phòng là 1tr5/tháng chia đôi mỗi người 1 nữa, điện 4k/số ( mình đi cả ngày, tháng trước hết có 80k tiền điện :D), nước 135k/người dùng tẹt ga.Phòng 2 cửa sổ nên thoáng mát, ấm áp khỏi phải nói... và còn rất nhiều điều tuyệt nữa. Ai thích thì lh : 0947343894 ( mình tên Hợp sn 94 cho tiện xưng hô). D/c: số 95 phố yên hòa ( cầu cót đi vào) - cầu giấy hà nôi.</div>', 'eyIwIjoiSW50ZXJuZXQifQ==', 1, 0, '{\"0\":\"21.0218044\",\"1\":\"105.79087200000004\"}', 1, 0, '2019-05-14 22:13:50', '2019-05-14 22:13:50');
