INSERT INTO `motelrooms` VALUES (858, 'Nam ở ghép Yên Hòa Cầu Giay Hà Nội.', 'nam-o-ghep-yen-hoa-cau-giay-ha-noi', 700000, 16.0000, 1, 16, 44, 'số 95 yên hòa cầu giấy hà nội., Yên Hòa, Cầu Giấy, Hà Nội', '0947343894', 2, 'Chung', '{\"0\":\"nam-o-ghep-yen-hoa-cau-giay-ha-noi-vxnxn.jpg\"}', '<div class=\"dis-content\">Ở 1 mình hơi chán, nên mình muốn tìm 1 bạn nam ( sn 94&gt;&gt;98) ở ghép cho vui, vừa đỡ tiền nhà, vừa đỡ tự kỷ =)). Phòng thì ở tầng 2 trong căn nhà 5 tầng, mới xây nên cực sạch sẽ. Ở cùng cổng với chủ nhà nên 5h sáng mở cửa, 10h đóng cửa ( thanh niên nào mà bay nhảy thì xác định đê :)), chủ nhà hiền lành vui tính. Phòng chung nhà vs với tầng 2 ( nhà về sinh ngay cửa phòng mình cực tiện mà không khó chịu, hàng tháng có người dọn). Mình thuê phòng là 1tr5/tháng chia đôi mỗi người 1 nữa, điện 4k/số ( mình đi cả ngày, tháng trước hết có 80k tiền điện :D), nước 135k/người dùng tẹt ga.Phòng 2 cửa sổ nên thoáng mát, ấm áp khỏi phải nói... và còn rất nhiều điều tuyệt nữa. Ai thích thì lh : 0947343894 ( mình tên Hợp sn 94 cho tiện xưng hô). D/c: số 95 phố yên hòa ( cầu cót đi vào) - cầu giấy hà nôi.</div>', 'eyIwIjoiSW50ZXJuZXQifQ==', 1, 0, '{\"0\":\"21.02862\",\"1\":\"105.79847900000004\"}', 1, 0, '2019-05-14 22:15:47', '2019-05-14 22:15:47');
INSERT INTO `motelrooms` VALUES (859, 'Cho thuê phòng trọ số 4, Ngách 18, Ngõ 629 Kim Mã', 'cho-thue-phong-tro-so-4-ngach-18-ngo-629-kim-ma', 2000000, 30.0000, 1, 14, 206, 'Số 4, Ngách 18, Ngõ 629 Kim Mã , Kim Mã, Ba Đình, Hà Nội', '0996152182', 4, 'Chưa xác định', '{\"0\":\"cho-thue-phong-tro-so-4-ngach-18-ngo-629-kim-ma-1481876212zi5pb-qa08g.jpg\",\"1\":\"cho-thue-phong-tro-so-4-ngach-18-ngo-629-kim-ma-1481876212zi5pb-nu71y.jpg\",\"2\":\"cho-thue-phong-tro-so-4-ngach-18-ngo-629-kim-ma-1481876212zi5pb-vdeqy.jpg\"}', '<div class=\"dis-content\">Nhà trọ bên chồng mình xây cho thuê còn 2 phòng ở tầng 2 giá 2tr. Nhà này là nhà trọ riêng sinh hoạt các bạn tự quản lý. phòng rất rộng 30m2 ở được 3-4 người. Có sẵn tủ, giường bếp nấu ăn, có bình nóng lạnh, có điều hòa ( mùa này lạnh rồi các bạn nên tắt , cần thì dùng quạt ) tắm có bình nước nóng. Hầu như những thứ cần đều có sẵn. Có camera an ninh ở cổng và hành lang. Phơi đồ sân thượng. để xe tầng 1<br>Tiền phòng: 2tr/ tháng. Điện: 2,5k/ số ; nước 70k/ người, Wifi : cáp quang, các bạn tự chia ra khoảng 50k.<br>Phòng nằm tại tầng 2 nhà 5 tầng mới xây, to đẹp, ban công rộng rãi thoáng mát, nhiều cây xanh. Địa chỉ: Số 4 ngách 18 ngõ 629 Kim Mã, đối diện công viên thủ lệ. Gần HV Ngoại Giao, Ngoại thương, Luật, Hành chính, giao thông vận tải. Tiện đường xe bus, chợ ngay ngõ. Khu dân trí cao, an ninh tốt. Mẹ chồng mình 0996152182</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCIsIjMiOiJcdTAxMTBpXHUxZWMxdSBoXHUwMGYyYSIsIjQiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCJ9', 1, 0, '{\"0\":\"21.0337815\",\"1\":\"105.81405389999998\"}', 1, 0, '2019-05-14 22:15:55', '2019-05-14 22:15:55');
