INSERT INTO `motelrooms` VALUES (865, 'Phòng khép kín trong toà nhà 7 tầng quận Long Biên', 'phong-khep-kin-trong-toa-nha-7-tang-quan-long-bien', 2200000, 20.0000, 1, 8, 51, 'Chung cư mini 7 tầng, số 29 ngõ 229 Nguyễn Văn Linh – Phúc Đồng, Q.Long Biên, Nguyễn Văn Linh, Long Biên, Hà Nội', '0904748688', 3, 'Khép kín', '{\"0\":\"phong-khep-kin-trong-toa-nha-7-tang-quan-long-bien-oem6k.jpg\",\"1\":\"phong-khep-kin-trong-toa-nha-7-tang-quan-long-bien-ymfz3.jpg\",\"2\":\"phong-khep-kin-trong-toa-nha-7-tang-quan-long-bien-izheg.jpg\",\"3\":\"phong-khep-kin-trong-toa-nha-7-tang-quan-long-bien-xhgwk.jpg\",\"4\":\"phong-khep-kin-trong-toa-nha-7-tang-quan-long-bien-haprm.jpg\",\"5\":\"phong-khep-kin-trong-toa-nha-7-tang-quan-long-bien-c8sw3.jpg\",\"6\":\"phong-khep-kin-trong-toa-nha-7-tang-quan-long-bien-g0ora.jpg\",\"7\":\"phong-khep-kin-trong-toa-nha-7-tang-quan-long-bien-0ytll.jpg\",\"8\":\"phong-khep-kin-trong-toa-nha-7-tang-quan-long-bien-ylkkg.jpg\"}', '<div class=\"dis-content\">[Chính chủ] 229 Nguyễn Văn Linh, Q.Long Biên – Phòng trọ chung cư mini đủ điều hòa, giường, nóng lạnh, wifi, thang máy….<br>---- Thực tế phòng trống hiện tại<br>+Phòng nhỏ tầng 2 không ban công có cửa sổ lớn thoải mái phơi đồ 2tr2<br>+Phòng lớn tầng 2 không ban công có cửa sổ lớn thoải mái phơi đồ 2tr5, phòng lớn nhất.<br>Sắp tết chủ nhà có linh động fix giá một chút nếu nhiệt tình thuê, cảm ơn.<br>+Liên lạc với chủ nhà : Hưng 0904748688<br>Địa chỉ : Chung cư mini 7 tầng, số 29 ngõ 229 Nguyễn Văn Linh – Phúc Đồng, Q.Long Biên<br>Ngay sát chân cần Vĩnh Tuy, cách Aeon Mall 1km, cách Big C Long Biên 1km, gần chợ, cạnh tạp hóa, cách điểm dừng xe bus 40,11… 200m.<br>An ninh tốt, tầng 1 để xe máy, có thang máy.<br>Diện tích phòng 20m2, hoàn toàn khép kín không chung đụng ai hết; thích hợp cho cặp vợ chồng ở hoặc 2-3 bạn ở chung với nhau, đóng tiền tháng một.<br>Tiện nghi trong phòng : điều hòa, bình nước nóng, giường 1m6x2m, khu vực bếp riêng, ban công riêng. <br>Giờ giấc tự do, camera an ninh, để xe tầng 1 Mỗi phòng được để 1 xe máy, ngoài ra có chỗ gửi ở ngay hàng xóm đối diện.<br>Điện 3.2k/số - Nước 30k/ khối nước<br>Internet wifi 100k nếu dùng, mỗi tầng 1 cục modem đảm bảo chất lượng mạng.<br>Nhà có 10 phòng cho thuê trải đều từ tầng 2-tầng6<br>+Liên lạc với chủ nhà : Hưng 0904748688</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJUaGFuZyBtXHUwMGUxeSIsIjMiOiJJbnRlcm5ldCIsIjQiOiJcdTAxMTBpXHUxZWMxdSBoXHUwMGYyYSIsIjUiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCJ9', 1, 0, '{\"0\":\"21.04083015685281\",\"1\":\"105.89845865131224\"}', 1, 0, '2019-05-14 22:16:55', '2019-05-14 22:16:55');
