INSERT INTO `motelrooms` VALUES (874, 'Cho thuê phòng trọ số 32, Ngách 85, Ngõ 211, Khương Trung', 'cho-thue-phong-tro-so-32-ngach-85-ngo-211-khuong-trung', 1200000, 12.0000, 1, 2, 63, 'Số 32, Ngách 85, Ngõ 211, Khương Trung, Thanh Xuân, Hà Nội', '0982821941', 2, 'Chưa xác định', '{\"0\":\"cho-thue-phong-tro-so-32-ngach-85-ngo-211-khuong-trung-ip13j.jpg\"}', '<div class=\"dis-content\">Hiện tại mình có 1 phòng tầng 2 trong nhà 3 tầng muốn cho thuê lại. có thể ở đc 2 người. Thêm 1 ng thêm 100k. khu vực yên tĩnh, an ninh tốt. giờ giấc thoải mái, ra đóng vào mở. <br>S khoảng 12m2. Nấu ăn, để xe tầng 1. Có nóng lạnh. máy giặt, phơi đồ tầng 3, có 2 nhà vệ sinh. Nhà xây ở theo gia đình nên mọi thứ đều ổn<br>Giá 1.2tr. Đặt cọc 500K, tiền đóng 2 tháng 1 lần, điện nước vệ sinh giá hộ gia đình, cuối tháng nhận bill chia đầu người. Có wifi<br>Yêu cầu: Nữ, gọn gàng, sạch sẽ, thật thà. nhà đã có 3 người. Phòng không quá rộng nên ưu tiên bạn nữ nào đã đi làm vào ở 1 mình có nhu cầu muốn ở lâu dài, lập hội chị em cho vui cửa vui nhà. <br>Có thể vào ở luôn <br>Địa chỉ: Ngách 85, ngõ 211, Khương Trung<br>Liên hệ: 0982821941<br></div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCIsIjMiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCIsIjQiOiJNXHUwMGUxeSBnaVx1MWViN3QifQ==', 1, 0, '{\"0\":\"20.9944848\",\"1\":\"105.81728150000004\"}', 1, 0, '2019-05-14 22:18:08', '2019-05-14 22:18:08');
INSERT INTO `motelrooms` VALUES (875, 'Cho thuê phòng trọ số 152 Nguyễn Đình Hoàn', 'cho-thue-phong-tro-so-152-nguyen-dinh-hoan', 2500000, 25.0000, 1, 16, 184, 'Số 152, Nguyễn Đình Hoàn, Cầu Giấy, Hà Nội', '01232954506', 4, 'Chưa xác định', '{\"0\":\"cho-thue-phong-tro-so-152-nguyen-dinh-hoan-bitm4.jpg\",\"1\":\"cho-thue-phong-tro-so-152-nguyen-dinh-hoan-yxakv.jpg\",\"2\":\"cho-thue-phong-tro-so-152-nguyen-dinh-hoan-ndsfb.jpg\"}', '<div class=\"dis-content\">t có phòng dạng ccmn khép kín vì lý do cá nhân nên muốn nhượng lại<br>✅nhà vệ sinh sạch sẽ nóng lạnh <br>✅phòng rộng có sẵn giường 1m6 gỗ hịn chắc chắn, có thể ở đc 3-4 người <br>✅có wife free,điện nước hợp đồng và không thu thêm bất kì loại phí nào<br>✅ a quản lý nhà cực dễ tính, nhà có chìa khoá riêng chỗ để xe rộng rãi đi về tự khoá cửa<br>✅ngoài ra có thêm tủ quần áo bằng vải và 1 bàn gỗ bếp điện ấm đun nước t để lại luôn cho bạn nào chưa có đồ đạc gì chỉ việc xách mông qua ở thôi ạ<br>✅ địa chỉ: 152 nguyễn đình hoàn <br>gần cac trường điện lực,báo chí, đại học thủ đô......<br>✅sdt : 0123295450</div>', 'eyIwIjoiQ2hcdTFlZDcgXHUwMTExXHUxZWMzIHhlIiwiMSI6IlNcdTAwZTJuIHBoXHUwMWExaSIsIjIiOiJJbnRlcm5ldCIsIjMiOiJCXHUwMGVjbmggblx1MDBmM25nIGxcdTFlYTFuaCJ9', 1, 0, '{\"0\":\"21.0409661\",\"1\":\"105.80539329999999\"}', 1, 0, '2019-05-14 22:18:14', '2019-05-14 22:18:14');
INSERT INTO `motelrooms` VALUES (876, 'Tìm nam ở ghép số 95 PHỐ YÊN HÒA ( CẦU CÓT) - P.Yên Hòa- Cầu Giay', 'tim-nam-o-ghep-so-95-pho-yen-hoa-cau-cot-pyen-hoa-cau-giay', 700000, 16.0000, 1, 16, 44, ' số 95 PHỐ YÊN HÒA ( CẦU CÓT) - P.Yên Hòa- Cầu Giay, Yên Hòa, Cầu Giấy, Hà Nội', '0947343894', 2, 'Chung', '{\"0\":\"tim-nam-o-ghep-so-95-pho-yen-hoa-cau-cot-pyen-hoa-cau-giay-q49sw.jpg\"}', '<div class=\"dis-content\">Ở 1 mình hơi chán, nên mình muốn tìm 1 bạn nam ( sn 94&gt;&gt;98) ở ghép cho vui, vừa đỡ tiền nhà, vừa đỡ tự kỷ =)). Phòng thì ở tầng 2 trong căn nhà 5 tầng, mới xây nên cực sạch sẽ. Ở cùng cổng với chủ nhà nên 5h sáng mở cửa, 10h đóng cửa ( thanh niên nào mà bay nhảy thì xác định đê :)), chủ nhà hiền lành vui tính. Phòng chung nhà vs với tầng 2 ( nhà về sinh ngay cửa phòng mình cực tiện mà không khó chịu, hàng tháng có người dọn). Mình thuê phòng là 1tr5/tháng chia đôi mỗi người 1 nữa, điện 4k/số ( mình đi cả ngày, tháng trước hết có 80k tiền điện :D), nước 135k/người dùng tẹt ga.Phòng 2 cửa sổ nên thoáng mát, ấm áp khỏi phải nói... và còn rất nhiều điều tuyệt nữa. Ai thích thì lh : 0947343894 ( mình tên Hợp sn 94 cho tiện xưng hô). D/c: số 95 phố yên hòa ( cầu cót đi vào) - cầu giấy hà nôi.</div>', 'eyIwIjoiSW50ZXJuZXQifQ==', 1, 0, '{\"0\":\"21.0111849\",\"1\":\"105.79399030000002\"}', 1, 0, '2019-05-14 22:18:18', '2019-05-14 22:18:18');
